INSERT INTO `vardai` VALUES (1,'Ada','Vardo reikšmė: Ada – iš germanų adal “kilminga”. Taip pat gali būti kilęs iš hebrajų adha “ornamentas, papuošimas, aušra”.',' Ada yra vokiečių kilmės vardas.'),(2,'Adalbertas','Vardo reikšmė: Adalbertas – iš vok. adal “kilmingas” + beraht “spindintis, žymus”.',' Adalbertas yra vokiečių kilmės vardas.'),(3,'Akvilinas',' (2) lot., trump. Akvilas, Akvilius, Linas, Inas, iš lot. Aquilinus: lot. aąuilinus „erelio, ereliškas',' Akvilinas yra lotynų kilmės vardas.'),(4,'Akvilina',' (2) lot., trump. Akvilė, Lina, Ina, iš lot. Aquilina: lot. aquilina „erelio, ereliška',' Akvilina yra lotynų kilmės vardas.'),(5,'Akvilė','(2) trump. Vilė, tarm. Akvilia piet. aukšt. (dz.), Akvilė yra liet. trumpinys iš Akvilina',' Akvilė yra lotynų kilmės vardas.'),(6,'Aistis','Tai dvasinio bei fizinio komforto siekimas. Esate ambicingas ir impulsyvus, turite stiprią valią. Esate labai pasitikintis savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtingas, ambicinngas.  Turite vystyti savo komunikabilumą.',' Aistis yra lietuvių kilmės vardas.'),(7,'Akvilas','(2) lot., var. Akvilius (2), trump. Vilius, tarm. Akvilis, Vilis vak. ir šiaur. žem., iš lot. Aąuila: lot. aąuila „erelis',' Akvilas yra lotynų kilmės vardas.'),(8,'Aistė','Tai dvasinio bei fizinio komforto siekimas. Esate ambicingaa ir impulsyvi, turite stiprią valią. Esate labai pasitikinti savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtinga, ambicinnga.  Turite vystyti savo komunikabilumą.',' Aistė yra lietuvių kilmės vardas.'),(9,'Aidis','Tai dvasinio bei fizinio komforto siekimas. Esate ambicingas ir impulsyvus, turite stiprią valią. Esate labai pasitikintis savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtingas, ambicinngas.  Turite vystyti savo komunikabilumą.',' Aidis, Aidys yra Lietuvių kilmės vardas.'),(10,'Airė','Tai dvasinio bei fizinio komforto siekimas. Esate ambicingaa ir impulsyvi, turite stiprią valią. Esate labai pasitikinti savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtinga, ambicinnga.  Turite vystyti savo komunikabilumą.',' Airė yra hebrajų kilmės vardas.'),(11,'Aidė','Tai dvasinio bei fizinio komforto siekimas. Esate ambicinga ir impulsyvi, turite stiprią valią. Esate labai pasitikinti savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtinga, ambicinnga.  Turite vystyti savo komunikabilumą.',' Aidė yra lietuvių kilmės vardas.'),(12,'Aldas',' (1), (2) liet. trumpinys iš Aldonas , v. Aldis gali būti ir trumpinys iš mot. vardo Aldona, pvz., sūnui duotas vardas Aldis, nes jo motina Aldona (Vilnius)',' Aldas, Aldis yra  kilmės vardas.'),(13,'Alda','Alda, Aldė - liet. trumpinys iš Aldona.',' Alda, Aldė yra  kilmės vardas.'),(14,'Albutas','Albutas – (1) liet., trump. Albas: al— (:liet. al-iai, aliai vienas „kiekvienas, plg. graik. allos „kitas, got, alja „kitas) + but-(:liet. but-as, būti)',' Albutas yra lietuvių kilmės vardas.'),(15,'Albutė','Panšūs vardai: Albutas, Albina, Albertas',' Albutė yra lietuvių kilmės vardas.'),(16,'Albrechtas','Panšūs vardai: Albertas, Albechtas',' Albrechtas, Albrechtas yra  kilmės vardas.'),(17,'Albinas',' (2) lot., trump. Albas, tarm. Albinas ryt. ir vak. aukšt., Albynas, Elbas, Elbys vak. liet., Elbinas vak. aukšt., Elbynas žem. (Laukuva), Alba, Albė, Albis vak. aukšt. (Jurbarkas), Albė, Albis piet. žem., iš lot. Albinus: lot. albus „baltas, skaistus',' Albinas yra lotynų kilmės vardas.'),(18,'Alfreda',' (1), (2) germ., trump. Alfa, Freda, baž. lot. Alfreda, kuris iš vyr. v. Alfredus, žr. Alfredas',' Alfreda yra vokiečių kilmės vardas.'),(19,'Albina',' (2) lot., trump. Alba, Albė, tarm. Albinė, Albė vak. liet., vak. žem., Elbė piet. žem. (švd.), iš lot. Albina, kuris iš vyr. v. Albinus, žr. Albinas',' Albina yra lotynų kilmės vardas.'),(20,'Alfonsas','',' Alfonsas yra vokiečių kilmės vardas.'),(21,'Albertina',' (2) germ., trump. Alberta, Alba, iš sulotyninto germ. Albertina, kuris yra priesagos -ina vedinys iš Alberta',' Albertina yra vokiečių kilmės vardas.'),(22,'Alfonsa',' (1) germ., trump. Alfa, tarm, Alponsa vak. aukšt., Alpinė, Alpa, Alpunė ryt. aukšt., baž. lot. Alfonsa, Alphonsa, kuris iš vyr. v. Alfonsus, Alphonsus, žr. Alfonsas ',' Alfonsa yra Vokiečių kilmės vardas.'),(23,'Albertas',' (1) germ., trump. Albas, tarm. Albrys vak. liet., Al’bus piet. aukšt. (dz.), Elbertas piet. žem. (švd.), iš sulotyninto germ. Albertus, kuris yra trumpinys iš germ. Adalbert, žr. Adalbertas ',' Albertas yra vokiečių kilmės vardas.'),(24,'Alfas',' (l) liet. trumpinys iš Alfonsas ir Alfredas',' Alfas yra graikų kilmės vardas.'),(25,'Alberta',' (1) germ., trump. Alba, Albė, iš sulotyninto germ. Alberta, kuris iš vyr. v. Albertas',' Alberta yra vokiečių kilmės vardas.'),(26,'Alfa',' (1) liet, trumpinys iš Alfonsa ir Alfreda',' Alfa yra graikų kilmės vardas.'),(27,'Albas',' (1) liet. trumpinys iš Albinas ir Albertas',' Albas yra lotynų kilmės vardas.'),(28,'Aleta','Aleta – pranc., trump. Alė, iš sulotyninto prancūzų Aletta, kuris iš pranc. Alette, o šis yra vardo Adela mažybinė forma, žr. Adelė.',' Aleta yra Prancūzų kilmės vardas.'),(29,'Alba','Alba, Aibė – liet. trumpinys iš Albina ir Alberta.',' Alba, Aibė yra Vokiečių kilmės vardas.'),(30,'Alantas',' (1) liet., iš upėvardžio A.lantas (Kartena)',' Alantas yra lietuvių kilmės vardas.'),(31,'Alena','Alena – 1. vok. trumpinys iš Magdalena, 2. sulietuvintas vardo Elena variantas.',' Alena yra Lotynų kilmės vardas.'),(32,'Alanta',' (3b) liet., iš upėvardžio Alanta (Molėtai)',' Alanta yra lietuvių kilmės vardas.'),(33,'Alginas',' (1) liet., trump. Algis, al- (žr. Albutas) + gin- (: liet. gin-ti, gin-a)',' Alginas yra lietuvių kilmės vardas.'),(34,'Aleksys','Aleksys, Aleksius – (4), (2) graik., trump, Alius, tarm. Eleksis šiaur. žem., Elius piet. žem. (švd.), per vid. lot. Alexis, Alexius iš graik. Aleksios – „gynėjas“: graik. alekso „ginti, saugoti.',' Aleksys, Aleksius yra Graikų kilmės vardas.'),(35,'Aleksė',' (1) liet. trumpinys iš Aleksandra',' Aleksė yra graikų kilmės vardas.'),(36,'Alanas','Alanas – (2) kelt., trump. Alys, Alius, iš sulotyninto kelt. Alanus: kelt. alun – santaika.',' Alanas yra keltų kilmės vardas.'),(37,'Algina','Algina, Algina, Alginė – (3b), (1), (1) liet., trump. Algė, iš vyr, v. Alginas.',' Algina, Algina, Alginė yra Lietuvių kilmės vardas.'),(38,'Algimantė',' (1) liet., trump. Algė, tarm. trump. Algima (Tauragė), iš vyr. v. Algimantas',' Algimantė yra lietuvių kilmės vardas.'),(39,'Aleksas','Aleksas – graikų kilmės vardo Aleksandras trumpinys. Graikų žodžių “alekso” – „saugoti, ginti“ + “aner” (andros) – „žmogus“ junginys. Reiškia “saugantis, apginantis žmogus”.',' Aleksas yra graikų kilmės vardas.'),(40,'Algimantas',' (1) liet., trump. Algis, tarm. trump. Algimas piet. žem. (švd.), Algis, algi- (: liet. alga „atpildas, atlyginimas, prūs. algas „t. p.“) + mant-(: liet. mantus „sumanus“, manta „turtas“)',' Algimantas yra lietuvių kilmės vardas.'),(41,'Aleksandras','',' Aleksandras yra graikų kilmės vardas.'),(42,'Algenis','Algenis – (2) liet., trump. Algis, priesagos -enis vedinys iš sen. trump. Algas, Algis, kuris iš avd. su Alg-, Al-g-, Algminas, Algimantas, Algirdas ir kt.',' Algenis yra lietuvių kilmės vardas.'),(43,'Aleksandra','Aleksandra – tai moteris, kuri pasižymi puikia nuojauta, todėl jos patarimų nereikėtų praleisti pro ausis.',' Aleksandra yra graikų kilmės vardas.'),(44,'Algenė',' (2) liet., trump. Algė, iš vyr. v. Algenis',' Algenė yra  kilmės vardas.'),(45,'Alė','Alė – (2) liet. trumpinys iš Aleksandra ir kt.',' Alė yra Lotynų kilmės vardas.'),(46,'Algedas','Algedas – liet., trump. Algis, al- (žr. Albutas) + ged- (: liet. ged-auti „ilgėtis“, ged-ėti).',' Algedas yra lietuvių kilmės vardas.'),(47,'Alkantas','Alkantas – liet., trump. Alkas, al- (žr. Albutas) + kant- (: liet. pa-kant-us, kant-rus)',' Alkantas yra lietuvių kilmės vardas.'),(48,'Aldonas','Aldonas – liet., trump. Aldas, Aldis, iš liet. avd. Aldonas, kuris yra priesagos -onas vedinys iš liet. šaknies ald-: ald-ėti „aidėti, skambėti, ald-oti „rėkauti.',' Aldonas yra slavų kilmės vardas.'),(49,'Alkanta',' (3b), (1), (1) liet., trump. Alkė, iš vyr. v. Alkantas',' Alkanta, Alkanta, Alkantė yra  kilmės vardas.'),(50,'Algeda','Algeda – liet., trump. Algė, iš vyr. v. Algedas.',' Algeda, Algeda, Algedė yra Lietuvių kilmės vardas.'),(51,'Aldona','Aldona – liet., trump. Alda. Aldė, tarm. Aldonia ryt. aukšt. (Dusetos), Aldonė šiaur. aukšt. (Žeimelis), Aldonė piet. aukst. (dz.), 1. liet., iš liet., avd. Aldonas, 2. suliet., iš brus. Aldonia. kuris iš graik. Eudokia, graik. eudokia „palankumas, maloningumas.',' Aldona yra slavų kilmės vardas.'),(52,'Aliodija','Alodija – pranc., trump. Alė, iš sulotyninto pranc. Alodia — „vieversėlis”.',' Aliodija, Alodija yra Prancūzų kilmės vardas.'),(53,'Alina','Alina – arab., trump. Alė, Lina, iš sulotyninto arabų Alina — „puikioji.',' Alina yra arabų kilmės vardas.'),(54,'Algė','Algė – tai lietuviškų vardų trumpinys iš vardų, kurie prasideda su Al-g-, Alg-: Algimantė, Algirdė ir kt. Algė – vyriško vardo Algis alternatyva.',' Algė yra lietuvių kilmės vardas.'),(55,'Algė','',' Algė yra  kilmės vardas.'),(56,'Algaudas','Algaudas – suliet. prūs., trump. Algas, al-(žr. Albutas) + gaud- (: liet. gaud-yti, plg. gauti).',' Algaudas yra lietuvių kilmės vardas.'),(57,'Alicija','Vardadienis: vasario 15d., birželio 21d., rugpjūčio 24d.',' Alicija yra prancūzų kilmės vardas.'),(58,'Algvilė','Algvilė – liet., trurnp, Algė, iš vyr. v. Algvilas.',' Algvilė yra lietuvių kilmės vardas.'),(59,'Algauda','Algauda, Algaudė – suliet. prūs., trump. Algė, iš vyr. v. Algaudas.',' Algauda, Algauda, Algaudė yra Lietuvių kilmės vardas.'),(60,'Algvilas','Algvilas – liet., trump. Algis, alg- (žr. Algimantas) + vil- (:liet. vil-tis, vil-iasi „tikėtis, vil-tis).',' Algvilas yra lietuvių kilmės vardas.'),(61,'Algardė','Algardė – suliet. prūs., trump. Algė, iš vyr. v. Algardas.',' Algardė yra Lotynų kilmės vardas.'),(62,'Algminas','Algminas – liet., trump. Algis, alg- (žr. Algimantas) + min- (: liet. min-ėti, min-ti, mena, mine).',' Algminas yra lietuvių kilmės vardas.'),(63,'Algardas','Algardas – suliet. prūs., trump. Algas, al-(žr. Albinas) + gard- (:liet. gard-inti „pranešti, garsinti, plg. prūs. gerd-aut „sakyti).',' Algardas yra Lotynų kilmės vardas.'),(64,'Algmina','Algmina, Algminė – liet., trump. Algė, iš vyr. v. Algminas.',' Algmina, Algmina, Algminė yra Lotynų kilmės vardas.'),(65,'Alfredas','Alfredas – trump. Alfas, Fredas, tarm. Alpredas, Elpredas piet. žem., Alfridas, Alpridas vak. žem., baž. lot. Alfredus, Alfridus per anglosaksų Alfred iš sen. germ. Alfrad — „geras patarėjas“: alf- „elfas (mitinė germ. būtybė) + rad „patarimas“.',' Alfredas yra vokiečių kilmės vardas.'),(66,'Alminta','Alminta, Almintė – liet., trump. Almė: iš vyr. v. Almintas.',' Alminta, Alminta, Almintė yra lietuvių kilmės vardas.'),(67,'Algis','Algis – liet. trumpinys iš avd. su Al-g-, Alg-: Algedas, Algirdas, Algimantas ir kt.',' Algis yra Lietuvių kilmės vardas.'),(68,'Alminas','Alminas – liet., trump. Almis: al- (žr. Albutas) + min- (žr. Algminas).',' Alminas yra lietuvių kilmės vardas.'),(69,'Algirdas','Vardadienis: Vasario 11 d., Liepos 9d., Gruodžio 28 d.',' Algirdas yra lietuvių kilmės vardas.'),(70,'Almina','Almina, Alminė – liet., trump. Almė: iš vyr. v. Alminas.',' Almina, Almina, Alminė yra Lietuvių kilmės vardas.'),(71,'Almilė','Almilė – liet., trump. Almė, iš vyr. v. Almilas.',' Almilė yra lietuvių kilmės vardas.'),(72,'Algirda','Algirda, Algirdė – liet., trump. Algė, iš vyr. v. Algirdas.',' Algirda, Algirda, Algirdė yra Lietuvių kilmės vardas.'),(73,'Algintas','Algintas – liet., trump. Algis, al- (žr. Albutas) + gint- (: liet. gint-as, ginti).',' Algintas yra lietuvių kilmės vardas.'),(74,'Almilas','Almilas – liet., trump. Almis, al- (žr. Albutas) + mil-(: liet. pa-mil-ti, pa-mil-o).',' Almilas yra lietuvių kilmės vardas.'),(75,'Almė','Almė – liet., trumpinys iš mot. v. su Al-m-: Almana, Almanta, Alminė ir kt.',' Almė yra lietuvių kilmės vardas.'),(76,'Alginta','Alginta, Algintė – liet., trump. Algė, iš vyr. v. Algintas.',' Alginta, Alginta, Algintė yra Lietuvių kilmės vardas.'),(77,'Almantas','Almantas - liet., trump. Almas, al- (žr. Albutas) + mant- (ŽR. ',' Almantas yra lietuvių kilmės vardas.'),(78,'Almanta','Almanta, Almantė – liet., trump. Almė, iš vyr. v. Almantas.',' Almanta, Almanta, Almantė yra Lietuvių kilmės vardas.'),(79,'Almanas','Almanas – liet. ir prūs., trump. Almas, al-(žr. Albutas) + man- (: liet. man-yti, su-manus).',' Almanas yra lietuvių kilmės vardas.'),(80,'Almana','Almana, Almanė – liet. ir prūs., trump. Almė, tarm. Almonė vak. liet., žem., iš vyr. v. Almanas.',' Almana, Almana, Almanė yra Lietuvių kilmės vardas.'),(81,'Almas','Almas – (1) lot., iš lot. Almus: lot. almus „maitinantis, palaimą teikiantis.',' Almas yra lotynų kilmės vardas.'),(82,'Alvilė','Alvilė – (1), (2) liet., trump. Alvė, iš vyr. v. Alvilas.',' Alvilė yra lietuvių kilmės vardas.'),(83,'Alvydas','Alvydas – (1) suliet. prūs., trump, Alvys, Alvis, tarm. Elvydas piet. žem. (švd.), al- (žr. Albutas) + vyd- (: prus. widdai „matė“, liet. iš-vyd-o).',' Alvydas yra lietuvių kilmės vardas.'),(84,'Alvilas','Alvilas – (1) liet., trump. Alvys, Alvis, al- (žr. Albutas) + vil- (žr. Algvilas).',' Alvilas yra lietuvių kilmės vardas.'),(85,'Alma','Alma – (1) lot., iš lot. Alma: lot. alma „maitinanti, palaimą teikianti.',' Alma yra lotynų kilmės vardas.'),(86,'Alkmenas','Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus.Galite lengviau sukaupti žinių apie gyvenimo paslaptis, patirtį. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.Atsiranda noras veikti ryžtingiau. Jus jau nebe taip lengva apkvailinti.',' Alkmenas yra lietuvių kilmės vardas.'),(87,'Alvyda','Vardadienis : Liepos 20d., Gegužės 13d.',' Alvyda, Alvyda, Alvydė yra Lietuvių kilmės vardas.'),(88,'Alvė','Alvė – (2) liet., trumpinys iš mot. v. su Al-v-: Alvyda, Alvilė.',' Alvė yra lietuvių kilmės vardas.'),(89,'Alkmena','Alkmena, Alkmenė – (3b), (1), (1) suliet. prūs., trump. Alkė, iš vyr. v. Alkmenas.',' Alkmena, Alkmena, Alkmenė yra Lietuvių kilmės vardas.'),(90,'Aiva','Aiva – (1) — liet. trumpinys iš Alvyra.',' Aiva yra Lietuvių kilmės vardas.'),(91,'Alkis','Alkis – (2) liet., iš Vilniaus įkūrimo legendos milžino v. Alkis, galūnės vedinys iš liet. alkas, alka „Šventa giraitė, aukų kalnas, aukojimo vieta.',' Alkis yra lietuvių kilmės vardas.'),(92,'Aluona','Aluona – (3) liet., iš upėvardžio Aluona (Josvainiai).',' Aluona yra lietuvių kilmės vardas.'),(93,'Atautas','Atautas – (1) liet., trump. Altis, Alys, al- (žr. Albutas) + taut- (: liet. taut-a).',' Atautas yra Lietuvių kilmės vardas.'),(94,'Altautė','Altautė – (1) liet., trump. Altė, Alė, iš vyr. v. Altautas.',' Altautė yra lietuvių kilmės vardas.'),(95,'Aloyzas','Aloyzas – (2) germ., trump. Alyzas, Alys, Alius, tarm. Alyzius piet. aukšt. (dz.), Eliojyzas, Elius piet. žem. (švd.), iš sulotyninto germ. Aloysius, Aloisius, kuris iš germ. Alwis: sen. vok. aukšt. al „visa + wisi „išmintingas“.',' Aloyzas yra vokiečių kilmės vardas.'),(96,'Andrė','Andrė – (2) sulietuvintas, graikų kilmės vardo trumpinys iš Andrėja , taip pat galūnės vedinys iš vyr. v. Andrius.',' Andrė yra graikų kilmės vardas.'),(97,'Aloyza','Aloyza – (2) germ., trump. Alyzė, Alė, iš sulotyninto germ. Aloisia, kuris iš vyr. v. Aloisius, žr. Aloyzas.',' Aloyza yra vokiečių kilmės vardas.'),(98,'Anastazija','Vardadienis: Lapkričio 11d., gruodžio 25d.',' Anastazija yra graikų kilmės vardas.'),(99,'Alna','Šis vardas stiprina Jūsų lyderio, sugebėjimus.Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę. Atsiranda noras veikti ryžtingiau. Jus jau nebe taip lengva apkvailinti.',' Alna yra lietuvių kilmės vardas.'),(100,'Anastazas','Vardadienis: Sausio 22d., balandžio 27d.',' Anastazas yra graikų kilmės vardas.'),(101,'Almuonė','Almuonė – (1) liet., iš upėvardžio Almuonė (buv. Rytprūsiuose).',' Almuonė yra Lietuvių kilmės vardas.'),(102,'Almis','Almis – (2) liet., trumpinys iš v. su Al-m-: Almantas, Almanas, Alminas.',' Almis yra lietuvių kilmės vardas.'),(103,'Almintas','Almintas – (1) liet., trump. Almis, al- (žr. Abutas) + mint- (: liet. minti, mint-is).',' Almintas yra lietuvių kilmės vardas.'),(104,'Anakcetas','Vardo Anakcetas pirmoji raidė A, kuri simbolizuoja norą imtis naujų planų ir juos įgyvendinti. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją. Jus ne taip paprasta pažeisti; labai pasitikite savimi. Esate stiprus, ryžtingas, atkaklus , jums būdingas užsispyrimas . ',' Anakcetas yra Graikų kilmės vardas.'),(105,'Aminta','Alminta – (2) graik., trump. Inta, iš sulotyninto graik. Aminta, Amynta — „apginta“: graik. amyno „ginti“.',' Aminta yra graikų kilmės vardas.'),(106,'Ambraziejus','Vardo Ambraziejus pirmoji raidė A, kuri simbolizuoja norą imtis naujų planų ir juos įgyvendinti. Esate imli ir nepriklausoma, turite stiprią valią ir intuiciją. Tai – galingas vardas, suteikiantis Jums gero lyderio savybių. Šio vardo savininkai pasižymės puikia nuojauta, intucija.',' Ambraziejus yra graikų kilmės vardas.'),(107,'Amelija','Amelija – žr. Amalija, tarm. Ameliūnė žem. (švd.).',' Amelija yra vokiečių kilmės vardas.'),(108,'Amarilė','Amarilė – (2) graik., trump. Marilė, iš sulotyninto graik. Amaryllis — „gaivus šaltinis.',' Amarilė yra graikų kilmės vardas.'),(109,'Amandas','Amandas – (1) lot., trump. Mandas, iš lot. Amandus: lot. amandus „mylėtinas“.',' Amandas yra lotynų kilmės vardas.'),(110,'Amalija','Vardadienis: Balandžio 21d., Liepos 10d.',' Amalija yra vokiečių kilmės vardas.'),(111,'Amanda','Amanda – (1) lot., trump. Manda, iš lot. Amanda: lot. amanda „mylėtina“.',' Amanda yra lotynų kilmės vardas.'),(112,'Alvys','Alvys, Alvis – (4), (2) liet., trumpinys iš vardų su Al-v-: Alvydas, Alvitas.',' Alvys, Alvis yra Lietuvių kilmės vardas.'),(113,'Alvinas','Alvinas – (1) germ., trump. Alvys, Alvis, iš germ. Alvin — „kilnus draugas“, al- kilęs iš adal „kilnus“ + wini „draugas“.',' Alvinas yra vokiečių kilmės vardas.'),(114,'Alvyra','Alvyra – (2) germ., trump. Alva, iš sulotyninto germ. Alvira, kuris iš gotų Alwara: got. alls „visas + wards „apsauga, saugotoja.',' Alvyra yra vokiečių kilmės vardas.'),(115,'Antanė','Antanės nuolat siekia išskirtinės sėkmės, veržiasi sukurti kažką nauja. Jaučia fizinių ir dvasinių galių perteklių, yra kupini valdžios ir įtakos geismo. Jiems nėra svetimi ir tokie dalykai, kaip atsakomybės jausmas, besąlygiškas teisingumas, maksimalus praktiškumo troškimas.',' Antanė yra graikų kilmės vardas.'),(116,'Alvina','Alvina – (2) germ., trump. Alva, iš sulotyninto germ. Alvina, kuris iš vyr. v. Alvinas.',' Alvina yra vokiečių kilmės vardas.'),(117,'Antanas','Antanai nuolat siekia išskirtinės sėkmės, veržiasi sukurti kažką nauja, daryti pribloškiantį įspūdį. Jaučia fizinių ir dvasinių galių perteklių. Jiems nėra svetimi ir tokie dalykai, kaip atsakomybės jausmas, besąlygiškas teisingumas, maksimalus praktiškos siekimas.',' Antanas yra graikų kilmės vardas.'),(118,'Ansas','Ansas – (1) vak. liet. iš vok. Hans, žr. Jonas.',' Ansas yra vokiečių kilmės vardas.'),(119,'Anta','Šis vardas daro Jus praktiškesniu, efektyvesniu, tvarkingesniu ir priklausomesniu. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. ',' Anta yra lietuvių kilmės vardas.'),(120,'Ankantas','Sugebate geriau įvertinti detales, jas greičiau pastebite. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu. Draugai, pažįstami ir šeima vertina Jūsų nuomonę.',' Ankantas yra lietuvių kilmės vardas.'),(121,'Anys',' (4) liet. trumpinys iš Anakletas, Anastazas ir kt.',' Anys yra graikų kilmės vardas.'),(122,'Anicetas','Anicetas- iš graikų “nenugalimas”.',' Anicetas yra graikų kilmės vardas.'),(123,'Aniceta','Aniceta- iš graikų “nenugalimas”.',' Aniceta yra graikų kilmės vardas.'),(124,'Angelius','Jūsų charakteris nepastovus. Nuolatinė nuomonės kaita, emocionalus nepastovumas, intriguojančių pojūčių poreikis tokius žmones gali įstumti į ilgalaikę depresiją. Jums reikia vengti ginčų, nes tai labai stipriai veikia nervinę sistemą.',' Angelius yra graikų kilmės vardas.'),(125,'Anelius','Anelius- (2) graik., trump. Anys, Nelius, tarm. Anielius piet. aukšt. žem., sulietuvintas pagal mot. v. Anelė iš vyr. v. Angelius.',' Anelius yra graikų kilmės vardas.'),(126,'Angelė','Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo finansus.',' Angelė yra graikų kilmės vardas.'),(127,'Anelė','Šio vardo savininkai labai gilinasi į gyvenimo paslaptis. Jų gyvenimo kredo – susirasti tokią vietą, kur galėtų tiesiogiai duoti naudą aplinkiniams. Žinoma, didžiausią naudą gali pateikti tada, kai suranda kelią nuo materialaus į dvasinį.',' Anelė yra graikų kilmės vardas.'),(128,'Arėjas','Arėjas- iš graikų “karo Dievas”.',' Arėjas yra graikų kilmės vardas.'),(129,'Andriejus','Jus visi labai myli, gerbia lengvai surandate kontaktus su bet kokiais žmonėmis. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Andriejus yra graikų kilmės vardas.'),(130,'Arbutas','Arbutas – (1) liet. ir prūs., trump. Arbas, Būtys, ar- (: liet. ar, er „taip pat, irgi, latv. ari, prūs. er „t. p.“) + but- (žr. Albutas).',' Arbutas yra lietuvių kilmės vardas.'),(131,'Aras','Aras – (4) liet. 1. trumpinys iš Arūnas, taip pat trumpinys iš vardų su Ar-: Arbutas, Arvaidas, 2. liet.: aras „erelis”',' Aras yra lietuvių kilmės vardas.'),(132,'Andrėja','Šio vardo savininkai sugeba gerai išreikšti savo jausmus, mintis tačiau linkę dramatizuoti. Domisi filosofija ir metafizika. Jums kartais labai pasiseka – gauti netikėtą palikimą ar valstybinę premiją. Esate gimęs po laiminga žvaigžde.',' Andrėja yra graikų kilmės vardas.'),(133,'Apolonijus','Neigiamos savybės: išlaidumas, paviršutiniškumas, plepumas. Kartais ima per daug savimi pasitikėti norėdami sukelti įspūdį ir patikti kitiems. Dažnai išnaudoja įgimtą patrauklumą, kad užkariautų kažkieno simpatiją, ir taip lengvai pasiekia savo tikslą.',' Apolonijus yra lotynų kilmės vardas.'),(134,'Apolonija','Apolonijų gerosios savybės: laki vaizduotė, gabumai menui, muzikalumai ir dramai, reikalaujančiai išradingumo. švelnumas, geraširdiškumas. Meilė, romantika, nes jas supa draugai ir gerbėjai. ',' Apolonija yra lotynų kilmės vardas.'),(135,'Apolinaras','Jų vedybos turi remtis abipusiu supratimu. Gali būti nusikaltamų grupuočių vadai.',' Apolinaras yra lotynų kilmės vardas.'),(136,'Apolinarija','Vardadienis: Sausio 8d., liepos 23d.',' Apolinarija yra lotynų kilmės vardas.'),(137,'Anzelmina','Anzelmina – (2) germ., trump. Anzelma, Zelma, iš sulotyninto germ. Anselmina, kuris yra priesagos -ina vedinys iš Anzelma, žr. Anzelma.',' Anzelmina yra vokiečių kilmės vardas.'),(138,'Anzelma',' (2) germ., trump. Zelma,, iš sulotyninto germ. Anselma, kuris iš vyr. v. Anselmus, žr. Anzelmas',' Anzelma yra vokiečių kilmės vardas.'),(139,'Anzelmas','Vardadienis: Kovo 18d., Balandžio 21d.',' Anzelmas yra vokiečių kilmės vardas.'),(140,'Anupras','Anupras – (2) egipt., trump, Anys, tarm. Anupris šiaur. žem., iš sulotyninto egiptiečių Onuphrius — „šventasis jautis“',' Anupras yra egiptiečių kilmės vardas.'),(141,'Antonijus','Antonijus – (1) lot., trump. Antas, Tonius, Tonis, iš lot. Antonius, kuris iš sen. romėnų giminės vardo Antius.',' Antonijus yra graikų kilmės vardas.'),(142,'Antonija','Antonija – (1) lot., trump, Anta, Tonė, tarm. Antonė žem., iš lot. Antonia, kuris iš vyr. v. Antonius, žr. Antonijus.',' Antonija yra graikų kilmės vardas.'),(143,'Arminas','Arminai filosofiškai žiūri į gyvenimą. Teatras, interjero dizainas, muzika – sritys, kurios jiems patinka. Tiki sėkme, todėl kartais gali save palepinti maloniomis smulkmenomis. Atsitinka ir taip, kad praturtėja netikėtai, pavyzdžiui, paveldi solidų palikimą.',' Arminas yra lietuvių kilmės vardas.'),(144,'Antas','Antas – (1) liet. trumpinys iš Antanas.',' Antas yra graikų kilmės vardas.'),(145,'Armina',' (3b), (1), (1) liet., trump. Arė, iš vyr. v. Armintas',' Armina, Armina, Arminė yra  kilmės vardas.'),(146,'Antanina','Vardadienis: Kovo 1d., gegužės 4d.',' Antanina yra graikų kilmės vardas.'),(147,'Armantė','Armantė – (1) liet., trump. Arė, Mantė, iš vyr. v. Armantas.',' Armantė yra lietuvių kilmės vardas.'),(148,'Armantas','Jūsų charakteris nepastovus. Sugebate geriau įvertinti detales, jas greičiau pastebite. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu. Draugai, pažįstami ir šeima vertina Jūsų nuomonę.',' Armantas yra lietuvių kilmės vardas.'),(149,'Arkadijus','Jūsų charakteris nepastovus. Nuolatinė nuomonės kaita, emocionalus nepastovumas, intriguojančių pojūčių poreikis tokius žmones gali įstumti į ilgalaikę depresiją. Jums reikia vengti ginčų, nes tai labai stipriai veikia nervinę sistemą.Draugai, pažįstami ir šeima vertina Jūsų nuomonę ir norus.',' Arkadijus yra graikų kilmės vardas.'),(150,'Arkadas','Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo finansus.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios jėgą.',' Arkadas yra graikų kilmės vardas.'),(151,'Aristidas','Aristidas – (2) graik. trump. Aristas, Tidas, iš sulotyninto graik. Aristides: graik. aristos „geriausias, kilmingas“.',' Aristidas yra graikų kilmės vardas.'),(152,'Arys','Arys – (4) liet., trumpinys iš avd. su Ar(i)-: Arimantas, Arminas ir kt. ',' Arys yra lietuvių kilmės vardas.'),(153,'Arimantė','Arimantas – iš liet. trumpinio Arys.',' Arimantė yra lietuvių kilmės vardas.'),(154,'Arimantas','Arimantas – iš liet. trumpinio Arys.',' Arimantas yra lietuvių kilmės vardas.'),(155,'Arvė','Šio vardo turėtojos dažniausiai pasižymi gera intucija, ryžtingumu ir puikia sveikata.',' Arvė yra lietuvių kilmės vardas.'),(156,'Arijus','Arijus- iš graikų “karo Dievas”.',' Arijus yra graikų kilmės vardas.'),(157,'Arvaldė','Jums reikėtų išmokti atleisti, vengti kvailų poelgių ir įpročių, tokių, kaip persivalgymo, įsitraukimo į girtuoklystę ar palaidą gyvenimą. Nors ir šios savybės rodo silpną valią, bet Jūs esate nuoširdus , nemeluojate ir iš gyvenimo norite pasiimti viskas kas geriausia.',' Arvaldė yra lietuvių kilmės vardas.'),(158,'Argintas','Šio vardo savininkai sugeba gerai išreikšti savo jausmus, mintis tačiau linkę dramatizuoti. Domisi filosofija ir metafizika, psichologija ir parapsichologija. Jums kartais labai pasiseka – gauti netikėtą palikimą ar valstybinę premiją. Esate gimęs po laiminga žvaigžde.',' Argintas yra lietuvių kilmės vardas.'),(159,'Arvaidas','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų. Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią.',' Arvaidas yra lietuvių kilmės vardas.'),(160,'Arginta',' (3b), (1), (1) liet., trump. Argė, Ginta, iš vyr. v. Argintas',' Arginta, Aginta, Argintė yra  kilmės vardas.'),(161,'Arvaidas','Šio vardo savininkai labai gilinasi į gyvenimo paslaptis turi labai išmintingą protą – idealistai,. Jų gyvenimo noras – susirasti tokią vietą, kur galėtų tiesiogiai duoti naudą aplinkiniams. Žinoma, didžiausią naudą gali pateikti tada, kai suranda kelią nuo materialaus į dvasinį.',' Arvaidas yra lietuvių kilmės vardas.'),(162,'Arvaida',' (3b), (1), (1) suliet. prūs., trump. Arvė, iš vyr. v. Arvaidas',' Arvaida, Arvaida, Arvaidė yra  kilmės vardas.'),(163,'Argaudas','Vardadienis: Sausio 30d., rugpjūčio 19d.',' Argaudas yra lietuvių kilmės vardas.'),(164,'Argauda',' (3b), (1), (1) liet., trump. Argė, Gaudė, iš vyr. v. Argaudas',' Argauda, Argauda, Argaudė yra  kilmės vardas.'),(165,'Arūnas','Arūnams patariama kontroliuoti savo charakterį, mažiau kištis į konfliktus – patylėti. Nors ir kaip jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų išmokti elgtis su savo pinigais.',' Arūnas yra lietuvių kilmės vardas.'),(166,'Arūnė','Arūnėms patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jos trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo finansus.',' Arūnė yra lietuvių kilmės vardas.'),(167,'Artūras','Artūrai sapnuoja nuostabius sapnus, iš kurių kartais semiasi naujų idėjų. Stengiasi suprasti slaptą sapnų esmę, gilinasi į ezoterikos paslaptis.',' Artūras yra keltų kilmės vardas.'),(168,'Arfautas','Panšūs vardai: Altautas, Artys, Arbutas.',' Arfautas yra lietuvių kilmės vardas.'),(169,'Artautė','Artautė – (1) liet., trump. Artė, Tautė, iš vyr. v. Artautas.',' Artautė yra lietuvių kilmės vardas.'),(170,'Arnulfas',' (1) germ., trump. Arnas, iš sulotyninto germ. Arnulphus, kuris iš germ. Arnulf: sen. vok. aukšt. arn- „erelis“ + wulf „vilkas“',' Arnulfas, Arnulpas yra  kilmės vardas.'),(171,'Astrida','Jūsų charakteris nepastovus. Nuolatinė nuomonės kaita, emocionalus nepastovumas, intriguojančių pojūčių poreikis tokius žmones gali įstumti į ilgalaikę depresiją. Jums reikia vengti ginčų, nes tai labai stipriai veikia nervinę sistemą.Draugai, pažįstami ir šeima vertina Jūsų nuomonę ir norus.',' Astrida yra skandinavų kilmės vardas.'),(172,'Arnoldas','Jūsų charakteris nepastovus. Sugebate geriau įvertinti detales, jas greičiau pastebite. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu. Draugai, pažįstami ir šeima vertina Jūsų nuomonę.',' Arnoldas yra vokiečių kilmės vardas.'),(173,'Astra','Astra – (2) liet. trumpinys iš Astrida.',' Astra yra skandinavų kilmės vardas.'),(174,'Astijus','Astijus – (1) graik., trump. Astas, iš sulotyninto graik. Astius : graik. asty „miestas“ .',' Astijus yra graikų kilmės vardas.'),(175,'Arnas','Arnas – (1) germ., iš germ. Arn, Arno, kuris yra dvikamienių vardų su Arn- (Arnold, Arnulf) trumpinys: sen. vok. aukšt. arn- „erelis“.',' Arnas yra vokiečių kilmės vardas.'),(176,'Asterijus','Asterijus – (1) graik., trump. Asteras, iš sulotyninto graik. Asterius: graik. asterios „žvaigždžių, žvaigždiškas',' Asterijus yra graikų kilmės vardas.'),(177,'Armintas','Armintas – (1) liet., trump. Arys, ar- (žr. Arbutas) + mint- (žr. Almintas).',' Armintas yra lietuvių kilmės vardas.'),(178,'Asterija',' (1) graik., trump. Astera, iš sulotyninto graik. Asteria, kuris iš vyr. v. Asterijus',' Asterija yra graikų kilmės vardas.'),(179,'Arminta',' (3b), (1), (1) liet., trump. Arė, iš vyr. v. Armintas',' Arminta, Arminta, Arminė yra  kilmės vardas.'),(180,'Astas','Astas (2) liet. trumpinys iš Astijus.',' Astas yra lietuvių kilmės vardas.'),(181,'Astė','Šio vardo savininkė pasižymi tvirtu charakteriu, ryžtu ir ištverme. Turi neeilinių sugebėjimų archeologijos srityse.',' Astė yra lietuvių kilmės vardas.'),(182,'Asta','Asta – (2) liet. trumpinys iš Anastazija, Augusta ir kt.',' Asta yra graikų kilmės vardas.'),(183,'Arvystė','Arvystė – (l) liet. ir prūs., trump. Arvė, iš vyr. v. Arvystas.',' Arvystė yra lietuvių kilmės vardas.'),(184,'Arvys',' (4), (2) – liet. trumpinys iš vardų su Ar-v-: Arvydas, Arvilas ir kt.',' Arvys, Arvis yra  kilmės vardas.'),(185,'Arvystas','Arvystas – (1) liet. ir prūs., trump. Arvys, Arvis, ar- (žr. Arbutas) + vyst- (: liet. iš-vysti, iš-vysta).',' Arvystas yra lietuvių kilmės vardas.'),(186,'Arvilė','Vardadienis: Vasario 4 d., liepos 17 d.',' Arvilė yra lietuvių kilmės vardas.'),(187,'Arvilas','Arvilas – (1) suliet. prūs., trump. Arvys, Arvis, ar- (žr. Arbutas) + vil- (žr. Alvilas)',' Arvilas yra lietuvių kilmės vardas.'),(188,'Audingas','Audingas – (1) liet., trump. Audys: au- (žr. Aubartas) + ding- (: prūs. po-dingan „patiktų“, plg. liet. ding-oti „nujausti, numanyti“).',' Audingas yra lietuvių kilmės vardas.'),(189,'Arvyda',' (3b), (1) ,(1) liet. ir prūs., trump. Arvė, iš vyr. v. Arvydas',' Arvyda, Arvyda, Arvydė yra  kilmės vardas.'),(190,'Audinga',' (3b), (1), (1) liet., trump. Audė: iš vyr. v. Audingas',' Audinga, Audinga, Audingė yra  kilmės vardas.'),(191,'Arvydas','Arvydas – (1) liet. ir prūs., trump. Arvys, Arvis, ar- (žr. Arbutas) + vyd- (žr. Alvydas).',' Arvydas yra lietuvių kilmės vardas.'),(192,'Audangė','Audangė – (1) suliet. prūs., trump. Audė, iš vyr. v. Audangas.',' Audangė yra prūsų kilmės vardas.'),(193,'Audangas','Audangas – (1) suliet. prūs., trump. Audas, Audys, au- (žr. Aubartas) + dang- (: liet. dang-intis, deng-ti „greitai bėgti“).',' Audangas yra prūsų kilmės vardas.'),(194,'Aubartė','Aubartė – (1) liet., trump. Bartė, iš vyr. v. Aubartas.',' Aubartė yra lietuvių kilmės vardas.'),(195,'Aubartas',' (l) liet., trump. Bartas, au- (: prūs. au „nuo, be, šalin“, plg. liet. au-monėm „be nuovokos) + bart- (: liet. barti sen. reikšme „kovoti“, plg. rus. borotjsia „kovoti“)',' Aubartas yra lietuvių kilmės vardas.'),(196,'Atėnė',' Atėnė – Dzeuso ir Heros dukra. Tai išminties, karo deivė Žmonėms, kuriuos globoja Atėnė, gerai sekasi verslas.',' Atėnė yra graikų kilmės vardas.'),(197,'Atanazas','Atanazas – (2) graik., trump. A tas, iš sulotynin-to graik. Athanasius, graik. athanasia „nemirtingumas“.',' Atanazas yra graikų kilmės vardas.'),(198,'Atalija','Atalija – (1) graik., trump. Atalė, Talė, iš sulotyninto graik. Atalia – „atalietė, Atalijos miesto (Mažojoje Azijoje) gyventoja“.',' Atalija yra graikų kilmės vardas.'),(199,'Ašvilė','Vardo Ašvilė pirmoji raidė A, kuri simbolizuoja norą imtis naujų planų ir juos įgyvendinti.Tampate reiklesnis sau pačiam ir kitiems. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją.',' Ašvilė yra lietuvių kilmės vardas.'),(200,'Ašvydas','Ašvydas – (1) liet., trump. Ašvys, aš- (žr. Ašmantas) + vyd- (žr. Alvydas).',' Ašvydas yra lietuvių kilmės vardas.'),(201,'Ašvilas','Ašvilas – (1) liet,. trump. Ašvys: aš- (žr. Ašmantas) + vil- (žr. Alvilas).',' Ašvilas yra lietuvių kilmės vardas.'),(202,'Ašvyda',' (3b), (1), (1) liet., trump. Ašvė, iš vyr. v. Ašvydas',' Ašvyda, Ašvyda, Ašvydė yra  kilmės vardas.'),(203,'Augenis','Augenis – (2) liet., trump. Augis, priesagos -enis vedinys iš Augas.',' Augenis yra lietuvių kilmės vardas.'),(204,'Augenė','Augenė – (2) liet., trump. Augė, iš vyr. v. Augenis.',' Augenė yra lietuvių kilmės vardas.'),(205,'Ašmantė','Ašmantė – (1) liet., trump. Ašmė, iš vyr. v. Ašmantas.',' Ašmantė yra lietuvių kilmės vardas.'),(206,'Augedas',' (1) liet., trump. Augis, au- (žr. Aubartas) + ged- (žr. Algedas)',' Augedas yra lietuvių kilmės vardas.'),(207,'Ašmantas','Ašmantas – (l) liet., trump. Ašmys, aš- iš až-(: liet. priel. až, ažu „už“) + mant- (žr. Algimantas).',' Ašmantas yra lietuvių kilmės vardas.'),(208,'Augeda',' (3b), (1), (1) liet., trump. Augė, iš vyr. v. Augedas',' Augeda, Augeda, Augedė yra  kilmės vardas.'),(209,'Augė','Augė – (2) liet., iš vyr. Augis.',' Augė yra lietuvių kilmės vardas.'),(210,'Augas','Augas – (2) liet.: liet. augus „augalotas“.',' Augas yra lietuvių kilmės vardas.'),(211,'Augantė','Augantė -(1) liet., trump. A ugė, iš vyr. v. Augantas.',' Augantė yra lietuvių kilmės vardas.'),(212,'Augantas','Augantas – (1) liet., Irump. Augas: priesagos -antas vedinys iš liet. augus „augalotas“.',' Augantas yra lietuvių kilmės vardas.'),(213,'Audrūnas','Audrūnas – (1) liet., priesagos -ūnas vedinys iš liet. audra.',' Audrūnas yra lietuvių kilmės vardas.'),(214,'Audrūnė','Audrūnė (1) liet., priesagos -ūnė vedinys iš liet. audra',' Audrūnė yra lietuvių kilmės vardas.'),(215,'Audronis',' (2) liet., priesagos -onis (-onius) vedinys iš liet. audra',' Audronis, Audronius yra  kilmės vardas.'),(216,'Audronė','Audronė – (2) liet., priesagos -onė vedinys iš liet. audra.',' Audronė yra lietuvių kilmės vardas.'),(217,'Audrius',' (2), (4) liet., metatoniniai galūnių vediniai iš liet. audra',' Audrius, Audrys yra  kilmės vardas.'),(218,'Aventinas','Aventinas – (2) lot., trump. Aventas, iš lot. Aventinus: lot. Aventinus — viena iš septynių Romos kalvų.',' Aventinas yra lotynų kilmės vardas.'),(219,'Aušvydas','Aušvydas – (1) liet., trump. Vydas, auš- (: liet. auš-ti, auš-ra) + vyd- (žr. Alvydas).',' Aušvydas yra lietuvių kilmės vardas.'),(220,'Audrė','Audrė – (2) liet.: metatoninis galūnės vedinys iš liet. audra.',' Audrė yra lietuvių kilmės vardas.'),(221,'Audra','',' Audra yra lietuvių kilmės vardas.'),(222,'Aušvyda',' (3b), (1), (1) liet., trump. Vyda, Vydė,iš vyr. v. Aušvydas',' Aušvyda, Aušvyda, Aušvydė yra  kilmės vardas.'),(223,'Augusta',' (2) lot., trump, Augė, Gustė, Asta, tarm. Augė ryt. aukšt., iš lot. Augusta, kuris iš vyr. v. Augustus, žr. Augustas',' Augusta, Augustė yra  kilmės vardas.'),(224,'Augūnė','Augūnė – (1) liet., trump. Augė, iš vyr. v. Augūnas.',' Augūnė yra lietuvių kilmės vardas.'),(225,'Augūnas','Augūnas – (1) liet., trump. Augius, priesagos -ūnas vedinys iš avd. Augas.',' Augūnas yra lietuvių kilmės vardas.'),(226,'Augraudė',' (1) suliet. prūs., trump. Augė, iš vyr. v. Augraudas',' Augraudė yra lietuvių kilmės vardas.'),(227,'Augraudas','Augraudas – (1) suliet. prūs., trump. Augas, au- (žr. Aubartas) + graud- (: liet. graud-us „smarkus, rūstus“, prūs. en-graudis „pasigailėk“).',' Augraudas yra lietuvių kilmės vardas.'),(228,'Augminas','Augminas – (1) liet., trump. Augis, aug- (žr. Augmantas) + min- (žr. Algminas).',' Augminas yra lietuvių kilmės vardas.'),(229,'Augmina',' (3b), (1), (1) liet., trump. Augė, iš vyr. v. Augminas',' Augmina, Augmina, Augminė yra  kilmės vardas.'),(230,'Augmilė','Vardo Augmilė pirmoji raidė A, kuri simbolizuoja norą imtis naujų planų ir juos įgyvendinti.Tampate reiklesnis sau pačiam ir kitiems. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją. ',' Augmilė yra lietuvių kilmės vardas.'),(231,'Augmilas','Augmilas – (1) liet., trump. Augis, aug- (žr. Augmantas) + mil- (žr. Almilas).',' Augmilas yra lietuvių kilmės vardas.'),(232,'Augmantė','Augmantė – (1) liet., trump. Augė, iš vyr. v. Augmantas.',' Augmantė yra lietuvių kilmės vardas.'),(233,'Augmantas','Augmantas – (1) liet., trump. Augas, aug-(: liet. aug-ti) + mant- (žr. Algimantas)',' Augmantas yra lietuvių kilmės vardas.'),(234,'Augis',' (2), (4), (2) liet.: liet. augus „augalotas“',' Augis, Augys, Augius yra  kilmės vardas.'),(235,'Aumantė','Aumantė – (1) liet., trump. Aumė, Mantė, iš vyr. v. Aumantas.',' Aumantė yra lietuvių kilmės vardas.'),(236,'Aumantas','Aumantas – (1) liet., trump. Aumis, Mantas, au- (žr. Aubartas) + mant- (žr. Algimantas).',' Aumantas yra lietuvių kilmės vardas.'),(237,'Auksys',' (4), (2) liet., metatoniniai galūnės vediniai iš liet. auksas, vertiniai iš lot. Aurelius, žr. Aurelijus',' Auksys, Auksius yra  kilmės vardas.'),(238,'Auksuolė','Auksuolė – (2) liet., trump. Auksė: priesagos -uolė vedinys iš liet. auksas, vertinys iš lot. Aurelia, žr. Aurelija.',' Auksuolė yra lietuvių kilmės vardas.'),(239,'Auksė','Auksės turi savybių, būdingų skaičiaus “devyni” vibracijai. Jos dvelkia gerumu, dosnumu silpniesiems bei vargšams. ',' Auksė yra lietuvių kilmės vardas.'),(240,'Augvinas','Augvinas – (1) liet., trump. Augis, aug- (žr. Augmantas) + vin- (sen. liet. vin- su balsių kaita iš vaina „priežastis, kaltė“).',' Augvinas yra lietuvių kilmės vardas.'),(241,'Augvilė','Augvilė – (1), (2) liet., trump. Augė, iš vyr. v. Augvilas.',' Augvilė yra lietuvių kilmės vardas.'),(242,'Augvilas','Augvilas – (1) liet., trump. Augis, aug- (žr. Augmantas) + vil- (žr. Alvilas).',' Augvilas yra lietuvių kilmės vardas.'),(243,'Augvyda',' (3b), (1), (1) liet., trump. Augė, iš vyr. v. Augvydas',' Augvyda, Augvyda, Augvydė yra  kilmės vardas.'),(244,'Augvydas','Augvydas – (1) liet., trump. Augis, aug- (žr. Augmantas) + vyd- (žr. Alvydas).',' Augvydas yra lietuvių kilmės vardas.'),(245,'Augutis','Augutis – (2) liet., trump. Augius: priesagos -utis vedinys iš avd. Augas.',' Augutis yra lietuvių kilmės vardas.'),(246,'Augutė','Augutė – (2) liet., trump. Augė, iš vyr. v. Augutis.',' Augutė yra lietuvių kilmės vardas.'),(247,'Aušrys',' (4), (2) liet. galūnės vediniai iš liet. aušra',' Aušrys, Aušrius yra  kilmės vardas.'),(248,'Augustinas','Vardadienis: Balandžio 29 d., gegužės 27 d., gegužės 28 d.',' Augustinas yra lotynų kilmės vardas.'),(249,'Aušrinė','Vardadienis: Liepos 25 d., rugpjūčio 27 d.',' Aušrinė yra lietuvių kilmės vardas.'),(250,'Augustina','Augustina – (2) lot., trump. Augustė, Gustina, Gustė, tarm. Austyna vak. liet., iš lot. Augustina, kuris iš vyr. v. Augustinus, žr. Augustinas.',' Augustina yra lotynų kilmės vardas.'),(251,'Aušrė',' (2) liet., galūnės vedinys iš liet. aušra',' Aušrė yra lietuvių kilmės vardas.'),(252,'Augustas','Vyras šiuo vardu nepakęs melo ir ko gero bus aršus teisybės gynėjas. Jo gyvenime bus daug permainų, todėl jo šeimos nariai neturėtų stebėtis intensyviu šio vyro gyenimo tempu ar dažnu nuovargiu. Savo partnerius ir šeimą jis bus linkęs ginti be gailesčio, bet lygiai taip pat nepakęs neištikimybės.',' Augustas yra lotynų kilmės vardas.'),(253,'Austėja','Tėvams vertėtų nuo mažens mokyti dukrą paprastų kasdieninių darbelių, kad išugdytų poreikį įgyvendinti savo planus. Nes būtent nemokėjimas praktiškai įgyvendinti savo norų gali pastoviai stabdyti šios nuostabios asmenybės atsiskleidimui.',' Austėja yra lietuvių kilmės vardas.'),(254,'Aušra','Aušra – (4) liet.: liet. aušra.',' Aušra yra lietuvių kilmės vardas.'),(255,'Aurys',' (4), (2), (2) liet., trumpinys iš Aurimas',' Aurys, Auris, Aurius yra  kilmės vardas.'),(256,'Austė','Austė – (2) liet. trumpinys iš Austėja.',' Austė yra lietuvių kilmės vardas.'),(257,'Aurimė','Aurimė – (1) liet., trump. Aurė, iš vyr. v. Aurimas.',' Aurimė yra lietuvių kilmės vardas.'),(258,'Aurimas','Aurimas – (1) liet., trump. Aurys, Aurius, Auris: au- (žr. Aubartas) + rim- (: liet. rim-ti, rim-o).',' Aurimas yra lietuvių kilmės vardas.'),(259,'Aurelijus','Aurelijai puikūs darbuotojai. Jie mėgsta dirbti kolektyve, o ne vieni.',' Aurelijus yra lotynų kilmės vardas.'),(260,'Aurelijonas','Aurelijonas – (2) lot., trump. Aurelis, Auras, iš lot. Aurelianus, kuris yra priesagos -anus vedinys iš Aurelius,žr. Aurelijus.',' Aurelijonas yra Lotynų kilmės vardas.'),(261,'Aurelija','Aurelijos puikios darbuotojos. Jos mėgsta dirbti kolektyve, o ne vienos. Jos puikios mokytojos, rašytojos, žurnalistės, politikės, filosofės. ',' Aurelija yra lotynų kilmės vardas.'),(262,'Aurėja','Aurėja – (1) lot., trump. Aura, iš lot. Aurea: lot. aurea „auksinė“.',' Aurėja yra lotynų kilmės vardas.'),(263,'Aurė','Aurė – (2) liet., trumpinys iš Aurimė.',' Aurė yra lotynų kilmės vardas.'),(264,'Aura','Aura – (1) liet. trumpinys iš Aurelija.',' Aura yra lotynų kilmės vardas.'),(265,'Bangys','',' Bangys, Bangius yra  kilmės vardas.'),(266,'Bangas',' (2), (4), (2) liet., galūnių vediniai iš liet. banga',' Bangas, Bangys, Bangius yra  kilmės vardas.'),(267,'Banga','Šis vardas simbolizuoja norą imtis naujų planų ir juos įgyvendinti.Tampate reiklesnis sau pačiam ir kitiems. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Banga yra lietuvių kilmės vardas.'),(268,'Baltras',' (2) – liet. trumpinys iš Baltramiejus',' Baltras, Baltrus yra  kilmės vardas.'),(269,'Baltramiejus','',' Baltramiejus yra aramėjų kilmės vardas.'),(270,'Baltys','Baltys – (4) liet., iš sen. avd. Baltys: liet. baltas.',' Baltys yra lietuvių kilmės vardas.'),(271,'Baltenis','Baltenis – (2) liet., trump. Baltys, Balčius, priesagos -enis vedinys iš sen. avd. Baltys: liet. baltas.',' Baltenis yra lietuvių kilmės vardas.'),(272,'Baltenė','Baltenė – (2) liet., trump. Baltė, iš vyr. v. Baltenis.',' Baltenė yra lietuvių kilmės vardas.'),(273,'Baltazaras','Baltazaras – (1), (2) asir. ir babil., trump. Baltas, iš sulotyninto hebr. Baltasar, Balthassar, kuris iš asir. ir babil. Bel-šar-uššur — „tepadeda (dievas) Belas karaliui“.',' Baltazaras yra asirų kilmės vardas.'),(274,'Balys','Balys – (4) liet. trumpinys iš Boleslovas.',' Balys yra slavų kilmės vardas.'),(275,'Balandis','Balandis – (2) liet., iš sen. avd. Balandis, liet. balandis.',' Balandis yra lietuvių kilmės vardas.'),(276,'Balandė','Balandė (2) liet., iš vyr. v. Balandis.',' Balandė yra lietuvių kilmės vardas.'),(277,'Barmantas','Barmantas – (1) liet., trump. Barys, bar- (žr. Bargailas) + mani- (: liet. mant-tus „sumanus“).',' Barmantas yra lietuvių kilmės vardas.'),(278,'Barmantė','Barmantė – (1) liet., trump. Bara, Barė, iš vyr. v. Barmantas.',' Barmantė yra lietuvių kilmės vardas.'),(279,'Barkintas','Barkintas – (1) liet. ir prūs., trump. Barys, Kintas, bar- (žr. Bargailas) + kint- (: liet. kint- su balsių kaita kent-ėti, plg. žiem-kint-is).',' Barkintas yra lietuvių kilmės vardas.'),(280,'Barkinta',' (3b), (1), (1) liet. ir prūs., trump. Bara, Barė, iš vyr. v. Barkintas',' Barkinta, Barkinta, Barkintė yra  kilmės vardas.'),(281,'Barys','Šis vardas simbolizuoja norą imtis naujų planų ir juos įgyvendinti.Tampate reiklesnis sau pačiam ir kitiems. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai',' Barys yra lietuvių kilmės vardas.'),(282,'Barintas','Barintas – (1) suliet. prūs., trump. Barys, priesagos -intas vedinys iš sen. trump. Barys.',' Barintas yra lietuvių kilmės vardas.'),(283,'Barinta',' (3b), (1), (1) suliet. prūs., trump. Bara, Barė, iš vyr. v. Barintas',' Barinta, Barinta, Barintė yra  kilmės vardas.'),(284,'Bargailė','Bargailė – (1) liet., trump. Bara, Barė, iš vyr. avd. Bargaila, žr. Bargailas.',' Bargailė yra lietuvių kilmės vardas.'),(285,'Bargailas','Bargailas – (1) liet., sen. var. Bargaila, trump. Barys, bar- (: barti sen. reikšme „kovoti“, plg. rus. borotjsia „kovoti“) + gail (: sen. liet. gailas „stiprus“).',' Bargailas yra lietuvių kilmės vardas.'),(286,'Barbora','Galima sakyti, kad Barboroms labai svarbi materialinė padėtis. Joms naudingiausios profesijos – verslas ir komercija.',' Barbora yra graikų kilmės vardas.'),(287,'Barė','Barė – (2) 1. liet.: trumpinys iš mot. v. su Bar-: Barkintė, Bartautė, Barvydė ir kt., 2. liet. trumpinys iš Barbora.',' Barė yra lietuvių kilmės vardas.'),(288,'Baniūtė','Baniūtė – (2) liet., sen var. Baniuta. trump. Banė, Benė, tarm. Banutė, Beniutė vak. liet., lietuviškas priesagos -utė (mažyb.) vedinys iš sen. trumpinio Banė, Benė, kuris tikriausiai iš Benedikta.',' Baniūtė yra lotynų kilmės vardas.'),(289,'Barbė','Barbė – (2) liet. trumpinys iš Barbora.',' Barbė yra graikų kilmės vardas.'),(290,'Banguolis','Banguolis – (2) liet., trump. Bangius, priesagos -uolis vedinys iš liet. banga.',' Banguolis yra lietuvių kilmės vardas.'),(291,'Banguolė','Banguolė – (2) liet. trump. Banga, Bangė, iš vyr. v. Banguolis.',' Banguolė yra lietuvių kilmės vardas.'),(292,'Bartvilė','Bartvilė – (1), (2) liet., trump. Bartė, iš vyr. v. Bartvilas.',' Bartvilė yra lietuvių kilmės vardas.'),(293,'Barutė','Barutė – (2) jotv. ir liet.: trump. Bara, Barė, iš vyr. v. Barutis.',' Barutė yra lietuvių kilmės vardas.'),(294,'Bartminas','Bartminas – (1) liet., trump. Bartas, Bartys, bart- (žr. Bartautas) + min- (: liet. min-ti, min-ėti).',' Bartminas yra lietuvių kilmės vardas.'),(295,'Bartvilas','Bartvilas – (1) liet., trump. Bartas, Bartys, bart- (ŽR. Bartautas) + vil- (: liet. vil-tis,vil–iasi „tikėtis“).',' Bartvilas yra lietuvių kilmės vardas.'),(296,'Bartmina',' (3b), (1), (1) liet., trump. Bartė,iš vyr. v. Bartmina',' Bartmina, Bartmina, Bartminė yra  kilmės vardas.'),(297,'Bartenis','Bartenis – (2) liet. ir prūs., trump. Bartas, Bartys, priesagos -enis vedinys iš sen. trumpinio Bartas, kuris iš avd. su Bar-t-: Bartautas, Bartminas ir kt.',' Bartenis yra prūsų kilmės vardas.'),(298,'Bartys','Bartys – (4) liet., trumpinys iš Bartenis, Bartminas ir kt. ',' Bartys yra lietuvių kilmės vardas.'),(299,'Bartenė','Bartenė – (2) liet. ir prūs., trump. Bartė, iš vyr. v. Bartenis.',' Bartenė yra prūsų kilmės vardas.'),(300,'Bartė','Bartė – (2) liet., trumpinys iš Bartautė, Bartminė ir suliet. prūs., iš sen. prūsų genties vardo bartai, žr. Bartas.',' Bartė yra prūsų kilmės vardas.'),(301,'Bartautė','Bartautė – (l) liet., trump. Bartė, iš vyr. v. Bartautas.',' Bartautė yra lietuvių kilmės vardas.'),(302,'Bartautas','Bartautas – (1) liet., trump. Bartas, bar- (: liet. bar-ti sen. reikšme „kovoti“, rus. bor-otj-sia „kovoti“ + taut- (: liet. tauta).',' Bartautas yra lietuvių kilmės vardas.'),(303,'Bartas','Bartas – sulietietuvintas prūsiškas vardas. Kildinimas iš sen. prūsų genties vardo bartai (vns. bartas). Bartas yra trumpinys ir kartu alternatyva kitiems bendros kilmės vardams: Bartenis, Bartautas, Bartminas ir kt. rakt. liet.',' Bartas yra prūsų kilmės vardas.'),(304,'Barnabas','Barnabas – (2) aram., trump. Barnas, iš sulotyninto aram. Barnabas iš aramėjų Barnabhūa — „paguodos sūnus“: aram. bar „sūnus“ + nabha „pranašystė“.',' Barnabas yra aramėjų kilmės vardas.'),(305,'Beinora',' (3b), (1), (1) liet., trump. Beina, Beinė, iš vyr. v. Beinoras',' Beinora, Beinora, Beinorė yra  kilmės vardas.'),(306,'Beatrisa','Beatrisa – (2) pranc., trump. Beata, Beta, iš prancūzų Beatrice, kuris yra lot. vardo Beatrix (kilm. Beatricis) prancūziškas variantas: lot. beatrix „laimę atnešanti“.',' Beatrisa yra prancūzų kilmės vardas.'),(307,'Beatričė','Beatričė visada kur nors skuba. Ji gali būti apdovanota meniniais gabumais, pasižymėti puikiu skoniu, mėgti sužibėti visuomenėje ir vakarėliuose. Darbšti, esant reikalui gali dirbti labai daug.',' Beatričė yra lotynų kilmės vardas.'),(308,'Beatas','Beatas – (2) lot., trump. Betas, Atas, iš lot. Beatus: lot. beatus „palaimintas“.',' Beatas yra lotynų kilmės vardas.'),(309,'Beata','Beatos laimingos, turi puikią sveikatą.',' Beata yra lotynų kilmės vardas.'),(310,'Bazilis',' (2) liet. trumpinys iš Bazilijus',' Bazilis, Bazilius yra  kilmės vardas.'),(311,'Bazilijus','Vardadienis: Sausio 2 d., birželio 14 d.',' Bazilijus yra graikų kilmės vardas.'),(312,'Bazilė','Vardadienis: Sausio 9 d., gegužės 17 d.',' Bazilė yra graikų kilmės vardas.'),(313,'Barvydas','Vardadienis: gegužės 5 d., rugpjūčio 29 d.',' Barvydas yra lietuvių kilmės vardas.'),(314,'Batilda','Batilda – (1) germ., trump. Tilda, baž. lot. Bathildis iš germ. Bathilde: sen. vok. aukšt. badu „kova“ + hiltja „kova“.',' Batilda yra germanų kilmės vardas.'),(315,'Barvyda',' (3b), (1), (1) liet., trump. Barė, Barvė, iš vyr. v. Barvydas ',' Barvyda, Barvyda, Barvydė yra  kilmės vardas.'),(316,'Barvaldė','Barvaldė – (1) liet., trump. Barė, Barvė, iš vyr. v. Barvaldas.',' Barvaldė yra Lietuvių kilmės vardas.'),(317,'Barvaldas','Barvaldas – (1) liet., trump. Barys, Barvas, bar- (žr. Bargailas) + vald- (:dyti liet. val).',' Barvaldas yra lietuvių kilmės vardas.'),(318,'Barvainas','Barvainas – (1) liet., trump. Barys, Barvas, bar- (žr. Bargailas) + vain- (: sen. liet. vaina „priežastis, kaltė“).',' Barvainas yra lietuvių kilmės vardas.'),(319,'Barutis','Barutis – (2) jotv. ir liet., trump. Barys, priesagos -utis vedinys iš avd. su Bar- (Bargailas, Barkintas, Barvainas ir pan.) seno trumpinio.',' Barutis yra lietuvių kilmės vardas.'),(320,'Benjaminas','Vardadienis: Kovo mėn 31 d. – Benjaminų vardo diena.',' Benjaminas yra hebrajų kilmės vardas.'),(321,'Benius','Benius – (2) liet. trumpinys iš Benediktas.',' Benius yra hebrajų kilmės vardas.'),(322,'Benitas','Benitas – (2) ital., trump. Benas, Benys, iš Benito, kuris yra vardo Benediktas itališka ir ispaniška forma.',' Benitas yra italų kilmės vardas.'),(323,'Benita','Benita – (2) ital., trump. Bena, Benė, iš Benita, kuris yra vardo Benedikta itališka ir ispaniška forrna.',' Benita yra italų kilmės vardas.'),(324,'Benignas','Vardadienis: vasario 13 d., spalio 31 d.',' Benignas yra lotynų kilmės vardas.'),(325,'Benys','Benys – (4) liet. trumpinys iš Benediktas.',' Benys yra lietuvių kilmės vardas.'),(326,'Benigna','Benigna – (2) lot., trump. Bena, Benė, tarm. Banigna ryt. aukšt., Benyna vak. liet., iš lot. Benigna, kuris iš vyr. v. Benignus, žr. Benignas.',' Benigna yra lotynų kilmės vardas.'),(327,'Benediktas','Benediktams patarimas – nesistengti reikštis, kai sekasi, ir nekeikti likimo nesėkmės atvejais, taip pat nebūti tokiais ambicingais.',' Benediktas yra lotynų kilmės vardas.'),(328,'Benas','Benų kūno silpniausios vietos: rankos, plaučiai, nervų sistema. Jiems nereikėtų rūkyti bei vartoti alkoholį. Būtina kovoti su gobšumu, avantiūrizmu, išlaidumu, pagyrūniškumu, tingumu, darboholizmu.',' Benas yra hebrajų kilmės vardas.'),(329,'Benedikta','Su Benediktais gyvenimas nelengvas. Jie retai būna populiarūs, net jeigu gerbiami už charakterio tvirtumą. Sunku juos gerbti, todėl, kad jie vis taikosi primesti savo valią kitiems, iš savo atminties į juodą sąrašą įtraukia visus tuos , kurie nepritaria jų nuomonei.',' Benedikta yra lotynų kilmės vardas.'),(330,'Bena',' (2) liet. trumpinys iš Benedikta ir kt.',' Bena, Benė yra  kilmės vardas.'),(331,'Benadas','Benadas – (2), (1) trump. Nadas, – liet. trumpinys iš Benediktas.',' Benadas yra lietuvių kilmės vardas.'),(332,'Beivydas','Beivydas – (1) liet., trump. Beivys, bei- (žr. Beinoras) + vyd- (žr. Barvydas).',' Beivydas yra lietuvių kilmės vardas.'),(333,'Beivyda',' (3b), (1), (1) liet., trump. Beiva, Beivė, iš vyr. v. Beivydas',' Beivyda, Beivyda, Beivydė yra  kilmės vardas.'),(334,'Beinoras','Beinoras – (l) liet., trump. Beinas, Beinys, bei- (: liet. bei „ar, bau“’, beig „ar, begu“, plg. dar vardus su Ar-: Arv-ydas, Arvaidas ir kt.) + nor- (:liet. nor-ėti).',' Beinoras yra lietuvių kilmės vardas.'),(335,'Bėržūna','Bėržūna – (1) liet., iš upėvardžio Beržūna (Lazūnai).',' Bėržūna yra lietuvių kilmės vardas.'),(336,'Beržas','Beržas – (1) liet., iš pasakos „Eglė žalčių karalienė“ Eglės sūnaus vardo Beržas: liet. beržas, plg. pvd. Beržas.',' Beržas yra lietuvių kilmės vardas.'),(337,'Bervainas','Bervainas – (1) liet., trump. Bervas, Bervys, ber- (žr. Bertautas) + vain- (žr. Barvainas).',' Bervainas yra lietuvių kilmės vardas.'),(338,'Bervainė','Bervainė – (1) liet., trump. Berė, Bervė, iš vyr. v. Bervainas.',' Bervainė yra lietuvių kilmės vardas.'),(339,'Bertoldas','Vardadienis: Kovo mėn 29 d. – Bertoldų vardo diena.',' Bertoldas yra vokiečių kilmės vardas.'),(340,'Bertautas','Bertautas – (1) liet., trump. Bertas, Benys, ber-(: liet. ber-ti, plg. liet. ber-nas, latv. ber-ns „vaikas“, got. barn „t. p.“)+ taut- (: liet. tauta).',' Bertautas yra lietuvių kilmės vardas.'),(341,'Bertautė','Bertautė – (1) liet., trump. Bertė, iš vyr. v. Bertautas.',' Bertautė yra lietuvių kilmės vardas.'),(342,'Berta','Vardadienis: Rugpjūčio 1 d., liepos 4 d., rugsėjo 3 d. – Bertų vardo diena.',' Berta yra vokiečių kilmės vardas.'),(343,'Bylotė','Bylotė – (1) liet., trump. Bylė, iš vyr. v. Bylotas.',' Bylotė yra lietuvių kilmės vardas.'),(344,'Bernardas','Bernardų neigiamos savybės: egocentriškumas, savimeilė, užsispyrimas, maniakiškumas, tironiškumas. Jiems patartina nepakliūti į neigiamų vibracijų srautus. Reikėtų vengti savimeilės, antagonizmo, ugdyti pusiausvyrą, kantrybę ir ramumą. Nusiraminti gali padėti prie kūno nešiojamas gabalėlis gintaro',' Bernardas yra vokiečių kilmės vardas.'),(345,'Bylotas','Bylotas – (1) liet. ir prūs., trump. Bylius, priesagos -otas vedinys iš avd. Bylius.',' Bylotas yra lietuvių kilmės vardas.'),(346,'Bilminas','Bilminas – (1) liet., trump. Bilys, Bilius, bil- (žr. Bilginas) + min- (žr. Bartminas).',' Bilminas yra lietuvių kilmės vardas.'),(347,'Bernarda','Bernarda – (1) sulot. germ., trump Bena, Benė, tarm. Bernada ryt. ir vak. aukšt., baž. lot. Bernarda, kuris iš vyr. v. Bernardus, žr. Bernardas.',' Bernarda yra vokiečių kilmės vardas.'),(348,'Bilmina',' (3a), (1), (1) liet. trump. Bilė, iš vyr. v. Bilminas',' Bilmina, Bilmina, Bilminė yra  kilmės vardas.'),(349,'Bernadeta','Bernadetos apdovanotos ir prieštaringu įtariu charakteriu. Iš vienos pusės, jos siekia taikos ir ramybės, o iš kitos – trokšta būti dėmesio centre. Kai kada jos susipainioja ir nežino netgi ko nori.',' Bernadeta yra prancūzų, lotynų, vokiečių kilmės vardas.'),(350,'Bernadas','Bernadas – (2) trump. Nadas, — liet. trumpinys iš Bernardas.',' Bernadas yra vokiečių kilmės vardas.'),(351,'Benvenutas','Benvenutas – (2) ital., trump. Benas, iš italų Benvenuto — „mielai laukiamas“.',' Benvenutas yra italų kilmės vardas.'),(352,'Bilmantė','Bilmantė – (1) liet., trump. Bilė, iš vyr. v. Bilmantas.',' Bilmantė yra lietuvių kilmės vardas.'),(353,'Bilmantas','Bilmantas – (1) liet., trump. Bilys, Bilius, bil- (žr. Bilginas) + mant- (:liet. mant-us „sumanus“, mant-a „turtas“).',' Bilmantas yra lietuvių kilmės vardas.'),(354,'Benonas','Benonas – (2), (1) sulot. germ., trump. Benas, baž. lot. Benno (kilm. Bennonis) iš germ. Benno, kuris yra germ. vardų su Bern-(Bernhard ir kt.) trumpinys: sen. vok. aukšt. bero (bern-) „lokys“.',' Benonas yra vokiečių kilmės vardas.'),(355,'Byvainė','Byvainė – (1) liet., trump. Byvė, iš vyr. v. Byvainas.',' Byvainė yra lietuvių kilmės vardas.'),(356,'Bylius','Bylius – (1) liet., liet. byl-oti „kalbėti, tarti“ galūnės vedinys.',' Bylius yra lietuvių kilmės vardas.'),(357,'Bilginas','Bilginas – (1) liet., trump. Bilys, Bilius: bil- (: liet. bil-ti, bil-us ,,šnekus“) + gin- (:liet. gin-ti „užstoti“).',' Bilginas yra lietuvių kilmės vardas.'),(358,'Byvainas','Byvainas – (1) liet., trump. Byvas, by- (žr. Bygailas) + vain- (žr. Barvainas).',' Byvainas yra lietuvių kilmės vardas.'),(359,'Benona','Benona – (2) sulot. germ., trump. Bena, Benė: iš vyr. v. Benno, žr. Benonas.',' Benona yra vokiečių kilmės vardas.'),(360,'Bylenis','Bylenis – (2) liet., trump. Bylius, priesagos –enis vedinys iš avd. Bylius.',' Bylenis yra lietuvių kilmės vardas.'),(361,'Bitė','Bitė – liet.: liet. bitė, plg. dar tos pačios reikšmės vardus Debora, Melita, bitė — darbštumo simbolis.',' Bitė yra lietuvių kilmės vardas.'),(362,'Bylenė','Bylenė – (2) liet., trump. Bylė, iš vyr. v. Bylenis.',' Bylenė yra lietuvių kilmės vardas.'),(363,'Bytautė','Bytautė – (1) liet. ir prūs., trump. Bytė, iš vyr. v. Bytautas.',' Bytautė yra lietuvių kilmės vardas.'),(364,'Bylė','Bylė – (1) liet.: iš vyr. v. Bylius.',' Bylė yra lietuvių kilmės vardas.'),(365,'Bytautas','Bytautas -(1) liet. ir prūs., trump. Bytis, by- (žr. Bygailas) + taut- (žr. Bartautas).',' Bytautas yra lietuvių kilmės vardas.'),(366,'Bygirdas','Bygirdas – (1) suliet. prūs., trump. Bygas, Bygius, by- (žr. Bygailas) + gird- (: liet. gird-ėti, gird-as „žinia, gandas“).',' Bygirdas yra prūsų kilmės vardas.'),(367,'Birvydas','Birvydas – (1) liet., trump. Biras: bir- (žr. Birmantas) + vyd (žr. Barvydas).',' Birvydas yra lietuvių kilmės vardas.'),(368,'Birvyda',' (3a), (1), (1) liet., trump. Birė, iš vyr. v. Birvydas',' Birvyda, Birvyda, Birvydė yra  kilmės vardas.'),(369,'Bygirda',' (3a), (1), (1) suliet. prūs., trump. Byga, Bygė, iš vyr. v. Bygirdas',' Bygirda, Bygirda, Bygirdė yra  kilmės vardas.'),(370,'Bygailė','Bygailė – (1) liet., trump. Byga, Bygė, iš vyr. avd. Bygaila, žr. Bygailas.',' Bygailė yra lietuvių kilmės vardas.'),(371,'Birutis','Birutis – (2) liet., trump. Biras, priesagos –utis vedinys iš sen. trump. Biras, kuris iš avd. su Bir-: Birmantas.',' Birutis yra lietuvių kilmės vardas.'),(372,'Bygailas','Bygailas – (1) liet., sen. var. Bygaila, trump. Bygas, by- (:liet. bij-oti, latv. bities „bijotis“, plg. vardus su Bug-: Bugvilas+ gail- (žr. Bargailas).',' Bygailas yra lietuvių kilmės vardas.'),(373,'Bronislovas','Bronislovas – (1) slav., sen. var. Bronislavas (1), trump. Bronys, Bronius, tarm. Branislavas, Branislovas, Branys, Branius ryt. aukšt., Bronius, Bronis piet. žem., baž. lot. Bronislaus iš slavų Bronislav (lenk. Bronislaw, čekų Branislav): sen. slav. braniti „ginti,saugoti“ + slava „šlovė“.',' Bronislovas yra slavų kilmės vardas.'),(374,'Birutė','Birutes gali kamuoti raumenų skausmai ir kraujo apytakos problemos. Joms reikėtų vengti prigimtinio potraukio alkoholiui.',' Birutė yra lietuvių kilmės vardas.'),(375,'Birmantė','Birmantė – (1) liet., trump. Birė, iš vyr. v. Birmantas.',' Birmantė yra lietuvių kilmės vardas.'),(376,'Birmantas','Birmantas – (1) liet., trump. Biras, bir- (: liet. bir-ti su balsių kaita iš ber-ti, žr. Bertautas) + mant- (žr. Bilmantas).',' Birmantas yra lietuvių kilmės vardas.'),(377,'Bronislova','Bronislova – (1) slav., sen. var. Bronislava (2), trump. Bronė, tarm. Branislava, Branislova, Branė ryt. aukšt., Bronė piet. žem., ryt. aukšt., Bronia piet. aukšt. (dz.), baž. lot. Bronislava iš slavų Bronislava, kuri iš vyr. v. Bronislav, žr. Bronislovas.',' Bronislova yra slavų kilmės vardas.'),(378,'Bronys','Broniams skirta per gyvenimą bent vieną kartą stoti prieš teismą. Jų gyvenime silpnas periodas apima dešimt pirmųjų sausio mėnesio dienų.',' Bronys yra slavų kilmės vardas.'),(379,'Birenis','Birenis – (2) liet., trump. Biras, priesagos –enis vedinys iš sen. trump. Biras, kuris iš avd. su Bir-: Birmantas, Birvydas ir kt.',' Birenis yra lietuvių kilmės vardas.'),(380,'Bronė','Bronė – (2) liet. trumpinys iš Bronislova.',' Bronė yra slavų kilmės vardas.'),(381,'Birenė','Birenė – (2) liet., trump Birė, iš vyr. v. Birenis.',' Birenė yra lietuvių kilmės vardas.'),(382,'Bilvinas','Bilvinas – (1) liet. trump. Bilys, Bilius, bil- (žr. Bilginas)+ vin- (:sen. liet. vin- su balsių kaita iš vain-: vaina „priežastis, kaltė“.',' Bilvinas yra lietuvių kilmės vardas.'),(383,'Brigita','Brigitos išdidžios, nemėgstančios niekam įsipareigoti; nepriklausomos ir iš karto susierzina, jeigu kas nors bando apriboti jų laisvę.',' Brigita yra keltų kilmės vardas.'),(384,'Bilvina',' (1) liet., trump. Bilė, iš vyr. v. Bilvinas',' Bilvina, Bilvina, Bilvinė yra  kilmės vardas.'),(385,'Brigė','Brigė – (2) liet. trumpinys iš Brigita.',' Brigė yra lietuvių kilmės vardas.'),(386,'Bonifacas','Kadangi Bonifacai labai individualūs, jiems geriausiai tinka pilka drabužių spalva. Jeigu juos traukia juoda spalva, tai reiškia, kad viskas juose protestuoja prieš nepasisekimus. Juoda spalva lyg ir atriboja juos nuo aplinkinių.',' Bonifacas yra lotynų kilmės vardas.'),(387,'Bonifacija','Kadangi Bonifacai labai individualūs, jiems geriausiai tinka pilka drabužių spalva. Jeigu juos traukia juoda spalva, tai reiškia, kad viskas juose protestuoja prieš nepasisekimus. Juoda spalva lyg ir atriboja juos nuo aplinkinių.',' Bonifacija yra lotynų kilmės vardas.'),(388,'Bonaventūras','Bonaventūras – (2) lot., sen. var. Bonaventūra (2), trump. Bonas, baž. lot. Bonaventura – „gėrybes žadantis“ : lot. bona „gėrybės, turtas“ + ventūrus „ateisiantis, pažadėtas“.',' Bonaventūras yra lotynų kilmės vardas.'),(389,'Bonaventūra','Bonaventūra – (2) lot., trump. Bona, iš vyr. v. Bonaventūra, žr. Bonaventūras.',' Bonaventūra yra lotynų kilmės vardas.'),(390,'Bonas','Bonas – (2) liet. trumpinys iš Bonifacas ir kt.',' Bonas yra lietuvių kilmės vardas.'),(391,'Bolius',' (2) liet. trumpinys iš Boleslovas',' Bolius yra slavų kilmės vardas.'),(392,'Bona','Bona – (2) 1. lot., iš lot. Bona: lot. bona „gera“, 2. liet. trumpinys iš Bonaventūra ir Bonifacija.',' Bona yra lotynų kilmės vardas.'),(393,'Blažys','Blažys – (4) liet. trumpinys iš Blažiejus.',' Blažys yra graikų kilmės vardas.'),(394,'Buivydas','Buivydas – (1) liet., trump. Buivys, bui- (: liet. bui-tis, bū-ti: bi-ti „buvo“) + vyd- (žr. Barvydas).',' Buivydas yra lietuvių kilmės vardas.'),(395,'Blažiejus','Blažiejus – (2) graik., trump. Blažys, tarm. Blažius piet. aukšt. (dz.), per lenkų Blazej iš sulotyninto graik. Blasius: graik. blaks „lepus, nerangus“.',' Blažiejus yra graikų kilmės vardas.'),(396,'Buivyda',' (3b), (1), (1) liet., trump. Buivė, iš vyr. v. Buivydas',' Buivyda, Buivyda, Buivydė yra  kilmės vardas.'),(397,'Bugvilė','Bugvilė – (1), (2) liet., trump. Bugė, iš vyr. v. Bugvilas.',' Bugvilė yra lietuvių kilmės vardas.'),(398,'Bugvilas','Bugvilas – (1) liet., trump. Bugys, bug- (: liet. bug-inti „bauginti, baidyti“, bug-us „bailus“) + vil- (:liet. vil-tis, vil-iasi, vil-tis).',' Bugvilas yra lietuvių kilmės vardas.'),(399,'Bugailas','Bugailas – (1) liet., sen. var. Bugaila, trump. Bugys, bu- (:liet. bu-tas, bū-ti ar bu- kilęw iš bug- : bug-inti „bauginti, baidyti“, bug-us „bailus“) + gail- (žr. Bargailas).',' Bugailas yra lietuvių kilmės vardas.'),(400,'Bugailė','Bugailė – (1) liet., trump. Bugė, iš vyr. avd. Bugaila, žr. Bugailas.',' Bugailė yra lietuvių kilmės vardas.'),(401,'Budvilė','Budvilė – (1), (2) liet., trump. Budvė, iš vyr. v. Budvilas.',' Budvilė yra lietuvių kilmės vardas.'),(402,'Budvilas','Budvilas – (1) liet., trump. Budvys, bud- (žr. Budvydas) + vil- (žr. Bartvilas).',' Budvilas yra lietuvių kilmės vardas.'),(403,'Budvydas','Budvydas – (1) liet., trump. Budvys, bud- (: bud-ėti, bud-inti) + vyd- (žr. Barvydas).',' Budvydas yra lietuvių kilmės vardas.'),(404,'Budvyda',' (3b), (1), (1) liet., trump. Budvė, iš vyr. v. Budvydas',' Budvyda, Budvyda, Budvydė yra  kilmės vardas.'),(405,'Budrys',' (4), (2) liet., galūnių vediniai iš liet. budrus',' Budrys, Budrius yra  kilmės vardas.'),(406,'Budrė','Budrė – (2) liet., iš vyr. v. Budrys, Budrius.',' Budrė yra lietuvių kilmės vardas.'),(407,'Brunonas','Vardadienis: Gegužės 27 d., liepos 12 d., spalio 6 d. ',' Brunonas yra vokiečių kilmės vardas.'),(408,'Brunona','Brunona – (2) sulot. germ., trump. Bruna, Brunė, iš vyr. v. BRUNO,. žr. Brunonas',' Brunona yra vokiečių kilmės vardas.'),(409,'Bronius','Taip jau yra, kad Broniams skirta per gyvenimą bent vieną kartą susidurti su teisėsauga. Jų gyvenime sunkus periodas – dešimt pirmųjų sausio mėnesio dienų.',' Bronius yra slavų kilmės vardas.'),(410,'Butautas','Butautas – (1) liet., trump. Butys, Būtys, bu- (žr. Bugailas) + taut- (žr. Bartautas).',' Butautas yra lietuvių kilmės vardas.'),(411,'Burvilė','Burvilė – (1), (2) liet., trump. Bura, Burvė, iš vyr. v. Burvilas.',' Burvilė yra lietuvių kilmės vardas.'),(412,'Bušė','Bušė – (2) vak. liet. trumpinys iš Barbušė, žr. Barbora.',' Bušė yra lietuvių kilmės vardas.'),(413,'Burvilas','Burvilas – (1) liet., trump. Buras, Burvys, bur- (žr. Burgailas) + vil- (žr. Bartvilas).',' Burvilas yra lietuvių kilmės vardas.'),(414,'Burvydas','Burvydas – (1) liet., trump. Buras, Burvys, bur- (žr. Burgailas)+ vyd- (žr. Barvydas).',' Burvydas yra lietuvių kilmės vardas.'),(415,'Burvyda',' (3a), (1), (1) liet., trump. Bura, Burė, iš vyr. v. Burvydas',' Burvyda, Burvyda, Burvydė yra  kilmės vardas.'),(416,'Burtautė','Burtautė – (1) liet., trump. Burtė, iš vyr. v. Burtautas.',' Burtautė yra lietuvių kilmės vardas.'),(417,'Burtautas','Burtautas – (1) liet., trump. Burtys, bur- (žr. Burgailas) + taut- (žr. Bartautas).',' Burtautas yra lietuvių kilmės vardas.'),(418,'Burkantas','Burkantas – (1) liet., trump. Buras, Burys, bur- (žr. Burgailas) + kant- (žr. Bukantas).',' Burkantas yra lietuvių kilmės vardas.'),(419,'Burkanta',' (3a), (1), (1) liet., trump. Bura, Burė, iš vyr. v. Burkantas',' Burkanta, Burkanta, Burkantė yra  kilmės vardas.'),(420,'Burgailas','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Burgailas yra lietuvių kilmės vardas.'),(421,'Burgailė','Taigi šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Burgailė yra lietuvių kilmės vardas.'),(422,'Bukantas','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas.Mėgstate discipliną ir tvarką, konservatyvūs ir pedantiški, stengiatės palaikyti bendrai priimtas tradicijas ir tvarką.Kai kurie esate avantiūristai, nuotykių ieškotojai, užsispyrę žaidėjai : gyvenimas – teatras.',' Bukantas yra lietuvių kilmės vardas.'),(423,'Bukanta',' (3b), (1), (1) liet. ir prūs., trump. Kantė, iš vyr. v. Bukantas',' Bukanta, Bukanta, Bukantė yra lietuvių kilmės vardas.'),(424,'Buivys','Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų.',' Buivys yra lietuvių kilmės vardas.'),(425,'Butmantė','Taigi šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Butmantė yra lietuvių kilmės vardas.'),(426,'Butmantas','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Butmantas yra lietuvių kilmės vardas.'),(427,'Butigeidė','Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei.',' Butigeidė yra lietuvių kilmės vardas.'),(428,'Butigeidas','Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei.',' Butigeidas yra lietuvių kilmės vardas.'),(429,'Butginta',' (3b), (1), (1) liet., trump. Butė, Būtė, iš vyr. v. Butgintas',' Butginta, Butginta, Butgintė yra  kilmės vardas.'),(430,'Butgintas','Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Butgintas yra lietuvių kilmės vardas.'),(431,'Butginas','Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Butginas yra lietuvių kilmės vardas.'),(432,'Butgina',' (3b), (1), (1) liet., trump. Butė, Būtė, iš vyr. v. Butginas',' Butgina, Butgina, Butginė yra  kilmės vardas.'),(433,'Butgailas','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Butgailas yra lietuvių kilmės vardas.'),(434,'Butgailė','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Butgailė yra lietuvių kilmės vardas.'),(435,'Butys',' (4) liet., trumpinys iš avd. su But-: Butautas, Butginas, Butvydas ir kt.',' Butys, Būtys yra  kilmės vardas.'),(436,'Butenis','Butenis – (2) liet., trump. Butys, priesagos –enis vedinys iš sen. trump. Butys.',' Butenis yra lietuvių kilmės vardas.'),(437,'Butenė','Butenė – (2) liet., trump. Butė, iš vyr. v. Butenis.',' Butenė yra lietuvių kilmės vardas.'),(438,'Bute',' (2) liet., iš vyr. v. Butys, Būtys',' Bute, Būtė yra  kilmės vardas.'),(439,'Butautė','Butautė – (1) liet., trump. Butė, Būtė, iš vyr. v. Butautas.',' Butautė yra lietuvių kilmės vardas.'),(440,'Butvinas','Butvinas – (l) liet., trump. Butys, Būtys, but- (žr. Butgailas) + vin- (žr. Bilvinas).',' Butvinas yra lietuvių kilmės vardas.'),(441,'Buvainė','Buvainė – (1) liet., trump. Buvė, iš vyr. v. Buvainas.',' Buvainė yra lietuvių kilmės vardas.'),(442,'Butvina',' (3b), (1), (1) liet., trump. Butė, Būtė, iš vyr. v. Butvinas',' Butvina, Butvina, Butvinė yra  kilmės vardas.'),(443,'Butvilė','Butvilė – (1), (2) liet., trump. Butė, Būtė, iš vyr. v. Butvilas.',' Butvilė yra lietuvių kilmės vardas.'),(444,'Butvilas','Butvilas – (1) liet., trump. Butys, Būtys, but- (žr. Butgailas) + vil- (žr. Bartvilas).',' Butvilas yra lietuvių kilmės vardas.'),(445,'Butvydas','Butvydas – (1) liet., trump, Butys, Būtys, but- (žr. Butgailas) + vyd- (žr. Barvydas).',' Butvydas yra lietuvių kilmės vardas.'),(446,'Butvyda',' (3b), (1), (1) liet., trump. Butė, Būtė, iš vyr. v. Butvydas',' Butvyda, Butvyda, Butvydė yra  kilmės vardas.'),(447,'Butrimė','Butrimė – (l) liet. ir prūs., trump. Butė, Būtė, iš vyr. v. Butrimas.',' Butrimė yra lietuvių kilmės vardas.'),(448,'Butrimas','Butrimas – (1) liet. ir prūs., trump. Butys, Būtys, but- (žr. Butgailas) + rim- (: liet. rim-ti).',' Butrimas yra lietuvių kilmės vardas.'),(449,'Butnoras','Butnoras – (1) liet., trump. Butys, Būtys, but- (žr. Butgailas) + nor- (žr. Beinoras).',' Butnoras yra lietuvių kilmės vardas.'),(450,'Butnora',' (3b), (1), (1) liet., trump. Butė, Būtė, iš vyr. v. Butnoras',' Butnora, Butnora, Butnorė yra  kilmės vardas.'),(451,'Butmintas','Butmintas – (1) liet., trump. Butys, Būtys, but- (žr. Butgailas) + mint- (: liet. minti, mint-as, mint-is).',' Butmintas yra lietuvių kilmės vardas.'),(452,'Butminta',' (3b), (1), (1) liet., trump. Butė, Būtė, iš vyr. v. Butmintas',' Butminta, Butminta, Butmintė yra  kilmės vardas.'),(453,'Butminas','Butminas – (1) liet., trump. Butys, Būtys, but- (žr. Butgailas) + min- (žr. Bartminas).',' Butminas yra lietuvių kilmės vardas.'),(454,'Butmina',' (3b), (1), (1) liet., trump. Butė, Būtė, iš vyr. v. Butminas',' Butmina, Butmina, Butminė yra  kilmės vardas.'),(455,'Cecilius','Cecilijai labai gerai jaučiasi visuomeniniame darbe. Niekas aiškiau nesugebės išaiškinti užduoties ar pavedimo kaip jia. Tačiau nemėgsta, kai juos bando “laikyti už trumpo pavadėlio”. Jie dirba dėl polinkio, o ne iš prievartos.',' Cecilius yra lotynų kilmės vardas.'),(456,'Cecilijus','Cecilijai labai gerai jaučiasi visuomeniniame darbe. Niekas aiškiau nesugebės išaiškinti užduoties ar pavedimo kaip jis. Tačiau nemėgsta, kai juos bando “laikyti už trumpo pavadėlio”. Jie dirba iš idėjos o ne ieškodami naudos sau pačiam.',' Cecilijus yra lotynų kilmės vardas.'),(457,'Celė','Celė – (2) liet. trumpinys iš Celina ir kt.',' Celė yra lietuvių kilmės vardas.'),(458,'Celerina','Celerina – (2) lot., trump. Celera, Celė, iš lot. Celerina, kuris iš vyr. v. Celerinas.',' Celerina yra lotynų kilmės vardas.'),(459,'Cecilė','Cecilijos puikios mokytojos, astrologės, istorikės, chemikės medikės, radijo ir televizijos darbuotojos.',' Cecilė yra lotynų kilmės vardas.'),(460,'Cecilija','Cecilijų laimingi skaičiai – 25 ir 28.',' Cecilija yra lotynų kilmės vardas.'),(461,'Cilas','Cilas – (2) liet. trumpinys iš Cecilijus.',' Cilas yra lotynų kilmės vardas.'),(462,'Cilė','Cilė – (2) liet. trumpinys iš Cecilė, Cecilija.',' Cilė yra lotynų kilmės vardas.'),(463,'Cezaris','Cezaris – (1) liet. trumpinys iš Cezarijus.',' Cezaris yra lotynų kilmės vardas.'),(464,'Cezarijus','Vardadienis: Sausio 12 d., rugpjūčio 27 d.',' Cezarijus yra lotynų kilmės vardas.'),(465,'Cezarija','Cezarija – (l) lot., trump. Cezarė, Cezara, iš lot. Caesaria, kuris iš vyr. v. Caesarius, žr. Cezarijus.',' Cezarija yra lotynų kilmės vardas.'),(466,'Cezarė',' (1), (2) liet. trumpinys iš Cezarija',' Cezarė, Cezara yra  kilmės vardas.'),(467,'Cezaras','Cezaras – (2) liet. trumpinys iš Cezarijus.',' Cezaras yra lietuvių kilmės vardas.'),(468,'Celsas','Celsas – (1) lot., iš lot, Celsus: lot. celsus „aukštas, kilnus“.',' Celsas yra lotynų kilmės vardas.'),(469,'Celina','Celina – (2) lot., trump. Celė: iš lot. Coelina lot. coelina „dangaus, dangiška“.',' Celina yra lotynų kilmės vardas.'),(470,'Celijus','Celijus – (1) lot., trump. Celius, iš lot. Celius: lot. caelum „dangus“.',' Celijus yra lotynų kilmės vardas.'),(471,'Celestinas','Vardadienis: Balandžio 6 d., gegužės 19 d.',' Celestinas yra lotynų kilmės vardas.'),(472,'Celestas','Celestas – (2) liet. trumpinys iš Celestinas.',' Celestas yra lotynų kilmės vardas.'),(473,'Celestina','Celestina – (2) lot., trump. Celesta, Celė, iš lot. Caelestina, Coelestina: lot. caelestina „dangaus, dangiška“.',' Celestina yra lotynų kilmės vardas.'),(474,'Celesta','Celesta – (2) liet. trumpinys iš Celestina.',' Celesta yra lotynų kilmės vardas.'),(475,'Celerinas','Celerinas – (2) lot., trump. Celeras, Celas, iš lot. Celerinus, lot. celer „greitas, vikrus“.',' Celerinas yra lotynų kilmės vardas.'),(476,'Česė','Česė – (2) liet. trumpinys iš Česlova.',' Česė yra slavų kilmės vardas.'),(477,'Česys','Česys, Česius — liet. trumpinys iš Česlovas',' Česys, Česius yra  kilmės vardas.'),(478,'Česlova','Česlovams geriausia gyvenimo draugė ta, kuri turi platų pažiūrų ratą, jai svetimas pavydo jausmas. Joms reikėtų turėti netgi artistiškų bruožų, kad sugebėtų išlaikyti jų interesus, vertintų jų plačius mastus ir drąsius entuziazmo protrūkius.',' Česlova yra slavų kilmės vardas.'),(479,'Česlovas','Česlovams geriausia gyvenimo draugė ta, kuri turi platų pažiūrų ratą, jai svetimas pavydo jausmas. Joms reikėtų turėti netgi artistiškų bruožų, kad sugebėtų išlaikyti jų interesus, vertintų jų plačius mastus ir drąsius entuziazmo protrūkius.',' Česlovas yra slavų kilmės vardas.'),(480,'Čiovyda','Čiovyda, Čiovyda, Čiovydė - liet., trump. Vyda, Vydė, iš vyr. v. Čiovydas',' Čiovyda, Čiovydė yra  kilmės vardas.'),(481,'Čiovydas','Čiovydas – (1) liet., trump. Vydas, čio- (: liet. čion „čia“) + vyd- (: liet. iš-vys-ti, iš-vyd-o).',' Čiovydas yra lietuvių kilmės vardas.'),(482,'Dalia','Dalios romantiškos idealistės, svajotojos ir labai dažnai jaučiasi įsimylėjusios. Jeigu suranda tikrąją meilę, tai jai atsiduoda visa savo siela ir kūnu. Jos optimistės ir atviraširdės ir netgi neturi minties, jog žmogus, kurį myli, galėtų būti neištikimas.',' Dalia yra lietuvių kilmės vardas.'),(483,'Dainora','Dainorų darbo vieta dvelkia pasitikėjimo atmosfera, visada tvarkinga, nėra nieko nereikalingo. Jų darbo pobūdis labai įvairus. Trokšdamos žinių, jos įsisavina bet kurią profesiją. Mėgsta labai kruopščiai ir profesionaliai dirbti. Jos įstaigų vadovės, puikios chemikės, įvairių sričių inžinierės.',' Dainora yra lietuvių kilmės vardas.'),(484,'Dava','Dava – (1) liet., Vydūno padarytas vardas iš sanskrito daiva „lemtis, dalia“.',' Dava yra lietuvių kilmės vardas.'),(485,'Dainys',' (4), (2) liet., iš sen. avd. Dainys: liet. daina',' Dainys, Dainius yra  kilmės vardas.'),(486,'Dainė','Dainė – (2) liet., iš vyr. v. Dainys.',' Dainė yra lietuvių kilmės vardas.'),(487,'Daina','Dainos, labai etiškos asmenybės, kurios stengiasi visada rodyti geriausius rezultatus. Jų vardadienį globoja Jupiterio planeta, todėl jų pagrindinis bruožas – intelektas. Esa realistės todėl ir protas būna analitinis ir tai joms leidžia atlikti grandiozinius darbus.',' Daina yra lietuvių kilmės vardas.'),(488,'Dagnė','Dagnė – (2) skand, iš skand. Dagny: skand. dagr „diena“ + NY „nauja“.',' Dagnė yra skandinavų kilmės vardas.'),(489,'Dagmara','Dagmara – (2) skand., trump. Dagmė, iš skand. Dagmar: skand. dagr „diena“ + maerr „garsi, žymi“.',' Dagmara yra skandinavų kilmės vardas.'),(490,'Dabinta','Dabinta – (4) liet., iš upėvardžio Dabinta (Kruonis).',' Dabinta yra lietuvių kilmės vardas.'),(491,'Dangirutė',' (2) liet., sen. var. Dangerutė, trump. Dangira, Dangė, iš vyr. v. Dangirutis',' Dangirutė yra  kilmės vardas.'),(492,'Dangiras','Dangiras – (1) liet., trump. Dangis, iškreiptas iš Daugiras.',' Dangiras yra lietuvių kilmės vardas.'),(493,'Dangira','Dangira – (3a), (1) liet., trump. Dangė, iš vyr. v. Dangiras.',' Dangira yra lietuvių kilmės vardas.'),(494,'Dangius',' (2) liet.: liet. dangus, vertinys iš lot. vardo Celestinas',' Dangius, Dangis yra  kilmės vardas.'),(495,'Dangerutis','',' Dangerutis yra  kilmės vardas.'),(496,'Dangė','Dangė – (2) liet., liet. dangus, vertinys, iš lot. vardų Celina, Celestina.',' Dangė yra lietuvių kilmės vardas.'),(497,'Danas',' (2), (2), (4), (2) liet. trumpiniai iš Danielius',' Danas, Danis, Danys, Danius yra  kilmės vardas.'),(498,'Dana',' (2) liet., trumpinys iš mot. v. Danutė',' Dana, Danė yra  kilmės vardas.'),(499,'Damijonas',' (2) graik., trump. Damas, iš sulotyninto graik. Damianus: graik. damao „tramdyti“',' Damijonas yra graikų kilmės vardas.'),(500,'Damazas','Damazas – (2) graik., trump, Damas, iš sulotyninto graik. Damasus: graik. damazo „malšinti“.',' Damazas yra graikų kilmės vardas.'),(501,'Dargina',' (3a), (1), (1) liet., trump. Darė, Dargė, iš vyr. v. Darginas',' Dargina, Dargina, Darginė yra  kilmės vardas.'),(502,'Damas','Damas – (2) liet. trumpinys iš Damazas ir Damijonas.',' Damas yra lietuvių kilmės vardas.'),(503,'Dalius','Daliai – filosofai. Gali valandų valandas mąstyti ką padaryti dar geriau ir gilintis kodėl kiti daro ne taip kaip jie. ',' Dalius yra lietuvių kilmės vardas.'),(504,'Dargilė','Dargilė – (l) liet. ir prūs., trump. Darė, Dargė, iš vyr. v. Dargilas.',' Dargilė yra lietuvių kilmės vardas.'),(505,'Dalija','Dalija – (1) naujas lot., trump. Dalė, iš lot. botanikos termino Dahlia (variabilis) „jurginas“.',' Dalija yra lotynų kilmės vardas.'),(506,'Dargenė','Dargenė – (2) liet. ir prūs., trump. Dargė, iš vyr. v. Dargenis.',' Dargenė yra lietuvių kilmės vardas.'),(507,'Dargė','Dargė – (1) liet., trumpinys iš mot. v. su Dar-g-: Dargailė, Dargaudė, Dargintė ir kt.',' Dargė yra lietuvių kilmės vardas.'),(508,'Dalė','Dalė – (2) liet. trumpinys iš Dalija.',' Dalė yra lietuvių kilmės vardas.'),(509,'Dargauda',' (3a), (1), (1) suliet. prūs. trump. Darė, Dargė, iš vyr. v. Dargaudas',' Dargauda, Dargauda, Dargaudė yra  kilmės vardas.'),(510,'Dargas','Dargas – (1) liet., trumpinys iš avd. su Darg-, Dar-g-: Dargvainas, Dargilas, Dargailas, Dargaudas ir kt.',' Dargas yra lietuvių kilmės vardas.'),(511,'Dargailė','Dargailė – (1) liet., trump. Darė, Dargė, iš vyr. v. Dargaila, žr. Dargailas.',' Dargailė yra lietuvių kilmės vardas.'),(512,'Darbutas','Darbutas – (1) liet., trump. Daras, Darius, dar- (: liet. dar-yti) + but- (: liet. but-as, būti).',' Darbutas yra lietuvių kilmės vardas.'),(513,'Darė','Darė – (2) liet., trumpinys iš mot. v. su Dar-: Dargailė, Dargintė, Dartautė ir kt.',' Darė yra lietuvių kilmės vardas.'),(514,'Darata','Vardadienis: Vasario 6 d., spalio 30 d.',' Darata yra graikų kilmės vardas.'),(515,'Danutė','Danutės savo profesijose labai specializuojasi ir tampa savo amato profesionalėmis . Stropios, atkaklios užtat dažnai pasirenka politikės karjerą.',' Danutė yra hebrajų, lietuvių kilmės vardas.'),(516,'Danys',' (4), (2) liet. trumpinys iš Danielius',' Danys, Danius yra  kilmės vardas.'),(517,'Danielius','Danieliai nesukurti vakarėliams, jie mieliau renkasi draugų ratą, keliones , turizmą. Puiki jų intuicija, kuri apsaugo juos nuo gyvenimo klaidingų posūkių.',' Danielius yra hebrajų kilmės vardas.'),(518,'Danguolė','Danguolių loginis mąstymas – gyvenimo dovana. Jos gali tapti puikiomis psichologėmis , medikėmis.',' Danguolė yra lietuvių kilmės vardas.'),(519,'Dangirutis','Dangirutis – (2) liet., sen. var. Dangerutis, trump. Dangiras, Dangis, iškreiptas iš Daugirutis.',' Dangirutis yra lietuvių kilmės vardas.'),(520,'Dartautas','Dartautas – (1) liet., trump. Daras, Darys, Darius, dar- (žr. Darbutas) + taut- ( : liet. taut-a).',' Dartautas yra lietuvių kilmės vardas.'),(521,'Darminta',' (3a), (1), (1) liet., trump. Darė, iš vyr. v. Darmintas',' Darminta, Darminta, Darmintė yra  kilmės vardas.'),(522,'Darmintas','Darmintas – (1) liet., trump. Daras, Darys, Darius, dar- (žr. Dar-butas) + mint- (: liet. minti, mint-is).',' Darmintas yra lietuvių kilmės vardas.'),(523,'Darmantas','Darmantas – (1) liet., trump. Daras, Darys, Darius: dar- (žr. Darbutas) + mant- (: liet. mant-us „sumanus“).',' Darmantas yra lietuvių kilmės vardas.'),(524,'Darmantė','Darmantė – (1) liet., trump. Darė, iš vyr. v. Darmantas.',' Darmantė yra lietuvių kilmės vardas.'),(525,'Darkintas','Darkintas – (l) liet., trump. Daras, Darys, Darius, dar- (žr. Dar-butas) + kint- (: liet. su balsių kaita iš kent-: kentėti, plg. žiem-kintis).',' Darkintas yra lietuvių kilmės vardas.'),(526,'Darkinta',' (3a), (1), (1) liet., trump. Darė, iš vyr. v. Darkintas',' Darkinta, Darkinta, Darkintė yra  kilmės vardas.'),(527,'Darius','Dariams namai – tai jų tvirtovė, kurioje jie turi jaustis saugūs, atsipalaidavę. Savo gerbūvio kūrimui gali paaukoti pusę gyvenimo.',' Darius yra graikų kilmės vardas.'),(528,'Darijus','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Darijus yra graikų kilmės vardas.'),(529,'Darija','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Darija yra graikų kilmės vardas.'),(530,'Dargvilė','Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Dargvilė yra lietuvių kilmės vardas.'),(531,'Dargiris',' Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Dargiris yra lietuvių kilmės vardas.'),(532,'Dargvainė','Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. ',' Dargvainė yra lietuvių kilmės vardas.'),(533,'Dargirė',' Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Dargirė yra lietuvių kilmės vardas.'),(534,'Darginta',' (3a), (1), (1) liet., trump. Darė, Dargė, iš vyr. v. Dargintas',' Darginta, Darginta, Dargintė yra  kilmės vardas.'),(535,'Daugaudas','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Daugaudas yra lietuvių kilmės vardas.'),(536,'Daugardas','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas.Mėgstate discipliną ir tvarką, konservatyvūs ir pedantiški, stengiatės palaikyti bendrai priimtas tradicijas ir tvarką.Kai kurie esate avantiūristai, nuotykių ieškotojai, užsispyrę žaidėjai : gyvenimas – teatras.',' Daugardas yra lietuvių kilmės vardas.'),(537,'Dauga',' (4), (2) liet., trumpinys iš v. su Daug-, Dau-g-, Daugailė, Daugaudė, Daugvydė, Daugvilė ir kt.',' Dauga, Daugė yra  kilmės vardas.'),(538,'Daubaras','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Daubaras yra lietuvių kilmės vardas.'),(539,'Daubara',' (3b), (1), (1) liet., trump. Daubė, iš vyr. v. Daubaras ',' Daubara, Daubara, Daubarė yra  kilmės vardas.'),(540,'Dasys',' (4), (2) liet. trumpinys iš Dasijus',' Dasys, Dasius yra  kilmės vardas.'),(541,'Dasijus','Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų.',' Dasijus yra graikų kilmės vardas.'),(542,'Darvilė','Darvilė – (1), (2) liet.