ia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Daugilas yra lietuvių kilmės vardas.'),(563,'Daukanta',' (3b), (1), (1) liet., trump. Dauka, Daukė, iš vyr. v. Daukantas',' Daukanta, Daukanta, Daukantė yra  kilmės vardas.'),(564,'Daugenė','Daugenė – (2) liet., trump. Dauga, Daugė, iš vyr. v. Daugenis.',' Daugenė yra lietuvių kilmės vardas.'),(565,'Daujota',' (3b), (1), (1) liet., trump. Dauja, Daujė, iš vyr. v. Daujotas',' Daujota, Daujota, Daujotė yra  kilmės vardas.'),(566,'Daujotas','Daujotams vertėtų daugiau padirbėti darbą, kuriam puikiai sugeba vadovauti. Jie puikūs lyderiai daugelyje profesijų, bet prasti darbininkai , nes giliai tiki, kad esa gimę vadovauti.',' Daujotas yra lietuvių kilmės vardas.'),(567,'Daugėlas','Šis vardas stiprina Jūsų žinių troškimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Daugėlas yra lietuvių kilmės vardas.'),(568,'Daugvinas','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę. Atsiranda noras veikti ryžtingiau. ',' Daugvinas yra lietuvių kilmės vardas.'),(569,'Daugvina','Daugvarda, Daugvarda, Daugvardė',' Daugvina, Daugvina, Daugvinė yra  kilmės vardas.'),(570,'Daugvilė','Jus jau nebe taip lengva apkvailinti.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Daugvilė yra lietuvių kilmės vardas.'),(571,'Daugvilas','Jus jau nebe taip lengva apkvailinti.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Daugvilas yra lietuvių kilmės vardas.'),(572,'Daugvydas','Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai. ',' Daugvydas yra lietuvių kilmės vardas.'),(573,'Daugvyda','Daugminta, Daugminta, Daugmintė',' Daugvyda, Daugvyda, Daugvydė yra  kilmės vardas.'),(574,'Daugvardas','Daugvardas – (1) liet., trump. Daugas, Daugys, daug- (žr. Daugmantas) + vard- (: liet. vard-uoti „burti“).',' Daugvardas yra lietuvių kilmės vardas.'),(575,'Daugutė','Daugminta, Daugminta, Daugmintė',' Daugutė yra  kilmės vardas.'),(576,'Daugvarda','Daugminta, Daugminta, Daugmintė',' Daugvarda, Daugvarda, Daugvardė yra  kilmės vardas.'),(577,'Daugturas','Daugturas – (1) liet., trump. Daugas, Daugys, daug- (žr. Daugmantas) + tur- (: liet. tur-ėti).',' Daugturas yra lietuvių kilmės vardas.'),(578,'Daugtura','Daugvarda, Daugvarda, Daugvardė',' Daugtura, Daugtura, Daugturė yra  kilmės vardas.'),(579,'Daugotė','Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių. Dažniausiai Jūs intelektualinio darbo atstovai. ',' Daugotė yra lietuvių kilmės vardas.'),(580,'Dautartas','Dautartas – (1) liet., trump. Dautas, Dautys, dau- (žr. Daubaras) + tart- (: liet. tart–as, tarti)',' Dautartas yra lietuvių kilmės vardas.'),(581,'Dautarta',' (3b), (1), (1) liet., trump. Dauta, Dautė, iš vyr. v. Dautartas',' Dautarta, Dautarta, Dautartė yra  kilmės vardas.'),(582,'Dautaras','Dautaras – (1) liet. trump. Dautas, Dautys, dau- (žr. Daubaras) + tar- (: liet. tar-ti, tar-ia).',' Dautaras yra lietuvių kilmės vardas.'),(583,'Dautara',' (3b), (1), (1) liet., trump. Dauta, Dautė, iš vyr. v. Dautaras ',' Dautara, Dautara, Dautarė yra  kilmės vardas.'),(584,'Daunora',' (3b), (1), (1) liet., trump. Dauna, Daunė, iš vyr. v. Daunoras',' Daunora, Daunora, Daunorė yra  kilmės vardas.'),(585,'Daunoras','Daunoras – (1) liet., trump. Daunas, Daunys, dau- (žr. Daubaras) + nor- (: liet. nor-ėti, nor-as).',' Daunoras yra lietuvių kilmės vardas.'),(586,'Dauminta',' (3b), (1), (1) liet., trump. Dauma, Daumė, iš vyr. v. Daumintas',' Dauminta, Dauminta, Daumintė yra  kilmės vardas.'),(587,'Daumintas','Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus.',' Daumintas yra lietuvių kilmės vardas.'),(588,'Daumilė','Daumilė – (1), (2) liet., trump. Dauma, Daumė, iš vyr. v. Daumilas.',' Daumilė yra lietuvių kilmės vardas.'),(589,'Daumilas','Daumilas – (1) liet., trump. Daumas, Daumys, dau- (žr. Daubaras) + mil- (: liet. pa-mil-ti).',' Daumilas yra lietuvių kilmės vardas.'),(590,'Daumantė','Daumantės, turėdamos nepriekaištingą intelektą, tiesiai į akis rėžia savo nuomonę. Tai daro labai kategoriškai, visiškai nesiklausydamos kitų patarimų. Potraukis – žavėtis savimi.',' Daumantė yra lietuvių kilmės vardas.'),(591,'Daumantas','Daumantas – (1) liet., trump. Daumas, Daumys, dau- (žr. Daubaras) + mant- (žr. Darmantas).',' Daumantas yra lietuvių kilmės vardas.'),(592,'Daukinta',' (3b), (1), (1) liet. ir prūs., trump. Dauka, Daukė, iš vyr. v. Daukintas',' Daukinta, Daukinta, Daukintė yra  kilmės vardas.'),(593,'Daukintas','Daukintas – (1) liet. ir prūs., trump. Daukas, Daukys, dau- (žr. Daubaras) + kint- (žr. Darkintas).',' Daukintas yra lietuvių kilmės vardas.'),(594,'Daukantas','Daukantas – (1) liet., trump. Daukas, Daukys, dau- (žr. Daubaras) + kant- (: liet. pa-kant–tus, kant-rus).',' Daukantas yra lietuvių kilmės vardas.'),(595,'Dirmantė','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Dirmantė yra lietuvių kilmės vardas.'),(596,'Dionyzas','',' Dionyzas, Dionizas yra  kilmės vardas.'),(597,'Dirmantas','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Dirmantas yra lietuvių kilmės vardas.'),(598,'Diksas','Diksas – (2) vak. liet. trumpinys iš Bendiksas, žr. Benediktas.',' Diksas yra lietuvių kilmės vardas.'),(599,'Dinga','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Dinga yra lietuvių kilmės vardas.'),(600,'Digna','Digna – (2) lot, iš lot. Digna: lot. digna „verta“',' Digna yra lotynų kilmės vardas.'),(601,'Diana','Dianas traukia ugnis, todėl gali pasirinkti visai nemoterišką metalurgės profesiją. Visiškai netinka specialybės susietos su daugybe smulkmenų ar rutiniškos.',' Diana yra lotynų kilmės vardas.'),(602,'Deziderijus','Deziderijus – (1) lot., trump. Dezideras, iš lot. Desiderius: lot. desiderium „laukimas, troškimas“.',' Deziderijus yra lotynų kilmės vardas.'),(603,'Denys','Denys – (4) liet. trumpinys iš Dionyzas.',' Denys yra lietuvių kilmės vardas.'),(604,'Deimilas','Deimilas – (1) liet., trump. Deimas, Deimys, dei- (žr. Deimantas) + mil- (žr. Daumilas).',' Deimilas yra lietuvių kilmės vardas.'),(605,'Deimilė','Deimilė – (1), (2) liet., trump. Deimė, iš vyr. v. Deimilas.',' Deimilė yra lietuvių kilmės vardas.'),(606,'Deimena','Deimena – (3b) liet., trump. Deimė, iš upėvardžio Deimena (buv. Rytprūsiuose).',' Deimena yra lietuvių kilmės vardas.'),(607,'Deimantas','Deimantas – (1) liet., trump. Deimas, Deimys, dei- (: liet. deivis, deivė) + mant- (žr. Darmantas).',' Deimantas yra lietuvių kilmės vardas.'),(608,'Deimantė','Deimantės – nedrausmingos, neretai gali pasielgti lengvabūdiškai dėl savo charakterio tokių savybių kaip: impulsyvumas, vėjavaikiškumas. Gyvenime linkusios eksperimentuoti todėl vienu gyvenimo partneriu neapsiriboja.',' Deimantė yra lietuvių kilmės vardas.'),(609,'Debora','Debora – (2) hebr., baž. lot. Debora, kuris iš hebr. Debora – „bitė“.',' Debora yra hebrajų kilmės vardas.'),(610,'Dona','',' Dona, Donė yra  kilmės vardas.'),(611,'Domitas','Domitas – (1) lot., trump. Domas, Domis, iš lot. Domitus: lot. domitus „sutramdytas“.',' Domitas yra lotynų kilmės vardas.'),(612,'Dominykas','Dominykai turi retą šiais laikais savybę – auksines rankas. Tiktai tereikia užsiminti, kad nebėga vanduo iš čiaupo , ar tolete vanduo nenusileidžia jie kaip mat pulsis tvarkyti ir sutvarkys.',' Dominykas yra lotynų kilmės vardas.'),(613,'Dominyka','Dominykos vardadienį globoja Neptūnas, kuris suteikia svajingumo, Neptūnas apgaubtas mistika, tai reiškia, kad Dominykos gali turėti ir atgamtiškų galių, gali matyti daugiau nei mato kiti. Įsiklausykite į jų sapnus.',' Dominyka yra lotynų kilmės vardas.'),(614,'Domilė','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Domilė yra lietuvių kilmės vardas.'),(615,'Domilas','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Domilas yra lietuvių kilmės vardas.'),(616,'Domicė','Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Domicė yra lietuvių kilmės vardas.'),(617,'Dovas','Dovydams reikėtų išmokti atleisti, vengti kvailų poelgių ir įpročių, tokių, kaip persivalgymo, įsitraukimo į girtuoklystę ar palaidą gyvenimą.',' Dovas yra hebrajų kilmės vardas.'),(618,'Domas','Dominykai mieliau dirba sau, nepaisant darbo pobūdžio (verslas ar intelektualus darbas). Jiems dažnokai gresia susirgti cukralige.',' Domas yra lotynų kilmės vardas.'),(619,'Domantė',' (1) liet., trump. Domė, iš vyr. v. Domantas',' Domantė yra lietuvių kilmės vardas.'),(620,'Dovaldė','Vardadienis: Rugsėjo 7 d., spalio 16 d.',' Dovaldė yra lietuvių kilmės vardas.'),(621,'Dovaldas','Dovaldas – (1) liet., trump. Dovas, do- (žr. Domantas) + vald- (: liet. vald-yti).',' Dovaldas yra lietuvių kilmės vardas.'),(622,'Domantas','Domantai dėl gerų savo savybių ir organizacinių sugebėjimų gana aukštai iškyla, įgyja turto ir garbės, teisingai ir tauriai naudojasi savo prakilnumu. Daug nuveikia įvairiose darbo ir mokslo srityse. Šeimoje laimingi, geri vyrai ir savo vaikų auklėtojai.',' Domantas yra lietuvių kilmės vardas.'),(623,'Doma',' (2) liet. trumpinys iš Domicėlė',' Doma, Domė yra  kilmės vardas.'),(624,'Dovainė','Šis vardas simbolizuoja norą imtis naujų idėjų ir jas įgyvendinti. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių, imlus ir nepriklausomas, turite stiprią valią ir intuiciją. ',' Dovainė yra lietuvių kilmės vardas.'),(625,'Dovaidė','Dovaidė – (1) liet., trump. Dovė, iš vyr. v. Dovaidas.',' Dovaidė yra lietuvių kilmės vardas.'),(626,'Doloresa','Jus ne taip paprasta pažeisti; labai pasitikite savimi. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Doloresa yra ispanų kilmės vardas.'),(627,'Dovaidas','Dovaidas – (1) liet., trump. Dovas, do- (žr. Domantas) + vaid- (: liet. vaid-ytis, vaid-entis „rodytis“).',' Dovaidas yra lietuvių kilmės vardas.'),(628,'Dobilė','Dobilė – (1) liet., iš vyr. v. Dobilas.',' Dobilė yra lietuvių kilmės vardas.'),(629,'Dorotėjas','Tai – galingas vardas, suteikiantis Jums gero lyderio savybių. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo.',' Dorotėjas yra graikų kilmės vardas.'),(630,'Dobilas','Dobilas – (3a) liet.: liet. dobilas.',' Dobilas yra lietuvių kilmės vardas.'),(631,'Dora',' (2) liet. trumpinys iš Dorotėjas ir Teodoras',' Dora, Dorė yra  kilmės vardas.'),(632,'Doras',' (2), (4) liet. trumpinys iš Dorotėjas ir Teodoras',' Doras, Dorys yra prūsų kilmės vardas.'),(633,'Donatilė','Donatilė – (2) lot., trump. Donata, Dona, iš lot. Donatilla, kuris yra priesagos -illa (mažyb.) vedinys iš Donata.',' Donatilė yra lotynų kilmės vardas.'),(634,'Donatas','Donatai tikrai geri psichologai, gydytojai, žiniuoniai. Bet jie geriau renkasi darbą, kuriame rezultatas apčiuopiamas , užtat retai jie tampa patarėjais , gydytojais, ar politikais. ',' Donatas yra lotynų kilmės vardas.'),(635,'Dromantas','Donata – (1) liet., trump. Dramas, dro- iš drov- (: liet. drov-us) + mant- (žr. Darmantas).',' Dromantas yra lietuvių kilmės vardas.'),(636,'Donata','Donatos tikrai geri psichologai, gydytojai, žiniuoniai. Bet jos geriau renkasi darbą, kuriame rezultatas apčiuopiamas , užtat retai jos tampa patarėjomis , gydytojomis, ar politikėmis. ',' Donata yra lotynų kilmės vardas.'),(637,'Donardas','Donardas – (1) kelt., trump. Donas, Donis, iš sulotyninto pranc. Donardus, kuris iš keltų v. Duenerth — „dievo galybė“.',' Donardas yra keltų kilmės vardas.'),(638,'Dravys','Šis vardas stiprina Jūsų lyderio, vedlio sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas.Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Dravys yra lietuvių kilmės vardas.'),(639,'Donaldas','Donaldai privalo kovoti su tokiomis silpnybėmis, kaip rūkymas, alkoholis ir narkotikai. Kitaip jie pražus. ',' Donaldas yra keltų kilmės vardas.'),(640,'Dravenis','Dravenis – (2) liet. ir prūs., trump. Dravys, priesagos -enis vedinys iš sen. avd. Dravys.',' Dravenis yra lietuvių kilmės vardas.'),(641,'Dravenė','Dravenė – (2) liet. ir prūs., trump. Dravė, iš vyr. v. Dravenis.',' Dravenė yra lietuvių kilmės vardas.'),(642,'Donalda','Donaldai privalo kovoti su tokiomis silpnybėmis, kaip rūkymas, alkoholis ir narkotikai. Kitaip jie pražus. ',' Donalda yra keltų kilmės vardas.'),(643,'Draudvilas','Šis vardas stiprina Jūsų žinių troškimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Draudvilas yra lietuvių kilmės vardas.'),(644,'Draudvilė','Šis vardas stiprina Jūsų žinių troškimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Draudvilė yra lietuvių kilmės vardas.'),(645,'Drąsutis',' (2) liet., trump. Drąsius, priesagos -utis vedinys iš avd. Drąsius',' Drąsutis yra lietuvių kilmės vardas.'),(646,'Drąsius','Drąsius – (2) liet.: liet. drąsus.',' Drąsius yra lietuvių kilmės vardas.'),(647,'Drąsutė','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę. Atsiranda noras veikti ryžtingiau. ',' Drąsutė yra lietuvių kilmės vardas.'),(648,'Dovilta',' (3a), (1), (1) liet., trump. Dovė, iš vyr. v. Doviltas',' Dovilta, Dovilta, Doviltė yra  kilmės vardas.'),(649,'Doviltas','Jus jau nebe taip lengva apkvailinti.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Doviltas yra lietuvių kilmės vardas.'),(650,'Dovilė','Dovilės seksualios ir gražios. Gera su jomis bendrauti, kadangi jos moka išklausyti, nekenčia kai jas pertraukia pokalbio metu ir kitų nepertraukinėja. Tai vyrus žavi, jie Dovilėse mato kitokią moterį. Tačiau ištekėti tikrai neskuba, ilgai renkasi savo princą.',' Dovilė yra lietuvių kilmės vardas.'),(651,'Dovilas','Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai.',' Dovilas yra lietuvių kilmės vardas.'),(652,'Dovydas','Dovydai turi retą šiais laikais savybę – auksines rankas. Tiktai tereikia užsiminti, kad nebėga vanduo iš čiaupo, ar tualete vanduo nenusileidžia,- jie kaip mat puls tvarkyti ir, žinoma, sutvarkys.',' Dovydas yra hebrajų kilmės vardas.'),(653,'Dovė',' (1) liet., trumpinys iš mot. v. Dovaidė, Dovainė, Dovilė ir kt.',' Dovė yra lietuvių kilmės vardas.'),(654,'Džiugintas','Džiugintas – (1) liet., trump. Džiugas, Džiugys, džiu- iš džiug- (žr. Džiugailas) + gint- (žr Daugintas).',' Džiugintas yra lietuvių kilmės vardas.'),(655,'Džiuginta',' (3b), (1), (1) liet., trump. Džiuga, Džiugė, iš vyr. v. Džiugintas',' Džiuginta, Džiuginta, Džiugintė yra  kilmės vardas.'),(656,'Džiugilė','Džiugilė – (1), (2) liet., trump. Džiugė, iš vyr. v. Džiugilas.',' Džiugilė yra lietuvių kilmės vardas.'),(657,'Džiugenis',' (2) liet., trump. Džiugas, Džiugys, priesagos -enis vedinys iš v. Džiugas',' Džiugenis yra lietuvių kilmės vardas.'),(658,'Džiugilas',' (1) liet., trump. Džiugas, Džiugys, priesagos -ilas vedinys iš v. Džiugas',' Džiugilas yra  kilmės vardas.'),(659,'Džiugas','Vardadienis: Sausio 22 d., gegužės 8 d.',' Džiugas yra lietuvių kilmės vardas.'),(660,'Džiugenė','Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių. Dažniausiai Jūs intelektualinio darbo atstovai.',' Džiugenė yra lietuvių kilmės vardas.'),(661,'Džiugailė','Džiugailė – (1) liet., trump. Džiuga, Džiugė, iš vyr. avd. Džiugaila, žr. Džiugailas.',' Džiugailė yra lietuvių kilmės vardas.'),(662,'Džiugailas','Džiugailas – (1) liet., sen. var. Džiugaila, trump. Džiugas, džiu- kilęs iš džiug- (: liet. nu-džiug-ti, džiug-us) + gail- (žr. Dargailas).',' Džiugailas yra lietuvių kilmės vardas.'),(663,'Džiuga','',' Džiuga, Džiugė yra  kilmės vardas.'),(664,'Dzidorius','Dzidorius – (1) liet. trumpinys iš Izidorius.',' Dzidorius yra lietuvių kilmės vardas.'),(665,'Drovyda',' (3a), (1), (1) liet., trump. Drovė, iš vyr. v. Drovydas',' Drovyda, Drovyda, Drovydė yra  kilmės vardas.'),(666,'Drovydas','Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus.',' Drovydas yra lietuvių kilmės vardas.'),(667,'Dromantė','Dromantė – (1) liet., trump. Dromė, iš vyr. v. Dromantas.',' Dromantė yra lietuvių kilmės vardas.'),(668,'Eda','Eda – (2) germ., trumpinys iš Edita.',' Eda yra germanų kilmės vardas.'),(669,'Egidė','Egidė – (2) trump. Egė, Gidė, – liet. trumpinys iš Egidija.',' Egidė yra graikų kilmės vardas.'),(670,'Egidas','Egidas – (2) trump. Egys, Egis, Gidas, Gidis, -liet. trumpinys iš Egidijus.',' Egidas yra graikų kilmės vardas.'),(671,'Egbertas','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Egbertas yra vokiečių kilmės vardas.'),(672,'Edvinas','Edvinas – (1) angl., trump. Edvis, Edis, iš sulotyninto anglų Edvinus, Aeduinus, kuris iš sen. angl. Eadwine: sen. angl. ead „turtas“ + wine „draugas“.',' Edvinas yra anglų kilmės vardas.'),(673,'Eduardas',' (1) angl., trump. Edas, Edis, tarm. Advdrda dz., Advardas ryt. aukšt., Adzius vak. aukšt., Edzys, Edzis, Edzė piet. žem., Edzius, Edžius vak. žem., iš sulotyninto anglų Eduardus, kuris iš sen. angl. Eadward: sen. angl. ead „turtas“ + ward „saugotojas“',' Eduardas, Edvardas yra  kilmės vardas.'),(674,'Edvina','Edvina – (2), (1) angl., trump. Edvė, Eda, iš vyr. v. Edvinus, žr. Edvinas.',' Edvina yra anglų kilmės vardas.'),(675,'Eduarda',' (1) angl., trump. Eda, iš vyr. v. Eduardus, žr. Eduardas',' Eduarda, Edvardė yra  kilmės vardas.'),(676,'Eidė','Eidė – (2) liet., trumpinys iš mot. v. su Ei-d-, Eid- : Eidgintė, Eidimtė, Eidminė ir kt.',' Eidė yra lietuvių kilmės vardas.'),(677,'Eidas',' (2), (4) liet., trumpinys iš avd. su Ei-d-, Eid-: Eidgintas, Eidimtas, Eidminas ir kt.',' Eidas, Eidys yra  kilmės vardas.'),(678,'Edmundė','Edmundė – (1) angl., trump. Edma, Edė, tarm. Edė, Edužė, Edušė vak. liet., iš vyr. v. Edmundus, žr. Edmundas.',' Edmundė yra anglų kilmės vardas.'),(679,'Edmundas','Edmundai puikūs verslininkai, politikai, valtybinio darbo atstovai. Edmundams privalu vengti alkoholio ir narkotikų; tramdyti savo cholerišką charakterį.',' Edmundas yra anglų kilmės vardas.'),(680,'Edmas','Edmas – (2) liet. trumpinys iš Edmundas.',' Edmas yra lietuvių kilmės vardas.'),(681,'Eidargė','Eidargė – (1) liet., trump. Eidė, iš vyr. v. Eidardas.',' Eidargė yra lietuvių kilmės vardas.'),(682,'Eidargas','Eidargas – (1) liet., trump. Eidas, Eidys, ei-(žr. Eibaras) + darg- (: latv. dargs „brangus“).',' Eidargas yra lietuvių kilmės vardas.'),(683,'Edma','Edma – (2) liet. trumpinys iš Edmundė.',' Edma yra anglų kilmės vardas.'),(684,'Eibutė','Eibutė – (1) liet. ir prūs., trump. Eibė, iš vyr. v. Eibutas.',' Eibutė yra prūsų kilmės vardas.'),(685,'Edita','Editų karjera – biznio sritys, jos puikiai žino koks turi būti vadovas.',' Edita yra anglų kilmės vardas.'),(686,'Eibutas','Eibutas – (1) liet. ir prūs., trump. Eibas, Eibis, ei- (žr. Eibaras) + būt- (: liet. but-as, būti).',' Eibutas yra prūsų kilmės vardas.'),(687,'Edgardas',' (1) ital., trump. Edas, Edis, iš v. Edgarus itališko varianto Edgardo, plg. Edgaras',' Edgardas, Edgardas yra  kilmės vardas.'),(688,'Eidotas','Eidotas – (1) liet., trump. Eidas, Eidys, priesagos -otas vedinys iš sen. trump. Eidas, kuris iš avd. su Eid-: Eidgintas, Eidminas, Eidvydas ir kt.',' Eidotas yra lietuvių kilmės vardas.'),(689,'Eibartė','Eibartė – (1) liet., trump. Eibė, iš vyr. v. Eibartas.',' Eibartė yra lietuvių kilmės vardas.'),(690,'Eidminas','Eidminas – (1) liet., trump. Eidas, Eidys, eid-(žr. Eidgintas) + min- (: liet. min-ėti).',' Eidminas yra lietuvių kilmės vardas.'),(691,'Eibartas','Eibartas – (1) liet., trump. Eibas, Eibis, ei- (žr. Eibaras) + bart- (: liet. barti – sen. reikšme „kovoti“, plg. rus. bor-otjsia „kovoti).',' Eibartas yra lietuvių kilmės vardas.'),(692,'Edgaras','Edgarai gyvenime pasiekia labai daug. Jie reikalauja absoliučios asmeninės laisvės ir nepakenčia kitų kišimosi į jų reikalus.',' Edgaras yra anglų kilmės vardas.'),(693,'Eidmina',' (3b), (1), (1) liet., trump. Eidė, iš vyr. v. Eidminas',' Eidmina, Eidmina, Eidminė yra  kilmės vardas.'),(694,'Eibara',' (3b), (1), (1) liet., trump. Eibė, iš vyr. v. Eibaras',' Eibara, Eibara, Eibarė yra  kilmės vardas.'),(695,'Edas',' (2) liet. trumpinys iš Edvardas ir kt.',' Edas, Edis yra  kilmės vardas.'),(696,'Eidmantė','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Eidmantė yra lietuvių kilmės vardas.'),(697,'Eibaras','Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Eibaras yra lietuvių kilmės vardas.'),(698,'Eidmantas','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Eidmantas yra lietuvių kilmės vardas.'),(699,'Egmontas','Egmontas – (1) germ., trump. Egis, iš germ. Egmont, kuris iš sen. germ. Egmunt: sen. vok. aukšt. ecka „kardas“ + munt „apsauga, gynėjas“.',' Egmontas yra vokiečių kilmės vardas.'),(700,'Eglė','Eglės žino kaip vyrą gerbti, užtat puikios šeimos moterys. Gimus vaikui jos pasišvenčia savo šeimai.',' Eglė yra lietuvių kilmės vardas.'),(701,'Eidintė','Eidintė – (1) liet., trump. Eidė, iš vyr. v. Eidintas.',' Eidintė yra lietuvių kilmės vardas.'),(702,'Egilas','Egilas – (1), (2) germ., trump. Egys, Egis, Gilas, iš germ. trumpinio, kuris iš germ. v. Agilbert: sen. vok. aukšt. agil „skydas“ + beraht „garsus, žymus“',' Egilas yra vokiečių kilmės vardas.'),(703,'Eidintas','Eidintas – (1) liet., trump. Eidas, Eidys, priesagos -intas vedinys iš sen. trump. Eidas, kuris iš v. su Ei-d-, Eid-: Eidgintas, Eidimtas, Eidminas ir kt.',' Eidintas yra lietuvių kilmės vardas.'),(704,'Egidijus','Egidijai dėl savo neryžtingumo dažnai skursta. Jie domisi daug kuo, griebiasi šio bei to, bet pradėto darbo nemoka užbaigti. Kol sugalvoja naują, liūdi ir nieko neveikia.',' Egidijus yra graikų kilmės vardas.'),(705,'Eidinas','Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs. ',' Eidinas yra lietuvių kilmės vardas.'),(706,'Egidija','Egidijos dėl savo neryžtingumo dažnai skursta. Jie domisi daug kuo, griebiasi šio bei to, bet pradėto darbo nemoka užbaigti. Kol sugalvoja naują, liūdi ir nieko neveikia.',' Egidija yra graikų kilmės vardas.'),(707,'Eidinė','Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Eidinė yra lietuvių kilmės vardas.'),(708,'Eidimtė','Šio vardo savininkai sugeba ilgam laikui prie ko nors prisirišti, tačiau jų partneriai dažnai pavargsta nuo emocinio jų nestabilumo. Šių žmonių stiprus energetinis laukas, jūs norite vadžias imti į savo rankas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas.',' Eidimtė yra lietuvių kilmės vardas.'),(709,'Eidimtas','Šio vardo savininkai sugeba ilgam laikui prie ko nors prisirišti, tačiau jų partneriai dažnai pavargsta nuo emocinio jų nestabilumo. Šių žmonių stiprus energetinis laukas, jūs norite vadžias imti į savo rankas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas.',' Eidimtas yra lietuvių kilmės vardas.'),(710,'Eidgintas','Tai – galingas vardas, suteikiantis Jums gero lyderio, vadovo savybių. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. ',' Eidgintas yra lietuvių kilmės vardas.'),(711,'Eigantas','Eigantas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gant- (: liet. ginti, gan-yti „saugoti“).',' Eigantas yra lietuvių kilmės vardas.'),(712,'Eiganta',' (3b), (1), (1) liet., trump. Eigė, iš vyr. v. Eigantas',' Eiganta, Eiganta, Eigantė yra  kilmės vardas.'),(713,'Eidginta',' (3b), (1), (1) liet. trump. Eidė, iš vyr. v. Eidgintas',' Eidginta, Eidginta, Eidgintė yra  kilmės vardas.'),(714,'Eidenis','Eidenis – (2) liet., trump. Eidas, Eidys, priesagos -enis vedinys iš sen. trump. Eidas, kuris iš avd. su Ei-d-, Eid-: Eidgintas, Eidimtas, Eidminas ir kt.',' Eidenis yra lietuvių kilmės vardas.'),(715,'Eigailė','Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį. ',' Eigailė yra prūsų kilmės vardas.'),(716,'Eigailas','Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį. ',' Eigailas yra prūsų kilmės vardas.'),(717,'Eidenė','Eidenė – (2) liet., trump. Eidė, iš vyr. v. Eidenis.',' Eidenė yra lietuvių kilmės vardas.'),(718,'Eidvinas','Norėtumėte dalyvauti politiniuose judėjimuose, Jus traukia psichologija ir spiritizmo praktika. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eidvinas yra lietuvių kilmės vardas.'),(719,'Eidvina',' (3b), (1), (1) liet., trump. Eidvė, iš vyr. v. Eidvinas',' Eidvina, Eidvina, Eidvinė yra  kilmės vardas.'),(720,'Eidvilė','Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eidvilė yra lietuvių kilmės vardas.'),(721,'Eidvilas','Tai – galingas vardas, suteikiantis Jums gero lyderio, vadovo savybių. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. ',' Eidvilas yra lietuvių kilmės vardas.'),(722,'Eidvydas','Eidvydas – (1) liet., trump. Eidvys, Eidvis, eid- (žr. Eidgintas) + vyd- (: liet. iš-vys-ti, iš-vyd-o).',' Eidvydas yra lietuvių kilmės vardas.'),(723,'Eidvyda',' (3b), (1), (1) liet., trump. Eidvė, iš vyr. v. Eidvydas',' Eidvyda, Eidvyda, Eidvydė yra  kilmės vardas.'),(724,'Eiginas','Eiginas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gin- (: liet. gin-ti „užstoti“).',' Eiginas yra lietuvių kilmės vardas.'),(725,'Eigina',' (3b), (1), (1) liet., trump. Eigė, iš vyr. v. Eiginas',' Eigina, Eigina, Eiginė yra  kilmės vardas.'),(726,'Eidvainė','Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį.',' Eidvainė yra lietuvių kilmės vardas.'),(727,'Eidvainas','Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį.',' Eidvainas yra lietuvių kilmės vardas.'),(728,'Eigilė','Norėtumėte dalyvauti politiniuose judėjimuose, Jus traukia psichologija ir spiritizmo praktika. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eigilė yra lietuvių kilmės vardas.'),(729,'Eigilas','Norėtumėte dalyvauti politiniuose judėjimuose, Jus traukia psichologija ir spiritizmo praktika. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eigilas yra lietuvių kilmės vardas.'),(730,'Eidravė','Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eidravė yra prūsų kilmės vardas.'),(731,'Eidravas','Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eidravas yra prūsų kilmės vardas.'),(732,'Eigydė','Eigydė – (1) liet., trump. Eigė, iš vyr. v. Eigydas.',' Eigydė yra lietuvių kilmės vardas.'),(733,'Eigydas','Eigydas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gyd- (: prus. sen. gydaut „gauti, pasiekti“, liet. geis-ti, geid-ė).',' Eigydas yra lietuvių kilmės vardas.'),(734,'Eigenis','Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eigenis yra lietuvių kilmės vardas.'),(735,'Eidotė','Šio vardo savininkai itin reiklūs sau pačiam ir kitiems. Nesprendžiate apie įvykius iš pirmo žvilgsnio. Jums prireiks daugiau laiko tobulėjimui. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eidotė yra lietuvių kilmės vardas.'),(736,'Eigenė','Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eigenė yra lietuvių kilmės vardas.'),(737,'Eigėlas','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eigėlas yra prūsų kilmės vardas.'),(738,'Eigėlė','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eigėlė yra prūsų kilmės vardas.'),(739,'Eigedas','Jus jau nebe taip lengva apkvailinti.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eigedas yra lietuvių kilmės vardas.'),(740,'Eigeda',' (3b), (1), (1) liet., trump. Eigė, iš vyr. v. Eigedas',' Eigeda, Eigeda, Eigedė yra  kilmės vardas.'),(741,'Eigė',' Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai. ',' Eigė yra lietuvių kilmės vardas.'),(742,'Eigaudas','Eigaudas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gaud- (: liet. gdud-yti, plg. gauti).',' Eigaudas yra lietuvių kilmės vardas.'),(743,'Eigauda',' (3b), (1), (1) liet., trump. Eigė, iš vyr. v. Eigaudas',' Eigauda, Eigauda, Eigaudė yra  kilmės vardas.'),(744,'Everardas','Šio vardo savininkas yra labai draugiškas, ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai ir populiarumas. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu. ',' Everardas yra vokiečių kilmės vardas.'),(745,'Evelina','Vardadienis: Gegužės 25 d., vasario 11 d., lapkričio 10 d. – Evelinos vardo diena.',' Evelina yra keltų kilmės vardas.'),(746,'Evaldas','Evaldų pasirinktas kelias daugiausia būna susijęs su informatika ir žiniasklaida, mokslo duomenų apdorojimu arba kelionėmis. Gana dažnai tokie žmonės tampa sportininkais.',' Evaldas yra vokiečių kilmės vardas.'),(747,'Evalda','Evaldų pasirinktas kelias daugiausia būna susijęs su informatika ir žiniasklaida, mokslo duomenų apdorojimu arba kelionėmis. Gana dažnai tokie žmonės tampa sportininkais.',' Evalda yra vokiečių kilmės vardas.'),(748,'Euzebijus','Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių.',' Euzebijus yra graikų kilmės vardas.'),(749,'Euzebija','Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių.',' Euzebija yra graikų kilmės vardas.'),(750,'Euzebas','Šių vardų savininkų sėkmė – būti kolektyve tarp žmonių, todėl tikriausiai jie labai gerai jaučiasi savo šeimoje.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jus traukia svaiginantys meilės nuotykiai ir pasirengimas bet kurią minutę pasinerti į eilinę avantiūrą. ',' Euzebas yra lietuvių kilmės vardas.'),(751,'Eutalija','Eutalija – (1) graik., trump. Eutalė, Talė, iš sulotyninto graik. Euthalia: graik. euthales „žydinti“.',' Eutalija yra lotynų kilmės vardas.'),(752,'Eutalė','Eutalė – (2) trump. Talė, — liet. trumpinys iš Eutalija.',' Eutalė yra lotynų kilmės vardas.'),(753,'Eustachas',' (2) liet. trumpinys iš Eustachijus',' Eustachas, Eustakas yra  kilmės vardas.'),(754,'Eustachijus','Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus. ',' Eustachijus yra graikų kilmės vardas.'),(755,'Eigirdas','Eigirdas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gird- (: liet. gird-ėti, gird-as „žinia“).',' Eigirdas yra lietuvių kilmės vardas.'),(756,'Eigintas',' (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gint- (: liet. ginti „užstoti“, gin-tas)',' Eigintas yra lietuvių kilmės vardas.'),(757,'Eigirda',' (3b), (1), (1) liet., trump. Eigė, iš vyr. v. Eigirdas',' Eigirda, Eigirda, Eigirdė yra  kilmės vardas.'),(758,'Eiginta',' (3b), (1), (1) liet., trump. Eigė, iš vyr. v. Eigintas',' Eiginta, Eiginta, Eigintė yra  kilmės vardas.'),(759,'Fulgis','Jūs puikiai žinote savo teises, nepajudinamą valios jėgą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. ',' Fulgis yra lietuvių kilmės vardas.'),(760,'Friderika',' (1) vok., trump. Frida, tarm. Pidrė vak. liet., baž. lot. Friderica iš vok. Friederike, kuris iš vyr. v. Friedrich, žr. Fridrikas',' Friderika, Fridrika yra  kilmės vardas.'),(761,'Fridrikas',' (1) vok., trump. Fridas, tarm. Pridrikis, Pridas, Pridžius, Bridžius, Pricas, Pričius, Pričkus vak. liet., baž. lot. Fridericus iš vok. Friedrich: sen. vok. aukšt. fridu „taika“ + richi „galingas (valdovas)“',' Fridrikas, Fridrichas yra  kilmės vardas.'),(762,'Fridas','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Fridas yra vokiečių kilmės vardas.'),(763,'Fredas','Fredas – (2) trumpinys iš Alfredas ir kt.',' Fredas yra vokiečių kilmės vardas.'),(764,'Frida','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Frida yra vokiečių kilmės vardas.'),(765,'Fortūnatas','Vardadienis: Vasario 27 d., gruodžio 24 d.',' Fortūnatas yra lotynų kilmės vardas.'),(766,'Fortūnata','Fortūnata – (2) lot., trump. Fortunė, Nata, iš lot. Fortūnata, kuris iš vyr. v. Fortunatus, žr. Fortūnatas.',' Fortūnata yra lotynų kilmės vardas.'),(767,'Florijonas','Kadangi Florijonai labai intelektualūs, todėl pasirenka rašytojo, dailininko, muzikanto, teatro kritiko profesijas. Ir dar, jie gali būti nuostabūs maisto gamintojai – virėjai.',' Florijonas yra lotynų kilmės vardas.'),(768,'Fabijus',' (1) lot., trump. Fabas, iš lot. Fabius, kuris iš romėnų sen. giminės vardo Fabius -„auginantis pupas“ : lot. faba „pupa“',' Fabijus yra lotynų kilmės vardas.'),(769,'Fausta','Faustos taupios, bet joms pinigai nėra taip aktualu kaip dvasiniai turtai. Faustos labai religingos, tikinčios karma.',' Fausta yra lotynų kilmės vardas.'),(770,'Fabijonas','Fabijonai myli gyvūnus, užtat puikiai jaučiasi gamtoje , net vabalas ant medžio šakos jiems suteikia malonumo. Šeimoje jie ramūs, tiki kad moteris šeimos židinys.',' Fabijonas yra lotynų kilmės vardas.'),(771,'Fabija','Fabijos rekomenduotina kaip amuletą nešioti mėlyną safyrą ant nuogo kūno, pakeičiant jį juodu perlu',' Fabija yra lotynų kilmės vardas.'),(772,'Gabrielius',' (2) hebr., trump. Gabras, Gabrys, Gabrius, tarm. Garbrelis, Gabrus piet.aukšt. (dz.), Gabris žem., baž. lot. Gabriel, kuris iš hebr. Gabhri’el — „dievo karys, dievas mano stiprybė“',' Gabrielius yra hebrajų kilmės vardas.'),(773,'Gabras',' (2), (4), (2) liet. trumpinys iš Gabrielius',' Gabras, Gabrys, Gabrius yra  kilmės vardas.'),(774,'Gabrė',' (2) liet. trumpinys iš Gabrielė',' Gabrė yra hebrajų kilmės vardas.'),(775,'Gabrielė',' (2) hebr., trump. Gabrė, tarm. Gabrilia, Gabrinia piet. aukšt. (dz.), baž. lot. Gabriela, kuris iš vyr. v. Gabhriel, žr. Gabrielius',' Gabrielė yra hebrajų kilmės vardas.'),(776,'Gabeta',' (1) liet., trump. Gabė, iš liet. mitologinės būtybės vardo Gabeta — židinio ugnies dievaitė: liet. gab- (žr. Gabija) + priesaga -ėta',' Gabeta yra  kilmės vardas.'),(777,'Gabija',' (4) liet., trump. Gabė, iš liet. mitologinės būtybės vardo Gabija — židinio ugnies dievaitė: liet. gab- (:liet. gab-ia-gobia, gobti „gaubti, dengti, glausti, guosti“) + priesaga -ija',' Gabija yra lietuvių kilmės vardas.'),(778,'Emilė',' (2) liet. trumpinys iš Emilija, tarm. Amilė ryt. aukšt., Amilia piet. aukšt. (dz.), v. Emilė trumpinys — Milė',' Emilė yra lotynų kilmės vardas.'),(779,'Emilija',' (1) lot., trump. Emilė, Milė, tarm. Amilė ryt. aukšt., Amilia piet. aukšt. (dz.), Mylė žem., iš lot. Aemilia, kuris iš vyr. v. Aemilius, žr. Emilijus',' Emilija yra lotynų kilmės vardas.'),(780,'Emilas','Emilas – (2) liet. trumpinys iš Emilijonas.',' Emilas yra lotynų kilmės vardas.'),(781,'Emerita','Emerita – (2) lot., trump. Emera, Ema, iš lot. Emerita: lot. emerita „nusipelniusi“.',' Emerita yra lotynų kilmės vardas.'),(782,'Emerikas','Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs. ',' Emerikas yra vokiečių kilmės vardas.'),(783,'Ema','Šio vardo savininkė labai tvarkinga moteris. Su ja nesutarsite jeigu atidėliosite problemų sprendimą, pastoviai vėluosite ar bandysite jai vadovauti. Šios moters nesutiksite grūstyje, bet ji visada žinos karščiausias naujienas. Ema vertins ramybę, stabilumą ir sunkiai pakęs miesto triukšmą.',' Ema yra hebrajų kilmės vardas.'),(784,'Elzė','Elzių loginis mąstymas – gyvenimo dovana. Jos gali tapti puikiomis psichologėmis , medikėmis.',' Elzė yra hebrajų kilmės vardas.'),(785,'Elžbieta','Elžbietų draugai dažniausiai biznieriai, rašytojai, literatai, žiniasklaidos darbuotojai. Savo kelią atranda švietimo sistemoje, finansinėje veikloje, prekybiniame biznyje, konsultacijų kontorose, labdaros veikloje. Turi nuostabių sugebėjimų. Puikios oratorės. Domisi metafizika.',' Elžbieta yra hebrajų kilmės vardas.'),(786,'Elvyras','Elvyras – (2) isp., trump. Elvas, Elvys, iš mot. v. Elvyra.',' Elvyras yra ispanų kilmės vardas.'),(787,'Elvinas',' (1) germ., trump. Elvas, Elvys, iš anglosaksų Elwin (vok. Alwin), kuris iš germ. Adalwin: sen. vok. aukšt. adal „kilmingas, kilnus“ + wini „draugas“',' Elvinas yra vokiečių kilmės vardas.'),(788,'Elvyra','Elvyros gali tapti kuo panorėjusios, bet turi rinktis darbą su žmonėmis. Gydytojos, advokatės, patarėjos, organizatorės. Darbas su žmonėmis – jų pašaukimas. Jos nepakeičiamos ten, kur reikalingas susitarimo menas.',' Elvyra yra ispanų kilmės vardas.'),(789,'Elvas',' (1), (3) liet. trumpinys iš Elvinas ir kt.',' Elvas, Elvys yra  kilmės vardas.'),(790,'Elvina','Elvina – (2) germ., trump. Elė, Elva, iš vyr. v. Elwin, žr. Elvinas.',' Elvina yra vokiečių kilmės vardas.'),(791,'Elva','Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį. ',' Elva yra vokiečių kilmės vardas.'),(792,'Elmis','Norėtumėte dalyvauti politiniuose judėjimuose, Jus traukia psichologija ir spiritizmo praktika. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Elmis yra lietuvių kilmės vardas.'),(793,'Erdgina',' (3b), (1), (1) liet., trump. Erdė, iš vyr. v. Erdginas',' Erdgina, Erdgina, Erdginė yra  kilmės vardas.'),(794,'Erdenis','Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Erdenis yra lietuvių kilmės vardas.'),(795,'Erdenė','Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Erdenė yra lietuvių kilmės vardas.'),(796,'Erdas',' (2), (4) liet., trumpinys iš avd. su Erd-: Erdvilas, ir kt.',' Erdas, Erdys yra  kilmės vardas.'),(797,'Erdė','Erdė – (2) liet., trumpinys iš mot. v. su Erd-: Erdvilė ir kt.',' Erdė yra lietuvių kilmės vardas.'),(798,'Erčius','Erčius – (2) var. Erdžius, — vak. liet. trumpinys iš Erdmonas (var. Ertmonas, Erkmonas), kuris iš vok. v. Erdmann — „žmogus iš žemės, žmogus“. Erdmann yra XVII a. vok. vertinys iš hebr. Adomas.',' Erčius yra lietuvių kilmės vardas.'),(799,'Erazmas','Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Erazmas yra graikų kilmės vardas.'),(800,'Erazma','Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Erazma yra graikų kilmės vardas.'),(801,'Enrikas','Šio vardo savininkai itin reiklūs sau pačiam ir kitiems. Nesprendžiate apie įvykius iš pirmo žvilgsnio. Jums prireiks daugiau laiko tobulėjimui. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Enrikas yra italų kilmės vardas.'),(802,'Ernestina','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Ernestina yra vokiečių kilmės vardas.'),(803,'Enrika','Kiekviena Enrika labai mėgsta keliauti, dėl to dažna šio vardo nešiotoja tampa poliglote ir lengvai įsisavina užsienio kalbas.',' Enrika yra italų kilmės vardas.'),(804,'Ernestas','Ernestai visgi tėra tiktai žmonės, todėl gresia pavojus, kad jie gali nukrypti į kraštutinumus ir praradę bet kokį realybės jausmą, gali tapti nepavojingais keistuoliais, amžinais svajotojais.',' Ernestas yra vokiečių kilmės vardas.'),(805,'Emilius','Emilius – (2) liet. trumpinys iš Emilijus.',' Emilius yra lietuvių kilmės vardas.'),(806,'Emilis','Vardadienis: Kovo 10 d., lapkričio 14 d.',' Emilis yra lotynų kilmės vardas.'),(807,'Ernesta','Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai.',' Ernesta yra vokiečių kilmės vardas.'),(808,'Erna','Šio vardo savininkas yra labai draugiškas, ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai ir populiarumas. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu.',' Erna yra vokiečių kilmės vardas.'),(809,'Emilijus','Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių. ',' Emilijus yra lotynų kilmės vardas.'),(810,'Erikas','Erikams šeima – tai jų namai, labai šeimyniški žmonės.',' Erikas yra vokiečių kilmės vardas.'),(811,'Emilijonas','Emilijonas – (2) lot., trump. Emilijus, Emilas, iš lot. Aemilianus, kuris yra priesagos -anus vedinys iš Aemilius, žr. Emilijus.',' Emilijonas yra lotynų kilmės vardas.'),(812,'Erika','Erikos, turėdamos nepriekaištingą intelektą, tiesiai į akis rėžia savo nuomonę. Tai daro labai kategoriškai, visiškai nesiklausydamos kitų patarimų. Potraukis – žavėtis savimi.',' Erika yra vokiečių kilmės vardas.'),(813,'Emilijona','Emilijona – (2) lot., trump. Emilija, Milė, tarm. Emilijonė žem., iš lot. Aemiliana, kuris iš vyr. v. Aemilianus, žr. Emilijonas.',' Emilijona yra lotynų kilmės vardas.'),(814,'Erdvilė','Erdvilė – (1), (2) liet., trump. Erdė, iš vyr. v. Erdvilas.',' Erdvilė yra lietuvių kilmės vardas.'),(815,'Erdvilas','Erdvilas – (1) liet., trump. Erdas, Erdys, erd- (: liet. erd-vė — sen. reikšme „laisvas žemės plotas“, plg. sen. vok. aukšt. erda „žemė“, sen. ind. ardha- „vieta, kraštas“) + vil- (žr. Eidvilas).',' Erdvilas yra lietuvių kilmės vardas.'),(816,'Erdmilas','Erdmilas – (1) liet., trump. Erdas, Erdmas, erd- (žr. Erdvilas) + mil- (žr. Eimilas).',' Erdmilas yra lietuvių kilmės vardas.'),(817,'Erdmilė','Erdmilė – (1), (2) liet., trump. Erdė, Erdmė, iš vyr. v. Erdmilas.',' Erdmilė yra lietuvių kilmės vardas.'),(818,'Erdmė','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Erdmė yra lietuvių kilmės vardas.'),(819,'Erdmas','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Erdmas yra lietuvių kilmės vardas.'),(820,'Erdmantė','Erdmantė – (1) liet., trump. Erdė, Erdmė, Mantė, iš vyr. v. Erdmantas.',' Erdmantė yra lietuvių kilmės vardas.'),(821,'Erdmantas','Erdmantas – (1) liet., trump. Erdas, Erdys, Erdmas, Mantas, erd- (žr. Erdvilas)+mant-(žr. Eidmantas).',' Erdmantas yra lietuvių kilmės vardas.'),(822,'Eulalija','Eulalija – (1) graik., trump. Eulalė, Lalė, iš sulotyninto graik. Eulalia : graik. eulalos „gražiakalbis“.',' Eulalija yra graikų kilmės vardas.'),(823,'Erdginas','Erdginas – (1) liet., trump. Erdas, Erdys, erd-(žr. Erdvilas) + gin- (žr. Eiginas).',' Erdginas yra lietuvių kilmės vardas.'),(824,'Eulalė','Eulalė – (2) trump. Lalė, – liet. trumpinys iš Eulalija.',' Eulalė yra graikų kilmės vardas.'),(825,'Eugenijus','Eugenijai gyvenime, – labai patiklūs , dažnai greitai kuo nors susižavi taip pat greitai ir nusivilia.',' Eugenijus yra graikų kilmės vardas.'),(826,'Eugenija','Eugenijos gyvenime dažnai susižavi ir greitai nusivilia, yra jausmingos, geidulingos ir nepastovios. Gyvena neramiai, kartais nedorai, vaikosi įvairių pasismaginimų. Linkusios į azartinius žaidimus, todėl iššvaisto savo gabumus ir energiją, nukrypdamos į menkaverčius malonumus.',' Eugenija yra graikų kilmės vardas.'),(827,'Eugenas','Eugenas – (2) trump. Genius, Genis, — liet. trumpinys iš Eugenijus.',' Eugenas yra graikų kilmės vardas.'),(828,'Eugenė','Eugenė – (2) trump. Genė, — liet. trumpinys iš Eugenija.',' Eugenė yra graikų kilmės vardas.'),(829,'Eufrozina','Eufrozina – (2) graik., trump. Frozė, Zina, tarm. Efrozina, Efrazina, Frazina ryt. aukšt., Eufruzina, Fruzė piet. žem., vak. aukšt., iš sulotyninto graik. Euphrosyna: graik. euphrosyne „džiaugsmas, linksmumas“.',' Eufrozina yra graikų kilmės vardas.'),(830,'Eufemija','Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu. ',' Eufemija yra graikų kilmės vardas.'),(831,'Eufema','Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu.',' Eufema yra lietuvių kilmės vardas.'),(832,'Eudora','Eudora – (2) graik., trump. Dora, iš sulotyninto graik. Eudora: graik. eu „gera“ + doron ,,dovana“.',' Eudora yra graikų kilmės vardas.'),(833,'Etmė','Šio vardo savininkams patinka viskas, kas puiku, ir jie patys nestokoja linksmo būdo. Neretai ir patys išoriškai itin patrauklūs, seksualūs, retkarčiais ir išdidūs, itin daug dėmesio skiria savo išvaizdai, jos priežiūrai. Jie pritaria laikmečiui, madoms, yra veiklūs, stengiasi atsiskleisti menui. ',' Etmė yra anglų kilmės vardas.'),(834,'Estera','Esterų profesijos bei užsiėmimai – puikios amatininkės, inžinierės, išradėjos, diplomatės, politikės-intrigantės, siekiančios tik sau naudos.',' Estera yra iraniečių kilmės vardas.'),(835,'Ervinas','Ervinas – (1) germ., trump. Ervas, baž. lot. Ervinus iš germ. Erwin: sen. vok. aukšt. era „garbė“ + wini „draugas“.',' Ervinas yra vokiečių kilmės vardas.'),(836,'Estela','Estelų sėkmei svarbu, kad materialiai jos būtų visiškai stabilios, tik taip jos gali save realizuoti. Reikėtų saugotis, kad materialinių vertybių nesumaišytų su dvasinėmis tada Estelos pražūtų.',' Estela yra ispanų kilmės vardas.'),(837,'Erta','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Erta yra vokiečių kilmės vardas.'),(838,'Elmyra','Jis suteikia drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Elmyra yra arabų kilmės vardas.'),(839,'Elmaras','Šis vardas suteikia Jums energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Elmaras yra vokiečių kilmės vardas.'),(840,'Elma','Jis teikia nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. ',' Elma yra anglų kilmės vardas.'),(841,'Eliza','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Eliza yra italų kilmės vardas.'),(842,'Eligijus','Eligijus – (1) lot., trump. Eligas, Elis, Elius, iš lot. Eligius: lot. eligo „išrinkti“.',' Eligijus yra lotynų kilmės vardas.'),(843,'Eligas','Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Menas galima sakyti Jūsų pašaukimas.',' Eligas yra lotynų kilmės vardas.'),(844,'Elidijus','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Elidijus yra lotynų kilmės vardas.'),(845,'Elidas','Elidas – (2) lot., trump. Elis, Elius, – liet. trumpinys iš Elidijus.',' Elidas yra lotynų kilmės vardas.'),(846,'Elfrida','Elfrida – (2) germ., trump. Elė, Frida, iš germ. Elfrida: germ. elf „elfas“ + sen. vok. aukšt. fridu „apsauga, taika“.',' Elfrida yra vokiečių kilmės vardas.'),(847,'Eleonora','Eleonoros drąsios ir impulsyvios, todėl dažnai pakliūva į įtemtas situacijas.',' Eleonora yra hebrajų kilmės vardas.'),(848,'Eivinas','Ateityje įgysite daugiau organizacinių sugebėjimų. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas, dar kitaip galima būtų Jus apibūdinti kaip avantiūristas.',' Eivinas yra lietuvių kilmės vardas.'),(849,'Elena','Elenos suaugusios dažniausiai tampa medikėmis, prižiūrėtojomis, auklėmis. Joms materialinė gerovė nėra labai svarbi. ',' Elena yra graikų kilmės vardas.'),(850,'Eivina',' (3b), (1), (1) liet., trump. Eivė, iš vyr. v. Eivinas',' Eivina, Eivina, Eivinė yra  kilmės vardas.'),(851,'Eladijus','Eladijus – (1) graik., trump. Eladas, Elas, Elius, iš sulotyninto graik. Helladius: graik. Helas (kilm. Hellados) — Elada (= Graikija).',' Eladijus yra graikų kilmės vardas.'),(852,'Eivilė','Eivilė – (1), (2) liet., trump. Eivė, iš vyr. v. Eivilas.',' Eivilė yra lietuvių kilmės vardas.'),(853,'Eivilas','Eivilas – (1) liet., trump. Eivas, Eivys, ei- (žr. Eibaras) + vil- (žr. Eidvilas).',' Eivilas yra lietuvių kilmės vardas.'),(854,'Eladas','Eladas – (2) graik., trump. Elas, Elius, – liet. trumpinys iš Eladijus.',' Eladas yra graikų kilmės vardas.'),(855,'Eivydas','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs. ',' Eivydas yra lietuvių kilmės vardas.'),(856,'Ekvitas','Ekvitas – (1) lot., trump. Ekvas, Ekvis, iš lot. Eąues: lot. eąues (kilm. eąuitis) „raitelis, raitininkas“.',' Ekvitas yra lotynų kilmės vardas.'),(857,'Eivyda',' (3b), (1), (1) liet. ir prūs., trump. Eivė, vyr. v. Eivydas',' Eivyda, Eivyda, Eivydė yra  kilmės vardas.'),(858,'Eivenis','Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Menas galima sakyti Jūsų pašaukimas.',' Eivenis yra lietuvių kilmės vardas.'),(859,'Eivė','Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Menas galima sakyti Jūsų pašaukimas.',' Eivė yra lietuvių kilmės vardas.'),(860,'Eivenė','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Eivenė yra lietuvių kilmės vardas.'),(861,'Eivas',' (2), (4) liet., trumpinys iš avd. su Ei-v-: Eivydas , Eivilas, Eivinas ir kt. ',' Eivas, Eivys yra  kilmės vardas.'),(862,'Eitvilta',' (3b), (1), (1) liet., trump. Eitė, iš vyr. v. Eitviltas',' Eitvilta, Eitvilta, Eitviltė yra  kilmės vardas.'),(863,'Eivardas','Jis teikia nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei.',' Eivardas yra lietuvių kilmės vardas.'),(864,'Eivarda',' (3b), (1), (1) liet., trump. Eivė, iš vyr. v. Eivardas',' Eivarda, Eivarda, Eivardė yra  kilmės vardas.'),(865,'Eitvilė','Šis vardas suteikia Jums energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eitvilė yra lietuvių kilmės vardas.'),(866,'Eitvilas','Šis vardas suteikia Jums energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eitvilas yra lietuvių kilmės vardas.'),(867,'Eivaidas','Vardas jums suteikia drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas taip pat leidžia Jums geriau įvertinti žmonių charakterius.',' Eivaidas yra lietuvių kilmės vardas.'),(868,'Eivaida',' (3b), (1), (1) liet., trump. Eivė, iš vyr. v. Eivaidas',' Eivaida, Eivaida, Eivaidė yra  kilmės vardas.'),(869,'Eitvyda',' (3b), (1), (1) liet. ir prūs., trump. Eitė, iš vyr. v. Eitvydas',' Eitvyda, Eitvyda, Eitvydė yra  kilmės vardas.'),(870,'Eitvydas','Eitvydas – (1) liet., trump. Eitas, Eitys, Vydas, eit- (žr. Eitmilas) + vyd- (žr. Eidvydas).',' Eitvydas yra lietuvių kilmės vardas.'),(871,'Eitviltas','Eitviltas – (1) liet., trump. Eitas, Eitys, eit- (žr. Eitmilas) + vilt- (: liet. viltis, vilt-is).',' Eitviltas yra lietuvių kilmės vardas.'),(872,'Eitvaldė','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Eitvaldė yra lietuvių kilmės vardas.'),(873,'Eitminas',' (1) liet., trump. Eitas, Eitys, eit- (žr. Eitmilas) + min- (žr. Eidminas) ',' Eitminas yra  kilmės vardas.'),(874,'Eitvaldas','Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Eitvaldas yra lietuvių kilmės vardas.'),(875,'Eitmina',' (3b), (1), (1) liet., trump. Eitė, iš vyr. v. Eitminas',' Eitmina, Eitmina, Eitminė yra  kilmės vardas.'),(876,'Eitmilė','Šio vardo savininkams patinka viskas, kas puiku, ir jie patys nestokoja linksmo būdo. Neretai ir patys išoriškai itin patrauklūs, seksualūs, retkarčiais ir išdidūs, itin daug dėmesio skiria savo išvaizdai, jos priežiūrai. Jie pritaria laikmečiui, madoms, yra veiklūs, stengiasi atsiskleisti menui.',' Eitmilė yra lietuvių kilmės vardas.'),(877,'Eitmilas','Šio vardo savininkams patinka viskas, kas puiku, ir jie patys nestokoja linksmo būdo. Neretai ir patys išoriškai itin patrauklūs, seksualūs, retkarčiais ir išdidūs, itin daug dėmesio skiria savo išvaizdai, jos priežiūrai. Jie pritaria laikmečiui, madoms, yra veiklūs, stengiasi atsiskleisti menui.',' Eitmilas yra lietuvių kilmės vardas.'),(878,'Eitenis','Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu.',' Eitenis yra lietuvių kilmės vardas.'),(879,'Eitenė','Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu.',' Eitenė yra lietuvių kilmės vardas.'),(880,'Eitautė','Eitautė – (1) liet., trump. Eitė, iš vyr. v. Eitautas.',' Eitautė yra lietuvių kilmės vardas.'),(881,'Eitė','Taigi šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgstantis dovanoti ir gauti dovanas, sugeba būti labai svetingas. Šis vardas simbolizuoja norą imtis naujų planų ir juos įgyvendinti.',' Eitė yra lietuvių kilmės vardas.'),(882,'Eitautas','Šio vardo savininkai sugeba ilgam laikui prie ko nors prisirišti, tačiau jų partneriai dažnai pavargsta nuo emocinio jų nestabilumo. Šių žmonių stiprus energetinis laukas, jūs norite vadžias imti į savo rankas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. ',' Eitautas yra lietuvių kilmės vardas.'),(883,'Eitas',' (2), (4) liet., trumpinys iš avd. su Ei-t-, Eit-: Eitautas, Eitminas, Eitvydas ir kt.',' Eitas, Eitys yra  kilmės vardas.'),(884,'Eitaras','Eitaras – (1) liet., trump. Eitas, Eitys, ei- (žr. Eibaras) + tar- (: liet. tar-ti)',' Eitaras yra lietuvių kilmės vardas.'),(885,'Eitara',' (3b), (1), (1) liet., trump. Eitė, iš vyr. v. Eitaras',' Eitara, Eitara, Eitarė yra  kilmės vardas.'),(886,'Eismantė','Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jūs atsargus, kartais netgi įtarus, mėgstate dovanoti ir gauti dovanas, sugebate būti labai svetingas. Esant reikalui, galite būti labai drąsus ir užsispyręs. ',' Eismantė yra lietuvių kilmės vardas.'),(887,'Eismantas','Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jūs atsargus, kartais netgi įtarus, mėgstate dovanoti ir gauti dovanas, sugebate būti labai svetingas. Esant reikalui, galite būti labai drąsus ir užsispyręs. ',' Eismantas yra lietuvių kilmės vardas.'),(888,'Eisvinas','Tai – galingas vardas, suteikiantis Jums pasitikėjimo, gero lyderio, vadovo savybių. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo.',' Eisvinas yra lietuvių kilmės vardas.'),(889,'Eiskantas','Šio vardo savininkai amžini klajokliai, lengvai įsisavinate užsienio kalbas. Šio vardo savininkas yra labai draugiškas, dėmesingas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas. Esant reikalui, gali būti labai drąsus ir labai atkaklus.',' Eiskantas yra prūsų kilmės vardas.'),(890,'Eikintas','Eikintas – (1) liet. ir prūs., trump. Eikys, ei- (žr. Eikantas) + kint- (: liet. kent-ėti, plg. žiem-kint-is).',' Eikintas yra prūsų kilmės vardas.'),(891,'Eiskanta',' (3b), (1), (1) suliet. prūs., trump. Eisė, iš vyr. v. Eiskantas',' Eiskanta, Eiskanta, Eiskantė yra  kilmės vardas.'),(892,'Eisvina',' (3b), (1), (1) liet., trump. Eisvė, iš vyr. v. Eisvinas',' Eisvina, Eisvina, Eisvinė yra  kilmės vardas.'),(893,'Einarta',' (3b), (1), (1) liet., trump. Einė, iš vyr. v. Einartas',' Einarta, Einarta, Einartė yra  kilmės vardas.'),(894,'Eikinta',' (3b), (1), (1) liet. ir prūs., trump. Eikė, iš vyr. v. Eikintas',' Eikinta, Eikinta, Eikintė yra  kilmės vardas.'),(895,'Eisvydas','Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas leidžia jums matyti daugiau nei kitiems.',' Eisvydas yra lietuvių kilmės vardas.'),(896,'Eisys','Eisys – (4) liet., trumpinys iš avd. su Eis-: Eiskantas, Eismantas, Eisvydas ir kt.',' Eisys yra lietuvių kilmės vardas.'),(897,'Eimutis','Norėtumėte dalyvauti politiniuose judėjimuose. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eimutis yra lietuvių kilmės vardas.'),(898,'Eisvyda',' (3b), (1), (1) liet., trump. Eisvė, Eisė, iš vyr. v. Eisvydas',' Eisvyda, Eisvyda, Eisvydė yra  kilmės vardas.'),(899,'Eikantas','Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Taip pat neabejingas psichologijai ir spiritizmo praktikai.',' Eikantas yra lietuvių kilmės vardas.'),(900,'Eimutė','Norėtumėte dalyvauti politiniuose judėjimuose. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eimutė yra lietuvių kilmės vardas.'),(901,'Eisė','Eisė – (2) liet., trumpinys iš mot. v. su Eis-: Eiskantė, Eismantė, Eisvydė ir kt.',' Eisė yra lietuvių kilmės vardas.'),(902,'Eisvaldė','Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate labiau įsigilinti į reiškinių esmę.',' Eisvaldė yra lietuvių kilmės vardas.'),(903,'Eikanta',' (3b), (1), (1) suliet. prūs., trump. Eikė, iš vyr. v. Eikantas',' Eikanta, Eikanta, Eikantė yra  kilmės vardas.'),(904,'Eimintas','Šio vardo savininkai itin reiklūs sau pačiam ir kitiems. Nesprendžiate apie įvykius iš pirmo žvilgsnio. Gaila bet Jums prireiks daugiau laiko tobulėjimui. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai išmokstate kitas kalbas.',' Eimintas yra lietuvių kilmės vardas.'),(905,'Eisvaldas','Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate labiau įsigilinti į reiškinių esmę.',' Eisvaldas yra lietuvių kilmės vardas.'),(906,'Eirimtė','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa praktiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eirimtė yra lietuvių kilmės vardas.'),(907,'Eisra','Jūsų vardo savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas.',' Eisra yra lietuvių kilmės vardas.'),(908,'Eiminta',' (3b), (1), (1) liet., trump. Eimė, Mintė, iš vyr. v. Eimintas',' Eiminta, Eiminta, Eimintė yra  kilmės vardas.'),(909,'Eirimtas','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa praktiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eirimtas yra lietuvių kilmės vardas.'),(910,'Eigutis','Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai.',' Eigutis yra lietuvių kilmės vardas.'),(911,'Eismintas','Eismintas – (1) liet., trump. Eismys, Eisys, eis-(žr. Eiskantas) + mint- (žr. Eigmintas).',' Eismintas yra lietuvių kilmės vardas.'),(912,'Eiminas','Šio vardo savininkas yra labai draugiškas, ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai ir populiarumas. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu.',' Eiminas yra lietuvių kilmės vardas.'),(913,'Eirimė','Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių. ',' Eirimė yra lietuvių kilmės vardas.'),(914,'Eigutė','Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai.',' Eigutė yra lietuvių kilmės vardas.'),(915,'Eisminta',' (3b), (1), (1) liet., trump. Eismė, Eisė, iš vyr. v. Eismintas',' Eisminta, Eisminta, Eismintė yra  kilmės vardas.'),(916,'Eimina',' (3b), (1), (1) liet., trump. Eimė, iš vyr. v. Eiminas',' Eimina, Eimina, Eiminė yra  kilmės vardas.'),(917,'Eirimas','Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių.',' Eirimas yra lietuvių kilmės vardas.'),(918,'Eigotė','Šių vardų savininkų sėkmė – būti kolektyve tarp žmonių, todėl tikriausiai jie labai gerai jaučiasi savo šeimoje.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jus traukia svaiginantys meilės nuotykiai ir pasirengimas bet kurią minutę pasinerti į eilinę avantiūrą.',' Eigotė yra lietuvių kilmės vardas.'),(919,'Einoras','Einoras – (1) liet., trump. Einas, Einys, Norys, ei- (žr. Eibaras) + nor- (: liet. nor-ėti, nor-as).',' Einoras yra lietuvių kilmės vardas.'),(920,'Eismina',' (3b), (1), (1) liet., trump. Eismė, iŠ vyr. v. Eisminas',' Eismina, Eismina, Eisminė yra  kilmės vardas.'),(921,'Eigotas','Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus.',' Eigotas yra lietuvių kilmės vardas.'),(922,'Eimilė','Jūs puikiai žinote savo teises, jaučiate nepajudinamą valios jėgą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. ',' Eimilė yra lietuvių kilmės vardas.'),(923,'Einora',' (3b), (1), (1) liet., trump. Einė, Nora, iš vyr. v. Einoras',' Einora, Einora, Einorė yra  kilmės vardas.'),(924,'Eimilas','Jūs puikiai žinote savo teises, jaučiate nepajudinamą valios jėgą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. ',' Eimilas yra lietuvių kilmės vardas.'),(925,'Eimė','Eimė – (2) liet., trumpinys iš mot. v. su Ei-m-: Eimilė, Eimanė, Eiminė ir kt.',' Eimė yra lietuvių kilmės vardas.'),(926,'Eigmintas',' (1) liet., trump. Eigas, Eigys, Eigis, eig- (žr. Eigmantas) + mint- (: liet. minti, mena, mintis)',' Eigmintas yra  kilmės vardas.'),(927,'Einė','Einė – (2) liet., trumpinys iš mot. v. su Ei-n-, Einorė ir kt.',' Einė yra lietuvių kilmės vardas.'),(928,'Eimas',' (2), (4) liet., trumpinys iš avd. su Ei-m-: Eimanas ir kt.',' Eimas, Eimys yra  kilmės vardas.'),(929,'Eigminta',' (3b), (1), (1) liet., trump. Eigė, iš vyr. v. Eigmintas',' Eigminta, Eigminta, Eigmintė yra  kilmės vardas.'),(930,'Einas',' (2), (4) liet., trumpinys iš avd. su Ei-n-: Einoras ir kt.',' Einas, Einys yra  kilmės vardas.'),(931,'Eimantė','Eimantė – (1) liet ir prūs., trump. Eimė, Mantė, iš vyr. v. Eimantas.',' Eimantė yra lietuvių kilmės vardas.'),(932,'Einartas','Einartas – (1) liet., trump. Einas, Einys, ei-(žr. Eibaras) + nart- (: liet. nart-us „atkaklus“).',' Einartas yra lietuvių kilmės vardas.'),(933,'Eimantas','Eimantams patariama kontroliuoti savo charakterį, mažiau kištis į konfliktus – patylėti. Nors ir kaip jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų išmokti elgtis su savo pinigais.',' Eimantas yra lietuvių kilmės vardas.'),(934,'Eigminas','Pagarba ir apdovanojimai, prestižas ir populiarumas – tai žodžiai, kurie Jus apibūdina. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eigminas yra lietuvių kilmės vardas.'),(935,'Eigmina',' (3b), (1), (1) liet., trump. Eigė, iš vyr. v. Eigminas',' Eigmina, Eigmina, Eigminė yra  kilmės vardas.'),(936,'Eimanė','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Eimanė yra lietuvių kilmės vardas.'),(937,'Eigmantė','Pagarba ir apdovanojimai, prestižas ir populiarumas – tai žodžiai, kurie Jus apibūdina. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eigmantė yra lietuvių kilmės vardas.'),(938,'Eimanas','Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Eimanas yra lietuvių kilmės vardas.'),(939,'Eigmantas','Pagarba ir apdovanojimai, prestižas ir populiarumas – tai žodžiai, kurie Jus apibūdina. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eigmantas yra lietuvių kilmės vardas.'),(940,'Eigis',' (2), (2), (4) liet., trumpinys iš avd. su Ei-g-, Eig-: Eigailas, Eigilas, Eigminas ir kt.',' Eigis, Eigas, Eigys yra  kilmės vardas.'),(941,'Fidelija','Fidelija – (1) lot., trump. Fida, Fidė, iš lot. Fidelia, kuris iš vyr. v. Fidelis, žr. Fidelis.',' Fidelija yra lotynų kilmės vardas.'),(942,'Fida',' (2) lot., iš lot. Fides: lot. fides „tikėjimas“',' Fida, Fidė yra  kilmės vardas.'),(943,'Fernandas','Fernandas – isp., trump. Fernas, Nandas, iš isp. Fernando, kuris yra isp. trumpinys iš Ferdinandus, žr. Ferdinandas.',' Fernandas yra vokiečių kilmės vardas.'),(944,'Fernanda','Fernanda – (1) isp., trump. Ferna, Nanda, iš vyr. v. Fernando, žr. Fernandas.',' Fernanda yra vokiečių kilmės vardas.'),(945,'Ferdinandas','Ferdinandai – filosofai. Gali valandų valandas mąstyti ką padaryti dar geriau ir gilintis kodėl kiti daro ne taip kaip jie.',' Ferdinandas yra vokiečių, ispanų, italų kilmės vardas.'),(946,'Feliksas','Feliksams patinka avantiūros. Jie vieną dieną gali būti viename pasaulio krašte, o kitą – kitame.',' Feliksas yra lotynų kilmės vardas.'),(947,'Felicita','Vardadienis: Kovo 7 d., lapkričio 23 d.',' Felicita yra lotynų kilmės vardas.'),(948,'Felicijonas','Felicijonas – (2) lot., trump. Felicijus, Felius, Felis, tarm. Pelicijonas ryt. ir piet. aukšt., iš lot. Felicianus, kuris yra priesagos -anus vedinys iš Felix, žr. Feliksas.',' Felicijonas yra lotynų kilmės vardas.'),(949,'Felicijus','Felicijus – (1) lot., trump. Felius, Felis, lot. vardo Felix variantas, žr. Feliksas.',' Felicijus yra lotynų kilmės vardas.'),(950,'Felicija','Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu.',' Felicija yra lotynų kilmės vardas.'),(951,'Felius',' (2) liet. trumpinys iš Feliksas, Felicijus ir Felicijonas',' Felius, Felis yra  kilmės vardas.'),(952,'Felė','Šio vardo savininkams patinka viskas, kas puiku, ir jie patys nestokoja linksmo būdo. Neretai ir patys išoriškai itin patrauklūs, seksualūs, retkarčiais ir išdidūs, itin daug dėmesio skiria savo išvaizdai, jos priežiūrai. Jie pritaria laikmečiui, madoms, yra veiklūs, stengiasi atsiskleisti menui.',' Felė yra lietuvių kilmės vardas.'),(953,'Faustinas','Vardadienis: Vasario 15., liepos 29 d.',' Faustinas yra lotynų kilmės vardas.'),(954,'Florentinas','Florentinas – (2) lot., trump. Florentas, Floras, iš lot. Florentinus, kuris yra priesagos -inus vedinys iš Florentius, žr. Florentas.',' Florentinas yra lotynų kilmės vardas.'),(955,'Faustina','Faustina – (2) lot., trump. Fausta, iš lot. Faustina, kuris iš vyr. v. Faustinus, žr. Faustinas.',' Faustina yra lotynų kilmės vardas.'),(956,'Floras','Floras – (2) lot., tarm. Flioras, Pliorus piet. aukšt. (dz.), iš lot. Florus: lot. florus „žydintis“.',' Floras yra lotynų kilmės vardas.'),(957,'Faustas','Faustai taupūs, bet jiems pinigai nėra taip aktualu kaip dvasiniai turtai. Faustai labai religingi, tikintys karma.',' Faustas yra lotynų kilmės vardas.'),(958,'Florentina','Florentina – (2) lot., trump. Florenta, Flora, iš lot. Florentina, kuris iš vyr. v. Florentinus, žr. Florentinas.',' Florentina yra lotynų kilmės vardas.'),(959,'Flora','Flora – (2) lot., iš lot. Flora, kuris iš mitologinio v. Flora — sen. italikų žiedų, pavasario ir jaunystės deivė: lot. flora „žydinti“.',' Flora yra lotynų kilmės vardas.'),(960,'Firminas','Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės.',' Firminas yra lotynų kilmės vardas.'),(961,'Flavija','Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs. ',' Flavija yra lotynų kilmės vardas.'),(962,'Firmas','Jūs užsispyrę darbuotojai, lengvai apsikraunantys visokiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės.',' Firmas yra lotynų kilmės vardas.'),(963,'Firmina','Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės. ',' Firmina yra lotynų kilmės vardas.'),(964,'Filomenas','Filomenas – (2) graik., trump. Filas, iš sulotyninto graik. Philomenus: graik. philamenos „mylimas“.',' Filomenas yra graikų kilmės vardas.'),(965,'Filomena','Filomenos labai mėgsta tvarką ir discipliną. Jos paklūsta protingiems įsakymams. Nori, kad visi jų pavaldiniai elgtųsi panašiai kaip ir jos. Dėl to kartais iškyla problemų, nes namuose jos pavirsta tironėmis ir diktatorėmis.',' Filomena yra graikų kilmės vardas.'),(966,'Filomela','Filomela – (2) graik., trump. Filė, iš sulotyninto graik. Philomela, kuris iš graik. Philomele — „lakštingala“.',' Filomela yra graikų kilmės vardas.'),(967,'Filė',' (2) liet. trumpinys iš Filomena ir Teofilė',' Filė yra  kilmės vardas.'),(968,'Filibertas',' (1) germ., trump. Filas, Bertas, baž. lot. Philibertus, Filibertus iš sen. vok. Filibert: sen. vok. aukšt. filu „daug“ + beraht „garsus, žymus“',' Filibertas, Filibertas yra  kilmės vardas.'),(969,'Fidentas','Fidentas – (2) lot., trump. Fidas iš lot. Fidentius, Fidens: lot. fidens (kilm. fidentis) „ištikimas“.',' Fidentas yra lotynų kilmės vardas.'),(970,'Fidelis','Fideliai mėgsta labai įvairų ir nuolat besikeičiantį darbą. Kadangi mėgsta keliauti, tai gali būti kelionių agentūrų vadovais, kurjeriais, detektyvais. Traukia juos ir menai. Gali būti įvairių draugijų mecenatai. Tinka jiems ir politiko gyvenimas.',' Fidelis yra lotynų kilmės vardas.'),(971,'Gailutis','Gailutis – (2) liet., trump. Gailius, priesagos -utis vedinys iš sen. trump. Gailas.',' Gailutis yra lietuvių kilmės vardas.'),(972,'Gailius','Gailius – (2) liet., trumpinys iš Gailigedas, Gailiminas ir kt.',' Gailius yra lietuvių kilmės vardas.'),(973,'Gailutė','Gailutė – (2) liet., trump. Gailė, iš vyr. v. Gailutis.',' Gailutė yra lietuvių kilmės vardas.'),(974,'Gailintas','Gailintas – (1) liet., trump. Gailas, iš ežero vardo Gailintas (Merkinė)',' Gailintas yra lietuvių kilmės vardas.'),(975,'Gailimina',' (2) liet. ir prūs., trump. Gailė, iš vyr. v. Gailiminas',' Gailimina, Gailiminė yra  kilmės vardas.'),(976,'Gailiminas','Gailiminas – (2) liet. ir prūs., trump. Gailius, gaili- (žr. Gailigedas) + min- (: liet. min-ti, min-ėti).',' Gailiminas yra prūsų kilmės vardas.'),(977,'Gailimantas','Gailimantas (1) liet., trump. Gailius, gaili- (žr. Gailigedas) + mant- (: liet. mant-us „sumanus“, mant-a „turtas“).',' Gailimantas yra lietuvių kilmės vardas.'),(978,'Gailimantė','Gailimantė (1) liet., trump. Gailė, iš vyr. v. Gailimantas.',' Gailimantė yra lietuvių kilmės vardas.'),(979,'Gailigedas','Gailigedas – (1) liet., trump. Gailius, gaili- (: liet. gailas „smarkus, stiprus“) + ged- (:liet. ged-auti „ilgėtis“).',' Gailigedas yra lietuvių kilmės vardas.'),(980,'Gailigedė','Gailigedė – (1) liet., trump. Gailė, iš vyr. v. Gailigedas.',' Gailigedė yra lietuvių kilmės vardas.'),(981,'Gailenis','Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gailenis yra lietuvių kilmės vardas.'),(982,'Gailenė','Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gailenė yra lietuvių kilmės vardas.'),(983,'Gailas','Šie vardo savininkai mielai priima draugų pagalbą ne vien žodžiais, bet ir pinigais. Neteisingai panaudotos seksualinės energijos pertekliai gali jiems sutrikdyti sveikatą ir ištuštinti pinigines.',' Gailas yra lietuvių kilmės vardas.'),(984,'Gailė','Šie vardo savininkai mielai priima draugų pagalbą ne vien žodžiais, bet ir pinigais. Neteisingai panaudotos seksualinės energijos pertekliai gali jiems sutrikdyti sveikatą ir ištuštinti pinigines.',' Gailė yra lietuvių kilmės vardas.'),(985,'Gaila','Šie vardo savininkai mielai priima draugų pagalbą ne vien žodžiais, bet ir pinigais. Neteisingai panaudotos seksualinės energijos pertekliai gali jiems sutrikdyti sveikatą ir ištuštinti pinigines.',' Gaila yra lietuvių kilmės vardas.'),(986,'Galkanta',' (3a), (1), (1) liet., trump. Galė, iš vyr. v. Galkantas',' Galkanta, Galkanta, Galkantė yra  kilmės vardas.'),(987,'Galintas','Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Galintas yra lietuvių kilmės vardas.'),(988,'Galintė','Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Galintė yra lietuvių kilmės vardas.'),(989,'Galindas','Galindas – (1) suliet. prūs., iš prūs. genties vardo galindai (vns. galindas).',' Galindas yra lietuvių kilmės vardas.'),(990,'Galindė','Galindė – (1) suliet. prūs., iš vyr. v. Galindas.',' Galindė yra lietuvių kilmės vardas.'),(991,'Galiginta',' (1) liet., trump. Galė, iš vyr. v. Galigintas',' Galiginta, Galigintė yra  kilmės vardas.'),(992,'Galia','Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Galia yra lietuvių kilmės vardas.'),(993,'Gaja','Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Gaja yra lietuvių kilmės vardas.'),(994,'Gaivys','Gaivys – (4) liet., trumpinys iš Gaivilas ir kt. ',' Gaivys yra lietuvių kilmės vardas.'),(995,'Gaivilė','Vardadienis: Sausio 24 d., spalio 8 d.',' Gaivilė yra lietuvių kilmės vardas.'),(996,'Gaivilas','Gaivilas – (1) liet., trump. Gaivys: gai- (: liet. gajus, gaivus) + vil- (: liet. vil-tis, vil-iasi, vil-tis).',' Gaivilas yra lietuvių kilmės vardas.'),(997,'Gaivenis','Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Gaivenis yra lietuvių kilmės vardas.'),(998,'Gaivenė','Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Gaivenė yra lietuvių kilmės vardas.'),(999,'Gaivė','Jus traukia politika ir bet kokia atvira visuomeninė veikla. Tai puikūs oratoriai, sugebantys žmones patraukti savo idėjomis. Visada praktiški, aktyvūs ir geri organizatoriai. Siekia prestižinio išsilavinimo.',' Gaivė yra lietuvių kilmės vardas.'),(1000,'Gaiva','Jus traukia politika ir bet kokia atvira visuomeninė veikla. Tai puikūs oratoriai, sugebantys žmones patraukti savo idėjomis. Visada praktiški, aktyvūs ir geri organizatoriai. Siekia prestižinio išsilavinimo.',' Gaiva yra lietuvių kilmės vardas.'),(1001,'Gaudė','Jūsų mokslo žinios pasitarnauja jų garbei bei gerovei. Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Gaudė yra lietuvių kilmės vardas.'),(1002,'Gasparas','Šių vardų savininkai visada randasi pačios triukšmingiausios kompanijos centre, mėgsta papasakoti keistų istorijų ar anekdotų. Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs.',' Gasparas yra lotynų kilmės vardas.'),(1003,'Gaudas','Jūsų mokslo žinios pasitarnauja jų garbei bei gerovei. Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Gaudas yra lietuvių kilmės vardas.'),(1004,'Garsė','Garsė – (2) liet., galūnės vedinys iš liet. garsi.',' Garsė yra lietuvių kilmės vardas.'),(1005,'Gantautas','Gantautas – (1) liet., trump. Gantas, gan- (: liet. gan-yti „saugoti, plg. ginti)+ taut- (: liet. taut-a).',' Gantautas yra lietuvių kilmės vardas.'),(1006,'Gantautė','Gantautė – (1) liet., trump. Ganta, Gante, iš vyr. v. Gantautas.',' Gantautė yra lietuvių kilmės vardas.'),(1007,'Ganta',' (2) liet., trumpinys iš mot. v. Gantautė',' Ganta, Gantė yra  kilmės vardas.'),(1008,'Gantas','Gantas – (2) liet., trumpinys iš avd. Gantautas.',' Gantas yra lietuvių kilmės vardas.'),(1009,'Gandė','Jūs iš prigimties užprogramuoti lyderiai. jūs nepriklausomi ir individualūs, bet kokia kaina trokštantys garbės. labai judrūs, energingi, nenustygstantys vietoje, linksmi, draugiški.',' Gandė yra lietuvių kilmės vardas.'),(1010,'Galvilė',' (1), (2) liet., trump. Galė, Galvė, iš vyr. v. Galvilas',' Galvilė yra  kilmės vardas.'),(1011,'Galvirda',' (3a), (1), (1) liet., trump. Galė, Galvė, iš vyr. v. Galvirdas',' Galvirda, Galvirda, Galvirdė yra  kilmės vardas.'),(1012,'Galvainė',' (1) liet., trump. Galė, Galvė, iš vyr. v. Galvainas',' Galvainė yra  kilmės vardas.'),(1013,'Galvyda',' (3a), (1), (1) liet., trump. Galė, Galvė, iš vyr. v. Galvydas',' Galvyda, Galvyda, Galvydė yra  kilmės vardas.'),(1014,'Galmina',' (3a), (1) liet., trump. Galė, Galmė, iš vyr. v. Galminas',' Galmina, Galminė yra  kilmės vardas.'),(1015,'Galmantė','Vardadienis: Kovo 7 d., rugsėjo 18 d.',' Galmantė yra lietuvių kilmės vardas.'),(1016,'Gaudvinas','Gaudvinas – (1) liet., trump. Gaudas, gaud- (žr. Gaudrimas) + vin- (sen. liet. vin- su balsių kaita iš vaina „kaltė, priežastis“).',' Gaudvinas yra lietuvių kilmės vardas.'),(1017,'Gaudvina','Gaudmina – (3b), (1), (1) liet., trump. Gaudė, iš vyr. v. Gaudvinas',' Gaudvina, Gaudvina, Gaudvinė yra  kilmės vardas.'),(1018,'Gaudvilas','Gaudvilas – (1) liet. ir prūs., trump. Gaudas, gaud- (žr. Gaudrimas) + vil- (žr. Gaivilas).',' Gaudvilas yra lietuvių kilmės vardas.'),(1019,'Gedgauda',' (3b), (1), (1) liet., trump. Gedė, iš vyr. v. Gedgaudas',' Gedgauda, Gedgauda, Gedgaudė yra  kilmės vardas.'),(1020,'Gaudvilė','Gaudvilė – (1), (2) liet., trump. Gaudė, iš vyr. v. Gaudvilas.',' Gaudvilė yra lietuvių kilmės vardas.'),(1021,'Gaudvydas','Gaudvydas – (1) liet., trump. Gaudas, gaud- (žr. Gaudrimas) + vyd- (žr. Galvydas).',' Gaudvydas yra lietuvių kilmės vardas.'),(1022,'Gaudvyda',' (3b), (1), (1) liet., trump. Gaudė, iš vyr. v. Gaudvydas',' Gaudvyda, Gaudvyda, Gaudvydė yra  kilmės vardas.'),(1023,'Gedgantas','Gedgantas – (1) liet., trump. Gedas, ged- (žr. Gedartas) + gant- (žr. Gantautas).',' Gedgantas yra lietuvių kilmės vardas.'),(1024,'Gedganta',' (3b), (1), (1) liet., trump. Gedė, iš vyr. v. Gedgantas',' Gedganta, Gedganta, Gedgantė yra  kilmės vardas.'),(1025,'Gaudvaišas','Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gaudvaišas yra lietuvių kilmės vardas.'),(1026,'Gaudrys',' (4), (2) liet., trumpinys iš Gaudrimas',' Gaudrys, Gaudrius yra  kilmės vardas.'),(1027,'Gedgailė','Gedgailė – (1) liet., trump. Gedė, iš vyr. avd. Gedgaila, žr. Gedgailas.',' Gedgailė yra lietuvių kilmės vardas.'),(1028,'Gedgailas','Gedgailas – (1) liet., sen. var. Gedgaila, trump. Gedas, ged- (žr. Gedartas) + gail- (žr. Gailigedas).',' Gedgailas yra lietuvių kilmės vardas.'),(1029,'Gedrimas','Gedrimas – (1) liet., trump. Gedas, Gedrys, ged- (žr. Gedartas) + rim- (žr. Gaudrimas).',' Gedrimas yra lietuvių kilmės vardas.'),(1030,'Gaudrimė','Gaudrimė – (1) liet., trump. Gaudrė, iš vyr. v. Gaudrimas.',' Gaudrimė yra lietuvių kilmės vardas.'),(1031,'Gedenis','Gedenis – (2) liet., trump. Gedas, priesagos -enis vedinys iš sen. trump. Gedas.',' Gedenis yra lietuvių kilmės vardas.'),(1032,'Gedmintas','Gedmintas – (1) liet., trump. Gedas, Gedmas, ged- (žr. Gedartas) + mint- (: liet. minti, mena, mint-is).',' Gedmintas yra lietuvių kilmės vardas.'),(1033,'Gaudrimas','Gaudrimas – (1) liet., trump. Gaudrys, Gaudrius, gaud- (: liet. gaud-yti, plg. gau-ti) + rim- (: liet. rim-ti).',' Gaudrimas yra lietuvių kilmės vardas.'),(1034,'Gedenė','Gedenė – (2) liet., trump. Gedė, iš vyr. v. Gedenis.',' Gedenė yra lietuvių kilmės vardas.'),(1035,'Gaudrė','Gaudrė – (2) liet., trumpinys iš mot. v. Gaudrimė.',' Gaudrė yra lietuvių kilmės vardas.'),(1036,'Gedminta',' (3b), (1), (1) liet., trump. Gedė, Gedmė, iš vyr. v. Gedmintas',' Gedminta, Gedminta, Gedmintė yra  kilmės vardas.'),(1037,'Gedbutė','Gedbutė – (1) liet., trump. Gedė, iš vyr. v. Gedbutas.',' Gedbutė yra lietuvių kilmės vardas.'),(1038,'Gaudilė','Gaudilė – (1), (2) suliet. prūs., trump. Gaudė, iš vyr. v. Gaudilas.',' Gaudilė yra lietuvių kilmės vardas.'),(1039,'Gedbutas','Gedbutas – (1) liet., trump. Gedas, ged- (žr. Gedartas) + but- (: liet. but-as, būti).',' Gedbutas yra lietuvių kilmės vardas.'),(1040,'Gaudilas',' (1) suliet. prūs., trump. Gaudas, priesagos -ilas vedinys iš sen. trump. Gaudas',' Gaudilas yra lietuvių kilmės vardas.'),(1041,'Gedminas','Gedminas – (1) liet., trump. Gedas, Gedmas, ged- (žr. Gedartas) + min- (žr. Gailiminas).',' Gedminas yra lietuvių kilmės vardas.'),(1042,'Gaudenis','Gaudenis – (2) suliet. prūs., priesagos -enis vedinys iš sen. trump. Gaudas.',' Gaudenis yra lietuvių kilmės vardas.'),(1043,'Gedautė','Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais da