t. ir prūs., trump. Geistė, iš vyr. v. Geistaras',' Geistara, Geistara, Geistarė yra  kilmės vardas.'),(1055,'Gedvardas','Gedvardas – (1) liet., trump. Gedas, Gedvas, ged- (žr. Gedartas) + vard- (: liet. varduoti „burti“).',' Gedvardas yra lietuvių kilmės vardas.'),(1056,'Gedmantė','Gedmantė – (1) liet., trump. Gedė, Gedmė, iš vyr. v. Gedmantas.',' Gedmantė yra lietuvių kilmės vardas.'),(1057,'Gedartė','Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gedartė yra lietuvių kilmės vardas.'),(1058,'Gedvarda','Gedvarda – (3b), (1), (1) liet., trump. Gedė, Gedvė, iš vyr. v. Gedvardas',' Gedvarda, Gedvarda, Gedvardė yra  kilmės vardas.'),(1059,'Gedmantas','Šie vardo savininkai mielai priima draugų pagalbą ne vien žodžiais, bet ir pinigais. Neteisingai panaudotos seksualinės energijos pertekliai gali jiems sutrikdyti sveikatą ir ištuštinti pinigines.',' Gedmantas yra lietuvių kilmės vardas.'),(1060,'Gedartas','Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gedartas yra lietuvių kilmės vardas.'),(1061,'Geismantė','Geismantė – (1) liet., trump. Geisma, Geismė, iš vyr. v. Geismantas.',' Geismantė yra lietuvių kilmės vardas.'),(1062,'Geismantas','Geismantas – (1) liet., trump. Geismys, geis- (: liet. geis-ti) + mant- (žr. Gailimantas).',' Geismantas yra lietuvių kilmės vardas.'),(1063,'Gedvaldė','Jus traukia politika ir bet kokia atvira visuomeninė veikla. Tai puikūs oratoriai, sugebantys žmones patraukti savo idėjomis. Visada praktiški, aktyvūs ir geri organizatoriai. Siekia prestižinio išsilavinimo.',' Gedvaldė yra lietuvių kilmės vardas.'),(1064,'Gausantė','Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Gausantė yra lietuvių kilmės vardas.'),(1065,'Gedkanta','Gedkanta – (3b), (1), (1) liet., trump. Gedė, iš vyr. v. Gedkantas',' Gedkanta, Gedkanta, Gedkantė yra  kilmės vardas.'),(1066,'Gedvaldas','Jus traukia politika ir bet kokia atvira visuomeninė veikla. Tai puikūs oratoriai, sugebantys žmones patraukti savo idėjomis. Visada praktiški, aktyvūs ir geri organizatoriai. Siekia prestižinio išsilavinimo.',' Gedvaldas yra lietuvių kilmės vardas.'),(1067,'Gediminė','Šių vardų savininkai visada randasi pačios triukšmingiausios kompanijos centre, mėgsta papasakoti keistų istorijų ar anekdotų. Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs.',' Gediminė yra lietuvių kilmės vardas.'),(1068,'Geidvilė','Jūsų mokslo žinios pasitarnauja jų garbei bei gerovei. Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Geidvilė yra lietuvių kilmės vardas.'),(1069,'Gediminas','Gediminai trokšta meilės ir giliai išgyvena, tačiau jie perdaug uždari, kad atskleistų savo jausmus. Užuot kalbėję apie jausmus, stengiasi tai įrodyti darbais. Įsidrąsina išreikšti savo jausmus tik tada, kai tvirtai įsitikina, kad nebus atstumti.',' Gediminas yra lietuvių kilmės vardas.'),(1070,'Gedvainė','Gedvainė – (1) liet., trump. Gedė, Gedvė, iš vyr. v. Gedvainas.',' Gedvainė yra lietuvių kilmės vardas.'),(1071,'Geidvilas','Jūsų mokslo žinios pasitarnauja jų garbei bei gerovei. Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Geidvilas yra lietuvių kilmės vardas.'),(1072,'Gedvainas','Gedvainas – (1) liet., trump. Gedas, Gedvas, ged- (žr. Gedartas) + vain- (žr. Galvainas).',' Gedvainas yra lietuvių kilmės vardas.'),(1073,'Gedilė','Gedilė – (1), (2) liet. ir prūs., trump. Gedė, iš vyr. v. Gedilas.',' Gedilė yra lietuvių kilmės vardas.'),(1074,'Geidutis','Geidutis – (2) liet. ir prūs., trump. Geidas, Geidys, priesagos -utis vedinys iš sen. trump. Geidas, kuris iš Geidbutas, Geidvilas ir kt.',' Geidutis yra lietuvių kilmės vardas.'),(1075,'Gedilas','Gedilas – (1) liet. ir prūs., trump. Gedas, priesagos -ilas vedinys iš sen. trump. Gedas.',' Gedilas yra lietuvių kilmės vardas.'),(1076,'Gedvaidas','Gedvaidas – (1) liet., trump. Gedas, Gedvas, ged- (žr. Gedartas) + vaid- (: liet. vaid-ytis, vaid-entis „rodytis“).',' Gedvaidas yra lietuvių kilmės vardas.'),(1077,'Geitautė','Geitautė – (1) liet., trump. Geitė, iš vyr. v. Geitautas.',' Geitautė yra lietuvių kilmės vardas.'),(1078,'Geidutė','Geidutė – (2) liet. ir prūs., trump. Geidė, iš vyr. v. Geidutis.',' Geidutė yra lietuvių kilmės vardas.'),(1079,'Gedgaudas',' (1) liet., trump. Gedas, ged- (žr. Gedartas) + gaud- (žr. Gaudrimas)',' Gedgaudas yra lietuvių kilmės vardas.'),(1080,'Gedvaida','Gedvaida – (3b), (1), (1) liet., trump. Gedė, Gedvė, iš vyr. v. Gedvaidas',' Gedvaida, Gedvaida, Gedvaidė yra  kilmės vardas.'),(1081,'Geitautas','Geitautas – (1) liet., trump. Geitys, gei- kilęs iš geid- (žr. Geidbutas) + taut- (žr. Gantautas).',' Geitautas yra lietuvių kilmės vardas.'),(1082,'Gedutis','Gedutis – (2) liet. ir prūs., trump. Gedas, priesagos -utis vedinys iš Gedas.',' Gedutis yra prūsų kilmės vardas.'),(1083,'Geisvinas','Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Geisvinas yra lietuvių kilmės vardas.'),(1084,'Gema','Jus globoja Saturnas. Jūsų mintys visada ramios, viskas apgalvota iki smulkmenų; retai kada pasireiškia impulsyvumas ir emocijos bei skubotumas. Jūs labai vertinate kiekvieną minutę ir kelyje į tikslą užimate tvirtą poziciją bei visada žinote, ko norite.',' Gema yra lotynų kilmės vardas.'),(1085,'Geidė','Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Geidė yra lietuvių kilmės vardas.'),(1086,'Geisvina',' (3b), (1), (1) liet., trump. Geisvė, iš vyr. v. Geisvinas',' Geisvina, Geisvina, Geisvinė yra  kilmės vardas.'),(1087,'Geidbutė','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Geidbutė yra lietuvių kilmės vardas.'),(1088,'Gelvydas','Gelvydas – (1) liet., trump. Gelvas, Gelvys, gel- (žr. Gelbutas) + vyd- (žr. Galvydas).',' Gelvydas yra lietuvių kilmės vardas.'),(1089,'Gedutė','Gedutė – (2) liet. ir prūs., trump. Gedė, iš vyr. v. Gedutis.',' Gedutė yra lietuvių kilmės vardas.'),(1090,'Geisvydas','Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Geisvydas yra lietuvių kilmės vardas.'),(1091,'Geidbutas','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Geidbutas yra prūsų kilmės vardas.'),(1092,'Gelvyda',' (3a), (1), (1) liet., trump. Gelva, Gelvė, iš vyr. v. Gelvydas',' Gelvyda, Gelvyda, Gelvydė yra  kilmės vardas.'),(1093,'Gedrimė','Gedrimė – (1) liet., trump. Gedė, Gedrė, iš vyr. v. Gedrimas.',' Gedrimė yra lietuvių kilmės vardas.'),(1094,'Geidas',' (2), (4) liet., trumpinys iš Geidbutas, Geidvilas ir kt.',' Geidas, Geidys yra  kilmės vardas.'),(1095,'Geisvyda',' (3b), (1), (1) liet., trump. Geisvė, iš vyr. v. Geisvydas',' Geisvyda, Geisvyda, Geisvydė yra  kilmės vardas.'),(1096,'Gelvardas','Gelvardas – (1) liet., trump. Gelvas, Gelvys, gel- (žr. Gelbutas) + vard- (žr. Gedvardas).',' Gelvardas yra lietuvių kilmės vardas.'),(1097,'Gedvinas','Gedvinas – (1) liet., trump. Gedas, Gedvys, ged- (žr. Gedartas) + vin- (žr. Gaudvinas).',' Gedvinas yra lietuvių kilmės vardas.'),(1098,'Geistutis','Jūsų vardo dieną valdo Venera. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Geistutis yra lietuvių kilmės vardas.'),(1099,'Gelvarda',' (3a), (1), (1) liet., trump. Gelva, Gelvė, iš vyr. v. Gelvardas',' Gelvarda, Gelvarda, Gelvardė yra  kilmės vardas.'),(1100,'Geistutė','Jūsų vardo dieną valdo Venera. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Geistutė yra lietuvių kilmės vardas.'),(1101,'Gedvina',' (3b), (1), (1) liet., trump. Gedė, Gedvė, iš vyr. v. Gedvilas',' Gedvina, Gedvina, Gedvinė yra  kilmės vardas.'),(1102,'Geistys','Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Geistys yra lietuvių kilmės vardas.'),(1103,'Gedvilė','Jūsų gyvenimo verpetuose stipriausias noras – laiminga santuoka. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Gedvilė yra lietuvių kilmės vardas.'),(1104,'Gelvainė','Gelvainė – (1) liet., trump. Gelvė, iš vyr. v. Gelvainas.',' Gelvainė yra lietuvių kilmės vardas.'),(1105,'Gelvainas',' (1) liet., trump. Gelvas, Gelvys, gel- (žr. Gelbutas) + vain- (žr. Galvainas) ',' Gelvainas yra  kilmės vardas.'),(1106,'Geistenis','Geistenis – (2) liet., trump. Geistys, priesagos -enis vedinys iš sen. trump. Geistys, kuris iš Geistaras, Geistautas ir kt.',' Geistenis yra lietuvių kilmės vardas.'),(1107,'Gelminas',' (1) liet., trump. Gelmas, Gelmys, gel- (žr. Gelbutas) + min- (žr. Gailiminas)',' Gelminas yra lietuvių kilmės vardas.'),(1108,'Gedvilas','Jūsų gyvenimo verpetuose stipriausias noras – laiminga santuoka. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Gedvilas yra lietuvių kilmės vardas.'),(1109,'Gerimantė','Gerimantė – (1) liet., trump. Gerė, iš vyr. v. Gerimantas.',' Gerimantė yra lietuvių kilmės vardas.'),(1110,'Geistenė','Geistenė – (2) liet., trump. Geistė, iš vyr. v. Geistenis.',' Geistenė yra lietuvių kilmės vardas.'),(1111,'Gerimantas','Gerimantas – (1) liet., trump. Geras, Gerys, geri- (: liet. geras) + mant- (žr. Gailimantas).',' Gerimantas yra lietuvių kilmės vardas.'),(1112,'Gelmina',' (3a), (1), (1) liet., trump. Gelma, Gelmė, iš vyr. v. Gelminas',' Gelmina, Gelmina, Gelminė yra  kilmės vardas.'),(1113,'Geistė','Geistė – (2) liet., trumpinys iš mot. v. Geistara, Geistautė ir kt.',' Geistė yra lietuvių kilmės vardas.'),(1114,'Gelgaudas',' (1) liet., trump. Gelys, gel- (žr. Gelbutas) + gaud- (žr. Gaudrimas)',' Gelgaudas yra lietuvių kilmės vardas.'),(1115,'Gerda',' (1) vok., trumpinys iš Gertrūda',' Gerda yra vokiečių kilmės vardas.'),(1116,'Geistautė','Geistautė – (1) liet. ir latv., trump. Geistė, iš vyr. v. Geistautas.',' Geistautė yra lietuvių kilmės vardas.'),(1117,'Gelgauda',' (3a), (1), (1) liet., trump. Gela, iš vyr. v. Gelgaudas',' Gelgauda, Gelgauda, Gelgaudė yra  kilmės vardas.'),(1118,'Gerardas','Gerardai turi ir blogybių. Viena jų – polinkis į egoizmą. Kartais gali būti ryžtingi, o kartais tiesiog užsispyrę. Dažnai kritikuoja kitus, teigdami, kad tie neturi pasiryžimo. Todėl toks iškreiptas supratimas gali atstumti nuo jų draugus ir šeimos narius.',' Gerardas yra vokiečių kilmės vardas.'),(1119,'Geistautas','Geistautas – (1) liet. ir latv., trump. Geistys, geis- (žr. Geismantas) + taut- (žr. Gantautas).',' Geistautas yra lietuvių kilmės vardas.'),(1120,'Geraldas','Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Geraldas yra vokiečių kilmės vardas.'),(1121,'Geistaras','Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Geistaras yra prūsų kilmės vardas.'),(1122,'Gėlė','',' Gėlė yra lietuvių kilmės vardas.'),(1123,'Genovaitė','Genovaitė – (1) suliet. lot., trump. Genė, tarm. Ginutė, Genutė, Genusė ryt. aukšt., iš vid. lot. Genovefa, kuris greičiausiai yra germaniškos kilmės: germ. geno „giminė“ + wefa „moteris“.',' Genovaitė yra lotynų kilmės vardas.'),(1124,'Gelbutas','Gelbutas – (1) liet., trump. Gelbas, gel- (: liet. gel-ti, gel-ia „skaudėti“) + but- (žr. Gedbutas).',' Gelbutas yra lietuvių kilmės vardas.'),(1125,'Geivydas','Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Geivydas yra lietuvių kilmės vardas.'),(1126,'Genius','Genius – (2) liet. trumpinys iš Eugenijus ir kt.',' Genius yra lietuvių kilmės vardas.'),(1127,'Geivyda',' (3b), (1), (1) liet., trump. Geivė, iš vyr. v. Geivydas',' Geivyda, Geivyda, Geivydė yra  kilmės vardas.'),(1128,'Genė','Genė – (2) liet. trumpinys iš Eugenė, Eugenija ir kt.',' Genė yra lotynų kilmės vardas.'),(1129,'Gendvilė','Gendvilė – (1), (2) liet., trump. Gendė: iš vyr. v. Gendvilas.',' Gendvilė yra lietuvių kilmės vardas.'),(1130,'Gendvilas','Gendvilas – (1) liet., trump. Gendas, Gendys, gend- (žr. Gendrimas) + vil- (žr. Gaivilas).',' Gendvilas yra lietuvių kilmės vardas.'),(1131,'Gervydas','Gervydas – (1) liet., trump. Gerys, ger- (žr. Germantas) + vyd- (žr. Galvydas).',' Gervydas yra lietuvių kilmės vardas.'),(1132,'Gervyda',' (3b), (1), (1) liet., trump. Gerė, iš vyr. v. Gervydas',' Gervyda, Gervyda, Gervydė yra  kilmės vardas.'),(1133,'Gendrutis','Gendrutis – (2) liet., trump. Gendrys, Gendrius: priesagos -utis vedinys iš sen. trump. Gendrys, Gendrius, kuris iš avd. Gendrimas.',' Gendrutis yra lietuvių kilmės vardas.'),(1134,'Gervazas','Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Gervazas yra ispanų kilmės vardas.'),(1135,'Gendrutė','Gendrutė – (2) liet., sen. var. Gendruta, trump. Gendrė, – 1. liet., priesagos -utė vedinys iš Gendrė, 2. sulietuvintas vardo Gertrūda variantas.',' Gendrutė yra lietuvių kilmės vardas.'),(1136,'Gendrys',' (4), (2) liet., trumpinys iš avd. Gendrimas',' Gendrys, Gendrius yra  kilmės vardas.'),(1137,'Gerutis','Gerutis – (2) liet., trump. Gerys, priesagos -utis vedinys iš sen. trump. Gerys, kuris iš Gerimantas, Germinas, Gertautas ir kt.',' Gerutis yra lietuvių kilmės vardas.'),(1138,'Gendrimas','Jūsų gyvenimą veikia Merkurijus, kuris nulemia jūsų protinį aktyvumą, gyvumą, naujus įspūdžius, prekybines operacijas, kalbą ir rašybą, domėjimąsi kultiniais mokslais.',' Gendrimas yra lietuvių kilmės vardas.'),(1139,'Gertrūda','Negatyvios vibracijos Gertrūdoms pateikia daugybę netikėtumų. Jos patiria transporto katastrofas, ištremiamos iš savo šalies arba miršta nuo svetimtaučio rankos.',' Gertrūda yra vokiečių kilmės vardas.'),(1140,'Gendrė','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Gendrė yra lietuvių kilmės vardas.'),(1141,'Gerutė','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Gerutė yra lietuvių kilmės vardas.'),(1142,'Gertautė','Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Gertautė yra lietuvių kilmės vardas.'),(1143,'Gertautas','Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Gertautas yra lietuvių kilmės vardas.'),(1144,'Gertas',' (2), (4) liet., trumpinys iš Gertautas, Gertaras ir kt.',' Gertas, Gertys yra  kilmės vardas.'),(1145,'Gertarė','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Gertarė yra lietuvių kilmės vardas.'),(1146,'Gertaras','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Gertaras yra lietuvių kilmės vardas.'),(1147,'Germinas','Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Germinas yra lietuvių kilmės vardas.'),(1148,'Gerta','Gerta – (1) vok., trumpinys iš Gertrūda.',' Gerta yra Vokiečių kilmės vardas.'),(1149,'Germina','Germina – (3b), (1), (1) liet., trump. Germė, iš vyr. v. Germinas ',' Germina, Germina, Germinė yra  kilmės vardas.'),(1150,'Germantė','Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Germantė yra lietuvių kilmės vardas.'),(1151,'Iduna','Iduna – (2) skand., trump. Ida, iš skandinavų Iduna, kuris iš mitologinio v. Iduna — amžinos jaunystės deivė.',' Iduna yra skandinavų kilmės vardas.'),(1152,'Idalija','Idalija – (1) ital., trump. Ida, iš italų Idalia, kuris yra priesaginis vedinys iš germ. Ida.',' Idalija yra italų kilmės vardas.'),(1153,'Ida','Vardadienis: Balandžio 13 d. rugsėjo 4 d.',' Ida yra vokiečių kilmės vardas.'),(1154,'Giedrius','Giedriai – tyros asmenybės, nes jų vardo vibracijos suteikia jiems didingų savybių. Jie visada apšviesti rampos šviesa. Tokį dėmesį pateisina ir stengiasi dirbti kitų labui. Turi daug vidinės energetikos ir gali būti puikiais mediumais. Dėl to daugelis tampa kunigais arba religiniais lyderiais.',' Giedrius yra lietuvių kilmės vardas.'),(1155,'Giedrė','Iš negatyvių veiksnių reikėtų pažymėti Giedrių norą gyventi ne pagal pajamas. Būdamos nekantrios sunkiai pakelia buities sunkumus ir bet kokius prieštaravimus. Joms būdingas ir per didelis pasitikėjimas savimi, pasipūtimas ir puikybė.',' Giedrė yra lietuvių kilmės vardas.'),(1156,'Giedra','Giedra – (2) liet. : liet. giedra, plg. Giedrė.',' Giedra yra lietuvių kilmės vardas.'),(1157,'Getautė','Getautė – (1) liet., trump. Getė, iš vyr. v. Getautas.',' Getautė yra lietuvių kilmės vardas.'),(1158,'Gilvina',' (3a), (1), (1) liet., trump. Gilvė, iš vyr. v. Gilvinas',' Gilvina, Gilvina, Gilvinė yra  kilmės vardas.'),(1159,'Getautas','Getautas – (1) liet., trump. Getas, Getys, ge- kilęs iš ged- (žr. Gedartas) + taut- (žr. Gantautas).',' Getautas yra lietuvių kilmės vardas.'),(1160,'Gesvina',' (3b), (1), (1) liet., trump. Gesvė, iš vyr. v. Gesvinas',' Gesvina, Gesvina, Gesvinė yra  kilmės vardas.'),(1161,'Gesvinas','Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai !',' Gesvinas yra lietuvių kilmės vardas.'),(1162,'Gilvilė','Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas.',' Gilvilė yra lietuvių kilmės vardas.'),(1163,'Gestautė','Gestautė – (1) liet., trump. Gestė, iš vyr. v. Gestautas.',' Gestautė yra lietuvių kilmės vardas.'),(1164,'Gilvilas','Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas.',' Gilvilas yra lietuvių kilmės vardas.'),(1165,'Gestautas','Gestautas – (1) liet., trump. Gestas, Gestys, ges- (žr. Geskantas) + taut- (žr. Gantautas).',' Gestautas yra lietuvių kilmės vardas.'),(1166,'Gilvydas','Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas.',' Gilvydas yra lietuvių kilmės vardas.'),(1167,'Geskantas','Geskantas – (1) liet., trump. Gesas, Gesys, ges- (: liet. pasi-ges-ti) + kant- (žr. Galkantas).',' Geskantas yra lietuvių kilmės vardas.'),(1168,'Geskanta',' (3b), (1), (1) liet., trump. Gesė, iš vyr. v. Geskantas',' Geskanta, Geskanta, Geskantė yra  kilmės vardas.'),(1169,'Gilvyda',' (3a), (1), (1) liet., trump. Gilva, Gilvė, iš vyr. v. Gilvydas',' Gilvyda, Gilvyda, Gilvydė yra  kilmės vardas.'),(1170,'Geržadas','Vardadienis: Vasario mėn 26 d. – Geržado vardo diena.',' Geržadas yra lietuvių kilmės vardas.'),(1171,'Gilvainė','Jūsų gyvenimas kiaurai persmelktas jūsų įsitikinimų. Jūs švytite, intuityvūs, atviri, emocionalūs ir išradingi. Galite būti stiprūs dvasiškai. Jūsų teigiamos savybės: artistiškumas, potraukis į nežabotas linksmybes, polinkis į kūrybą, romantiškumas, aistringumas, linksmumas, platūs interesai.',' Gilvainė yra lietuvių kilmės vardas.'),(1172,'Geržada',' (3b), (1), (1) liet., trump. Gerė, iš vyr. v. Geržadas',' Geržada, Geržada, Geržadė yra  kilmės vardas.'),(1173,'Gilvainas','Jūsų gyvenimas kiaurai persmelktas jūsų įsitikinimų. Jūs švytite, intuityvūs, atviri, emocionalūs ir išradingi. Galite būti stiprūs dvasiškai. Jūsų teigiamos savybės: artistiškumas, potraukis į nežabotas linksmybes, polinkis į kūrybą, romantiškumas, aistringumas, linksmumas, platūs interesai.',' Gilvainas yra lietuvių kilmės vardas.'),(1174,'Gervilė','Gervilė – (1), (2) liet., trump. Gerė, iš vyr. v. Gervilas.',' Gervilė yra lietuvių kilmės vardas.'),(1175,'Gilmintas',' (1) liet., trump. Gilas, Gilmas, gil- (žr. Gilminas) + mint- (žr. Gedmintas)',' Gilmintas yra lietuvių kilmės vardas.'),(1176,'Gintas','Gintai siaurų profesijų specialistai, tačiau tai tikri profesionalai. Jie kantrūs, pasitikintys, turi išskirtinių savybių. Reikėtų saugotis neigiamų vibracijų: nekantrumo, melancholijos, potraukio alkoholiui. Tingumo.',' Gintas yra lietuvių kilmės vardas.'),(1177,'Gervilas','Gervilas – (1) liet., trump. Gerys, ger- (žr. Germantas) + vil- (žr. Gaivilas).',' Gervilas yra lietuvių kilmės vardas.'),(1178,'Gilminta',' (3a), (1), (1) liet., trump. Gilmė, iš vyr. v. Gilmintas',' Gilminta, Gilminta, Gilmintė yra  kilmės vardas.'),(1179,'Gilminas','Gilminas – (1) liet., trump. Gilas, Gilmas, gil- (: liet. gil-ti „skaudinti“) + min- (žr. Gailiminas).',' Gilminas yra lietuvių kilmės vardas.'),(1180,'Gintarė','Gintarės puikiai supranta pinigų svarbą, tačiau jų kaupimas – ne jų tikslas. Turėdamos pinigų, jos stengiasi juos investuoti į kokį nors patikimą biznį.',' Gintarė yra lietuvių kilmės vardas.'),(1181,'Gilmina',' (3a), (1), (1) liet., trump. Gilmė, iš vyr. v. Gilminas',' Gilmina, Gilmina, Gilminė yra  kilmės vardas.'),(1182,'Gildas','Gildas – (1) liet.: liet. gild-yti (širdį).',' Gildas yra lietuvių kilmės vardas.'),(1183,'Gintaras','Gintarų teigiamos savybės: ryžtingumas, solidumas, nenuramdomumas, atkaklumas. Aštuonetukas jiems papildomai suteikia profesionalumo, autoritetą, sugebėjimą, ambicingumo.',' Gintaras yra lietuvių kilmės vardas.'),(1184,'Gintara',' (1) liet. ir prūs., trump. Ginta, Gintė, iš vyr. v. Gintaras',' Gintara, Gintara, Gintarė yra  kilmės vardas.'),(1185,'Gilda','Gilda – (1) liet., iš vyr. v. Gildas.',' Gilda yra lietuvių kilmės vardas.'),(1186,'Ginta',' (1) liet. ir prūs., trumpinys iš Gintautė ir kt.',' Ginta, Gintė yra  kilmės vardas.'),(1187,'Gilbertas','Gilbertas – (1) germ., trump. Gilas, Bertas, iš vok. Gilbert, kuris iš germ. Gisalbert, Giselbert: germ. gisal- „įkaitas“ + beraht „garsus, žymus“.',' Gilbertas yra vokiečių kilmės vardas.'),(1188,'Ginvilė','Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Ginvilė yra lietuvių kilmės vardas.'),(1189,'Giniotė','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais',' Giniotė yra lietuvių kilmės vardas.'),(1190,'Ginvilas','Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Ginvilas yra lietuvių kilmės vardas.'),(1191,'Giniotas','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais',' Giniotas yra lietuvių kilmės vardas.'),(1192,'Gilanda','Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Gilanda yra lietuvių kilmės vardas.'),(1193,'Gindvilė','Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Gindvilė yra lietuvių kilmės vardas.'),(1194,'Ginvydas','Ginvydas – (1) liet., trump. Ginas, Ginius, gin- (žr. Gintaras) + vyd- (žr. Galvydas).',' Ginvydas yra lietuvių kilmės vardas.'),(1195,'Ginvyda',' (3a), (1), (1) liet., trump. Gina, iš vyr. v. Ginvydas',' Ginvyda, Ginvyda, Ginvydė yra  kilmės vardas.'),(1196,'Gindvilas','Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Gindvilas yra lietuvių kilmės vardas.'),(1197,'Gindas','Gindas – (2) liet. ir prūs., trumpinys iš Gindvilas.',' Gindas yra lietuvių kilmės vardas.'),(1198,'Gintvilė','Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Gintvilė yra lietuvių kilmės vardas.'),(1199,'Ginda',' (2) liet., trumpinys iš mot. vardų Gindvilė ir kt.',' Ginda, Gindė yra  kilmės vardas.'),(1200,'Gintvilas','Gintvilas – (1) liet., trump. Gintas, gint- (žr. Gintvainas) + vil- (žr. Gaivilas).',' Gintvilas yra lietuvių kilmės vardas.'),(1201,'Gintvainė','Gintvainė – (1) liet., trump. Gintė, iš vyr. v. Gintvainas.',' Gintvainė yra lietuvių kilmės vardas.'),(1202,'Ginas',' (2) liet., trumpinys iš avd. su Gin-: Ginvydas, Ginvilas ir kt.',' Ginas, Ginius yra  kilmės vardas.'),(1203,'Giriotas','Giriotas – (1) liet., trump. Girius, gir- (: liet. gir-ti, gir-ia) + jot- (: liet. joti, jot-ų).',' Giriotas yra lietuvių kilmės vardas.'),(1204,'Gintvainas','Gintvainas – (1) liet., trump. Gintas, gint- (: liet. ginti, gint-as) + vain- (žr. Galvainas).',' Gintvainas yra lietuvių kilmės vardas.'),(1205,'Gina','Vardadienis: Kovo 31 d., gegužės 24 d.',' Gina yra lietuvių kilmės vardas.'),(1206,'Girėnas','Girėnas – (1) liet., trump. Girius, iš transatlantinio lakūno pavardės Girėnas.',' Girėnas yra lietuvių kilmės vardas.'),(1207,'Gintys','Gintys – (4) liet. ir prūs., trumpinys iš Gintaras, Gintautas, Gintvilas ir kt.',' Gintys yra lietuvių kilmės vardas.'),(1208,'Girdvilė',' (1), (2) liet., trump. Girdė, iš vyr. v. Girdvilas',' Girdvilė yra lietuvių kilmės vardas.'),(1209,'Gintilė','Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Gintilė yra lietuvių kilmės vardas.'),(1210,'Gilvinas','Gilvinas – (1) liet., trump. Gilvas, Gilvys, gil- (žr. Gilminas) + vin- (žr. Gaudvinas).',' Gilvinas yra lietuvių kilmės vardas.'),(1211,'Girdvilas','Girdvilas – (1) liet., trump. Girdas, Girdys, gird- (žr. Girdmantas) + vil- (žr. Gaivilas).',' Girdvilas yra lietuvių kilmės vardas.'),(1212,'Gintilas','Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Gintilas yra prūsų kilmės vardas.'),(1213,'Girdvydas','Girdvydas – (1) liet., trump. Girdas, Girdys, gird- (žr. Girdmantas) + vyd- (žr. Galvydas).',' Girdvydas yra lietuvių kilmės vardas.'),(1214,'Gintenis','Gintenis – (2) liet., trump. Gintis, priesagos -enis vedinys iš sen. trump. Gintas.',' Gintenis yra lietuvių kilmės vardas.'),(1215,'Girdvyda',' (3b), (1), (1) liet., trump. Girdė, iš vyr. v. Girdvydas',' Girdvyda, Girdvyda, Girdvydė yra  kilmės vardas.'),(1216,'Gintenė','Gintenė – (2) liet., trump. Gintė, iš vyr. v. Gintenis.',' Gintenė yra lietuvių kilmės vardas.'),(1217,'Girdvainė','Girdvainė – (1) liet., trump. Girdė, iš vyr. v. Girdvainas.',' Girdvainė yra lietuvių kilmės vardas.'),(1218,'Girdvainas','Girdvainas – (1) liet., trump. Girdas, Girdys, gird- (žr. Girdmantas) + vain- (žr. Galvainas).',' Girdvainas yra lietuvių kilmės vardas.'),(1219,'Gintautė','Gintautė – (1) liet. ir prūs., trump. Ginta, Gintė, iš vyr. v. Gintautas.',' Gintautė yra lietuvių kilmės vardas.'),(1220,'Girtautė','Girtautė – (1) liet., trump. Girė, iš vyr. v. Girtautas.',' Girtautė yra lietuvių kilmės vardas.'),(1221,'Girtautas','Girtautas – (1) liet., trump. Giras, Girius, gir- (žr. Giriotas) + taut- (žr. Gantautas).',' Girtautas yra lietuvių kilmės vardas.'),(1222,'Girdutis','Girdutis – (2) liet. ir prūs., trump. Girdas, Girdys, priesagos -utis vedinys iš sen. trump. Girdas.',' Girdutis yra lietuvių kilmės vardas.'),(1223,'Gintautas','Gintautai neigiamų savybių labai linkę blogybėms; seksualiniai maniakai. Jie nevalingi, išdidūs, pagyrūnai. Tokie veiksmai sukelia pašalinių pašaipias šypsenėles. Nemėgsta dirbti ir labai tingūs. Jie gudrūs ir naudojasi kitų silpnybėmis, tačiau patys bailūs ir nemėgsta stipresniųjų už save.',' Gintautas yra lietuvių kilmės vardas.'),(1224,'Girstys','Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės.',' Girstys yra lietuvių kilmės vardas.'),(1225,'Girdutė','Girdutė – (2) liet. ir prūs., trump. Girdė, iš vyr. v. Girdutis.',' Girdutė yra lietuvių kilmės vardas.'),(1226,'Girstenis','Girstenis – (2) liet. ir prūs., trump. Girstys, priesagos -enis vedinys iš sen. trump. Girstys.',' Girstenis yra lietuvių kilmės vardas.'),(1227,'Girdmantė','Girdmantė – (1) liet., trump. Girdė, iš vyr. v. Girdmantas.',' Girdmantė yra lietuvių kilmės vardas.'),(1228,'Girdmantas','Girdmantas – (1) liet., trump. Girdas, Girdys, gird- (: liet. gird-ėti, gird-as „gandas, žinia“) + mant- (žr. Gailimantas).',' Girdmantas yra lietuvių kilmės vardas.'),(1229,'Girstenė','Girstenė – (2) liet. ir prūs., trump. Girstė, iš vyr. v. Girstenis.',' Girstenė yra lietuvių kilmės vardas.'),(1230,'Girdenė','Girdenė – lietuviškos kilmės vardas mergaitei. Girdenės vardo trumpinys – Girdė, o Girdenės vardo atitikmuo vyrui – Girdenis.',' Girdenė yra lietuvių kilmės vardas.'),(1231,'Girstė','Girstė – (1) liet., trumpinys iš Girstautė.',' Girstė yra lietuvių kilmės vardas.'),(1232,'Girdenis','Girdenis – lietuviškas vardas, kurio trumpinys – Girdys. Girdenis – priesagos -enis vedinys iš senovinio vardo trumpinio Girdas.',' Girdenis yra lietuvių kilmės vardas.'),(1233,'Girstautė','Girstautė – (1) liet. ir prūs., trump. Girstė, iš vyr. v. Girstautas.',' Girstautė yra lietuvių kilmės vardas.'),(1234,'Gytenė','Gytenė – (2) liet., trump. Gytė, iš vyr. v. Gytenis.',' Gytenė yra lietuvių kilmės vardas.'),(1235,'Girdas',' (2), (4) liet., trumpinys iš Girdmantas, Girdvainas, Girdvydas ir kt.',' Girdas, Girdys yra  kilmės vardas.'),(1236,'Girstautas','Vardadienis: Rugsėjo 4 d., gruodžio 24 d.',' Girstautas yra lietuvių kilmės vardas.'),(1237,'Gytė','Vardadienis: Spalio 17 d., rugsėjo 11 d.',' Gytė yra lietuvių kilmės vardas.'),(1238,'Girmas','Girmas – (1) liet., trumpinys iš Girmantas.',' Girmas yra lietuvių kilmės vardas.'),(1239,'Gytautė','Gytautė -(1) liet., trump. Gytė, iš vyr. v. Gytautas.',' Gytautė yra lietuvių kilmės vardas.'),(1240,'Girmantė','Vardadienis: Kovo 28 d., balandžio 18 d.',' Girmantė yra lietuvių kilmės vardas.'),(1241,'Gytautas','Vardadienis: Vasario 1 d., rugsėjo 1 d.',' Gytautas yra lietuvių kilmės vardas.'),(1242,'Girmantas','Girmantas – (1) liet., trump. Girmas, gir- (žr. Giriotas) + mant- (žr. Gailimantas).',' Girmantas yra lietuvių kilmės vardas.'),(1243,'Girma','Girma – (1) liet., trumpinys iš Girmantė.',' Girma yra lietuvių kilmės vardas.'),(1244,'Gita','Gita – (2) vok., iš vok. Gita, Gitta, kuris yra vok. trumpinys iš Brigita.',' Gita yra vokiečių kilmės vardas.'),(1245,'Giržadė','Giržadė – (1) liet., trump. Girė, iš vyr. v. Giržadas.',' Giržadė yra lietuvių kilmės vardas.'),(1246,'Girkantas',' (1) liet., trump. Giras, Girius, gir-(žr. Giriotas) + kant- (žr. Galkantas)',' Girkantas yra lietuvių kilmės vardas.'),(1247,'Girkanta',' (3a), (1), (1) liet., trump. Girė, iš vyr. v. Girkantas',' Girkanta, Girkanta, Girkantė yra  kilmės vardas.'),(1248,'Giržadas','Giržadas – (1) liet., trump. Giras, Girius, gir- (žr. Giriotas) + žad- (žr. Geržadas).',' Giržadas yra lietuvių kilmės vardas.'),(1249,'Girvinas','Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Girvinas yra lietuvių kilmės vardas.'),(1250,'Giriotė','Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Giriotė yra lietuvių kilmės vardas.'),(1251,'Girvina',' (3a), (1), (1) suliet. prūs., trump. Girė, iš vyr. v. Girvinas',' Girvina, Girvina, Girvinė yra  kilmės vardas.'),(1252,'Girvilė','Girvilė – (1), (2) liet., trump. Girė, iš vyr. v. Girvilas.',' Girvilė yra lietuvių kilmės vardas.'),(1253,'Girvilas','Girvilas – (1) liet., trump. Giras, Girius, gir- (žr. Giriotas) + vil- (žr. Gaivilas).',' Girvilas yra lietuvių kilmės vardas.'),(1254,'Girvydas','Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Girvydas yra lietuvių kilmės vardas.'),(1255,'Girvyda',' (3a), (1), (1) liet., trump. Girė, iš vyr. v. Girvydas',' Girvyda, Girvyda, Girvydė yra  kilmės vardas.'),(1256,'Guoda','Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Guoda yra lietuvių kilmės vardas.'),(1257,'Guntilda','Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Guntilda yra vokiečių kilmės vardas.'),(1258,'Girvainė','Jus globoja Saturnas. Jūsų mintys visada ramios, viskas apgalvota iki smulkmenų; retai kada pasireiškia impulsyvumas ir emocijos bei skubotumas. Jūs labai vertinate kiekvieną minutę ir kelyje į tikslą užimate tvirtą poziciją bei visada žinote, ko norite.',' Girvainė yra lietuvių kilmės vardas.'),(1259,'Gotautas','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Gotautas yra lietuvių kilmės vardas.'),(1260,'Girvainas','Jus globoja Saturnas. Jūsų mintys visada ramios, viskas apgalvota iki smulkmenų; retai kada pasireiškia impulsyvumas ir emocijos bei skubotumas. Jūs labai vertinate kiekvieną minutę ir kelyje į tikslą užimate tvirtą poziciją bei visada žinote, ko norite.',' Girvainas yra lietuvių kilmės vardas.'),(1261,'Gundė','Gundė – (2) suliet. prūs., trumpinys iš mot. v. Jogundė, Nergundė, Sangundė ir kt.',' Gundė yra lietuvių kilmės vardas.'),(1262,'Gotartas','Gotartas – (1) liet., trump. Gotas, go- iš god- (: liet. god-yti „nujausti, nutuokti“) + tart- (žr. Gedartas).',' Gotartas yra lietuvių kilmės vardas.'),(1263,'Gotarta',' (3a), (1), (1) liet., trump. Gotė, iš vyr. v. Gotartas',' Gotarta, Gotarta, Gotartė yra  kilmės vardas.'),(1264,'Gostautė','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Gostautė yra lietuvių kilmės vardas.'),(1265,'Gostautas','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Gostautas yra lietuvių kilmės vardas.'),(1266,'Gostarta',' (3a), (1), (1) suliet. prūs., trump. Gostė, iš vyr. v. Gostartas',' Gostarta, Gostarta, Gostartė yra  kilmės vardas.'),(1267,'Gostartas','Gostartas – (1) suliet. prūs., trump. Gostys, gos- (: liet. gos-tis „atsipeikėti“) + tart- (žr. Gedartas).',' Gostartas yra lietuvių kilmės vardas.'),(1268,'Gomantas','Gomantas – (1) liet., trump. Gomas, go- (: liet. go-ti „eiti“) + mant- (žr. Gailimantas).',' Gomantas yra lietuvių kilmės vardas.'),(1269,'Gomantė','Gomantė – (1) liet., trump. Gomė, iš vyr. v. Gomantas.',' Gomantė yra lietuvių kilmės vardas.'),(1270,'Goda',' (4) liet., iš sen. vyr. avd. Godas (plg. vv. Godai — Radviliškis), kuris yra sen. trumpinys iš God-tautas, virtusio Gotautas, iš God-tartas, virtusio Gotartas',' Goda yra lietuvių kilmės vardas.'),(1271,'Gytis','Jūsų vardo dieną valdo Venera. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Gytis yra lietuvių kilmės vardas.'),(1272,'Gytenis','Jūsų vardo dieną valdo Venera. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Gytenis yra lietuvių kilmės vardas.'),(1273,'Gvidonas','Jūsų gyvenimo verpetuose stipriausias noras – laiminga santuoka. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Gvidonas yra vokiečių kilmės vardas.'),(1274,'Gvidas','Gvidai meilės dalykuose stengiasi nurungti partnerį, tačiau tas, likdamas meilus ir paslaugus, turi stengtis neprarasti iniciatyvos.',' Gvidas yra vokiečių kilmės vardas.'),(1275,'Gutautė','Gutautė – (1) liet., trump. Gutė, iš vyr. v. Gutautas.',' Gutautė yra lietuvių kilmės vardas.'),(1276,'Gutautas','Gutautas – (1) liet., trump. Gutys, gu- kilęs iš gud- (žr. Gudminas) + taut (žr. Gantautas).',' Gutautas yra lietuvių kilmės vardas.'),(1277,'Gustina','Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Gustina yra lietuvių kilmės vardas.'),(1278,'Gustavas','Gustus galima būtų apibendrinti trimis žodžiais: tikėjimas, viltis ir meilė. Nors sakoma, kad juos veikia Venera, tačiau daugeliu atveju jų meilę galima pavadinti labiau motiniška, negu jausmine. Meilėje jie vadovaujasi romantizmu ir idealizmu.',' Gustavas yra skandinavų kilmės vardas.'),(1279,'Gustė','Gustė – (2) 1. liet. trumpinys iš Augustė, 2. liet., trumpinys iš Gustautė.',' Gustė yra lietuvių kilmės vardas.'),(1280,'Gustava','Gustava – (1) skand., trump. Gustė, iš vyr. v. Gustavus, žr. Gustavas.',' Gustava yra skandinavų kilmės vardas.'),(1281,'Gustautas','Gustautas – (1) liet., trump. Gustas, Gustys, gus- kilęs iš gust- (, liet. gust-ų, gusti) + taut- (žr. Gantautas).',' Gustautas yra lietuvių kilmės vardas.'),(1282,'Gustautė','Gustautė – (1) liet., trump. Guste, iš vyr. v. Gustautas.',' Gustautė yra lietuvių kilmės vardas.'),(1283,'Gustas',' (2), (2), (4) 1. liet. trumpinys iš Gustavas ir Augustas bei Augustinas, 2. liet., trumpinys iš Gustautas',' Gustas, Gustis, Gustys yra  kilmės vardas.'),(1284,'Guostė','Guostė – (1) liet., iš upėvardžio Guostė (Stakliškės).',' Guostė yra lietuvių kilmės vardas.'),(1285,'Gražinė','Kartais Gražinos profesiją pasirenka finansų, statistikos, ekonomikos srityse. Susiklosčius negatyvioms aplinkybėms, Gražinos patiria finansinių sunkumų ir tada jos įpuola į depresiją',' Gražinė yra lietuvių kilmės vardas.'),(1286,'Gražina','Vardadieniai: balandžio mėn. 1 d., rugsėjo mėn. 8 d., rugsėjo mėn. 26 d. – Gražinos vardo dienos.',' Gražina yra lietuvių kilmės vardas.'),(1287,'Gražė','Kartais Gražinos profesiją pasirenka finansų, statistikos, ekonomikos srityse. Susiklosčius negatyvioms aplinkybėms, Gražinos patiria finansinių sunkumų ir tada jos įpuola į depresiją.',' Gražė yra lietuvių kilmės vardas.'),(1288,'Gratas','Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Gratas yra lotynų kilmės vardas.'),(1289,'Grata','Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Grata yra lotynų kilmės vardas.'),(1290,'Grasilda','',' Grasilda yra vokiečių kilmės vardas.'),(1291,'Grasė',' (2) liet. trumpinys iš Grasilda',' Grasė yra  kilmės vardas.'),(1292,'Gracius','Gracijai retai kada būna turtingi. Jie visiškai nemoka elgtis su savo finansais, todėl būtų protingiausia šiuos reikalus atiduoti žmonai arba artimiesiems.',' Gracius yra lotynų kilmės vardas.'),(1293,'Gracijus','Gracijai retai kada būna turtingi. Jie visiškai nemoka elgtis su savo finansais, todėl būtų protingiausia šiuos reikalus atiduoti žmonai arba artimiesiems.',' Gracijus yra lotynų kilmės vardas.'),(1294,'Gracijonas','Gracijai retai kada būna turtingi. Jie visiškai nemoka elgtis su savo finansais, todėl būtų protingiausia šiuos reikalus atiduoti žmonai arba artimiesiems.',' Gracijonas yra lotynų kilmės vardas.'),(1295,'Gracija','Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Gracija yra lotynų kilmės vardas.'),(1296,'Govartė','Govartė – (1) liet., trump. Govė, iš vyr. v. Govartas.',' Govartė yra lietuvių kilmės vardas.'),(1297,'Govartas','Govartas – (1) liet., trump. Govas, go- (žr. Gomantas) + vart- (: liet. vart-yti, vart-o).',' Govartas yra lietuvių kilmės vardas.'),(1298,'Gotfridas','Gotfridas – (1) vok., trump. Gotas, Fridas, baž. lot. Godefridus, Gottfridus iš vok. Gottfried: sen. vok. aukšt. got „dievas“ + fridu „taika“.',' Gotfridas yra vokiečių kilmės vardas.'),(1299,'Grigas','Grigas – (2) liet. trumpinys iš Grigalius.',' Grigas yra graikų kilmės vardas.'),(1300,'Gotautė','Gotautė – (1) liet., trump. Gotė, iš vyr. v. Gotautas.',' Gotautė yra lietuvių kilmės vardas.'),(1301,'Grigalius','Vardadienis: Sausio 2 d., gegužės 9 d., birželio 17 d., rugsėjo 3 d.',' Grigalius yra graikų kilmės vardas.'),(1302,'Greta','Greta – (1) vak. liet. iš vok. Greta, Grete, kuris yra vok. trumpinys iš Margarita',' Greta, Grėtė yra  kilmės vardas.'),(1303,'Gundas','Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Gundas yra lietuvių kilmės vardas.'),(1304,'Gražvilė','Gražvilė – (1), (2) liet., trump. Gražė, iš vyr. v. Gražvilas.',' Gražvilė yra lietuvių kilmės vardas.'),(1305,'Gunda','Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Gunda yra lietuvių kilmės vardas.'),(1306,'Gražvilas','Gražvilas – (1) liet., trump. Gražys, graž- (žr. Gražmantas) + vil- (žr. Gaivilas).',' Gražvilas yra lietuvių kilmės vardas.'),(1307,'Gudvinas','Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Gudvinas yra lietuvių kilmės vardas.'),(1308,'Gražvydas','Gražvydas – (1) liet., trump. Gražys, graž- (žr. Gražmantas) + vyd- (žr. Galvydas).',' Gražvydas yra lietuvių kilmės vardas.'),(1309,'Gudvina',' (3b), (1), (1) liet., trump. Gudvė, iš vyr. v. Gudvinas',' Gudvina, Gudvina, Gudvinė yra  kilmės vardas.'),(1310,'Hermas','Hermanai turi geros sveikatos ir nekreipia dėmesio į ligos simptomus. Nors jie lyderiai, tačiau turi gerą širdį ir dvasiškai pažeidžiami.',' Hermas yra graikų kilmės vardas.'),(1311,'Gražvyda',' (3b), (1), (1) liet., trump. Gražė, iš vyr. v. Gražvydas',' Gražvyda, Gražvyda, Gražvydė yra  kilmės vardas.'),(1312,'Gudvilė','Gudvilė – (1), (2) liet., trump. Gudvė, iš vyr. v. Gudvilas.',' Gudvilė yra lietuvių kilmės vardas.'),(1313,'Hermanas','Hermanai turi geros sveikatos ir nekreipia dėmesio į ligos simptomus. Nors jie lyderiai, tačiau turi gerą širdį ir dvasiškai pažeidžiami.',' Hermanas yra vokiečių kilmės vardas.'),(1314,'Gražvaldė','Gražvaldė – (1) liet., trump. Gražė, iš vyr. v. Gražvaldas.',' Gražvaldė yra lietuvių kilmės vardas.'),(1315,'Herkus','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Herkus yra vokiečių kilmės vardas.'),(1316,'Gražvaldas','Gražvaldas – (1) liet., trump. Gražys, graž- (žr. Gražmantas) + vald- (žr. Gedvaldas).',' Gražvaldas yra lietuvių kilmės vardas.'),(1317,'Gudvilas','Gudvilas – (1) liet., trump. Gudvas, Gudvys, gud- (žr. Gudminas) + vil- (žr. Gaivilas).',' Gudvilas yra lietuvių kilmės vardas.'),(1318,'Gudvainė','Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Gudvainė yra lietuvių kilmės vardas.'),(1319,'Herbertas','Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Herbertas yra vokiečių kilmės vardas.'),(1320,'Gudvainas','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Gudvainas yra lietuvių kilmės vardas.'),(1321,'Gražmintė','Gražmintė – (1) liet., trump. Gražė, iš vyr. v. Gražmintas.',' Gražmintė yra lietuvių kilmės vardas.'),(1322,'Heraklis','Heraklis – (2) graik., sen. var. Heraklas, Heraklijus, Iraklijus, baž. lot. Heraklius iš graik. Herakles – „Heros šlovė“: Hera — sen. graikų santuokos deivė + kleos „šlovė“.',' Heraklis yra graikų kilmės vardas.'),(1323,'Gražmintas','Gražmintas – (1) liet., trump. Gražys, graž- (žr. Gražmantas) + mint- (žr. Gedmintas).',' Gražmintas yra lietuvių kilmės vardas.'),(1324,'Gudrė','Gudrė – (2) liet., galūnės vedinys iš liet. gudri.',' Gudrė yra lietuvių kilmės vardas.'),(1325,'Hubertas','Hubertas – (1) germ., trump. Bertas, tarm. Ubertas, iš sulotyninto germ. Hubertus, kuris iš sen. germ. Hugubert: sen. vok. aukšt. hugu „dvasia“ + beraht „garsus, žymus“.',' Hubertas yra vokiečių kilmės vardas.'),(1326,'Henris','Henriai linkę į boheminį gyvenimą. Greitai užsiliepsnoja, labai impulsyvūs ir todėl kaip linkę romantiškiems meilės ryšiams.',' Henris yra vokiečių kilmės vardas.'),(1327,'Gražmantė','Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Gražmantė yra lietuvių kilmės vardas.'),(1328,'Gudminas','Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai !',' Gudminas yra lietuvių kilmės vardas.'),(1329,'Hortenzija','Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas. ',' Hortenzija yra lotynų kilmės vardas.'),(1330,'Henrikas','Henrikų profesijos: išradėjai, pažangūs mokslininkai, hipnotizuotojai, politikai, medikai, žurnalistai',' Henrikas yra vokiečių kilmės vardas.'),(1331,'Gudmina',' (3b), (1), (1) liet., trump. Gudmė, iš vyr. v. Gudminas',' Gudmina, Gudmina, Gudminė yra  kilmės vardas.'),(1332,'Gražmantas','Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Gražmantas yra lietuvių kilmės vardas.'),(1333,'Honorijus','Honorijus – (1) lot., trump. Honoras, Honas, iš lot. Honorius: lot. honor „garbė“.',' Honorijus yra lotynų kilmės vardas.'),(1334,'Helmutas','Helmutas – (1) vok., trump. Helmas, Helmis, iš vok. Helmut: sen. vok. aukšt. helm „šalmas, apsauga“ + muot „nusistatymas, nusiteikimas“.',' Helmutas yra vokiečių kilmės vardas.'),(1335,'Gražys','Gražys – (4) liet., trumpinys iš Gražvydas, Gražvilas ir kt.',' Gražys yra lietuvių kilmės vardas.'),(1336,'Grožvyda','Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas. ',' Grožvyda yra lietuvių kilmės vardas.'),(1337,'Honoratas','Honoratas – (2) lot., trump. Honoras, Honas, iš lot. Honoratus: lot. honoratus „gerbiamas, garbingas“.',' Honoratas yra lotynų kilmės vardas.'),(1338,'Heliodoras','Heliodoras – (2) graik., trump. Helas, Doras, iš sulotyninto graik. Heliodorus: graik. helios „saulė“ + doron „dovana“.',' Heliodoras yra graikų kilmės vardas.'),(1339,'Gražinis','Jūsų gyvenimas kiaurai persmelktas jūsų įsitikinimų. Jūs švytite, intuityvūs, atviri, emocionalūs ir išradingi. Galite būti stiprūs dvasiškai. Jūsų teigiamos savybės: artistiškumas, potraukis į nežabotas linksmybes, polinkis į kūrybą, romantiškumas, aistringumas, linksmumas, platūs interesai.',' Gražinis yra lietuvių kilmės vardas.'),(1340,'Gryta',' (1) vak. liet. iš vok. Grit, Gritta, kuris yra vok. trumpinys iš Margarita',' Gryta, Grytė yra  kilmės vardas.'),(1341,'Honorata','Honorata – (2) lot., trump. Honora, Hona, tarm. Onorata piet. aukšt., Genorata ryt. aukšt. (Kupiškis), iš lot. Honorata: lot. honorata „gerbiama, garbinga“',' Honorata yra lotynų kilmės vardas.'),(1342,'Helianta','Helianta – (1) graik., trump. Helė, iš graik. Helianthe – „pakalnutė“: graik. helios„saulė“ + anthos „žiedas“.',' Helianta yra graikų kilmės vardas.'),(1343,'Grintautė','Grintautė – (1) liet., trump. Grinė, Grintė, iš vyr. v. Grintautas.',' Grintautė yra Lietuvių kilmės vardas.'),(1344,'Imantė','Imantė – (1) liet. ir latv., trump. Imė, Mantė, iš vyr. v. Imantas.',' Imantė yra lietuvių kilmės vardas.'),(1345,'Hildegarda','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Hildegarda yra vokiečių kilmės vardas.'),(1346,'Grintautas','Grintautas – (1) liet., trump. Grinys, Grintas, grin- (: liet. grynas „tyras, doras“) + taut- (žr. Gantautas).',' Grintautas yra lietuvių kilmės vardas.'),(1347,'Helė','Helė – (2) graik. trumpinys iš Helianta.',' Helė yra graikų kilmės vardas.'),(1348,'Imantas','Imantas – (1) liet. ir latv., trump. Imas, Mantas, i- iš im- (:liet. im-ti, im-a) + mant- (: liet. mant-us „sumanus“).',' Imantas yra lietuvių kilmės vardas.'),(1349,'Hilda','Hilda – (1) germ., baž. lot. Hilda iš germ. Hilda, Hilde, sen. vok. aukšt. hiltja „kova“.',' Hilda yra vokiečių kilmės vardas.'),(1350,'Helga','Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Helga yra skandinavų kilmės vardas.'),(1351,'Ilzbė',' (2) vak. liet. trumpinys iš Elzbieta',' Ilzbė, Ilzė, Ilžė yra  kilmės vardas.'),(1352,'Hilarija',' (1) lot., trump. Hilara, Hiliara, Hila, iš lot. Hilaria: lot. hilaris „linksma“',' Hilarija, Hiliarija yra  kilmės vardas.'),(1353,'Hektoras','Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Hektoras yra graikų kilmės vardas.'),(1354,'Hilaras',' (2) lot., sen. var. Hilarijus, Hiliarijus, trump. Hilas, tarm. Ilarijus, Ilaras, iš lot. Hilarius: lot. hilaris „linksmas“',' Hilaras, Hiliaras yra  kilmės vardas.'),(1355,'Haroldas','Haroldas – (1) germ., trump. Haris, skand. vardo Harald variantas, žr. Haraldas.',' Haroldas yra skandinavų kilmės vardas.'),(1356,'Ilona','Ilonoms geriausiai sekasi reklaminis darbas. Kai kurios dirba komercijoje. Teatras – štai arena, kurioje jos gali pilnai atsiskleisti. Ir dar – politika.',' Ilona yra vengrų kilmės vardas.'),(1357,'Ilma','Ilma – (1) liet., iš upėvardžio Ilma (Pabradė).',' Ilma yra lietuvių kilmės vardas.'),(1358,'Hiacintas','Vardadienis: Rugpjūčio 17 d., rugsėjo 11 d.',' Hiacintas yra graikų kilmės vardas.'),(1359,'Haraldas','Haraldas – (1) skand., trump. Haris, baž. lot. Haroldus iš skandinavų Harald : har- (iš heri) „kariuomenė“ + waldan „valdyti“.',' Haraldas yra skandinavų kilmės vardas.'),(1360,'Iliuminata','Iliuminata – (2) lot., trump. Ilė, Nata, iš lot. Iliuminata: lot. illuminata „apšviesta“',' Iliuminata yra lotynų kilmės vardas.'),(1361,'Hiacinta','Hiacinta – (1) graik., var. Jacinta (1), trump. Cinta, iš sulotyninto graik. Hyacintha, kuris iš vyr. v. Hyacinthus, žr. Hiacintas.',' Hiacinta yra graikų kilmės vardas.'),(1362,'Ildefonsas','Ildefonsas – (1) germ., trump. Ildas, baž. lot. Ildefonsus iš germ. Hildefuns: sen. vok. aukšt. hiltja „kova“ + „ūmus, karštas“.',' Ildefonsas yra vokiečių kilmės vardas.'),(1363,'Ignotas','Vardadienis: Vasario 1 d., liepos 31 d., spalio 7 d.',' Ignotas yra lotynų kilmės vardas.'),(1364,'Ignė','Ignė – sulietuvintas trumpinys iš lotynų kilmės vardo Ignacija.',' Ignė yra lotynų kilmės vardas.'),(1365,'Ignas',' (2) liet. trumpinys iš Ignacijus ir Ignotas',' Ignas, Ignius yra  kilmės vardas.'),(1366,'Ignacijus','Vardadienis: Vasario 11 d., liepos 30 d.',' Ignacijus yra lotynų kilmės vardas.'),(1367,'Ignacija','Ignacija – (1) lot., trump. Igna, Ignė, iš lot. Ignatia, kuris iš vyr. v. Ignatius, žr. Ignacijus.',' Ignacija yra lotynų kilmės vardas.'),(1368,'Ignacas','Vardadienis: liepos 31 d., spalio 17 d.',' Ignacas yra lotynų kilmės vardas.'),(1369,'Ifigenija','Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus. ',' Ifigenija yra graikų kilmės vardas.'),(1370,'Ieva','Ievos gali būti ateityje puikios mokslininkės ir revoliucionierės, svajojančios sukurti laimingą rytojų. Tai gėrio simbolis.',' Ieva yra hebrajų kilmės vardas.'),(1371,'Ira','Ira – (2) 1. hebr., iš hebr. Ira – „atsargi“, 2. liet. trumpinys iš Irena.',' Ira yra graikų kilmės vardas.'),(1372,'Ipolitas','Ipolitams patartina vengti piktnaudžiavimo alkoholiniais gėrimais, kurie jiems gali sukelti kepenų ir inkstų susirgimus. Jie linkę į šiuos susirgimus.',' Ipolitas yra graikų kilmės vardas.'),(1373,'Inocentas','Jūs apsigimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, mokslininkai, rašytojai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Inocentas yra lotynų kilmės vardas.'),(1374,'Inocenta','Jūs apsigimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, mokslininkai, rašytojai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Inocenta yra lotynų kilmės vardas.'),(1375,'Ingvaras',' (1) skand., trump. Ingas, Ingis, iš skand. Ingvarr — „(dievo) Ingo saugomas“',' Ingvaras yra skandinavų kilmės vardas.'),(1376,'Ingrida','Ingridas traukia meno horizontai ir noras visus valdyti. Labai didelį vaidmenį gyvenime vaidina draugai. Daugelis mano, kad jos draugiškos ir filantropės. Ne veltui jos aktyviai padeda kitiems žmonėms pinigais ir patarimais.',' Ingrida yra skandinavų kilmės vardas.'),(1377,'Ingeborga',' (1) skand., trump. Inga, Ingė, iš skand. Ingeborg – „(dievo) Ingo apsauga“',' Ingeborga, Ingeburga yra  kilmės vardas.'),(1378,'Inga',' (1) liet. trumpinys iš Ingeborga ir Ingrida',' Inga, Ingė yra  kilmės vardas.'),(1379,'Irvaidas','Irvaidas – (1) liet., trump. Irvas, Vaidas, ir- (žr. Irdangas) + vaid- (: liet. vaid-ytis „rodytis“, vaid-entis).',' Irvaidas yra lietuvių kilmės vardas.'),(1380,'Ineza','Ineza – (2) isp., trump. Ina, Inė, iš isp. Inez, kuris yra ispaniškas vardo Agnė variantas.',' Ineza yra lietuvių kilmės vardas.'),(1381,'Irtuona','Irtuona – (1) liet., iš upėvardžio Irtuona (Tauragė).',' Irtuona yra lietuvių kilmės vardas.'),(1382,'Irtautė','Irtautė – (1) liet., trump. Irtė, Tautė, iš vyr. v. Irtautas.',' Irtautė yra lietuvių kilmės vardas.'),(1383,'Irtautas','Irtautas – (1) liet., trump. Irtas, Tautas, ir- (žr. Irdangas) + taut- (: liet. tauta).',' Irtautas yra lietuvių kilmės vardas.'),(1384,'Indrė','Indrės meilę demonstruoja labai atvirai. Tokia povyza dažnai atbaido jų gerbėjus. Jie juk nežino, kad jos mėgsta meilės preliudijas. Pavyzdžiui, prieš meilės aktą, jų partneris turi pavaišinti šokoladu, vynuogėmis, kūną ištepti aromatiniais aliejais.',' Indrė yra lietuvių kilmės vardas.'),(1385,'Indrajas','Indrajas – (1) liet., trump. Indrys, iš ežero vardo Indrajai (Daugailiai).',' Indrajas yra lietuvių kilmės vardas.'),(1386,'Irmina','Irmina – (2) germ., trump. Irma, iš sulotyninto germ. Irmina, kuris yra trumpinys iš Irmingard, žr. Irmgarda/',' Irmina yra vokiečių kilmės vardas.'),(1387,'Indraja','Indraja – (3a) liet., trump. Indrė, iš upėvardžio Indraja (Antalieptė): ryt. aukšt. Indrė „nendrė“.',' Indraja yra lietuvių kilmės vardas.'),(1388,'Irmgarda','Nors dažnai būdami užsiėmę svarbiais darbais, labai vertina namų židinį. Jūs dažniausiai nesate romantikai, todėl flirtas ir seksas jus mažai domina. Jums svarbi tik meilė, į kurią jūs žiūrite labai atsargiai. Tik įsitikinę jausmų tikrumu kuriate šeimą.',' Irmgarda yra vokiečių kilmės vardas.'),(1389,'Ina','Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Ina yra germanų kilmės vardas.'),(1390,'Iminas','Iminas – (1) liet., trump. Imas, Minius, i- iš im- (žr. Imantas) + min- (:liet. min-ti, min-ėti, min-i).',' Iminas yra lietuvių kilmės vardas.'),(1391,'Irmė','Irmė – (2) liet., trumpinys iš Irmantė.',' Irmė yra graikų kilmės vardas.'),(1392,'Imina',' (3b), (1), (1) liet., trump. Imė, Minė, iš vyr. v. Iminas',' Imina, Imina, Iminė yra  kilmės vardas.'),(1393,'Izolda','Izoldos nelinkusios pilnėti, nes jų organizmas labai greitai įsisavina gautą su maistu energiją. Todėl joms bet kokia dieta nėra sunki. Joms tik rekomenduotina mažinti maisto kaloringumą, vartoti daugiau baltymų, šviežių vaisių, daug vaikščioti.',' Izolda yra keltų kilmės vardas.'),(1394,'Irmantė','Irmantė – (1) liet., trump. Irmė, iš vyr. v. Irmantas.',' Irmantė yra lietuvių kilmės vardas.'),(1395,'Izidorius','Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Izidorius yra graikų kilmės vardas.'),(1396,'Irmantas','Irmantas – (1) liet., trump. Irmas, ir- (žr. Irdangas) + mant- (žr. Imantas)',' Irmantas yra lietuvių kilmės vardas.'),(1397,'Irma','Irmų vestuvės sėkmingos tada, kai sutuoktinis ne tik turtingas, bet ir malonios išvaizdos, sugebantis jautriai reaguoti į jų romantinius nusiteikimus, nesugriauna to iliuzinio pasaulio, kuris joms labai artimas ir svarbus.',' Irma yra vokiečių kilmės vardas.'),(1398,'Izidora','Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Izidora yra graikų kilmės vardas.'),(1399,'Irenius','Irenius – (2) liet. trumpinys iš Irenėjas, vardo Irenius trumpiniai – Iras, Renius.',' Irenius yra graikų kilmės vardas.'),(1400,'Izaokas','Izaokas – (2) hebr., trump. Izokas vak. aukšt., iš sulotyninto hebr. Izaak, Isaak — „linksmuolis“: hebr. jišak „jis juoksis“.',' Izaokas yra hebrajų kilmės vardas.'),(1401,'Irenėjas','Irenėjas – (1) graik., sen. Irenėjus, Ireniejus, trump. Irenius, Irenas, Iras, iš sulotyninto graik. Irenaeus: graik. eirenaios „taikingas, ramus“.',' Irenėjas yra graikų kilmės vardas.'),(1402,'Izabelė','Izabelėms tinka visi darbai, kuriuose jos galėtų užsidirbti pinigų. Gali darbuotis vien iš altruistinių paskatų. Labai geros kulinarės.',' Izabelė yra ispanų kilmės vardas.'),(1403,'Irena','Irenos turi nuostabią regimą atmintį. Jas galima sutikti kavinėje su draugais arba tiesiog vieną ir susimąsčiusią. Dažniausiai jos laiką leidžia bibliotekose ar namie už rašomojo stalo, dirba iki vėlumos.',' Irena yra graikų kilmės vardas.'),(1404,'Irdangė','Irdangė – (1) liet., trump. Irė, iš vyr. v. Irdangas.',' Irdangė yra lietuvių kilmės vardas.'),(1405,'Irdangas','Irdangas – (1) liet., trump. Iras, ir- (: liet. ir, irgi „taip pat“) + dang- (: liet. dang-inti(s), plg. deng-ti „greitai bėgti“).',' Irdangas yra lietuvių kilmės vardas.'),(1406,'Ivona','Ivonos puikios poetės, rašytojos, dailininkės, kurios gali savo idėjas išreikšti bet kokiomis priemonėmis. Mėgstamiausia tyrinėjimo tema – filosofija, todėl jos puikios mokslininkės.',' Ivona yra vokiečių kilmės vardas.'),(1407,'Iza','Iza – (2) liet. trumpinys iš Izabelė ir Izolda.',' Iza yra lietuvių kilmės vardas.'),(1408,'Iveta','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Iveta yra prancūzų kilmės vardas.'),(1409,'Ivas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Ivas yra vokiečių kilmės vardas.'),(1410,'Iva','Iva – (2) liet. trumpinys iš Iveta ir Ivona.',' Iva yra lietuvių kilmės vardas.'),(1411,'Irvydas','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Irvydas yra lietuvių kilmės vardas.'),(1412,'Irvyda',' (3b), (1), (1) liet., trump. Irvė, Vydė, iš vyr. v. Irvydas',' Irvyda, Irvyda, Irvydė yra  kilmės vardas.'),(1413,'Irvainė','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Irvainė yra lietuvių kilmės vardas.'),(1414,'Irvainas','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Irvainas yra lietuvių kilmės vardas.'),(1415,'Irvaidė','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Irvaidė yra lietuvių kilmės vardas.'),(1416,'Jacinta','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Jacinta yra graikų kilmės vardas.'),(1417,'Jaunys',' (4), (2) liet., metatoniniai galūnių vediniai iš liet. jaunas',' Jaunys, Jaunius yra  kilmės vardas.'),(1418,'Jaunė','Jaunė – (2) liet., iš vyr. v. Jaunys, Jaunius.',' Jaunė yra lietuvių kilmės vardas.'),(1419,'Jaumantė','Jaumantė – (1) liet., trump. Mantė, iš vyr. v. Jaumantas.',' Jaumantė yra lietuvių kilmės vardas.'),(1420,'Jaumantas','Jaumantas – (1) liet., trump. Mantas, jau- (žr. Jaugedas) + mant- (: liet. mant-us „sumanus“).',' Jaumantas yra Lietuvių kilmės vardas.'),(1421,'Jaukantas','Jaukantas – (1) liet., trump. Jaukys, Kantas, jau- (žr. Jaugedas) + kant- (: liet. pa-kant-us, kant-rus).',' Jaukantas yra lietuvių kilmės vardas.'),(1422,'Jaukanta',' (3b), (1), (1) liet., trump. Jaukė, Kantė, iš vyr. v. Jaukantas',' Jaukanta, Jaukanta, Jaukantė yra  kilmės vardas.'),(1423,'Jaugys',' (4) liet., trumpinys iš avd. su Jau-g-: Jaugedas, Jaugilas, Jauginas ir kt.',' Jaugys yra  kilmės vardas.'),(1424,'Jaugindė','Jaugindė – (1) liet., trump. Jaugė, iš vyr. v. Jaugindas.',' Jaugindė yra lietuvių kilmės vardas.'),(1425,'Jaugindas','Jaugindas – (1) liet., trump. Jaugys, jau- (žr. Jaugedas) + gind- (: liet. gind- su balsių kaita iš gend-: pasi-gend-a, pasigesti).',' Jaugindas yra lietuvių kilmės vardas.'),(1426,'Jakas',' (2), (4) liet. trumpinys iš Jokūbas ir Jakimas',' Jakas, Jakys yra  kilmės vardas.'),(1427,'Jauginas','Jauginas – (1) liet., trump. Jaugys, jau- (žr. Jaugedas) + gin- (: liet. gin-ti, gin-a „saugoti“).',' Jauginas yra lietuvių kilmės vardas.'),(1428,'Jadvyga','Jadvygos pasižymi konservatyviomis pažiūromis, kurios atsispindi netgi jų išvaizdoje ir manierose rengtis. Darbe nepakeičiamos ir parodo didžiulius dalykinius sugebėjimus, nuostabų darbštumą. Sugeba sunkiai ir ilgai dirbti. Labai domisi profesionaliu tobulėjimu, imasi sunkiausių užduočių.',' Jadvyga yra vokiečių kilmės vardas.'),(1429,'Jackus','Vardadienis: Rugpjūčio 17 d., rugsėjo 11 d.',' Jackus yra graikų kilmės vardas.'),(1430,'Jadvė','Jadvygos pasižymi konservatyviomis pažiūromis, kurios atsispindi netgi jų išvaizdoje ir manierose rengtis. Darbe nepakeičiamos ir parodo didžiulius dalykinius sugebėjimus, nuostabų darbštumą. Sugeba sunkiai ir ilgai dirbti. Labai domisi profesionaliu tobulėjimu, imasi sunkiausių užduočių.',' Jadvė yra lietuvių kilmės vardas.'),(1431,'Jacintas','Vardadienis: Rugpjūčio 17 d., rugsėjo 11 d.',' Jacintas yra graikų kilmės vardas.'),(1432,'Kalikstas',' (2) graik., trump. Kalstis, iš sulotyninto graik. Callixtus, Callistus: graik. kallistos „labai gražus, gražiausias“',' Kalikstas, Kalistas yra  kilmės vardas.'),(1433,'Kajus','Kajams reikia stengtis būti ne tokiais ūmiais ir išlaikyti pusiausvyrą. Su jais bendraujantys turi daugiau dėmesio skirti jų vidinėms, o ne išorinėms savybėms, nes tai, ką jie savyje jaučia, gali visiškai nepasireikšti jų išorėje.',' Kajus yra lotynų kilmės vardas.'),(1434,'Kajetonas','Kajetonas – (2) lot., trump. Kajetas, Kajus, tarm. Kajatas piet. aukšt. (dz.), Kajeta, Kajė žem., iš lot. Caietanus — „kajetietis, Kajetos miesto (dabar Gajeta — Italijoje) gyventojas“.',' Kajetonas yra lotynų kilmės vardas.'),(1435,'Lauksmina',' (1) liet., trump. Lauksmė, iš vyr. v. Lauksminas',' Lauksmina, Lauksmina, Lauksminė yra  kilmės vardas.'),(1436,'Leonas','Leonai gražūs ir patrauklūs vyrai, todėl jiems nesunku užmegzti naujas pažintis ir meilės istorijas.',' Leonas yra lotynų kilmės vardas.'),(1437,'Lauksmė',' (2) liet., iš vyr. v. Lauksmis, taip pat trumpinys iš mot. v. Lauksmina',' Lauksmė yra  kilmės vardas.'),(1438,'Largas','Largas – (1) lot., iš lot. Largus: lot. largus „dosnus“.',' Largas yra lotynų kilmės vardas.'),(1439,'Laiva','Laiva – (1) liet., iš upėvardžio Laiva (Kvėdarna).',' Laiva yra lietuvių kilmės vardas.'),(1440,'Laisvūnė','Uolumas darbe, atsidavimas artimiesiems ilgainiui Laisvūnes gali paversti įžymiomis, iškiliomis, ir artimųjų kantrybė galiausiai esti dosniai atlyginta.',' Laisvūnė yra lietuvių kilmės vardas.'),(1441,'Laisvūnas','Laisvūnas – (1) liet., trump. Laisvis, Laisvius, priesagos -ūnas vedinys iš liet. laisvė.',' Laisvūnas yra lietuvių kilmės vardas.'),(1442,'Laisvis','Laisvis – (2) liet., galūnės vedinys iš liet. laisvas.',' Laisvis yra lietuvių kilmės vardas.'),(1443,'Laisvydas','Laisvydas – (1) liet., trump. Laisvis, Laisvius, lais- iš laisv- (: liet. laisv-as, laisv-ai) + vyd- (: liet. išvyd-o, iš-vysti).',' Laisvydas yra lietuvių kilmės vardas.'),(1444,'Labys','Labys – (4) liet., trumpinys iš avd. su Lab-: Labgaudas, Labvardas ir kt.',' Labys yra lietuvių kilmės vardas.'),(1445,'Labgaudas','Labgaudas – (1) liet., trump. Labys, lab- (: liet. labas „geras, taurus“, labas „nauda, turtas“) + gaud- (: liet. gaud-yti, plg. gauti).',' Labgaudas yra lietuvių kilmės vardas.'),(1446,'Otilija','Profesijas paprastai pasirenka susietas su žmonių sveikatingumu; tampa aukštųjų mokyklų dėstytojomis; dirba laboratorijų vadovėmis. Geros darbų organizatorės, todėl dažnai užima įvairius vadovaujančius postus.',' Otilija yra vokiečių kilmės vardas.'),(1447,'Osvaldas','Osvaldai turi tam tikrų iliuzijų – vesti žemesnio socialinio lygio moterį. Taip elgdamiesi jie įsivaizduoja, kad “neturtinga Pelenė” bus dėkinga visą gyvenimą. Dėl to kartais labai skaudžiai nusivilia.',' Osvaldas yra anglų kilmės vardas.'),(1448,'Osmundas','Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Osmundas yra anglų kilmės vardas.'),(1449,'Oskaras','Oskarai geri direktoriai, švietimo ir kultūros darbuotojai. Mėgsta sportuoti. Jie geri leidybininkai, teisėjai ar advokatai.',' Oskaras yra anglų kilmės vardas.'),(1450,'Orintas','Orintas – (1) liet., trump. Orys, priesagos -intas vedinys iš liet. orus „iškilnus“.',' Orintas yra lietuvių kilmės vardas.'),(1451,'Otonas','Vardadienis: Birželio 30 d., lapkričio 18 d.',' Otonas yra graikų kilmės vardas.'),(1452,'Jaugina',' (3b), (1), (1) liet., trump. Jaugė, iš vyr. v. Jauginas',' Jaugina, Jaugina, Jauginė yra  kilmės vardas.'),(1453,'Jaugilė','Jaugilė – (1), (2) liet., trump. Jaugė, iš vyr. v. Jaugilas.',' Jaugilė yra lietuvių kilmės vardas.'),(1454,'Jaugilas','Jaugilas – (1) liet., trump. Jaugys, jau- (žr. Jaugedas) + gil- (: liet. gil-ti „skaudinti“).',' Jaugilas yra lietuvių kilmės vardas.'),(1455,'Jaugėlė','Jaugėlė – (1) liet., trump. Jaugė, iš vyr. v. Jaugėlas.',' Jaugėlė yra lietuvių kilmės vardas.'),(1456,'Jaugėlas','Jaugėlas – (1) liet., trump. Jaugys, jau- (žr. Jaugedas) + gėl- (:liet. gėla „skausmas“, širdgėla).',' Jaugėlas yra lietuvių kilmės vardas.'),(1457,'Jaugeda',' (3b), (1), (1) suliet. prūs., trump. Jaugė, Gedė, iš vyr. v. Jaugedas',' Jaugeda, Jaugeda, Jaugedė yra  kilmės vardas.'),(1458,'Jaugedas','Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Jaugedas yra prūsų kilmės vardas.'),(1459,'Jaras',' (2) liet. trumpinys iš Jeronimas',' Jaras yra  kilmės vardas.'),(1460,'Januarijus','Januarijus – (1) lot., trump. Januaras, Janys, iš lot. Januarius – „(dievo) Jano mėnesį gimęs“ (lot. Janus – laiko ir šviesos dievas, Jano mėnuo, arba sausio mėnuo, – lot. Januarius).',' Januarijus yra lotynų kilmės vardas.'),(1461,'Januarija','Januarija – (1) lot., trump. Januarė, iš lot. Januaria, kuris iš vyr. v. Januarius, žr. Januarijus.',' Januarija yra lotynų kilmės vardas.'),(1462,'Januaras','Januaras – (2), trump. Janys, liet. trumpinys iš Januarijus.',' Januaras yra lietuvių kilmės vardas.'),(1463,'Janys','Janys – (4) liet. trumpinys iš Januaras , Januarijus.',' Janys yra lietuvių kilmės vardas.'),(1464,'Janina','Meilėje Janinos atviros, nuoširdžios, mėgsta atvirai ir aiškiai reikšti švelnius jausmus. Joms ypač svarbu pajusti partnerio širdies šilumą. Mėgsta sukurti stiprų lizdą ir sukurti materialinį pagrindą būsimai šeimai. Kreipia dėmesį į būsimojo vyro vidų, o ne išorę.',' Janina yra hebrajų kilmės vardas.'),(1465,'Jakimas','Jakimas – (2) hebr., trump. Jakas, Jakys, v. Joakimas sulietuvintas variantas.',' Jakimas yra hebrajų kilmės vardas.'),(1466,'Janė','Meilėje Janinos atviros, nuoširdžios, mėgsta atvirai ir aiškiai reikšti švelnius jausmus. Joms ypač svarbu pajusti partnerio širdies šilumą. Mėgsta sukurti stiprų lizdą ir sukurti materialinį pagrindą būsimai šeimai. Kreipia dėmesį į būsimojo vyro vidų, o ne išorę.',' Janė yra latvių kilmės vardas.'),(1467,'Joakimas',' (2), (1), (2) hebr., var. suliet., trump. Jokys, Jakas, Jakys, tarm. Jokymas žem., vak. aukšt., Jokamas, Jakamas, Jakas vak. liet., iš sulotyninto hebr. Joachim, kuris iš hebr. Jehojakim — „Jehova (jj) kelia, išaukština“',' Joakimas, Jokimas, Jakimas yra  kilmės vardas.'),(1468,'Joana','Joanos nemėgsta rutinos ir monotoniškumo. Gyvenimą myli iki kraštutinumų ir “pražysta” ten, kur yra veikimas, judėjimas. Negyvena praeities atsiminimais, visiškai atsiduoda šiandieniniam gyvenimui, o žvilgsnį nukreipia į rytdieną, siekia nuotykių ir įspūdžių.',' Joana yra hebrajų kilmės vardas.'),(1469,'Jogintas','Jogintas – (1) liet., trump. Jogys, Gintas, jo- (žr. Jodaugas) + gint- (: liet. ginti, gint-as).',' Jogintas yra lietuvių kilmės vardas.'),(1470,'Joginta',' (3a), (1), (1) liet., trump. Jogė, Gintė, iš vyr. v. Jogintas',' Joginta, Joginta, Jogintė yra  kilmės vardas.'),(1471,'Jeronimas','(1) suliet. graik., trump. Jeras, Jaras, tarm. Jeronymas žem., Jerys vak. aukšt., iš sulotyninto graik. Hieronymus: graik. hieros „šventas“ + onyma „vardas“',' Jeronimas yra graikų kilmės vardas.'),(1472,'Joginas','Joginas – (1) liet., trump. Jogys, Ginas, jo- (žr. Jodaugas) + gin- (žr. Jauginas).',' Joginas yra lietuvių kilmės vardas.'),(1473,'Jolanta','Jolantos mėgsta keliauti, be jokio išskaičiavimo ateina į pagalbą pagalbos trokštantiems. Labai išreikštas polinkis į meną, ypač dailę, muziką. Tampa geromis mokytojomis, šou biznio organizatorėmis, muziejų tarnautojomis.',' Jolanta yra graikų kilmės vardas.'),(1474,'Jauvydas','Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Jauvydas yra lietuvių kilmės vardas.'),(1475,'Jauvyda',' (1) liet., trump. Vyda, Vydė, iš vyr. v. Jauvydas',' Jauvyda, Jauvvda, Jauvydė yra  kilmės vardas.'),(1476,'Jogina',' (1) liet., trump. Jogė, Gina, iš vyr. v. Joginas',' Jogina, Jogina, Joginė yra  kilmės vardas.'),(1477,'Jokūbas',' (2) hebr., trump. Jokas, Jakas, tarm. Jakūbas ryt. aukšt., Jokūbas, Kūbas, Kūbus vak. liet., Jokūpas, Jopė vak. žem., Jaka XVI a. inventoriai, iš sulotyninto hebr. Jacobus, kuris iš hebr. Ja‘akob — „(jis) seka paskui Jahvę“',' Jokūbas yra hebrajų kilmės vardas.'),(1478,'Jogilė','Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogilė yra lietuvių kilmės vardas.'),(1479,'Jauvainė','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Jauvainė yra lietuvių kilmės vardas.'),(1480,'Jokintas',' (1) liet., trump. Jokys, Kintas, jo- (žr. Jodaugas) + kint- (: liet. žiem-kin-tis, kent-ėti)',' Jokintas yra  kilmės vardas.'),(1481,'Jauvainas','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Jauvainas yra lietuvių kilmės vardas.'),(1482,'Jokinta',' (3a), (1), (1) liet., trump. Kintė, iš vyr. v. Jokintas',' Jokinta, Jokinta, Jokintė yra  kilmės vardas.'),(1483,'Jogilas','Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogilas yra lietuvių kilmės vardas.'),(1484,'Jauvaidas','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Jauvaidas yra lietuvių kilmės vardas.'),(1485,'Jokimė','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Jokimė yra lietuvių kilmės vardas.'),(1486,'Jauvaida',' (3b), (1), (1) liet., trump. Vaida, iš vyr. v. Jauvaidas',' Jauvaida, Jauvaida, Jauvaidė yra  kilmės vardas.'),(1487,'Jogėlė','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Jogėlė yra lietuvių kilmės vardas.'),(1488,'Jokimas','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Jokimas yra lietuvių kilmės vardas.'),(1489,'Jautra',' (1) liet., galūnės vedinys iš liet. jautrus, -i',' Jautra, Jautrė yra  kilmės vardas.'),(1490,'Joris','Joris – (2) liet., iš sen. lietuvių pavasario žalio dievo (pagal S. Daukantą) vardo Joris: liet. jorė „žalymas, pavasario žaluma“ jorus „žalias“, jor-iuoti „žaliuoti“, galbūt šio vardo tolimesnis vedinys yra v. Jorigis.',' Joris yra lietuvių kilmės vardas.'),(1491,'Jogėlas','Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogėlas yra lietuvių kilmės vardas.'),(1492,'Jogvilė','Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogvilė yra lietuvių kilmės vardas.'),(1493,'Jaurimtė',' (1) liet., trump. Jaurė, Rimtė, iš vyr. v. Jaurimtas',' Jaurimtė yra  kilmės vardas.'),(1494,'Jogė','Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Jogė yra lietuvių kilmės vardas.'),(1495,'Jogvilas','Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogvilas yra lietuvių kilmės vardas.'),(1496,'Jogaudas',' (1) liet. ir prūs., trump. Jogys, Gaudas, jo- (žr. Jodaugas) + gaud- (: liet. gaud-yti, plg. gau-ti)',' Jogaudas yra  kilmės vardas.'),(1497,'Jaurimtas','Jaurimtas – (1) liet., trump. Jauras, Rimtas, jau- (žr. Jaugedas) + rim- (: liet. rim-ti, rim-o).',' Jaurimtas yra lietuvių kilmės vardas.'),(1498,'Jorigė','Jorigė – (1) liet., trump. Jorė, iš vyr. v. Jorigis.',' Jorigė yra lietuvių kilmės vardas.'),(1499,'Jogundas','Jogundas – (1) suliet. prūs., trump. Jogys, Gundas, jo- (žr. Jodaugas) + gund- (: liet. gund-a, gusti).',' Jogundas yra lietuvių kilmės vardas.'),(1500,'Jogauda',' (3a), (1), (1) liet. ir prūs., trump. Jogė, Gaudė, iš vyr. v. Jogaudas',' Jogauda, Jogauda, Jogaudė yra  kilmės vardas.'),(1501,'Jonis','Jonis – (2) – liet. (žem.) vardo Jonas variantas.',' Jonis yra hebrajų kilmės vardas.'),(1502,'Jaunutis','Jaunutis – (2) liet., trump. Jaunius, priesagos -utis vedinys iš sen. avd. Jaunys, Jaunius.',' Jaunutis yra lietuvių kilmės vardas.'),(1503,'Jogunda',' (3a), (1), (1) suliet. prūs., trump. Jogė, Gundė, iš vyr. v. Jogundas',' Jogunda, Jogunda, Jogundė yra  kilmės vardas.'),(1504,'Josvainas','Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Josvainas yra lietuvių kilmės vardas.'),(1505,'Jogminas','Jogminas – (1) liet., trump. Jogys, Minius, jo-g- (: liet. jo-ti, jo-ja + -g-, plg. sen. avd. Jogys) + min- (: liet. min-ti, min-ėti, min-i).',' Jogminas yra lietuvių kilmės vardas.'),(1506,'Jostautė','Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Jostautė yra lietuvių kilmės vardas.'),(1507,'Jogailė','Vardadienis: Sausio 8 d., rugpjūčio 7 d.',' Jogailė yra lietuvių kilmės vardas.'),(1508,'Jaunutė','Jaunutė – (2) liet., trump. Jaunė, iš vyr. v. Jaunutis.',' Jaunutė yra lietuvių kilmės vardas.'),(1509,'Jonė','Jonė – (2) – liet. trumpinys iš Joana.',' Jonė yra lietuvių kilmės vardas.'),(1510,'Jonaudė','Jonaudė – (1) liet., trump. Naudė, iš vyr. v. Jonaudas.',' Jonaudė yra lietuvių kilmės vardas.'),(1511,'Jogaila','Jogailos egoistiški ir agresyvūs, labai sąžiningi ir atviri. Pasitikintys, o apsirikę vėl tiki. Jie neturi gudrumo, ir tokiais išlieka visą gyvenimą. Kartais ima statyti oro pilis, bet ne tam, kad ką apgautų. Paprasčiausiai jie patys tiki visu tuo.',' Jogaila yra lietuvių kilmės vardas.'),(1512,'Jogmina',' (1) liet., trump. Jogė, Minė, iš vyr. v. Jogminas',' Jogmina, Jogmina, Jogminė yra  kilmės vardas.'),(1513,'Jostautas','Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Jostautas yra lietuvių kilmės vardas.'),(1514,'Jovaišas','Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Jovaišas yra lietuvių kilmės vardas.'),(1515,'Jonaudas','Jonaudas – (1) liet., trump. Jonys, Naudas, jo- (žr. Jodaugas) + naud- (: liet. naud-a „turtas, gerovė“).',' Jonaudas yra lietuvių kilmės vardas.'),(1516,'Jogys','Jogys – (4) liet., trumpinys iš avd. su Jo-g- ir Jog-: Jogilas, Jogirdas, Jogminas, Jogvilas ir kt.',' Jogys yra Lietuvių kilmės vardas.'),(1517,'Jostartas','Jostartas – (1) liet., trump. Jostys, jos- (žr. Josbutas) + tart- (: liet. tarti, tart-as).',' Jostartas yra lietuvių kilmės vardas.'),(1518,'Jodaugė','Jodaugė – (1) liet., trump. Daugė, iš vyr. v. Jodaugas.',' Jodaugė yra lietuvių kilmės vardas.'),(1519,'Jovainė',' (1) liet., trump. Jovė, Vainė, iš vyr. v. Jovainas',' Jovainė yra  kilmės vardas.'),(1520,'Jonas','Jonai su neigiamomis savybėmis labai kerštingi, nesusilaikantys, kartais niekšingi, gudrūs, nepasitikintys ir labai egoistiški, inertiški, linkę į tironiją.',' Jonas yra hebrajų kilmės vardas.'),(1521,'Jostarta',' (3a), (1), (1) liet., trump. Jostė, iš vyr. v. Jostartas',' Jostarta, Jostarta, Jostartė yra  kilmės vardas.'),(1522,'Jogirdas','Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Jogirdas yra lietuvių kilmės vardas.'),(1523,'Jodaugas','Jodaugas – (1) liet., trump. Daugas, jo- (: liet. jo-ti, jo-ja, jo-tis „jojimas, raiteliai“) + daug- (: liet. daug, daug-is „daugumas“).',' Jodaugas yra lietuvių kilmės vardas.'),(1524,'Jovainas','Jovainas (1) liet., trump. Jovas, Vainius, jo- (žr. Jodaugas) + vain- (žr. Jauvainas).',' Jovainas yra lietuvių kilmės vardas.'),(1525,'Jomilė','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Jomilė yra lietuvių kilmės vardas.'),(1526,'Jomilas','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Jomilas yra lietuvių kilmės vardas.'),(1527,'Jovaidas','Jovaidas – (1) liet., trump. Jovas, Vaidas, jo- (žr. Jodaugas) + vaid- (žr. Jauvaidas).',' Jovaidas yra lietuvių kilmės vardas.'),(1528,'Jostaras','Jostaras – (1) liet., trump. Jostys , jos- (žr. Josbutas) + tar- (: liet. tar-ti, tar-ia).',' Jostaras yra lietuvių kilmės vardas.'),(1529,'Judita','Darbe jos labai kruopščios, puikiai susitvarko su bet kokiomis užduotimis, tačiau vadovauti joms sunku. Labai geros muzikantės, artistės, dailininkės, oratorės, mokytojos, žurnalistės bei rašytojos. Kai kurios Juditos gabios matematikės, mechanikės, elektrotechnikės. Puikios mokslininkės.',' Judita yra hebrajų kilmės vardas.'),(1530,'Jogirda',' (3a), (1), (1) liet., trump. Jogė, Girdė, iš vyr. v. Jogirdas',' Jogirda, Jogirda, Jogirdė yra  kilmės vardas.'),(1531,'Jostara',' (3a), (1), (1) liet., trump. Jostė, iš vyr. v. Jostaras',' Jostara, Jostara, Jostarė yra  kilmės vardas.'),(1532,'Jomantė','Jomantė – (1) liet. ir prūs., trump. Mantė, iš vyr. v. Jomantas.',' Jomantė yra lietuvių kilmės vardas.'),(1533,'Jovaida',' (3a), (1), (1) liet., trump. Jovė, Vaida, iš vyr. v. Jovaidas',' Jovaida, Jovaida, Jovaidė yra  kilmės vardas.'),(1534,'Jovitas','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Jovitas yra lietuvių kilmės vardas.'),(1535,'Juntautas','Juntautas – (1) liet., trump. Juntys, Tautas, jun- iš jund- (: liet. su-junda, su-justi) + taut- (žr. Jostautas).',' Juntautas yra lietuvių kilmės vardas.'),(1536,'Josminas','Josminas – (1) liet., trump. Josys, Minius, jos- (žr. Josbutas) + min- (žr. Jogminas).',' Josminas yra lietuvių kilmės vardas.'),(1537,'Jomantas','Jomantas – (1) liet. ir prūs., trump. Mantas, jo- (žr. Jodaugas) + mant- (žr. Jaumantas).',' Jomantas yra lietuvių kilmės vardas.'),(1538,'Jovita','Jovitos vardo trumpinys – Jovė. Tarmiškai vakarų Žemaitijoje Jovita – Jovė. Vardas vyrui – Jovitas.',' Jovita yra lotynų, lietuvių kilmės vardas.'),(1539,'Jotvilė','Jotvilė – (1), (2) liet., trump. Jotvė, Vilė, iš vyr. v. Jotvilas.',' Jotvilė yra lietuvių kilmės vardas.'),(1540,'Josmina',' (3a), (1), (1) liet., trump. Minė, iš vyr. v. Josminas',' Josmina, Josmina, Josminė yra  kilmės vardas.'),(1541,'Jundutis','Jundutis – (2) liet., trump. Jundys, priesagos -utis vedinys iš sen. avd. Jundas, žr. Jundilas.',' Jundutis yra lietuvių kilmės vardas.'),(1542,'Jovirdas','Jovirdas – (1) liet., trump. Jovas, Virdys, jo- (žr. Jodaugas) + vird- (: prūs. wirds „žodis“, plg. liet. vardas, latv. vards „žodis“).',' Jovirdas yra lietuvių kilmės vardas.'),(1543,'Jotvilas','Jotvilas – (1) liet., trump. Jotys, Vilas, jot- (žr. Jotautas) + vil- (žr. Jaudvilas).',' Jotvilas yra lietuvių kilmės vardas.'),(1544,'Jolita','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Jolita yra vengrų kilmės vardas.'),(1545,'Jundutė','Jundutė – (2) liet., trump. Jundė, iš vyr. v. Jundutis.',' Jundutė yra lietuvių kilmės vardas.'),(1546,'Joskaudė','Joskaudė – (1) liet., trump. Skaudė, iš vyr. v. Joskaudas.',' Joskaudė yra lietuvių kilmės vardas.'),(1547,'Jovirda',' (3a), (1), (1) liet., trump. Jovė, Virdė, iš vyr. v. Jovirdas',' Jovirda, Jovirda, Jovirdė yra  kilmės vardas.'),(1548,'Jurgis','Neigiamos savybės: nervingi, bailoki, perdaug emocingi, pikti. Kai kurie įklimpsta į alkoholio ar narkotikų liūną. Moterų medžiotojai ir suvedžiotojai.',' Jurgis yra graikų kilmės vardas.'),(1549,'Jotys','Jotys – (2) liet., trump. iš avd. su Jot-: Jotautas, Jotkantas, Jotvilas ir kt.',' Jotys yra lietuvių kilmės vardas.'),(1550,'Joleta',' (2), (2) vengr., trump. Jolė, iš sulotyninto vengrų Joleta, Jolita, kuris iš vengrų Johelet, o pastarasis yra vengriškas vardo Helene (žr. Elena) variantas',' Joleta, Jolita yra  kilmės vardas.'),(1551,'Jundilė','Jundilė – (1) liet., trump. Jundė, iš vyr. v. Jundilas.',' Jundilė yra lietuvių kilmės vardas.'),(1552,'Joskaudas','Joskaudas – (1) liet., trump. Josys, Skaudys, jo- (žr. Jodaugas) + skaud- (: liet. skaud-us „griežtas, smarkus“).',' Joskaudas yra lietuvių kilmės vardas.'),(1553,'Jurgina','Jurgina – graikų kilmės vardas mergaitei. Jurgina – graikiško žodžio Jurga ir -in junginys. Žodis Jurga graikų kalboje reiškia žemdirbė. Taip pat šis vardas siejamas su augalu Jurginas.',' Jurgina yra graikų kilmės vardas.'),(1554,'Jotautė','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Jotautė yra lietuvių kilmės vardas.'),(1555,'Joviltas','Joviltas – (1) liet., trump. Jovas, Viltys, jo- (žr. Jodaugas) + vilt- (: liet. vilt-as, plg. viltis).',' Joviltas yra lietuvių kilmės vardas.'),(1556,'Jolė','Jolė – (2) liet. trumpinys iš Jolanta ir Joleta, Jolita.',' Jolė yra lietuvių kilmės vardas.'),(1557,'Jundilas',' (1) liet., trump. Jundys, priesagos -ilas vedinys iš sen. avd. Jundas, Jundys: liet. su-junda, su-justi',' Jundilas yra  kilmės vardas.'),(1558,'Jotautas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Jotautas yra lietuvių kilmės vardas.'),(1559,'Josgailė','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Josgailė yra lietuvių kilmės vardas.'),(1560,'Jurgė','Jurgė – (1) suliet. graik., iš vyr. v. Jurgis.',' Jurgė yra graikų kilmės vardas.'),(1561,'Jovilta',' (3a), (1), (1) liet., trump. Jovė, Viltė, iš vyr. v. Joviltas',' Jovilta, Jovilta, Joviltė yra  kilmės vardas.'),(1562,'Josvilė','Josvilė – (1), (2) liet., trump. Josvė, Vilė, iš vyr. v. Josvilas.',' Josvilė yra lietuvių kilmės vardas.'),(1563,'Jurga',' (1) liet. trumpinys iš Jurgita',' Jurga yra graikų kilmės vardas.'),(1564,'Julius','Juliai gali būti ekstrasensai, žiniuoniai; jiems patinka dirbti su žmonėmis, todėl įgyja daug žinių apie žmogaus vidines būsenas. Taip pat geri gydytojai, advokatai, rašytojai, žiniasklaidos darbuotojai.',' Julius yra graikų kilmės vardas.'),(1565,'Josgailas','Josgailas – (1) liet., var. Josgaila, trump. Josys, Gailas, jos- (žr. Josbutas) + gail- (: sen. liet. gail-as „stiprus“).',' Josgailas yra lietuvių kilmės vardas.'),(1566,'Jovilė','Jovilės labai seksualios. Jos labai atkaklios, tad joms atsispirti beveik neįmanoma. Ištekėjusios tampa puikiomis motinomis.',' Jovilė yra lietuvių kilmės vardas.'),(1567,'Julita','Vardadienis: Gegužės 18 d., birželio 16 d.',' Julita yra prancūzų kilmės vardas.'),(1568,'Josvilas','Josvilas – (1) liet., trump. Josvys, Vilas, jos- (žr. Josbutas) + vil- (žr. Jaudvilas).',' Josvilas yra lietuvių kilmės vardas.'),(1569,'Jovilas','Jovilas – (1) suliet. prūs., trump. Jovas, Vilas, jo- (žr. Jodaugas) + vil- (žr. Jaudvilas).',' Jovilas yra lietuvių kilmės vardas.'),(1570,'Jūratė','Teigiamos Jūračių savybės – pasitikėjimas savo jėgomis, lyderio bruožai. Jos sunkiai paklūsta, eina į tikslą tiesiai, laužydamos viską pakelėje. Pasižymi ypatingu kantrumu. Priešininkai bando jas sugniuždyti, tačiau daugeliu atveju tai neįmanoma padaryti.',' Jūratė yra lietuvių kilmės vardas.'),(1571,'Josbutė','Vardas skatina gilumino žavesio pasireiškimą ir stiprių jausmų proveržį. Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Josbutė yra lietuvių kilmės vardas.'),(1572,'Julijus','Juliai gali būti ekstrasensai, žiniuoniai; jiems patinka dirbti su žmonėmis, todėl įgyja daug žinių apie žmogaus vidines būsenas. Taip pat geri gydytojai, advokatai, rašytojai, žiniasklaidos darbuotojai.',' Julijus yra graikų kilmės vardas.'),(1573,'Jovydas','Jovydas – (1) liet., trump. Jovas, Vydas, jo- (žr. Jodaugas) + vyd- (žr. Josvydas).',' Jovydas yra lietuvių kilmės vardas.'),(1574,'Josvydas','Josvydas – (1) liet., trump. Josvys, Vydas, jos- (žr. Josbutas) + vyd- (: liet. iš-vyd-o, išvysti).',' Josvydas yra lietuvių kilmės vardas.'),(1575,'Juras','Jurams nesvetimas romantinis nusiteikimas, todėl to pačio reikalauja iš žmonių. Moterys jų gyvenime turi pažinti tuos pačius jausmus, kaip ir jie, turi būti tobulų jausmų ir aktyvios. Sekso reikaluose nepripažįsta jokių draudimų ar apribojimų.',' Juras yra graikų kilmės vardas.'),(1576,'Josbutas','Vardas skatina gilumino žavesio pasireiškimą ir stiprių jausmų proveržį. Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Josbutas yra lietuvių kilmės vardas.'),(1577,'Juzė','Juzė – (2) liet. trumpinys iš Juozapa ir Juozapota.',' Juzė yra hebrajų kilmės vardas.'),(1578,'Julijonas','Juliai gali būti ekstrasensai, žiniuoniai; jiems patinka dirbti su žmonėmis, todėl įgyja daug žinių apie žmogaus vidines būsenas. Taip pat geri gydytojai, advokatai, rašytojai, žiniasklaidos darbuotojai.',' Julijonas yra graikų, lotynų kilmės vardas.'),(1579,'Josvyda',' (3a), (1), (1) liet., trump. Josvė, Vydė, iš vyr. v. Josvydas',' Josvyda, Josvyda, Josvydė yra  kilmės vardas.'),(1580,'Jovyda',' (3a), (1), (1) liet., trump. Jovė, Vydė, iš vyr. v. Jovydas',' Jovyda, Jovyda, Jovydė yra  kilmės vardas.'),(1581,'Jūra','',' Jūra yra lietuvių kilmės vardas.'),(1582,'Juventinas','Juventinas – (2) lot., trump. Juventas, Juvas, iš lot. Juventinus, kuris yra priesagos -inus vedinys iš Juventius, žr. Juvencijus.',' Juventinas yra lotynų kilmės vardas.'),(1583,'Julijona','Julijonos atviros moterys, ir žmonės tą jaučia. Jos mėgsta išklausyti kitų išgyvenimus ir dėl savo geros intuicijos, pataria, kaip elgtis. Pavargusios nuo intelektualaus darbo mėgsta pasportuoti. Mėgstamiausios sporto šakos: plaukimas, badmintonas ir atpalaiduojantys pratimai',' Julijona yra graikų, lotynų kilmės vardas.'),(1584,'Josvainė','Josvainė – (1) liet., trump. Josvė, Vainė, iš vyr. v. Josvainas.',' Josvainė yra lietuvių kilmės vardas.'),(1585,'Jovardas','Jovardas – (1) liet., trump. Jovas, Vardys, jo- (žr. Jodaugas) + vard- (: liet. vard-uoti „burti“, plg. vardas, latv. vards „žodis“).',' Jovardas yra lietuvių kilmės vardas.'),(1586,'Kangailė','Kangailė – (1) liet., trump. Gailė, iš vyr. avd. Kangaila, žr. Kangailas.',' Kangailė yra lietuvių kilmės vardas.'),(1587,'Juozė',' (2) liet. trumpinys iš Juozapa ir Juozapota',' Juozė, Juzė yra  kilmės vardas.'),(1588,'Jovarda',' (3a), (1), (1) liet.,trump. Jovė, Vardė, iš vyr. v. Jovardas',' Jovarda, Jovarda, Jovardė yra  kilmės vardas.'),(1589,'Juventas','Juventas – (2) liet. trumpinys iš Juventius, žr. Juvencijus.',' Juventas yra lotynų kilmės vardas.'),(1590,'Julija','Julijos pasirenka įvairias veiklos sritis. Jeigu jos linkusios į menus, tai tampa puikiomis dailininkėmis, muzikantėmis ar rašytojomis. Gali tapti taip pat istorikėmis, teisėjomis, politikėmis, mokytojomis.',' Julija yra graikų kilmės vardas.'),(1591,'Juozas','Juozų teigiamos savybės: įkvėptumas, susikaupimas, geraširdiškumas, jautrumas, diplomatiškumas, garbingumas, paslaptingumas, kantrumas.',' Juozas yra hebrajų kilmės vardas.'),(1592,'Juvencijus','Juvencijus – (1) lot., trump. Juvas, Juventas, iš lot. Juventius: lot. juventus „jaunystė“.',' Juvencijus yra lotynų kilmės vardas.'),(1593,'Kangailas','Kangailas – (1) liet., sen. var. Kangaila, trump. Gailas, kan- iš kant(i)- (: liet. pa-kantus, kant-rus) + gail- (: sen. liet. gailas „stiprus“).',' Kangailas yra lietuvių kilmės vardas.'),(1594,'Julė','Julijos pasirenka įvairias veiklos sritis. Jeigu jos linkusios į menus, tai tampa puikiomis dailininkėmis, muzikantėmis ar rašytojomis. Gali tapti taip pat istorikėmis, teisėjomis, politikėmis, mokytojomis.',' Julė yra graikų kilmės vardas.'),(1595,'Jovaldė','Jovaldė – (1) liet., trump. Jovė, Valdė, iš vyr. v. Jovaldas.',' Jovaldė yra lietuvių kilmės vardas.'),(1596,'Juozapotas',' (2) hebr., trump. Juozas, iš sulotyninto hebr. Josaphatus, Josaphat iš hebr. Jošafat — „(dievas) Jahvė teisė“',' Juozapotas, Juozapatas yra  kilmės vardas.'),(1597,'Kandidas','Kandidas – (2) lot., trump. Didas, iš lot. Candidus: lot. candidus „baltas, be dėmės“.',' Kandidas yra lotynų kilmės vardas.'),(1598,'Juvenalis','Juvenalis – (2) lot., trump. Juvenas, Juvas, iš lot. Juvenalis: lot. juvenalis „jaunuoliškas, jaunatviškas“.',' Juvenalis yra lotynų kilmės vardas.'),(1599,'Jukundas','Jukundas – (1) lot., iš lot. Jucundus: lot. jucundus „malonus, mielas“.',' Jukundas yra lotynų kilmės vardas.'),(1600,'Jovaldas','Jovaldas – (1) liet., trump. Jovas, Valdas, jo- (žr. Jodaugas) + vald- (: liet. vald-yti, vald-o).',' Jovaldas yra lietuvių kilmės vardas.'),(1601,'Juozapota',' (2) hebr., trump. Juozė, iš sulotyninto hebr. Josaphata, kuris iš vyr. v. Josaphat, žr. Juozapotas',' Juozapota, Juozapata yra  kilmės vardas.'),(1602,'Kantrimė','Kantrimė – (1) liet., trump. Kantė, Kantrė, iš vyr. v. Kantrimas.',' Kantrimė yra lietuvių kilmės vardas.'),(1603,'Kandida','Kandida – (2) lot., trump. Dida, iš lot. Candida: lot. candida „balta, be dėmės“.',' Kandida yra lotynų kilmės vardas.'),(1604,'Justinas','Vardadienis: Balandžio 14 d., birželio 1 d.',' Justinas yra lotynų kilmės vardas.'),(1605,'Jukunda','Jukunda – (1) lot., iš lot. Jucunda: lot. jucunda „maloni, miela“.',' Jukunda yra lotynų kilmės vardas.'),(1606,'Kamilė',' (2) lot., trump. Kamė, iš vyr. v. Kamilas',' Kamilė yra lotynų kilmės vardas.'),(1607,'Kantrimas','Kantrimas – (1) liet., trump. Kantas, Kantrys, kant- (žr. Kangailas) + rim- (: liet. rim-ti, rim-o).',' Kantrimas yra lietuvių kilmės vardas.'),(1608,'Juozapina','Juozapina – (2) hebr., trump. Juozė, Juzė, iš sulotyninto Josephina, kuris yra priesagos -ina vedinys iš Josepha, žr. Juozapa.',' Juozapina yra hebrajų kilmės vardas.'),(1609,'Judra','',' Judra, Judrė yra  kilmės vardas.'),(1610,'Justina','Vardadienis: Rugsėjo 5-26 d., spalio 7 d.',' Justina yra lotynų kilmės vardas.'),(1611,'Kamilas',' (2) lot., trump. Kamys, baž. lot. Camillus iš sen. romėnų prievardžio Camillus: lot. camillus „patarnautojas aukojant“',' Kamilas, Kamilis yra  kilmės vardas.'),(1612,'Juozapas','Juozapai tiesmuki, būna grubūs ir žiaurūs, tiesiog – storžieviai. Daugelį moka nuteikti prieš save, dėl to įsigydami priešų visam gyvenimui.',' Juozapas yra hebrajų kilmės vardas.'),(1613,'Kantminas','Kantminas – (1) liet., trump. Kantas, kant- (žr. Kangailas) + min- (žr. Kalminas).',' Kantminas yra lietuvių kilmės vardas.'),(1614,'Justė','Justė – (2) liet. trumpinys iš Justina.',' Justė yra lotynų kilmės vardas.'),(1615,'Juozapa','Juozapa – (1), (3b) hebr., trump. Juozė, Juzė, tarm. Jūzupė žem., Juzia piet. aukšt. (dz.), baž. lot. Josepha iš vyr. v. Joseph, žr. Juozapas.',' Juozapa yra hebrajų kilmės vardas.'),(1616,'Kantmina',' (3b), (1), (1) liet., trump. Kantė, iš vyr. v. Kantminas',' Kantmina, Kantmina, Kantminė yra  kilmės vardas.'),(1617,'Justas','Vardadienis: Sausio 26 d., gegužės 28 d., gruodžio 15 d.',' Justas yra lotynų kilmės vardas.'),(1618,'Kalnius','Kalnius – (2) liet., metatoninis galūnės vedinys iš liet. kalnas.',' Kalnius yra lietuvių kilmės vardas.'),(1619,'Kasijonas','Kasijonas – (2) lot., trump. Kasijus, Kasius, iš lot. Cassianus, kuris yra priesagos -anus vedinys iš sen. romėnų giminės vardo Cassius — Kasijus: lot. cassus „tuščias“.',' Kasijonas yra lotynų kilmės vardas.'),(1620,'Juntautė','Juntautė – (1) liet., trump. Juntė, iš vyr. v. Juntautas.',' Juntautė yra lietuvių kilmės vardas.'),(1621,'Kalnė','Kalnė – (2) liet., iš vyr. v. Kalnius.',' Kalnė yra lietuvių kilmės vardas.'),(1622,'Kantigirdė','Kantigirdė – (1) suliet. prūs., trump. Kantė,iš vyr. v. Kantigirdas.',' Kantigirdė yra prūsų kilmės vardas.'),(1623,'Karolis','Šeimoje kaprizingumas dažnai užgožia kitus asmeninius bruožus, todėl konfliktai su antrąja puse neišvengiami.',' Karolis yra vokiečių kilmės vardas.'),(1624,'Kalmintas','Kalmintas – (1) liet., trump. Kalmas, kal- (žr. Kalmantas) + mint- (: liet. minti, mena, mintis).',' Kalmintas yra lietuvių kilmės vardas.'),(1625,'Kantigirdas','Kantigirdas – (1) suliet. prūs., trump. Kantas, Kantys, kanti- (žr. Kangailas) + gird- (: liet. gird-ėti, girdas „žinia, gandas“).',' Kantigirdas yra prūsų kilmės vardas.'),(1626,'Kalminta',' (3b), (1), (1) liet., trump. Kalmė, iš vyr. v. Kalmintas',' Kalminta, Kalminta, Kalmintė yra  kilmės vardas.'),(1627,'Jūris',' (2) liet., metatoninis galūnės vedinys iš liet. jūra',' Jūris, Jūrius yra  kilmės vardas.'),(1628,'Karolina','Silpniausia vieta Karolinoms yra jų fizinis pažeidžiamumas. Beveik kiekviename žingsnyje Karoliną gali ištikti visai netikėti  nelaimingi nutikimai, nes jai neįprasta iš pradžių galvoti, o tik paskui veikti.',' Karolina yra vokiečių kilmės vardas.'),(1629,'Kantė','Kantė – (2) liet., iš vyr. v. Kantas.',' Kantė yra lietuvių kilmės vardas.'),(1630,'Kęsvilė','Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jums patinka viską daryti patiems. Esate labai užsispyrę. Valios jėga ir rimtas charakteris leidžia susidoroti su bet kokiais projektais, todėl gyvenime palieka gilų pėdsaką.',' Kęsvilė yra lietuvių kilmės vardas.'),(1631,'Karolė','Karolės silpniausia vieta - fizinis pažeidžiamumas. Beveik kiekviename žingsnyje Karolę gali ištikti netikėti  nelaimingi nutikimai, nes jai neįprasta iš pradžių galvoti, o tik paskui veikti.',' Karolė yra vokiečių kilmės vardas.'),(1632,'Jurgita','Jurgita – graikų kilmės vardas mergaitei, kurio trumpinys – Jurga. Graikų kalboje Jurga reiškia žemdirbė. Jurgitos vardas įtalų kalboje – Giorgitta. Jurgita vardo vienintelė alternatyva vyrui – Jurgis.',' Jurgita yra graikų kilmės vardas.'),(1633,'Kalminas','Kalminas – (1) liet., trump. Kalmas, kal- (žr. Kalmantas) + min- (: liet. min-ėti, min-i).',' Kalminas yra lietuvių kilmės vardas.'),(1634,'Kantenis','Kantenis – (2) liet. ir prūs., trump. Kantas, priesagos -enis vedinys iš sen. trumpinio Kantas.',' Kantenis yra prūsų kilmės vardas.'),(1635,'Kęsvilas','Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jums patinka viską daryti patiems. Esate labai užsispyrę. Valios jėga ir rimtas charakteris leidžia susidoroti su bet kokiais projektais, todėl gyvenime palieka gilų pėdsaką. ',' Kęsvilas yra lietuvių kilmės vardas.'),(1636,'Karmela','Karmela – (2) isp., trump. Karma, Mela, iš isp. Carmela, kuris yra isp. vardo Carmen (: lot. carmen „daina“) liaudiškas variantas.',' Karmela yra ispanų kilmės vardas.'),(1637,'Kalmina',' (3b), (1), (1) liet., trump. Kalme, iš vyr. v. Kalminas',' Kalmina, Kalmina, Kalminė yra  kilmės vardas.'),(1638,'Karina','Karinos, veikiamos neigiamos skaičių vibracijos, tampa tik savų interesų vykdytojomis. Gali išnaudoti žmogų ir palikti likimo valiai. Joms taikytinas itin svarbus posakis: “Nekask duobės kitam, nes pats įkrisi”.',' Karina yra italų kilmės vardas.'),(1639,'Kazimieras','Kazimierams patartina mokytis geriau save išreikšti. Būtina įgyti pasitikėjimą savimi, pažaboti aikštingą temperamentingą charakterį, daugiau bendrauti su žmonėmis.',' Kazimieras yra lotynų kilmės vardas.'),(1640,'Kantautė','Kantautė – (1) liet., trump. Kantė, iš vyr. v. Kantautas.',' Kantautė yra lietuvių kilmės vardas.'),(1641,'Kalmantė','Kalmantė – (1) liet., trump. Kalmė, iš vyr. v. Kalmantas.',' Kalmantė yra lietuvių kilmės vardas.'),(1642,'Karigailė','Karigailė – (1) liet., trump. Karė, iš vyr. v. Karigaila.',' Karigailė yra lietuvių kilmės vardas.'),(1643,'Kantautas','Kantautas – (1) liet., trump. Kantas, kan- iš kant- (žr. Kangailas) + taut- (: liet. taut-a).',' Kantautas yra lietuvių kilmės vardas.'),(1644,'Kazimiera','Kazimierų neigiamos savybės: paviršutiniškumas, niūrumas, nekantrumas. Būdamos emocingos ir jautrios, kartais įžvelgia kritiką ten, kur jos iš tikrųjų visai nėra. Gali būti pavydžios ir plepios. Joms patartina siekti konkrečių tikslų, nepanirti į mistikos labirintus.',' Kazimiera yra lotynų kilmės vardas.'),(1645,'Kalmantas','Kalmantas – (1) liet., trump. Kalmas, kai- (: prūs. kal-tza iš kal-sa „skambėti“, latv. kal-uot „šnekėti“, liet. kal-ba) + mant- (: liet. mantus „sumanus“).',' Kalmantas yra lietuvių kilmės vardas.'),(1646,'Kantas','Kantas – (2) liet., trumpinys iš vardų su Kan-t-, Kant-: Kantautas, Kantminas ir kt.',' Kantas yra lietuvių kilmės vardas.'),(1647,'Karalius','Karalius – (2) sulietuvintas vardo Karolis variantas.',' Karalius yra lietuvių kilmės vardas.'),(1648,'Kazė','Kazimierų neigiamos savybės: paviršutiniškumas, niūrumas, nekantrumas. Būdamos emocingos ir jautrios, kartais įžvelgia kritiką ten, kur jos iš tikrųjų visai nėra. Gali būti pavydžios ir plepios. Joms patartina siekti konkrečių tikslų, nepanirti į mistikos labirintus.',' Kazė yra lotynų kilmės vardas.'),(1649,'Kanutas','Kanutas – (2) skand., trump. Kanas, Knutas, baž. lot. Canutus iš skand. Kanut – „kilmingasis, kilnusis“.',' Kanutas yra skandinavų kilmės vardas.'),(1650,'Kalikstė',' (2) graik., trump. Kalstė, iš sulotyninto graik. Callixta, Callista, kuris iš vyr. v. Callixtus, Callistus, žr. Kalikstas',' Kalikstė, Kalistė yra  kilmės vardas.'),(1651,'Katrė','Katrė – (2), (4) liet. trumpinys iš Katryna, žr. Katarina.',' Katrė yra graikų kilmės vardas.'),(1652,'Kantalgė','Kantalgė – (1) liet., trump. Kantė, iš vyr. v. Kantalgas.',' Kantalgė yra lietuvių kilmės vardas.'),(1653,'Kantalgas','Kantalgas – (1) liet., trump. Kantas, kant- (žr. Kangailas) + alg- (: liet. alg-a „atpildas, atlyginimas“).',' Kantalgas yra lietuvių kilmės vardas.'),(1654,'Kantvilė','Kantvilė – (1), (2) liet. ir prūs., trump. Kantė, iš vyr. v. Kantvilas.',' Kantvilė yra lietuvių kilmės vardas.'),(1655,'Katarina',' (2) graik., suliet. var. Kotryna (2), trump. Katrė, Katrė, tarm. Katryna, Katrynė, Tryna, Trynė vak. liet., Katarinė vak. žem., Katrina vak. aukšt. (Babtai), Katriuka piet. aukšt., iš sulotyninto graik. Catharina, Catherina, kuris iš graik. Aikatherine: graik. katharos „tyras, švarus“',' Katarina, Katryna yra  kilmės vardas.'),(1656,'Kantvilas','Kantvilas – (1) liet. ir prūs., trump. Kantas, kant- (žr. Kangailas) + vil- (: liet. vil-tis, vil-iasi, vil-tis).',' Kantvilas yra lietuvių kilmės vardas.'),(1657,'Kangedas','Kangedas – (1) liet., trump. Gedas, kan- (žr. Kangailas) + ged- (: liet. ged-auti „ilgėtis“).',' Kangedas yra lietuvių kilmės vardas.'),(1658,'Kastytis','Kastyčiai, kurie laisvalaikiu naudojasi įvairiais malonumais ar tuščiai laiką leidžia, labai retos išimtys.',' Kastytis yra lietuvių kilmės vardas.'),(1659,'Kangeda',' (3b), (1), (1) liet., trump. Gedė, iš vyr. v. Kangedas',' Kangeda, Kangeda, Kangedė yra  kilmės vardas.'),(1660,'Kantvydas','Kantvydas – (1) liet. ir prūs., trump. Kantas, kant- (žr. Kangailas) + vyd- (: liet. iš-vyd-o, iš-vysti).',' Kantvydas yra lietuvių kilmės vardas.'),(1661,'Kastė','Kastė – (2) 1. liet., trumpinys iš Kastautė, 2. liet., trumpinys iš sulietuvinto Kastancija, žr. Konstancija.',' Kastė yra lietuvių kilmės vardas.'),(1662,'Kantvyda',' (3b), (1), (1) liet. ir prūs., trump. Kantė, iš vyr. v. Kantvydas',' Kantvyda, Kantvyda, Kantvydė yra  kilmės vardas.'),(1663,'Kastautė','Kastautė – (1) liet., trump. Kastė, iš vyr. v. Kastautas.',' Kastautė yra lietuvių kilmės vardas.'),(1664,'Kintaras','Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus. ',' Kintaras yra lietuvių kilmės vardas.'),(1665,'Kantvainė','Kantvainė – (1) liet., trump. Kantė, iš vyr. v. Kantvainas.',' Kantvainė yra lietuvių kilmės vardas.'),(1666,'Kastautas','Kastautas – (1) liet., trump. Kastas, Kastys, kas- (: liet. įvardis kas) + taut- (žr. Kantautas).',' Kastautas yra lietuvių kilmės vardas.'),(1667,'Kintalgė','Kintalgė – (1) liet., trump. Kintė, iš vyr. v. Kintalgas.',' Kintalgė yra lietuvių kilmės vardas.'),(1668,'Kantvainas',' (1) liet., trump. Kantas, kant- (žr. Kangailas) + vain- (: sen. liet. vaina „kaltė, priežastis“)',' Kantvainas yra  kilmės vardas.'),(1669,'Kastas','Kastas – (2) 1. liet. trumpinys iš Kastantas, 2. liet., trumpinys iš Kastautas.',' Kastas yra lietuvių kilmės vardas.'),(1670,'Kintalgas','Kintalgas – (1) liet., trump. Kintas, kint- (: liet. kint- su balsių kaita iš kent-ėti, plg. žiem-kin-tis „kas žiemą iškenčia“) + alg- (žr. Kantalgas).',' Kintalgas yra lietuvių kilmės vardas.'),(1671,'Kastancija','Kastancija – (1) žr. Konstancija.',' Kastancija yra lotynų kilmės vardas.'),(1672,'Kilna',' (4), (2) liet., galūnių vediniai iš liet. kilni „dora, tauri“',' Kilna, Kilnė yra  kilmės vardas.'),(1673,'Kasparas','Kasparai gyvenime pasireiškia kaip rašytojai, oratoriai arba aktoriai. Jie turtingos vaizduotės, labai jautrūs, dosnūs ir meilūs.',' Kasparas yra lotynų kilmės vardas.'),(1674,'Kasijus','Jūs apsigimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, mokslininkai, rašytojai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Kasijus yra lotynų kilmės vardas.'),(1675,'Kilmintas','Kilmintas – (1) liet., trump. Kilius, Kilmys, kil- (žr. Kilmantas) + mint- (žr. Kalmintas).',' Kilmintas yra lietuvių kilmės vardas.'),(1676,'Kilminta',' (3a), (1), (1) liet., trump. Kilė, Kilma, iš vyr. v. Kilmintas',' Kilminta, Kilminta, Kilmintė yra  kilmės vardas.'),(1677,'Kilminas','Kilminas – (1) liet., trump. Kilius, Kilmys, kil- (žr. Kilmantas) + min- (žr. Kalminas).',' Kilminas yra lietuvių kilmės vardas.'),(1678,'Kilmina',' (3a), (1), (1) liet., trump. Kilė, Kilma, iš vyr. v. Kilminas',' Kilmina, Kilmina, Kilminė yra  kilmės vardas.'),(1679,'Kilmantė','Kilmantė – (1) liet., trump. Kilė, Kilma, iš vyr. v. Kilmantas.',' Kilmantė yra lietuvių kilmės vardas.'),(1680,'Kilmantas','Kilmantas – (1) liet., trump. Kilius, Kilmys, kil- (: liet. kil-ti) + mant- (žr. Kalmantas).',' Kilmantas yra lietuvių kilmės vardas.'),(1681,'Kilijonas','Nors dažnai būdami užsiėmę svarbiais darbais, labai vertina namų židinį. Jūs dažniausiai nesate romantikai, todėl flirtas ir seksas jus mažai domina. Jums svarbi tik meilė, į kurią jūs žiūrite labai atsargiai. Tik įsitikinę jausmų tikrumu kuriate šeimą.',' Kilijonas yra keltų kilmės vardas.'),(1682,'Kęsvina',' (3b), (1), (1) liet., trump. Kęstė, Kęsvė, iš vyr. v. Kęsvinas',' Kęsvina, Kęsvina, Kęsvinė yra  kilmės vardas.'),(1683,'Kęsvinas','Kęsvinas – (1) liet., trump. Kęstas, Kęsvys, kęs- iš kęst- (žr. Kęsbartas) + vin- (sen. liet. vin- su balsių kaita iš vaina „priežastis, kaltė“).',' Kęsvinas yra lietuvių kilmės vardas.'),(1684,'Kęsgailas','Kęsgailas – (1) liet., sen. var. Kęsgaila, trump. Kęstas, Kęstys, kęs- iš kęst- (žr. Kęsbartas) + gail- (žr. Kangailas).',' Kęsgailas yra lietuvių kilmės vardas.'),(1685,'Kęsbartė','Kęsbartė – (1) liet., trump. Kęstė, iš vyr. v. Kęsbartas.',' Kęsbartė yra lietuvių kilmės vardas.'),(1686,'Kęstutis','Kęstučiai turi gerą humoro jausmą, todėl su jais bendrauti labai įdomu. Mėgsta skaityti detektyvinius romanus bei fantastiką. Gyvenime gali būti labai gerais tardytojais, analitikais bei politikais.',' Kęstutis yra lietuvių kilmės vardas.'),(1687,'Kęsbartas','Kęsbartas – (1) liet., trump. Kęstas, Kęstys, kęs- iš kęst- (: liet. kęsti) + bart- (: liet. bar-ti sen. reikšme „kovoti“, bartas, plg. rus. borotjsia „kovoti“).',' Kęsbartas yra lietuvių kilmės vardas.'),(1688,'Kęstutė','Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Kęstutė yra lietuvių kilmės vardas.'),(1689,'Kervydas','Kervydas – (1) liet., trump. Kerys, ker- (žr. Kergailas) + vyd- (žr. Kantvydas).',' Kervydas yra lietuvių kilmės vardas.'),(1690,'Kęstė','Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Kęstė yra lietuvių kilmės vardas.'),(1691,'Kervainas','Kervainas – (1) liet., trump. Kerys, ker- (žr. Kergailas) + vain- (žr. Kantvainas).',' Kervainas yra lietuvių kilmės vardas.'),(1692,'Kęstautė',' (1) liet., trump. Kęstė, iš vyr. v. Kęstautas',' Kęstautė yra  kilmės vardas.'),(1693,'Kertautė',' (1) liet., trump. Kerė, iš vyr. v. Kertautas',' Kertautė yra  kilmės vardas.'),(1694,'Kęstautas','Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Kęstautas yra lietuvių kilmės vardas.'),(1695,'Kipras','Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Kipras yra graikų kilmės vardas.'),(1696,'Kęstas',' (2) liet, ir prūs., trumpinys iš avd. su Kęs-t-: Kęstartas, Kęstautas ir kt.',' Kęstas yra lietuvių kilmės vardas.'),(1697,'Kertautas','Kertautas – (1) liet., trump. Kerys, Kertys, ker- (žr. Kergailas) + taut- (žr. Kantautas).',' Kertautas yra lietuvių kilmės vardas.'),(1698,'Kintvilė','Kintvilė – (1), (2) liet., trump. Kintė, iš vyr. v. Kintvilas.',' Kintvilė yra lietuvių kilmės vardas.'),(1699,'Klarentas','Klarentas – (2) lot., trump. Klaras, iš lot. Clarentius: lot. clarens (kilm. clarentis) „šviečiantis“.',' Klarentas yra lotynų kilmės vardas.'),(1700,'Kęstartė',' (1) liet., trump. Kęstė, iš vyr. v. Kęstartas ',' Kęstartė yra  kilmės vardas.'),(1701,'Kernius','Kernius – (2) liet., iš legendinio Kernavės kunigaikščio vardo, kuris yra galūnės vedinys iš liet. kerna, kerna „mažaūgis (žmogus)“.',' Kernius yra lietuvių kilmės vardas.'),(1702,'Kintvilas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kintvilas yra lietuvių kilmės vardas.'),(1703,'Klaras','Klaras – (2) lot., iš lot. Clarus: lot. clarus „šviesus, garsus“.',' Klaras yra lotynų kilmės vardas.'),(1704,'Kęstartas',' (1) liet., trump. Kęstas, Kęstys, kęs- iš kęst- (žr. Kęsbartas) + tart- (: liet. tarti, tartas)',' Kęstartas yra  kilmės vardas.'),(1705,'Kermantė','Kermantė – (1) liet., trump. Kerė, iš vyr. v. Kermantas.',' Kermantė yra lietuvių kilmės vardas.'),(1706,'Kintvainė',' (1) liet., trump. Kintė, iš vyr. v. Kintvainas',' Kintvainė yra  kilmės vardas.'),(1707,'Klara','Vardadienis: Rugpjūčio 11-12 d.',' Klara yra lotynų kilmės vardas.'),(1708,'Klema',' (2) liet. trumpinys iš Klemencija ir Klementina ',' Klema, Klemė yra  kilmės vardas.'),(1709,'Kęsminas',' (1) liet., trump. Kęsmys, kęs- iš kęst- (žr. Kęsbartas) + min- (žr. Kalminas) ',' Kęsminas yra lietuvių kilmės vardas.'),(1710,'Kermantas','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais',' Kermantas yra lietuvių kilmės vardas.'),(1711,'Kintvainas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kintvainas yra lietuvių kilmės vardas.'),(1712,'Kyvainė','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kyvainė yra lietuvių kilmės vardas.'),(1713,'Klausvydas','Klausvydas – (1) liet., trump. Klausas, klaus- (žr. Klausgailas) + vyd- (žr. Kantvydas).',' Klausvydas yra lietuvių kilmės vardas.'),(1714,'Kergailė','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kergailė yra lietuvių kilmės vardas.'),(1715,'Kęsmina',' (3b), (1), (1) liet. trump. Kęstė, Kęsmė, iš vyr. v. Kęsminas',' Kęsmina, Kęsmina, Kęsminė yra  kilmės vardas.'),(1716,'Kintrimė','Kintrimė – (1) liet., trump. Kintė, Kintrė, iš vyr. v. Kintrimas.',' Kintrimė yra lietuvių kilmės vardas.'),(1717,'Kyvainas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kyvainas yra lietuvių kilmės vardas.'),(1718,'Klausvyda',' (3b), (1), (1) liet., trump. Klausė, iš vyr. v. Klausvydas',' Klausvyda, Klausvyda, Klausvydė yra  kilmės vardas.'),(1719,'Kergailas','Kergailas – (1) liet., var. Kergaila, trump. Kerys, ker- (: liet. ker-ėti, ker-ai „burtai“, latv. sa-cer-et „sukurti“) + gail- (žr. Kangailas).',' Kergailas yra lietuvių kilmės vardas.'),(1720,'Koglandas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Koglandas yra lietuvių kilmės vardas.'),(1721,'Kęsmantė','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Kęsmantė yra lietuvių kilmės vardas.'),(1722,'Kintrimas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kintrimas yra lietuvių kilmės vardas.'),(1723,'Kentautė','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Kentautė yra lietuvių kilmės vardas.'),(1724,'Kytautė','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Kytautė yra lietuvių kilmės vardas.'),(1725,'Klausutis','Klausutis – (2) liet., trump. Klausas, priesagos -utis vedinys iš sen. trumpinio Klausas, kuris iš Klausgailas.',' Klausutis yra lietuvių kilmės vardas.'),(1726,'Kęsmantas','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Kęsmantas yra lietuvių kilmės vardas.'),(1727,'Kodravė','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kodravė yra lietuvių kilmės vardas.'),(1728,'Kytautas',' (1) liet., trump. Kytis, ky- (: liet. įvardžio kas sen. forma, atliepianti ide. kui, plg. sen. isl. hvi, av. či „kaip“) + taut- (žr. Kantautas)',' Kytautas yra  kilmės vardas.'),(1729,'Kentautas','Kentautas – (1) liet., trump. Kentys, ken- iš kent- (: liet. kent-ėti)+ taut- (žr. Kantautas).',' Kentautas yra lietuvių kilmės vardas.'),(1730,'Kintibutas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kintibutas yra lietuvių kilmės vardas.'),(1731,'Klausutė','Klausutė – (2) liet., trump. Klausė, iš vyr. v. Klausutis.',' Klausutė yra lietuvių kilmės vardas.'),(1732,'Kodravas','Kodravas – (1) suliet. prūs., trump. Kodrys, ko- (žr. Kobutas) + drav- (: liet. drūtas „stiprus“, tvirtas (kaip medis)“, pl. dravė, dravis „drevė“.',' Kodravas yra lietuvių kilmės vardas.'),(1733,'Kęsgilė','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kęsgilė yra lietuvių kilmės vardas.'),(1734,'Kintenis','Kintenis – (2) suliet. prūs., trump. Kintas, priesagos -enis vedinys iš sen. trump. Kintas, kuris iš avd. su Kin-t-, Kint-: Kintautas, Kintvainas, Kintvilas ir kt.',' Kintenis yra lietuvių kilmės vardas.'),(1735,'Kazys','Kazimierams patartina mokytis geriau save išreikšti. Būtina įgyti pasitikėjimą savimi, pažaboti aikštingą temperamentingą charakterį, daugiau bendrauti su žmonėmis.',' Kazys yra lotynų kilmės vardas.'),(1736,'Klausilė','Klausilė – (1) suliet. prūs. trump. Klausė, iš vyr. v. Klausilas.',' Klausilė yra lietuvių kilmės vardas.'),(1737,'Kirstautė','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kirstautė yra lietuvių kilmės vardas.'),(1738,'Kęsgailas','Kęsgailas – (1) liet., trump. Kęstas, Kęstys, kęs- iš kęst- (žr. Kęsbartas) + gil- (: liet. su-gil-ti, gil-dyti širdį).',' Kęsgailas yra lietuvių kilmės vardas.'),(1739,'Kobutas','Kobutas – (1) liet., trump. Butys, ko- (: liet. ko įvardžio kas kilm.) + but- (žr. Kaributas).',' Kobutas yra lietuvių kilmės vardas.'),(1740,'Kintenė','Kintenė – (2) suliet. prūs., trump. Kintė, iš vyr. v. Kintenis.',' Kintenė yra lietuvių kilmės vardas.'),(1741,'Kirstautas','Kirstautas – (1) liet., trump. Kirstys, kirs- (: liet. pa-kirs-ti „pabusti“) + taut- (žr. Kantautas).',' Kirstautas yra lietuvių kilmės vardas.'),(1742,'Klausilas','Klausilas – (1) suliet. prūs., trump. Klausas, priesagos -ilas vedinys iš sen. trump. Klausas, kuris iš Klausgailas.',' Klausilas yra lietuvių kilmės vardas.'),(1743,'Klotilda','Klotilda – (1) germ., trump. Tilda, vid. lot. Clotilda (baž. lot. Clotildis) iš germ. Clothilda, Klothilde: sen. vok. aukšt. hlūt „garsus“ + hiltja „kova“.',' Klotilda yra vokiečių kilmės vardas.'),(1744,'Kęsgailė','Kęsgailė – (1) liet., trump. Kęstė, iš vyr. avd. Kęsgaila žr. Kęsgailas.',' Kęsgailė yra lietuvių kilmės vardas.'),(1745,'Kintė','Kintė – (3) liet., galūnės vedinys iš Kintas, taip pat trumpinys iš mot. v. su Kin-t-, Kint-: Kintautė, Kintvainė, Kintvilė ir kt.',' Kintė yra lietuvių kilmės vardas.'),(1746,'Kirmantė','Kirmantė – (1) liet., trump. Kirė, iš vyr. v. Kirmantas.',' Kirmantė yra lietuvių kilmės vardas.'),(1747,'Klausgailė','Klausgailė – (1) liet., trump. Klausė, iš vyr. avd. Klausgaila, žr. Klausgailas.',' Klausgailė yra lietuvių kilmės vardas.'),(1748,'Kintautė',' (1) liet., trump. Kintė, iš vyr. v. Kintautas',' Kintautė yra lietuvių kilmės vardas.'),(1749,'Kletas','Kletas – (2) graik., iš sulotyninto graik. Cletus — „šauktas“, kuris yra trumpinys iš Anakletas.',' Kletas yra graikų kilmės vardas.'),(1750,'Klausgailas','Klausgailas – (1) liet., sen. var. Klausgaila, trump. Klausas, klaus- (: liet. klausy-ti, klaus-us „paklusnus, turintis klausą“) + gail- (žr. Kangailas).',' Klausgailas yra lietuvių kilmės vardas.'),(1751,'Kirmantas','Kirmantas – (1) liet., trump. Kirys, kir- (žr. Kirbutas) + mant- (žr. Kalmantas).',' Kirmantas yra lietuvių kilmės vardas.'),(1752,'Kintautas','Kintautas – (1) liet., trump. Kintas, kin- iš kint- (žr. Kintalgas) + taut- (žr. Kantautas).',' Kintautas yra lietuvių kilmės vardas.'),(1753,'Klausenis','Klausenis – (2) suliet. prūs., trump. Klausas, priesagos -enis vedinys iš sen. trump. Klausas, kuris iš Klausgailas.',' Klausenis yra lietuvių kilmės vardas.'),(1754,'Kleopatra','Kleopatros meilėje skiria daug dvasinių savybių. Jos gali metų metais laukti savo išsvajotojo. Įsimylėjusios myli karštai ir ilgai.',' Kleopatra yra graikų kilmės vardas.'),(1755,'Kirkantas','Kirkantas – (1) liet., trump. Kirys, kir- (žr. Kirbutas) + kant- (žr. Kangailas).',' Kirkantas yra lietuvių kilmės vardas.'),(1756,'Kintas','Kintas – (2) liet., trumpinys iš avd. su Kin-t-, Kint-, Kintautas, Kintvainas, Kintvilas ir kt.',' Kintas yra lietuvių kilmės vardas.'),(1757,'Klausenė','Klausenė – (2) suliet. prūs., trump. Klausė, iš vyr. v. Klausenis.',' Klausenė yra lietuvių kilmės vardas.'),(1758,'Kirkanta',' (3a), (1), (1) liet., trump. Kirė, iš vyr. v. Kirkantas',' Kirkanta, Kirkanta, Kirkantė yra  kilmės vardas.'),(1759,'Kleopas','Vardadienis: Balandžio 9 d., rugsėjo 25 d.',' Kleopas yra graikų kilmės vardas.'),(1760,'Kintarė','Kintarė – (1) liet., trump. Kintė, iš vyr. v. Kintaras.',' Kintarė yra lietuvių kilmės vardas.'),(1761,'Klausė','Klausė – (2) liet., galūnės vedinys iš Klausas, taip pat trumpinys iš mot. v. Klausgailė.',' Klausė yra lietuvių kilmės vardas.'),(1762,'Kleopa','Kleopa – (2) graik., trump. Klevė (Rietavas), iš vyr. v. Kleopas.',' Kleopa yra lietuvių kilmės vardas.'),(1763,'Kirbutas','Kirbutas – (1) liet., trump. Kirys, kir- (: liet. kir-inti „jaudrinti“, kir-b-inti „judinti“) + but- (žr. Kaributas).',' Kirbutas yra lietuvių kilmės vardas.'),(1764,'Kiprijonas',' (2) sulot. graik., trump. Kipras, per rytų slavų Kiprijan iš sulotyninto graik. Cyprianus – „kiprietis, Kipro salos gyventojas“',' Kiprijonas yra graikų kilmės vardas.'),(1765,'Klementinas','Klemensai serga kojų ligomis, dažnai jiems skauda galvą, linkę vidurių sutrikimams, nes mėgsta labai daug valgyti, piktnaudžiauja alkoholiu.',' Klementinas yra lotynų kilmės vardas.'),(1766,'Klausas','Klausas – (2) liet., trumpinys iš vardų su Klaus-: Klausgailas.',' Klausas yra graikų kilmės vardas.'),(1767,'Klaudijus','Vardadienis: Balandžio 26 d., birželio 6 d.',' Klaudijus yra lotynų kilmės vardas.'),(1768,'Klementina','Klementina – (2) lot., trump. Klementa, Klema, Klemė, tarm. Klimanta, Klima ryt. aukšt., iš lot. Clementina, kuris yra priesagos -ina vedinys iš lot. Clementia, žr. Klemencija.',' Klementina yra lotynų kilmės vardas.'),(1769,'Klemensas','Klemensai serga kojų ligomis, dažnai jiems skauda galvą, linkę vidurių sutrikimams, nes mėgsta labai daug valgyti, piktnaudžiauja alkoholiu.',' Klemensas yra lotynų kilmės vardas.'),(1770,'Klaudija','Klaudijos savo veiklą skiria darbams, kurie susiję su kažkokiu perdirbimu, atnaujinimu.Jos savo talentus panaudoja pramonės prekių papuošimui, kvepalų, kosmetikos, juvelyrinių dirbinių sritims. Būdamos turtingos, užsiima labdara.',' Klaudija yra lotynų kilmės vardas.'),(1771,'Klemensa','Klemensa – (1) lot., trump. Klema,Klemė, iš vyr. v. Clemens, žr. Klemensas.',' Klemensa yra lotynų kilmės vardas.'),(1772,'Klemencija','Klemencija – (1) lot., trump. Klema, Klemė, iš lot. Clementia: lot. clementia „švelnumas, malonumas“ .',' Klemencija yra lietuvių kilmės vardas.'),(1773,'Kotryna','Kotrynoms tinka judrūs ir besikeičiantys darbai. Jos geros restoranų padavėjos, kelionių organizatorės, reklamos darbuotojos, manekenės, geografijos mokytojos, artistės, sekretorės, sportininkės.',' Kotryna yra graikų kilmės vardas.'),(1774,'Kotrė',' (2) liet. (žem.) trumpinys iš Kotryna',' Kotrė yra  kilmės vardas.'),(1775,'Klemas','Klemas – (2) liet. trumpinys iš Klemensas ir Klementinas.',' Klemas yra lietuvių kilmės vardas.'),(1776,'Kostė','Kostė – (2) liet. trumpinys iš Konstancija ir Konstantina.',' Kostė yra lotynų kilmės vardas.'),(1777,'Kornelis','Kornelis – (2) trumpinys iš Kornelijus.',' Kornelis yra lietuvių kilmės vardas.'),(1778,'Kornelijus','Vardadienis: Birželio 4 d., rugsėjo 16 d.',' Kornelijus yra lotynų kilmės vardas.'),(1779,'Kordula',' (1) lot., var. Kordulė (2), trump. Korda, iš lot. Cordula — „širdelė“: lot. cor (kilm. cordis) „širdis“',' Kordula, Kordulė yra  kilmės vardas.'),(1780,'Kornelija','Kornelijos labai savarankiškos ir nemėgsta jokių patarimų. Jos turi gerą intuiciją ir ja neklysdamos vadovaujasi. Gresia potraukis girtuoklystei bei narkotikams.',' Kornelija yra lotynų kilmės vardas.'),(1781,'Konstantina','Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Konstantina yra lotynų kilmės vardas.'),(1782,'Konstancija','Konstancijoms rekomenduotina nuolat kelti savo kvalifikaciją, įsigyti jaujų žinių. Joms daugiau reikėtų domėtis kitų reikalais. Nebūti nuošalyje ir pasidalyti savo žiniomis su kitais. Ugdykite pakantumą draugams. Saugokitės alkoholinių gėrimų!',' Konstancija yra lotynų kilmės vardas.'),(1783,'Konradas','Konradai nevengia santuokos: norėtų turėti klausytoją, pašnekovę ir vienmintę. Tačiau dar labiau trokšta laisvės, be to, netiki, jog sugebės atrasti giminišką sielą. Patartina nesibaiminti: kandidatų į sutuoktinius magnetizmas bei dvasinės vibracijos padės juos surasti.',' Konradas yra vokiečių kilmės vardas.'),(1784,'Kolumbas','Kolumbas – (1) lot., trump. Kolys, Kolius, iš lot. Columbus: lot. columbus „balandis“.',' Kolumbas yra lotynų kilmės vardas.'),(1785,'Kristijonas','Kristijonai daugiausia pasiekia biznio pasaulyje, medicinoje (chirurgijoje). Meno pasaulyje jiems artimiausias teatras, muzika, radijas ir fotografija',' Kristijonas yra lotynų kilmės vardas.'),(1786,'Kolumba','Kolumba – (1) lot., trump. Kolė, iš lot. Columba: lot. columba „balandė“.',' Kolumba yra lotynų kilmės vardas.'),(1787,'Kristijona','Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Kristijona yra lotynų kilmės vardas.'),(1788,'Koleta','Koleta – (2) pranc., trump. Leta, baž. lot. Coletta iš pranc. Colette, kuris yra trumpinys iš Nicolette, o šis priesagos -ette (mažyb.) vedinys iš Nicola, padaryto iš vyr. v. Nikolaus, žr. Mikalojus.',' Koleta yra prancūzų kilmės vardas.'),(1789,'Kolangas','Kolangas – (1) suliet. prūs., trump. Kolys, ko- (žr. Kobutas) + lang- (: prūs. langi-seiligins „lengva-manis“).',' Kolangas yra lietuvių kilmės vardas.'),(1790,'Kristė','Kristė – (2) liet. trumpinys iš Kristina ir Kristijona.',' Kristė yra lotynų kilmės vardas.'),(1791,'Krisčius',' (2) liet. trumpinys iš Kristijonas, Kristinas ir Kristupas',' Krisčius, Kristis yra  kilmės vardas.'),(1792,'Koglandė','Koglandė – (1) suliet. prūs., trump. Kogė, Glandė, iš vyr. v. Koglandas.',' Koglandė yra lietuvių kilmės vardas.'),(1793,'Koviltė','Koviltė – (1) liet., trump. Kovė, Viltė, iš vyr. v. Koviltas.',' Koviltė yra lietuvių kilmės vardas.'),(1794,'Koviltas','Koviltas – (1) liet., trump. Kovys, Viltas, ko-(žr. Kobutas) + vilt- (:liet. viltis „tikėtis“, vilt-is).',' Koviltas yra lietuvių kilmės vardas.'),(1795,'Kovilė','Kovilė – (1), (2) liet., trump. Kovė, Vilė, iš vyr. v. Kovilas.',' Kovilė yra lietuvių kilmės vardas.'),(1796,'Kovydas','Kovydas – (1) liet., trump. Kovas, Vydas, ko- (žr. Kobutas) + vyd- (žr. Kantvydas).',' Kovydas yra lietuvių kilmės vardas.'),(1797,'Kovilas','Kovilas – (1) liet., trump. Kovys, Vilas, ko- (žr. Kobutas) + vil- (žr. Kantvilas).',' Kovilas yra lietuvių kilmės vardas.'),(1798,'Kovyda',' (3a), (1), (1) liet., trump. Kovė, Vydė, iš vyr. v. Kovydas',' Kovyda, Kovyda, Kovydė yra  kilmės vardas.'),(1799,'Kvirinas','Kvirinas – (2) lot., trump. Kviras, Kviris, iš lot. Quirinus, kuris iš sen. italikų dievo vardo Quirinus: lot. ąuirinus „ieties metikas, pilietis“.',' Kvirinas yra lotynų kilmės vardas.'),(1800,'Kovaldė','Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Kovaldė yra lietuvių kilmės vardas.'),(1801,'Kunotas','',' Kunotas yra lietuvių kilmės vardas.'),(1802,'Kovaldas','Kovaldas – (1) suliet. prūs., trump. Kovas, Valdas, ko- (žr. Kobutas) + vald- (: liet. vald-yti, vald-o).',' Kovaldas yra lietuvių kilmės vardas.'),(1803,'Kovaidas','Kovaidas – (1) liet., trump. Kovas, Vaidas, ko- (žr. Kobutas) + vaid- (: liet. vaid-ytis „rodytis“, vaid-entis).',' Kovaidas yra lietuvių kilmės vardas.'),(1804,'Kunigunda','Vardadienis: Kovo 3 d., liepos 24 d.',' Kunigunda yra vokiečių kilmės vardas.'),(1805,'Kovaida',' (3a), (1), (1) liet., trump. Kovė, Vaida, iš vyr. v. Kovaidas',' Kovaida, Kovaida, Kovaidė yra  kilmės vardas.'),(1806,'Ksaverija','',' Ksaverija yra ispanų kilmės vardas.'),(1807,'Ksavera',' (2), (1) isp., tarm. Ksevera, Kseverija ryt. aukšt., iš vyr. v. Xaverius, žr. Ksaveras',' Ksavera, Ksaverija yra  kilmės vardas.'),(1808,'Ksaveras','Ksaverų blogybės pasireiškia jų noru perdėtai domėtis kitų reikalais, nuolat patarinėti, net jeigu to jų niekas neprašo. Kerštingi.',' Ksaveras yra ispanų kilmės vardas.'),(1809,'Krizostomas','Krizostomas – (2) graik., trump. Krizas, iš sulotyninto graik. Chrisostomus — „auksaburnis“: graik. chrysos „auksas“ + tomos „burna“.',' Krizostomas yra graikų kilmės vardas.'),(1810,'Krizas','Krizas – (2) liet. trumpinys iš Krizantas, Krizostomas ir Kristijonas.',' Krizas yra lotynų kilmės vardas.'),(1811,'Krizantas','Krizantas – (1) graik., trump. Krizas, iš sulotyninto graik. Chrysanthus: graik. chrysos „auksas“ + anthos „žiedas“.',' Krizantas yra graikų kilmės vardas.'),(1812,'Kristupas','Kristupas – (1) trump. Krisčius, Kristis, – liet. trumpinys iš Kristoforas.',' Kristupas yra graikų kilmės vardas.'),(1813,'Kristoforas','Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Kristoforas yra graikų kilmės vardas.'),(1814,'Kristinas','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Kristinas yra lotynų kilmės vardas.'),(1815,'Kristina','Kristinos geriausiai jaučiasi būdamos mokslo įstaigos dėstytojos. Jos geros visuomenės organizatorės ir reformatorės. Puikios žiniasklaidos darbuotojos.',' Kristina yra lotynų kilmės vardas.'),(1816,'Laisvyda',' (3b), (1), (1) liet., trump. Laisvė, iš vyr. v. Laisvydas',' Laisvyda, Laisvyda, Laisvydė yra  kilmės vardas.'),(1817,'Laisvė','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Laisvė yra lietuvių kilmės vardas.'),(1818,'Laisva','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Laisva yra lietuvių kilmės vardas.'),(1819,'Laimutis','Laimučiai labai draugiški ir emocionalūs, tačiau tikrų draugų turi mažai. Tai atsitinka dėl to, kad jie visada labai užsiėmę ir skubantys, dėl to nelieka laiko įsigilinti į draugų problemas. Todėl jie gali tapti dideliais vienišiais.',' Laimutis yra lietuvių kilmės vardas.'),(1820,'Laimutė','Laimučių profesijos labai įvairios. Pažymėtina tai, kad darbe, kur jos bedirbtų, idealiai stengiasi taktiškai save išreikšti, todėl visų mylimos už takto saikingumą.',' Laimutė yra lietuvių kilmės vardas.'),(1821,'Laimona',' (1) suliet. latv., trump. Laima, galūnės vediniai iš vyr. v. Laimonas',' Laimona, Laimonė yra  kilmės vardas.'),(1822,'Laimonas','Laimonai renkasi profesijas, kurios sužadina kitų aktyvumą. Jie turi vadovauti, nes kitu atveju praranda norą dirbti. Pagrindiniai jų užsiėmimai: kadrų rinkimas, apmokymas, teatras, politika, sportas, armija.',' Laimonas yra lietuvių kilmės vardas.'),(1823,'Laimis','Vardadienis: Sausio 14 d., kovo 26 d., liepos 29 d., rugpjūčio 30 d., lapkričio 20 d.',' Laimis yra lietuvių kilmės vardas.'),(1824,'Laimintas','Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Laimintas yra lietuvių kilmės vardas.'),(1825,'Laigedas','Laigedas – (1) suliet. prūs., trump. Laigas, Laigys, lai- (: liet. lai „tegu“) + ged- (: liet. ged-auti „ilgėtis“, ged-ėti).',' Laigedas yra lietuvių kilmės vardas.'),(1826,'Laiminta','Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Laiminta yra lietuvių kilmės vardas.'),(1827,'Laigeda',' (3b), (1), (1) suliet. prūs., trump. Laigė, iš vyr. v. Laigedas',' Laigeda, Laigeda, Laigedė yra  kilmės vardas.'),(1828,'Ladas',' (2), (4) liet. trumpinys iš Vladas, Vladys ',' Ladas, Ladys yra  kilmės vardas.'),(1829,'Labvardas','Labvardas – (1) liet., trump. Labys, lab- (žr. Labgaudas) + vard- (: liet. vard-as, latv. vards „žodis, vardas“, plg. liet. varduoti „burti“).',' Labvardas yra lietuvių kilmės vardas.'),(1830,'Labvarda',' (3b), (1), (1) liet., trump. Laba, Lobė, iš vyr. v. Labvardas',' Labvarda, Labvarda, Labvardė yra  kilmės vardas.'),(1831,'Legailė','Legailė – (1) liet., trump. Lega, Gailė, iš vyr. avd. Legaila, žr. Legailas.',' Legailė yra lietuvių kilmės vardas.'),(1832,'Leandras','Leandras – (1) graik., trump. Andras, iš sulotyninto graik. Leander, kuris iš graik. Leiandros, Leandros: graik. leos „tauta“ + aner (kilm. andros) „vyras“.',' Leandras yra graikų kilmės vardas.'),(1833,'Legailas','Legailas – (1) liet., sen. var. Legaila, trump. Legys, le- iš leg- (su balsių kaita iš liet. lėg-ti „mažėti, lyžti, leisti“, plg. at-lėgti „sumažėti, susilpnėti“) + gail- (: sen. liet. gail-as „stiprus, smarkus“).',' Legailas yra lietuvių kilmės vardas.'),(1834,'Laurynas','Laurynai romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose.',' Laurynas yra lotynų kilmės vardas.'),(1835,'Laurentinas','Laurentinas – (2) lot., trump. Lauras, iš lot. Laurentinus — „laurentietis, Laurento miesto (netoli Romos) gyventojas“.',' Laurentinas yra lotynų kilmės vardas.'),(1836,'Laurentina','Laurentina – (2) lot., trump. Laura, iš lot. Laurentina, kuris iš vyr. v. Laurentinus, žr. Laurentinas.',' Laurentina yra lotynų kilmės vardas.'),(1837,'Laurencijus','Laurencijus – (1) lot., trump. Laurentas, Lauras, tarm. Lauris žem., iš lot. Laurentius — „laurentietis, Laurento miesto (netoli Romos) gyventojas“.',' Laurencijus yra lotynų kilmės vardas.'),(1838,'Laurentas','Laurentas – (2) lot., trumpinys iš Laurentius, žr. Laurencijus.',' Laurentas yra lotynų kilmės vardas.'),(1839,'Lauras','Lauras – (1), (2) 1. lot., iš lot. Laurus: lot. laurus „lauro medis, lauro šakelė, laurų vainikas“, 2. liet. trumpinys iš Laurynas.',' Lauras yra lotynų kilmės vardas.'),(1840,'Laurencija','Laurencija – (1) lot., trump. Laura, tarm. Laurė žem., iš lot. Laurentia, kuris iš vyr. v. Laurentius, žr. Laurencijus.',' Laurencija yra lotynų kilmės vardas.'),(1841,'Laura','Lauros domisi mistika, sumanios, drąsios, turi tvirtus principus ir didžiules ambicijas. Didžiuojasi savo šeima, namais ir savo pasirinktu gyvenimo keliu. Reikėtų joms saugotis iliuzijų, nes jų pasitikėjimas gali būti apgaulingas. ',' Laura yra lotynų kilmės vardas.'),(1842,'Lauksvyda',' (3b), (1), (1) liet., trump. Lauksvė, iš vyr. v. Lauksvydas',' Lauksvyda, Lauksvyda, Lauksvydė yra  kilmės vardas.'),(1843,'Lauksvydas','Lauksvydas – (1) liet., trump. Lauksvys, lauks- (žr. Lauksminas) + vyd- (žr. Laisvydas).',' Lauksvydas yra lietuvių kilmės vardas.'),(1844,'Lauksmis','Lauksmis – (2) liet., trumpinys iš Lauksminas.',' Lauksmis yra lietuvių kilmės vardas.'),(1845,'Leonardas','Leonardai energingi ir pilni entuziazmo, tačiau gali būti lengvai pažeidžiami, nes labai jautrūs. Daug energijos įlieja į kūrybinį darbą. Jiems tik reikėtų vystyti savyje pagarbą kitiems žmonėms.',' Leonardas yra vokiečių kilmės vardas.'),(1846,'Lauksminas','Lauksminas – (1) liet., trump. Lauksmis, lauks- (: liet. lauks-tus „nedrąsus, ilgus“, lauksmas „laukimas“, lauks-čioti „vengti, varžytis“) + min- (: liet. min-ėti, min-ti, mena).',' Lauksminas yra lietuvių kilmės vardas.'),(1847,'Leonarda','Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Leonarda yra vokiečių kilmės vardas.'),(1848,'Leona',' (2) liet. trumpinys iš Leonija',' Leona, Leonė yra  kilmės vardas.'),(1849,'Leokadija','Leokadijos turi stiprią trauką asmeninei laisvei ir nepriklausomybei. Per gyvenimą patiria daugybę pakilimų ir kritimų.',' Leokadija yra graikų kilmės vardas.'),(1850,'Lengvinas','Lengvinas – (1) liet., trump. Lengys, leng- (: liet. leng-ti „silpnėti, nykti“) + vin- (: vin- su balsių kaita iš vain-, — sen. liet. vaina „priežastis, kaltė“).',' Lengvinas yra lietuvių kilmės vardas.'),(1851,'Lengvenis','Lengvenis – (2) liet., trump. Lengvys, priesagos -enis vedinys iš liet. lengvas.',' Lengvenis yra lietuvių kilmės vardas.'),(1852,'Lelija','Lelija – (2) sulietuvinta lot. vardo Lilija forma.',' Lelija yra lietuvių kilmės vardas.'),(1853,'Lėja','Lėja – (1) hebr., iš sulotyninto hebr. Lea: hebr. le’a „antilopė“.',' Lėja yra hebrajų kilmės vardas.'),(1854,'Leinartė','Leinartė – (1) liet., trump. Leinė, iš vyr. v. Leinartas.',' Leinartė yra lietuvių kilmės vardas.'),(1855,'Leinartas','Leinartas – (1) liet., trump. Leinys, lei- (žr. Leikantas) + nart- (: liet. nart-us „atkaklus“).',' Leinartas yra lietuvių kilmės vardas.'),(1856,'Leimantė','Leimantė – (1) liet., trump. Mantė, iš vyr. v. Leimantas.',' Leimantė yra lietuvių kilmės vardas.'),(1857,'Leikantas','Leikantas – (1) suliet. prūs., trump. Kantas, lei- (: latv. lei, lai „tegu“, liet. lai „t. p.“) + kant- (: liet. pa-kant-us, kant-rus).',' Leikantas yra lietuvių kilmės vardas.'),(1858,'Leimantas','Leimantas – (1) liet., trump. Mantas, lei- (žr. Leikantas) + mant- (: liet. mant-us „sumanus“, mant-a „turtas, nauda“).',' Leimantas yra lietuvių kilmės vardas.'),(1859,'Legedas','Legedas – (1) liet., trump. Legys, le- (žr. Legailas) + ged- (žr. Laigedas).',' Legedas yra lietuvių kilmės vardas.'),(1860,'Legaudas','Legaudas – (1) liet., trump. Legys, le- iš leg- (žr. Legailas) + gaud- (: liet. gaud-yti, plg. gauti).',' Legaudas yra lietuvių kilmės vardas.'),(1861,'Mozė','Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Mozė yra hebrajų kilmės vardas.'),(1862,'Mudrė','Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Mudrė yra lietuvių kilmės vardas.'),(1863,'Motiejus','Motiejai veda gana vėlai, nes iki to nori sukurti materialinį šeimos pagrindą. Nematydami perspektyvos, jie lieka senberniais. Tačiau jeigu veda, tai laikosi šeimyninio gyvenimo taisyklių. Negali taikstytis su žmonos neištikimybe.',' Motiejus yra hebrajų kilmės vardas.'),(1864,'Morta','Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Morta yra aramėjų kilmės vardas.'),(1865,'Morkus','Morkai savo profesiją renkasi labai skrupulingai. Todėl jie geri pasaulinės rinkos analitikai, inžinieriai, finansininkai. Ne mažiau gali pasiekti ir kaip liaudies gydytojas, astrologas ar numerologas.',' Morkus yra lotynų kilmės vardas.'),(1866,'Monika','Monikos susiderina su panašiais į save, gal dar su tais, kas jų bijo ar kam jos brangios kaip asmenybės. Vyrai joms turi būti lygiaverčiai arba vergai.',' Monika yra graikų kilmės vardas.'),(1867,'Modestas','Vardadienis: Balandžio 15 d., Spalio 2 d.',' Modestas yra lotynų kilmės vardas.'),(1868,'Modesta','Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Modesta yra lotynų kilmės vardas.'),(1869,'Ovidijus','Ovidijus drąsiai galima pavadinti dosniais žmonėmis, atvirais. Jie pripratę nemalonumus nugalėti savo didingumu, kilniaširdiškumu, tikėjimu ateitimi. Jausmingumą gauna iš gamtos.',' Ovidijus yra lotynų kilmės vardas.'),(1870,'Levas','Levas – (2) liet. trumpinys iš Leonas ir kt.',' Levas yra graikų kilmės vardas.'),(1871,'Leticija','Leticija – (1) lot., trump. Leta, Letė, iš lot. Laetitia: lot. laetitia „linksmumas, džiaugsmas“.',' Leticija yra lotynų kilmės vardas.'),(1872,'Leva','Leva – (2) liet. trumpinys iš Leonė ir kt.',' Leva yra lietuvių kilmės vardas.'),(1873,'Letas','Letas – (2) lot., iš lot. Letus: lot. letus „linksmas, džiugus“.',' Letas yra lotynų kilmės vardas.'),(1874,'Leta','Leta – (2) 1. lot., iš lot. Leta: lot. leta „linksma, džiugi“, 2. liet. trumpinys iš Violeta ir Leticija.',' Leta yra lotynų kilmės vardas.'),(1875,'Leontina','Leontina – (2) lot., trump. Leonta, Leontė, iš lot. Leontina, kuris yra priesagos -ina vedinys iš Leontia, žr. Leoncija.',' Leontina yra graikų kilmės vardas.'),(1876,'Leontas',' (1) liet. trumpinys iš Leoncijus',' Leontas yra graikų kilmės vardas.'),(1877,'Leonora','Leonoros didžiausių pasiekimų turi didelių pinigų pasaulyje, politikoje, biznyje. Jos puikios darbų organizatorės, galinčios koordinuoti pačius sudėtingiausius darbus. Geros advokatės, finansininkės, chirurgės, išradėjos, lakūnės.',' Leonora yra hebrajų kilmės vardas.'),(1878,'Liaudvydas',' (1) liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + vyd- (žr. Laisvydas)',' Liaudvydas yra  kilmės vardas.'),(1879,'Leonilė','Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leonilė yra lotynų kilmės vardas.'),(1880,'Liaudvyda','Liaudgina, Liaudgina, Liaudginė',' Liaudvyda, Liaudvyda, Liaudvydė yra  kilmės vardas.'),(1881,'Leonija','Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leonija yra lotynų kilmės vardas.'),(1882,'Liaudminas','Liaudminas – (1) liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + min- (žr. Lauksminas).',' Liaudminas yra lietuvių kilmės vardas.'),(1883,'Leonidas','Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leonidas yra graikų kilmės vardas.'),(1884,'Liaudmina','Liaudgina, Liaudgina, Liaudginė',' Liaudmina, Liaudmina, Liaudminė yra  kilmės vardas.'),(1885,'Leonida',' (2) graik., trump. Leva, Nida, Nidė, iš sulotyninto graik. Leonida, kuris iš vyr. v. Leonidas',' Leonida, Leonidė yra  kilmės vardas.'),(1886,'Liaudmantė','Liaudmantė – (1) liet., trump. Liauda, Liaudė, iš vyr. v. Liaudmantas.',' Liaudmantė yra lietuvių kilmės vardas.'),(1887,'Leonė','Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leonė yra lotynų kilmės vardas.'),(1888,'Leoncijus','Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leoncijus yra graikų kilmės vardas.'),(1889,'Liaudmantas','Liaudmantas – (1) liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + mant- (žr. Leimantas).',' Liaudmantas yra lietuvių kilmės vardas.'),(1890,'Liaudgintas','Liaudgintas – (1) liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + gint- (: liet. gint-as, ginti „užstoti“).',' Liaudgintas yra lietuvių kilmės vardas.'),(1891,'Lygauda',' (3a), (1), (1) liet., trump. Lyga, Lygė, iš vyr. v. Lygaudas',' Lygauda, Lygauda, Lygaudė yra  kilmės vardas.'),(1892,'Liaudginta','Liaudgina, Liaudgina, Liaudginė',' Liaudginta, Liaudginta, Liaudgintė yra  kilmės vardas.'),(1893,'Leoncija','Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leoncija yra graikų kilmės vardas.'),(1894,'Liaudginas','Liaudginas – (1) liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + gin- (: liet. gin-ti „užstoti“, gin-a).',' Liaudginas yra lietuvių kilmės vardas.'),(1895,'Liepa','Liepa linkusi staiga keisti savo pomėgius ar nuomonę, tačiau nelengvai įtakojama pašalinių. Vardas palankus menininkei, teisininkei, kriminalistei, vadybininkei ar moteriai dirbančiai mosklinį tiriamąjį darbą. Vardo savininkei būtina skirti pakankamai laiko miegui bei vengti azartinių lošimų.',' Liepa yra lietuvių kilmės vardas.'),(1896,'Liaudgina','Liaudginta, Liaudginta, Liaudgintė',' Liaudgina, Liaudgina, Liaudginė yra  kilmės vardas.'),(1897,'Lieda','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Lieda yra lietuvių kilmės vardas.'),(1898,'Liaudbaras','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaudbaras yra lietuvių kilmės vardas.'),(1899,'Lidija','Vardadienis: Kovo 27 d., rugpjūčio 3 d.',' Lidija yra graikų kilmės vardas.'),(1900,'Liaudė','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaudė yra lietuvių kilmės vardas.'),(1901,'Liberatas','Liberatas – (2) lot., trump. Liberas, iš lot. Liberatus: lot. liberatus „išlaisvintas, išvaduotas“.',' Liberatas yra lotynų kilmės vardas.'),(1902,'Liaudas',' (1), (3) liet., trumpinys iš Liaudginas',' Liaudas, Liaudys yra  kilmės vardas.'),(1903,'Liberata','Liberata – (2) lot., trump. Libera, iš lot. Liberata: lot. liberata „išlaisvinta, išvaduota“.',' Liberata yra lotynų kilmės vardas.'),(1904,'Liauda',' (1) liet., trumpinys iš Liaudgina',' Liauda, Liaudė yra  kilmės vardas.'),(1905,'Liaubaras','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaubaras yra lietuvių kilmės vardas.'),(1906,'Lybartė','Lybartė – (1) liet., trump. Bartė, iš vyr. v. Lybartas.',' Lybartė yra lietuvių kilmės vardas.'),(1907,'Liaugintas','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaugintas yra lietuvių kilmės vardas.'),(1908,'Lybartas','Lybartas – (1) liet., trump. Bartas, ly- iš lyg- (: liet. lyg-ti, lygus, žr. dar Lygmantas) + bart- (: liet. bart-as, barti – sen. reikšme „kovoti“, plg. rus. borotjsia).',' Lybartas yra lietuvių kilmės vardas.'),(1909,'Liauginta',' (3a), (1), (1) liet., trump. Liaugė, iš vyr. v. Liaugintas',' Liauginta, Liauginta, Liaugintė yra  kilmės vardas.'),(1910,'Liaugedas','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaugedas yra lietuvių kilmės vardas.'),(1911,'Lymantė','Lymantė – (1) liet., trump. Lymė, Mantė, iš vyr. v. Lymantas.',' Lymantė yra lietuvių kilmės vardas.'),(1912,'Liaugeda',' (3a), (1), (1) liet., trump. Liaugė, Gedė, iš vyr. v. Liaugedas',' Liaugeda, Liaugeda, Liaugedė yra  kilmės vardas.'),(1913,'Liaugaudas',' (1) liet., trump. Liaugas, Gaudas, liau- (žr. Liaubaras) + gaud- (žr. Legaudas)',' Liaugaudas yra lietuvių kilmės vardas.'),(1914,'Lymantas','Lymantas – (1) liet., trump. Lymas, Mantas, ly- iš lyg- (žr. Lybartas) + mant- (žr. Leimantas).',' Lymantas yra lietuvių kilmės vardas.'),(1915,'Liaudvilė','Liaudgina, Liaudgina, Liaudginė',' Liaudvilė yra  kilmės vardas.'),(1916,'Lilijana','Lilijana – (2) lot., trump. Lilė, Lijana, baž. lot. Liliana, kuris yra priesagos -ana vedinys iš Lilija.',' Lilijana yra lotynų kilmės vardas.'),(1917,'Liaudvilas','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Liaudvilas yra lietuvių kilmės vardas.'),(1918,'Lilija','Lilija – (1) lot., trump. Lilė, tarm. Lilia ryt. aukšt. (Laičiai), piet. aukšt. (dz.), iš lot. Lilia: lot. lilium „lelija“.',' Lilija yra lotynų kilmės vardas.'),(1919,'Lilė','Lilė – (2) 1. liet. trumpinys iš Lilija ir Lilijana, 2. vok., iš vok. Lili, kuris yra trumpinys iš Elisabeth, žr. Elzbieta.',' Lilė yra lotynų kilmės vardas.'),(1920,'Lykantė','Lykantė – (1) liet., trump. Lykė, Kantė, iš vyr. v. Lykantas.',' Lykantė yra lietuvių kilmės vardas.'),(1921,'Lijana',' Lijana – italų kilmės vardas iš itališko vardo Liana, kuris yra trumpinys iš Lilijana.',' Lijana yra lotynų kilmės vardas.'),(1922,'Lykantas','Lykantas – (1) liet., trump. Lykas, Lykys, ly- iš lyg- (žr. Lybartas) + kant- (: liet. pa-kant-us, kant-rus).',' Lykantas yra lietuvių kilmės vardas.'),(1923,'Lygmantė','Lygmantė – (1) liet., trump. Lyga, Lygė, iš vyr. v. Lygmantas.',' Lygmantė yra lietuvių kilmės vardas.'),(1924,'Lygmantas','Lygmantas – (1) liet., trump. Lygas, Lygys, lyg- (: liet. lyg-ti, lyg-us) + mant- (žr. Leimantas).',' Lygmantas yra lietuvių kilmės vardas.'),(1925,'Lygirda',' (3a), (1), (1) liet., trump. Lyga, Lygė, iš vyr. v. Lygirdas',' Lygirda, Lygirda, Lygirdė yra  kilmės vardas.'),(1926,'Lygirdas','Lygirdas – (1) liet., trump. Lygas, Lygys, ly- iš lyg- (žr. Lybartas) + gird- (: liet. gird-ėti, gird-as „žinia, gandas“).',' Lygirdas yra lietuvių kilmės vardas.'),(1927,'Lygeda',' (3a), (1), (1) suliet. prūs., trump. Lyga, Lygė, iš vyr. v. Lygedas',' Lygeda, Lygeda, Lygedė yra  kilmės vardas.'),(1928,'Lygedas','Lygedas – (1) suliet. prūs., trump. Lygas, Lygys, ly- iš lyg- (žr. Lybartas) + ged- (žr. Laigedas).',' Lygedas yra lietuvių kilmės vardas.'),(1929,'Lygaudas','Lygaudas – (1) liet., trump. Lygas, Lygys, ly- iš lyg- (žr. Lybartas) + gaud- (žr. Legaudas).',' Lygaudas yra lietuvių kilmės vardas.'),(1930,'Liubartas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Liubartas yra lietuvių kilmės vardas.'),(1931,'Liubartė','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti.',' Liubartė yra lietuvių kilmės vardas.'),(1932,'Lionginas',' (1) lot., trump. Liongas, Longas, iš lot. Longinus: lot. langus „ilgas“',' Lionginas, Longinas yra  kilmės vardas.'),(1933,'Liongina','Liongina – (1) lot., trump. Lionga, Liongė, iš lot. Longina, kuris iš vyr. v. Longinus, žr. Lionginas.',' Liongina yra lotynų kilmės vardas.'),(1934,'Lionė','Lionė – (2) trumpinys iš Leonora ir kt.',' Lionė yra lotynų kilmės vardas.'),(1935,'Linvydas','Linvydas – (1) liet., trump. Linys, Linius, lin- iš link- (žr. Lingailas) + vyd- (: liet. iš-vyd-o, iš-vysti).',' Linvydas yra lietuvių kilmės vardas.'),(1936,'Linvyda',' (3a), (1), (1) liet., trump. Linė, iš vyr. v. Linvydas',' Linvyda, Linvyda, Linvydė yra  kilmės vardas.'),(1937,'Lingailas','Jūsų gerosios savybės – mokėjimas mylėti, draugiškumas, pagarba aplinkiniams. Gebate suprasti kitus žmones, todėl susilaukiate simpatijų, paslaugumo ir gerumo.',' Lingailas yra lietuvių kilmės vardas.'),(1938,'Lingailė','Jūsų gerosios savybės – mokėjimas mylėti, draugiškumas, pagarba aplinkiniams. Gebate suprasti kitus žmones, todėl susilaukiate simpatijų, paslaugumo ir gerumo.',' Lingailė yra lietuvių kilmės vardas.'),(1939,'Linius','Atvirumas ir nuoširdumas leidžia sukurti tvirtus ryšius su artimaisiais. Šio skaičiaus savininkų pagrindinis tikslas – sukurti namus. Asmeninės savybės dažnai suteikia galimybę susikurti prabangų ir pasiturintį gyvenimą.',' Linius yra lietuvių kilmės vardas.'),(1940,'Linė','Atvirumas ir nuoširdumas leidžia sukurti tvirtus ryšius su artimaisiais. Šio skaičiaus savininkų pagrindinis tikslas – sukurti namus. Asmeninės savybės dažnai suteikia galimybę susikurti prabangų ir pasiturintį gyvenimą.',' Linė yra lietuvių kilmės vardas.'),(1941,'Linas','Žodyje „Linas“ vyrauja penketuko vibracijos. Tai labai aktyvus skaičius, esantis visada judėjime. Todėl Linai linkę ieškoti naujovių, mėgsta keliauti ir patirti nuotykius. Jie labai smalsūs. Kai kurie domisi spiritizmu, religija ar ezoterika. Jie azartiški lošėjai, visą laiką ieško būdų praturtėti.',' Linas yra lietuvių kilmės vardas.'),(1942,'Lynartė','Jei išnaudosite likimo suteiktas galimybes, taktiškumas ir draugiškas elgesys atneš jums populiarumą. Jūs patiksite visiems žmonėms. Jie vertins, kad dirbate ne dėl pinigų, o savo idealų.',' Lynartė yra lietuvių kilmės vardas.'),(1943,'Livijus','Livijus – (1) lot., trump. Livas, iš lot. Livius, kuris iš sen. romėnų giminės vardo Livius — „libietis, Libijos (Afrikoje) gyventojas“.',' Livijus yra lotynų kilmės vardas.'),(1944,'Lynartas','Jei išnaudosite likimo suteiktas galimybes, taktiškumas ir draugiškas elgesys atneš jums populiarumą. Jūs patiksite visiems žmonėms. Jie vertins, kad dirbate ne dėl pinigų, o savo idealų.',' Lynartas yra lietuvių kilmės vardas.'),(1945,'Livija','Livija – (1) lot., trump. Livė, iš lot. Livia, kuris iš vyr. v. Livius, žr. Livijus.',' Livija yra lotynų kilmės vardas.'),(1946,'Lina','Linos moka ginti savo gerovę ir niekad nepatenka į skurdą; moka darbuotis, bet yra labai neramios, užsigaunančios ir visada nepatenkintos. Šeimoje kenčia dėl savo ir vyro charakterių nesutapimo. Joms dažnai skauda galvą , serga hemorojumi.',' Lina yra lietuvių kilmės vardas.'),(1947,'Liutgardas','Liutgardas – (1) germ., trump. Liutas, Gardas, iš sulotyninto germ. Lutgardus: sen. vok. aukšt. liut „tauta“ + gard „apsauga, saugotojas“.',' Liutgardas yra vokiečių kilmės vardas.'),(1948,'Liutaurė','Liutaurė – (1) liet., trump. Liutė, Taurė, iš vyr. v. Liutauras.',' Liutaurė yra lietuvių kilmės vardas.'),(1949,'Liutgarda','Liutgarda – (1) germ., trump. Liutė, Garda, iš sulotyninto germ. Lutgarda, Lutgardis iš germ. Luitgard, Luitgardis: sen. vok. aukšt. liut „tauta“ + sen. saksų gard „apsauga, saugotoja“.',' Liutgarda yra vokiečių kilmės vardas.'),(1950,'Liutauras','Liutaurai neparsiduoda už pinigus, tačiau pinigams nėra abejingi. Greičiau priešingai. Jie neturėtų taip stengti dominuoti, prisimindami, kad stipriam žmogui tai visai lengva, o kitam visada bus ne pagal pečius',' Liutauras yra vokiečių kilmės vardas.'),(1951,'Liudvis','Vardadienis: Rugpjūčio 25 d., spalio 9 d.',' Liudvis yra vokiečių kilmės vardas.'),(1952,'Liudvina','Liudvina – (2) germ., trump. Liudvė, iš sulotyninto germ. Ludvina iš germ. Lutwine: sen. vok. aukšt. liut „tauta“ + wini „draugė“.',' Liudvina yra vokiečių kilmės vardas.'),(1953,'Liudvikas','Vardadienis: Rugpjūčio 25 d., spalio 9 d.',' Liudvikas yra vokiečių kilmės vardas.'),(1954,'Lukrecijus','Lukrecijus – (1) lot., trump. Lukas, iš lot. Lucretius, kuris iš sen. romėnų giminės vardo Lucretius: lot. lucrum „nauda, turtas“.',' Lukrecijus yra lotynų kilmės vardas.'),(1955,'Liudvika','Vardadienis: Sausio 30-31 d., balandžio 14 d.',' Liudvika yra vokiečių kilmės vardas.'),(1956,'Lukrecija','Vardadienis: Kovo 15 d., birželio 7 d.',' Lukrecija yra lotynų kilmės vardas.'),(1957,'Lukošius','Lukošius – (2) pasenęs vardas, iš lenkų Lukasz, kuris iš lot. Lucas, žr. Lukas.',' Lukošius yra lotynų kilmės vardas.'),(1958,'Liudvė','Liudvė – (2) liet. trumpinys iš Liudvika.',' Liudvė yra lietuvių kilmės vardas.'),(1959,'Lukas','Vardadienis: Spalio mėn. 18 d. - Luko vardo diena.',' Lukas yra lotynų kilmės vardas.'),(1960,'Liudgaras','Liudgaras – (1) germ., trump. Liudas, iš sulotyninto germ. Ludgarus iš germ. Ludgar, Ludger: sen. vok. aukšt. liut „tauta“ + ger „ietis“.',' Liudgaras yra vokiečių kilmės vardas.'),(1961,'Luiza',' (2) vok., iš vok. Luise, kuris iš pranc. Louise, o šis yra trumpinys iš Liudvika',' Luiza, Luizė yra  kilmės vardas.'),(1962,'Liudas','Vardadienis: Rugpjūčio 25 d., Spalio 9 d.',' Liudas yra vokiečių kilmės vardas.'),(1963,'Liuda','Vardadienis: Sausio 30-31 d., balandžio 14 d., ',' Liuda yra vokiečių kilmės vardas.'),(1964,'Liucidas',' (1) lot., trump. Liucys, Liucius, iš lot. Lucidus: lot. lucidus „spindintis, švytintis“',' Liucidas, Lucidas yra  kilmės vardas.'),(1965,'Lucijus','Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lucijus yra lietuvių kilmės vardas.'),(1966,'Lucija','Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lucija yra lietuvių kilmės vardas.'),(1967,'Lucidas','Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lucidas yra lotynų kilmės vardas.'),(1968,'Lucė','Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lucė yra lotynų kilmės vardas.'),(1969,'Lozorius','Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lozorius yra hebrajų kilmės vardas.'),(1970,'Loreta','Loretos gali pasiekti bet kokį užsibrėžtą tikslą. Labiausiai sekasi veikti didelių pinigų pasaulyje, politikoje ir biznyje. Labai geros organizatorės, sugebančios “užkurti” bendradarbius dideliems darbams.',' Loreta yra italų kilmės vardas.'),(1971,'Lora','Lora – (2) trumpinys iš Loreta.',' Lora yra italų kilmės vardas.'),(1972,'Lolita',' (2) isp., trump. Lola, iš sulotyninto isp. Lolita, kuris yra priesagos -ita (mažyb.) vedinys iš Lola, o pastarasis yra trumpinys iš v. Dolores, žr. Doloresa',' Lolita yra ispanų kilmės vardas.'),(1973,'Longinas','Seksas Lionginams reikalingas tik jų asmeniniams įgeidžiams patenkinti – jie nesidomi partnerės emocijomis. Vedybos retai būna nusisekusios, jeigu partnerė neparodo jų atžvilgiu ypatingo supratimo ir pagarbos. Jie visur kur tvirti ir nepalenkiami, niekada neatsisako įvykdyti to, ką yra užsibrėžę.',' Longinas yra lietuvių kilmės vardas.'),(1974,'Liza',' (2) vok., iš vok. Lisa, Lise, kuris yra trumpinys iš Elizabeth, žr. Elzbieta',' Liza, Lyzė yra  kilmės vardas.'),(1975,'Mamerta','Mamerta – (1), (2) lot., trump. Merta, iš lot. Mamerta, kuris iš vyr. v. Mamertus, žr. Mamertas.',' Mamerta yra oskų kilmės vardas.'),(1976,'Malvina','Malvinos nenuilstančios ir smalsios pasaulio stebėtojos. Jos veiklios ir moka uždirbti pinigus, labai energingos.',' Malvina yra vokiečių kilmės vardas.'),(1977,'Maksimilijonas','Maksimilijonas – (2) lot., trump. Maksimas, Maksas, iš lot. Maximilianus – „didžiausias iš Emilijų (giminės)“: lot. Maximus + Aemilianus – iš Emilijų giminės, žr. Emilijonas.',' Maksimilijonas yra lotynų kilmės vardas.'),(1978,'Maksimas','Maksimas – (1), (2) lot., trump. Maksas, Simas, tarm. Maksis vak. žem., iš lot. Maximus: lot. maximus „labai didelis, didžiausias“.',' Maksimas yra lotynų kilmės vardas.'),(1979,'Maksima','Maksima – (1), (2) lot., trump. Maksė, Sima, iš lot. Maxima: lot. maxima „labai didelė, didžiausia“.',' Maksima yra lotynų kilmės vardas.'),(1980,'Manys',' (4), (2) liet., trumpinys iš avd. su Man-: Mangailas, Mangaudas, Manvydas ir kt.',' Manys, Manius yra  kilmės vardas.'),(1981,'Maksas','Maksas – (2) trumpinys iš Maksimas ir Maksimilijonas.',' Maksas