is stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Mąstautė yra lietuvių kilmės vardas.'),(2047,'Mąstautas','Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Mąstautas yra lietuvių kilmės vardas.'),(2048,'Marcelijonas','Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Marcelijonas yra lotynų kilmės vardas.'),(2049,'Marcelė',' (2) lot., trump. Marcė, tarm. Marcelia piet. aukšt. (dz.), Marcė piet. aukšt., ryt. aukšt., iš lot. Marcella, kuris iš vyr. v. Marcellus, žr. Marcelis',' Marcelė yra lotynų kilmės vardas.'),(2050,'Martys','Martys – (4) liet. trumpinys iš Martynas ir Martinijonas.',' Martys yra lotynų kilmės vardas.'),(2051,'Martinijonas','Martinijonas – (2) lot., trump. Martys, iš lot. Martiniams, kuris yra priesagos -anus vedinys iš Martinus, žr. Martynas.',' Martinijonas yra lotynų kilmės vardas.'),(2052,'Marcė','Vardadienis: Birželio 5 d., liepos 9 d.',' Marcė yra lotynų kilmės vardas.'),(2053,'Manvilė',' (1), (2) liet., trump. Manė, iš vyr. v. Manvilas',' Manvilė yra  kilmės vardas.'),(2054,'Martynas','Martynai į gyvenimą žiūri rimtai ir linkę į radikalizmą – arba viskas, arba niekas. Nemėgsta banalumo ir linkę užsiimti tik esminiais klausimais.',' Martynas yra lotynų kilmės vardas.'),(2055,'Martyna','Martynas sunku suprasti ar aprašyti. Jos mato žmones, su kuriais bendrauja, tiesiog kiaurai. Niekada nepraranda kantrybės, apdovanotos retu žmonių supratimu, būna jų paslapčių saugotojos.',' Martyna yra lotynų kilmės vardas.'),(2056,'Marta','Martas sunku suprasti ar aprašyti. Jos mato žmones, su kuriais bendrauja, tiesiog kiaurai. Niekada nepraranda kantrybės, apdovanotos retu žmonių supratimu, būna jų paslapčių saugotojos.',' Marta yra aramėjų kilmės vardas.'),(2057,'Marius',' (2) 1. liet., galūnės vedinys iš marios, 2. liet. trumpinys iš lot. Marius, žr. Marijus',' Marius yra lotynų kilmės vardas.'),(2058,'Marinas','Marinas – (2) lot., trump. Marys, Marius, iš lot. Marinus: lot. marinus „jūrų, jūrinis“.',' Marinas yra lotynų kilmės vardas.'),(2059,'Marina','Marina – (2) lot., trump. Marė, iš lot- Marina, lot. marina „jūrų, jūrinė“.',' Marina yra lotynų kilmės vardas.'),(2060,'Marijus','Vardadienis: Sausio 19 d., vasario 9 d.',' Marijus yra lotynų kilmės vardas.'),(2061,'Marijonas','Marijonai jaučia aštuonetuko vibracijas, todėl jie nori viską daryti su užmoju. Jiems tinka būti vadybininkais, lyderiais arba turėti įspūdingą verslą. Trokšta vesti paskui save kitus, o ne vilktis iš paskos.',' Marijonas yra lotynų kilmės vardas.'),(2062,'Marijona','Marijona – (2) lot., trump. Marė, Marytė, tarm. Marijonė žem. (Salantai), iš lot. Marianna, kuris kilęs iš dvigubo vardo Maria— Anna.',' Marijona yra hebrajų kilmės vardas.'),(2063,'Marija','Kai kurios Marijos veikia neapgalvotai ir todėl gyvenime patiria daug problemų, pakliūva į aferistų pinkles, paskui labai sielojasi.',' Marija yra hebrajų kilmės vardas.'),(2064,'Margryta','Margryta – (1) vak. liet. trumpinys iš Margarita.',' Margryta yra lietuvių kilmės vardas.'),(2065,'Mečius','',' Mečius yra lietuvių kilmės vardas.'),(2066,'Meda','graik., iš sulotyninto graik. Meda: graik. medos „midas, persas“',' Meda yra graikų kilmės vardas.'),(2067,'Mečislovas','Mečislovai atrodo paslaptingi ir rimti žmonės. Jie kartais užsidaro savyje. Tai inteligentai, turintys aristokratiškų bruožų asmenybės. Mėgsta knygas. Jie geri mokytojai, vienuoliai arba valstybės tarnautojai.',' Mečislovas yra slavų kilmės vardas.'),(2068,'Mažvilė',' (1), (2) liet., trump. Mažvė, Vilė, iš vyr. v. Mažvilas',' Mažvilė yra lietuvių kilmės vardas.'),(2069,'Mečys',' (4), (2) liet. trumpinys iš Mečislovas',' Mečys, Mečius yra  kilmės vardas.'),(2070,'Mažvilas','Mažvilas – (1) liet., trump. Mažvys, maž- (žr. Mažrimas) + vil- (žr. Mantvilas).',' Mažvilas yra lietuvių kilmės vardas.'),(2071,'Mažvydas','Mažvydai geri meno žinovai. Kai kurie turi mediumo savybių. Mėgsta operą, ryškias spalvas ir gražius daiktus. Jie dažniausiai būna rašytojai, aktoriai, mokytojai, sportininkai, leidybininkai.',' Mažvydas yra lietuvių kilmės vardas.'),(2072,'Mažvyda',' (3b), (1), (1) liet., trump. Mažvė, iš vyr. v. Mažvydas',' Mažvyda, Mažvyda, Mažvydė yra  kilmės vardas.'),(2073,'Mažrimas','Mažrimas – (1) liet., trump. Mažrys, maž- (: liet. maž-as, maž-ai) + rim- (žr. Mantrimas).',' Mažrimas yra lietuvių kilmės vardas.'),(2074,'Mažrimė','Mažrimė – (1) liet., trump. Mažrė, iš vyr. v. Mažrimas.',' Mažrimė yra lietuvių kilmės vardas.'),(2075,'Mauricijus','Mauricijus – (1) lot., trump. Mauricius, Mauricis, Mauras, iš lot. Mauritius, Mauricius, kuris yra priesaginis vedinys iš lot. vardo Maurus, žr. Mauras.',' Mauricijus yra lotynų kilmės vardas.'),(2076,'Mauras','Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės.',' Mauras yra lotynų kilmės vardas.'),(2077,'Matilda','Matildoms patartina vengti skubių sprendimų, impulsyvių veiksmų; geriau viską apgalvoti ir tik “septynis kartus atmatavus”, nukirpti. Dvasinė ramybė turėtų ateiti per ramybę ir namų židinį',' Matilda yra vokiečių kilmės vardas.'),(2078,'Matas','Matai – pasilinksminimų mėgėjai. Jie nepaprastai liberalūs ir stengiasi savo vaikams įdiegti altruizmą, meilę laisvei bei pagarbą aplinkiniams. Jie savo dvasia visada jauni, atviraširdžiai ir truputį naivoki, todėl randa kalbą su visais.',' Matas yra hebrajų kilmės vardas.'),(2079,'Mąstvilas','Mąstvilas – (1) liet., trump. Mąstys, mąst- (žr. Mąstautas) + vil- (žr. Mantvilas).',' Mąstvilas yra lietuvių kilmės vardas.'),(2080,'Mėgotas','Mėgotas – (1) suliet. prūs., trump. Mėgys, priesagos -otas vedinys iš aen. avd. Mėgys.',' Mėgotas yra prūsų kilmės vardas.'),(2081,'Mėgys','Mėgys – (4) liet.: liet. mėg-ti, mėg-o.',' Mėgys yra lietuvių kilmės vardas.'),(2082,'Medvilė','Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Medvilė yra lietuvių kilmės vardas.'),(2083,'Medvilas','Medvilas – (1) liet., trump. Medys, med- (žr. Medginas) + vil- (žr. Mantvilas).',' Medvilas yra lietuvių kilmės vardas.'),(2084,'Miglovaras','Miglovaras – (1) liet., iš aušrininko poeto Juozo Miliausko slapyvardžio Miglovara: miglo- (: liet. migla) + var- (: liet. varyti).',' Miglovaras yra lietuvių kilmės vardas.'),(2085,'Medvaišas','Medvaišas – (1) liet., trump. Medys, med- (žr. Medginas) + vaiš- (: liet. vaiš-ės, plg. viešas, viešė „kiemas, kaimas“ ir sen. indų vis- „namas“, got. weihs „kaimas“).',' Medvaišas yra lietuvių kilmės vardas.'),(2086,'Medūnė',' (1) liet. ir prūs., trump. Medė, iš vyr. v. Medūnas',' Medūnė yra  kilmės vardas.'),(2087,'Miglė','Miglės gyvenime siekia visapusiško idealumo, nors pačios gyvenime turi daug negatyvaus. Pavyzdžiui, jos įsitikinusios, kad niekas kitas nepadarys darbo geriau už jas. Kartais jos tampa tiesiog furijomis, tačiau tai pasitaiko rečiau. Jos nepriima bet kokios kritikos jų adresu.',' Miglė yra lietuvių kilmės vardas.'),(2088,'Medūnas','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Medūnas yra lietuvių kilmės vardas.'),(2089,'Michalina','Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Michalina yra hebrajų kilmės vardas.'),(2090,'Metodijus','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Metodijus yra graikų kilmės vardas.'),(2091,'Medys','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Medys yra lietuvių kilmės vardas.'),(2092,'Mėta',' (1) vok., iš vok. Meta, kuris yra trumpinys iš Margarita ir Matilda',' Mėta yra  kilmės vardas.'),(2093,'Milgaudas','Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Milgaudas yra lietuvių kilmės vardas.'),(2094,'Medgintas','Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Medgintas yra lietuvių kilmės vardas.'),(2095,'Mėta','',' Mėta yra lietuvių kilmės vardas.'),(2096,'Medginta',' (3b), (1), (1) liet., trump. Medė, iš vyr. v. Medgintas',' Medginta, Medginta, Medgintė yra  kilmės vardas.'),(2097,'Milgauda',' (3a), (1), (1) liet. ir prūs., trump. Milė, iš vyr. v. Milgaudas',' Milgauda, Milgauda, Milgaudė yra  kilmės vardas.'),(2098,'Merūnas','Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Merūnas yra lietuvių kilmės vardas.'),(2099,'Milė','Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Netgi nereikšmingos užduotys jų akimis įgyja pirmaeilės svarbos.',' Milė yra lietuvių kilmės vardas.'),(2100,'Medginas','Ypač rūpi buities problemos ir savojo “Aš” pažinimas. Turi labai stiprius jausmus, užjaučia draugus ir artimuosius. Kartais jiems sunku bendrauti su aplinkiniais, tačiau įgimtas protas visada padeda. Tie, kurie išdrįsta su jais užmegzti draugystę, niekada nebūna atstumti.',' Medginas yra lietuvių kilmės vardas.'),(2101,'Milda',' (1) liet., iš vieno T. Narbuto minimos sen. liet. „meilės ir meilinimosi deivės“ vardo Milda: sen. liet. mild-ingai „draugiškai“ (vieno Doričiaus iš Marcinkonių užrašytas žodis), jotv. mild-at „mylėti“',' Milda yra lietuvių kilmės vardas.'),(2102,'Merkys','Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Merkys yra lietuvių kilmės vardas.'),(2103,'Medgina',' (3b), (1), (1) liet., trump. Medė, iš vyr. v. Medginas',' Medgina, Medgina, Medginė yra  kilmės vardas.'),(2104,'Merkelis','Šis vardas Merkelis turėtų priklausyti žmogui, kuriam labai svarbūs yra namai. Jis ko gero daug laiko skirs namų puoselėjimui, palaikymui bei įrengimui. Greičiausiai šiam vyrui tiktų posakis “mano namai-mano tvirtovė”. ',' Merkelis yra hebrajų, prancūzų kilmės vardas.'),(2105,'Milbutė','Finansine prasme, tai vardas skatinantis šiokį tokį savanaudiškumą. Priešingai, tai gali būti žmogus gerai skaičiuojantis pinigus.',' Milbutė yra lietuvių kilmės vardas.'),(2106,'Medenis','Žmogus Medenio vardu ko gero turės pakankamai ištvermės, kad galėtų suvaldyti nuosavą verslą. Vardas gali būti ypač sėkmingas menininkams, poetams, muzikantams ir šokėjams.',' Medenis yra lietuvių kilmės vardas.'),(2107,'Milbutas','Finansine prasme, tai vardas skatinantis šiokį tokį savanaudiškumą. Priešingai, tai gali būti žmogus gerai skaičiuojantis pinigus.',' Milbutas yra lietuvių kilmės vardas.'),(2108,'Miltaras','Miltarai – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs. Jūs esate visų mylimi, aplinkiniai negali atsispirti jūsų spinduliuojam geriui. ',' Miltaras yra lietuvių kilmės vardas.'),(2109,'Melita','Vardadienis: Gruodžio mėn. 1 d. – Melitos vardo diena.',' Melita yra graikų kilmės vardas.'),(2110,'Miltara',' (3a), (1), (1) liet., trump. Milė, iš vyr. v. Miltaras ',' Miltara, Miltara, Miltarė yra  kilmės vardas.'),(2111,'Medas','Vardadienis: Sausio mėn. 12 d. – Medo vardo diena.',' Medas yra lietuvių, prūsų kilmės vardas.'),(2112,'Milbartė','Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Milbartė yra lietuvių kilmės vardas.'),(2113,'Melė','Vardadienis: Gruodžio mėn. 28 d. – Melės vardo diena.',' Melė yra lietuvių kilmės vardas.'),(2114,'Milbartas','Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Milbartas yra lietuvių kilmės vardas.'),(2115,'Melchioras','Jeigu jums nepasiseka atsidurti valdžioje ir turėti bent keletą pavaldinių, jaučiatės nepasiekę tikslo. Šie vardo turėtojai paklūsta griežtai disciplinai ir to paties reikalauja iš kitų. Dominuodami jie nesugeba įsiklausyti į kitų nuomonę girdi tik save.',' Melchioras yra hebrajų kilmės vardas.'),(2116,'Medardas','Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Medardas yra vokiečių kilmės vardas.'),(2117,'Milotas','Niekas ir niekada neturi kėsintis į Jūsų laisvę ar kaip kitaip varžyti.',' Milotas yra lietuvių, prūsų kilmės vardas.'),(2118,'Milnoras','Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Milnoras yra lietuvių kilmės vardas.'),(2119,'Melanijus','Melanijai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Melanijus yra graikų kilmės vardas.'),(2120,'Milkantas','Vardadienis: Lapkričio mėn. 30 d. – Milkanto vardo diena.',' Milkantas yra lietuvių kilmės vardas.'),(2121,'Mykolė','Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Mykolė yra hebrajų kilmės vardas.'),(2122,'Melanija','Melanijos rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Melanija yra graikų kilmės vardas.'),(2123,'Minbartė','Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Minbartė yra lietuvių kilmės vardas.'),(2124,'Milkanta',' (3a), (1), (1) liet., trump. Milė, iš vyr. v. Milkantas',' Milkanta, Milkanta, Milkantė yra  kilmės vardas.'),(2125,'Mikolė',' (2) graik., trump. Mikė, iš sulotyninto graik. Nicola, kuris iš vyr. v. Nicolaus, žr. Mikalojus',' Mikolė yra hebrajų kilmės vardas.'),(2126,'Minbartas',' (1) liet., trump. Minas, Minius, min- (žr. Minalgas) + bart- (žr. Milbartas)',' Minbartas yra  kilmės vardas.'),(2127,'Mykolas','Turite sugebėjimų veikti jus supančią aplinką.',' Mykolas yra hebrajų kilmės vardas.'),(2128,'Meilė','Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Meilė yra lietuvių kilmės vardas.'),(2129,'Milius','Turi blogybių. Viena iš jų – polinkis į egoizmą. Kartais gali būti ryžtingi, o kartais tiesiog užsispyrę. Dažnai kritikuoja kitus, teikdami, kad anie neturi ryžto. Todėl toks iškreiptas supratimas gali atstumti juos nuo draugų ir šeimos narių.',' Milius yra lietuvių kilmės vardas.'),(2130,'Minas',' (2) liet., trumpinys iš avd. su Min- : Minbutas, Minkantas, Minvainas ir kt.',' Minas, Minius yra  kilmės vardas.'),(2131,'Mikita','Vardadienis: Gruodžio mėn. 11d. – Mikitos vardo diena.',' Mikita yra lietuvių kilmės vardas.'),(2132,'Milgintas','Milgintai gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Milgintas yra lietuvių kilmės vardas.'),(2133,'Minalgė','Minalgės turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Minalgė yra lietuvių kilmės vardas.'),(2134,'Milginta',' (3a), (1), (1) liet., trump. Milė, iš vyr. v. Milgintas',' Milginta, Milginta, Milgintė yra  kilmės vardas.'),(2135,'Mikas','Abejonės, dvejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožais.',' Mikas yra hebrajų kilmės vardas.'),(2136,'Minalgas','Minalgai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Minalgas yra lietuvių kilmės vardas.'),(2137,'Mikalojus','Gyvenime dažnai gali pasitaikyti momentų, kai reikės suprasti, jog tob