r. Steponas',' Stefanija, Stepanija yra  kilmės vardas.'),(5385,'Valentas','(1), (2) lot., trump. Valys, Valius, tarm. Valenta ryt. aukšt., Valis šiaur. žem., iš lot. Valentinus / Valens : lot. valens (kilm. valentis) „gyvuojantis“',' Valentas yra lotynų kilmės vardas.'),(5386,'Venancijus','(1) lot., trump. Venas, iš lot. Venantius / Venans: lot. venans (kilm. venantis) „medžiojantis, medžiotojas“',' Venancijus, Venantas yra  kilmės vardas.'),(5387,'Vincentas','lot., trump. Vincas, tarm. Vicentas vak. ir piet. aukšt., žem., Vincė žem., Vincus, Vinca piet. aukšt. (dz.), Vincas, Vinca ryt. aukšt., iš lot. Vincentius / Vincens: lot. vincens (kilm. vincentis) „nugalintis“',' Vincentas yra lotynų kilmės vardas.'),(5388,'Viventas','(2) lot., trump. Vivas, iš lot. Viventius / Vivens: lot. vivens (kilm. viventis) „gyvenantis, gyvuojantis“',' Viventas yra lotynų kilmės vardas.'),(5389,'Adelija','(1) germ., trump. Adelė, Ada, iš sulotyninto germ. Adelia, kuris yra vardo Ade/a variantas, žr. Adelė',' Adelija yra vokiečių kilmės vardas.'),(5390,'Henrieta','(2) pranc., trump. Henrė, iš sulotyninto Henrietta, kuris iš pranc. Henriette (tai mažybinė vardo Henrika forma) Henrika / (1) germ., trump. Henrė, baž. lot. Henrica iš germ. Henrika, kuris iš vyr. v. Henrik, žr. Henrikas',' Henrieta yra prancūzų kilmės vardas.'),(5391,'Genadas','(2) graik., trump. Genius, Nadas, iš sulotyninto graik. Gennadius: graik. gennadas „kilmingas, kilnus“ Genardas / (1) germ., trump. Genius, iš sulotyninto, germ. Genardus: germ. geno „giminė“ + sen. vok. aukšt. hard „stiprus, tvirtas“',' Genadas yra  kilmės vardas.'),(5392,'Simanas','Kiti šio vardo variantai: Simonas, Simeonas, Saimonas, Saimontas.',' Simanas yra  kilmės vardas.'),(5393,'Simeonas','Kiti šio vardo variantai: Simonas, Simanas, Saimonas, Saimontas.',' Simeonas yra  kilmės vardas.'),(5394,'Simona','Simona – moteriškas, mergaitiškas vardas kilęs nuo vardo Simonas.',' Simona yra  kilmės vardas.'),(5395,'Simonas','Ukrainiečių k.: Семен (Semen), Симон (Symon)',' Simonas yra hebrajų kilmės vardas.'),(5396,'Artūras','Graikų k.: Αρθούρος (Arthoúros)',' Artūras yra  kilmės vardas.'),(5397,'Karigaila',' (1) liet., trump. Karius, kari- (žr. Kargaudas) + gail- (: sen. liet. gail-as „stiprus“)',' Karigaila yra lietuvių kilmės vardas.'),(5398,'Kastantas',' (1) lot., trump. Kastas, tarm. Kastis, Kastantas šiaur. žem., — sulietuvintas vardo Konstantas variantas',' Kastantas yra lotynų kilmės vardas.'),(5399,'Konstantinas',' (2) lot., trump. Kostas, suliet. var. Kastantinas, Kastas, tarm. Kastantas, Kastis šiaur. žem., Kostas, Kostis piet. žem., Kasčius piet. aukšt. (dz.), iš lot. Constantinus, kuris yra priesagos -inus vedinys iš Constantius, žr. Konstantas',' Konstantinas yra lotynų kilmės vardas.'),(5400,'Kostas',' (2) liet. trumpinys iš Konstantas ir Konstantinas',' Kostas yra lotynų kilmės vardas.'),(5401,'Dargailas',' (1) liet. var. Dargaila, trump. Daras, Darys, Dargis, dar- (žr. Darbutas) + gail- (: sen. liet. gailas „stiprus“)',' Dargailas yra lietuvių kilmės vardas.'),(5402,'Dargaudas',' (1) suliet. prūs., trump. Daras, Darys, Dargis, dar- (žr. Darbutas) + gaud- (: liet. gaud-yti, gauti)',' Dargaudas yra lietuvių kilmės vardas.'),(5403,'Dargenis',' (2) liet. ir prūs., trump. Dargis, priesagos -enis vedinys iš sen. trump. Dargas, kuris iš avd. su Dar-g-(Dargaudas, Darginas) arba su Darg- (Dargvilas, Dargvainas)',' Dargenis yra  kilmės vardas.'),(5404,'Dargilas',' (1) liet. ir prūs., trump. Daras, Darys, Dargis, dar- (žr. Darbutas) + gil- (: liet. su-gi-lti, plg. gil-dyti)',' Dargilas yra  kilmės vardas.'),(5405,'Darginas',' (1) liet., trump. Daras, Darys, Dargis, dar- (žr. Dar-butas) + gin- (: liet. gin-ti „užstoti, saugoti“)',' Darginas yra lietuvių kilmės vardas.'),(5406,'Dargintas',' (1) liet., trump. Daras, Darys, Dargis, dar- (žr. Darbutas) + gint- (: liet. gint-as „užstotas, saugotas“) ',' Dargintas yra lietuvių kilmės vardas.'),(5407,'Dargvilas',' (1) liet., trump. Dargis, darg- (žr. Dargvainas) + vil- (: liet. vil-tis, vil-iasi, vil-tis)',' Dargvilas yra lietuvių kilmės vardas.'),(5408,'Saudargas',' (1) liet., trump. Saudys, Dargis, sau- (: liet. savas) + darg- (: latv. dargs „brangus“)',' Saudargas yra  kilmės vardas.'),(5409,'Daugailas','(1) liet., sen. var. Daugaila, trump. Daugas, Daugys, dau- (žr. Daubaras) + gail-(: sen. liet. gailas „stiprus“) Daugailė / (1) liet., trump. Dauga, Daugė iš vyr. avd. Daugaila, žr. Daugailas',' Daugailas yra lietuvių kilmės vardas.'),(5410,'Tolvinas',' (1) liet., trump. Tolys, tol- (žr. Tolbaudas) + vin- (žr. Tarvinas)',' Tolvinas yra lietuvių kilmės vardas.'),(5411,'Liucius',' (2) liet. trumpinys iš Liucijus, Lucijus',' Liucius, Lucius yra  kilmės vardas.'),(5412,'Vientautas',' (1) liet., trump. Vienys, Tautas, vien- (: liet. vienas, vien-yti) + taut- (žr. Vaištautas)',' Vientautas yra lietuvių kilmės vardas.'),(5413,'Vieštautas',' (1) liet., trump. Viešys, Tautas, vieš-(: liet. vieš-as, vieš-ė „kiemas, kaimas“, plg. dar sen. ind. vis- „namas“, got. weihs „kaimas“) + taut- (žr. Vaištautas)',' Vieštautas yra  kilmės vardas.'),(5414,'Viltautas',' (1) liet., trump. Viltys, Vilas, vil- (žr. Vilbutas) + taut- (žr. Vaištautas)',' Viltautas yra lietuvių kilmės vardas.'),(5415,'Vytautas',' (1) liet., trump. Vytas, Vytis, tarm. Vytė žem., vy- iš vyd- (žr. Vydgailas) + taut- (žr. Vaištautas)',' Vytautas yra lietuvių kilmės vardas.'),(5416,'Neimantas',' (1) liet., trump. Neimys, Mantas, nei- (žr. Neikantas) + mant- (žr. Naumantas)',' Neimantas yra lietuvių kilmės vardas.'),(5417,'Karijotas',' (1) liet., trump. Karius, kari- (žr. Kargaudas) + jot- (: liet. joti, jot-is „jojimas“)',' Karijotas, Kariotas yra  kilmės vardas.'),(5418,'Žvainys',' (4) liet., iš V. Mykolaičio-Putino poemos „Kunigaikštis Žvainys“ herojaus vardo Žvainys, kuris yra galūnės vedinys iš liet. žvain-us „akylas, guvus“, plg. pvd. Žvainys',' Žvainys yra lietuvių kilmės vardas.'),(5419,'Žvaigždikas','(1) suliet. prūs., trump. Žvaigždys, iš sen. prūsų šviesos dievo vardo Suaixtix [Zvaigstiks] (: prūs. swaigstan „šviesą“, poswaigstinai „tenušviečia“) sulietuvintas siejant su žvaigžde',' Žvaigždikas yra  kilmės vardas.'),(5420,'Nadas',' (2) liet. trumpinys iš Benadas, Bernadas ir Genadas',' Nadas yra  kilmės vardas.'),(5421,'Demetras',' (2) liet. trumpinys iš Demetrijus',' Demetras yra graikų kilmės vardas.'),(5422,'Dovainas',' (1) liet., trump. Dovas, do- (žr. Domantas) + vain- (žr. Darvainas)',' Dovainas yra lietuvių kilmės vardas.'),(5423,'Boleslovas','Boleslovų žmonų idealas – jų mylimoji turi savyje suderinti namų šeimininkę, virėją, kolegę ir draugę, sekretorę ir savų vaikų motiną. Išrinktosios rankos ir širdies paprašo po didžiausių svyravimų, kruopščios kandidačių atrankos ir pasitikrinimo.',' Boleslovas yra slavų kilmės vardas.'),(5424,'Adauktas',' (1) lot., trump, Adas, iš lot. Adauktus: lot. adauctus „padidintas, padaugintas',' Adauktas yra lotynų kilmės vardas.'),(5425,'Abdonas','Abdonas - hebr., trump. Abdas, iš sulotyninto hebr. Abdon: hebr. ‘abd „tarnas“.',' Abdonas yra hebrajų kilmės vardas.'),(5426,'Abraomas',' (2) hebr., sen. var. Abromas trump. Abrys, tarm. Obromas, Obras, Obrys vak. liet., iš sulotyninto hebr. Abraham, kuris iš hebr. ‘Abraham — „išaukštintas tėvas, žmonių tėvas',' Abraomas yra arabų kilmės vardas.'),(5427,'Žvainibudas','žvain- (žvainus „akylas, guvus“) + bud- (budėti, budinti) – „akylai budintis, stebintis“',' Žvainibudas yra lietuvių kilmės vardas.'),(5428,'Živilis','',' Živilis yra lietuvių kilmės vardas.'),(5429,'Laertas','Pirminė reikšmė nėra žinoma. Vardas pradėtas vartoti iš graikų mito apie Odisėją. Laertas buvo Odisėjo tėvas.',' Laertas yra graikų kilmės vardas.'),(5430,'Kainas','',' Kainas yra škotų kilmės vardas.'),(5431,'Domingas','Dominykas variantas lotynų: dominus „ponas, dievas“ – „gimęs, -usi viešpaties dieną, t.y., sekmadienį“',' Domingas yra ispanų kilmės vardas.'),(5432,'Ąžuolas',' (1) liet., iš pasakos „Eglė žalčių karalienė“ Eglės vyriausiojo sūnaus vardo Ąžuolas: liet. ąžuolas — tvirtumo simbolis',' Ąžuolas yra lietuvių kilmės vardas.'),(5433,'Ąžuolis',' (2) liet., metatoninis galūnės vedinys iš liet. ąžuolas',' Ąžuolis yra lietuvių kilmės vardas.'),(5434,'Visgailas',' (1) liet., sen. var. Visgaila, trump. Gailas, vis- (žr. Visalgas) + gail- (žr. Vaigailas)',' Visgailas yra lietuvių kilmės vardas.'),(5435,'Ūdrys',' (3) liet., galūnės vedinys iš liet. ūdra „vandeninis žvėrelis (Lutra lutra)“, plg. dar dab. pvd. Ūdra, Ūdras',' Ūdrys yra lietuvių kilmės vardas.'),(5436,'Ubaldas',' (1) germ., trump. Ubas, Aldas, baž. lot. Ubaldus iš italų Ubaldo, kuris iš germ. Hugibald: sen. vok. aukšt. hugu „dvasia“ + bald „drąsus, narsus“',' Ubaldas yra vokiečių kilmės vardas.'),(5437,'Ugnius',' (2) liet., galūnės vedinys iš liet. ugnis, plg. Ugnė',' Ugnius yra lietuvių kilmės vardas.'),(5438,'Švitrys',' (4) liet., trumpinys iš Švitrigaila',' Švitrys yra  kilmės vardas.'),(5439,'Švitrigaila',' (1) liet., trump. Švitrys, švitri- (: liet. švitr-ūs „greitas, vikrus, žvitrus, žvalus“) + gail- (: liet. gail-as „smarkus, stiprus“)',' Švitrigaila yra lietuvių kilmės vardas.'),(5440,'Gaudenta',' (2) liet. trumpinys iš Gaudencija',' Gaudenta yra lietuvių kilmės vardas.'),(5441,'Gaudencija',' (1) lot., trump. Gaudenta, Gauda, iš lot. Gaudentia, kuris iš vyr. v. Gaudentius, žr. Gaudentas',' Gaudencija yra lotynų kilmės vardas.'),(5442,'Florenta',' (2) lot., trump. Flora, iš lot. Florentia, kuris iš vyr. v. Florentius, žr. Florentas',' Florenta yra lotynų kilmės vardas.'),(5443,'Krescencija',' (1) lot., trump. Krescenta, iš lot. Crescentia, kuris iš vyr. v. Crescentius, žr. Krescentas',' Krescencija yra lotynų kilmės vardas.'),(5444,'Butvirda',' (3b), (1), (1) liet., trump. Butė, Būtė, iš vyr. v. Butvirdas',' Butvirda, Butvirda, Butvirdė yra  kilmės vardas.'),(5445,'Barvainė',' (1) liet., trump. Barė, Barvė, iš vyr. v. Barvainas',' Barvainė yra lietuvių kilmės vardas.'),(5446,'Dauganta',' (3b), (1), (1) liet., trump. Dauga, Daugė, iš vyr. v. Daugantas',' Dauganta, Dauganta, Daugantė yra  kilmės vardas.'),(5447,'Liucė',' (2) liet. trumpinys iš Liucija, Liucina ir Liucilė',' Liucė yra lotynų kilmės vardas.'),(5448,'Tarvina',' (3b), (1), (1) liet., trump. Tarė, iš vyr. v. Tarvinas',' Tarvina, Tarvina, Tarvinė yra  kilmės vardas.'),(5449,'Daugirda',' (3b), (1), (1) liet., trump. Dauga, Daugė, iš vyr. v. Daugirdas',' Daugirda, Daugirda, Daugirdė yra  kilmės vardas.'),(5450,'Milkinta',' (3a), (1), (1) liet., trump. Milė, iš vyr. v. Milkintas',' Milkinta, Milkinta, Milkintė yra  kilmės vardas.'),(5451,'Liucija',' (1) lot., trump. Liucė, Lucė, tarm. Lucia piet. aukšt. (dz.), ryt. aukšt. (Molėtai), iš lot. Lucia, kuris iš vyr. v. Lucius, žr. Liucijus',' Liucija, Lucija yra  kilmės vardas.'),(5452,'Emanuelė','Šio vardo savininkė labai tvarkinga moteris. Su ja nesutarsite jeigu atidėliosite problemų sprendimą, pastoviai vėluosite ar bandysite jai vadovauti. Šios moters nesutiksite grūstyje, bet ji visada žinos karščiausias naujienas. Emanuelės vertins ramybę, stabilumą ir sunkiai pakęs miesto triukšmą.',' Emanuelė yra hebrajų kilmės vardas.'),(5453,'Dorotėja','Dorotėjos turi ir neigiamų savybių kaip: nepunktualios, nekantrios, užsisklendusios savyje. Labai seksualios ir aistringos ir tuo puikiai naudojasi suvilioti kitiems, pasinaudoti kitų silpnybe seksualiomis moterimis. ',' Dorotėja yra graikų kilmės vardas.'),(5454,'Kargauda',' (3a), (1), (1) liet., trump. Karė, iš vyr. v. Kargaudas',' Kargauda, Kargauda, Kargaudė yra  kilmės vardas.'),(5455,'Demetra',' (2) liet. trumpinys iš Demetrija',' Demetra yra graikų kilmės vardas.'),(5456,'Daunota',' (3b), (1), (1) suliet. prūs., trump. Dauna, Daunė, iš vyr. v. Daunotas',' Daunota, Daunota, Daunotė yra  kilmės vardas.'),(5457,'Vaidutė','vaidytis, vaidentis – „tas kuris rodosi, vaidenasi“',' Vaidutė yra lietuvių kilmės vardas.'),(5458,'Laima','Vardas Laima yra kilęs iš Laimės, kuri lietuvių pagonių gyvenimo, gimimo ir likimo deivė.',' Laima yra lietuvių kilmės vardas.'),(5459,'Lada','slaviškas ir probaltiškas vardas, kuriuo buvo vadinama namų ir meilės deivė gimdytoja.',' Lada yra slavų kilmės vardas.'),(5460,'Simona','šimon „išklausymas“; dievas išklausė duodamas Lėjai sūnų',' Simona yra hebrajų kilmės vardas.'),(5461,'Ąžuolė',' (2) liet., metatoninis galūnės vedinys iš liet. ąžuolas',' Ąžuolė yra lietuvių kilmės vardas.'),(5462,'Elona',' (2) hebr., trump. Elė, iš sulotyninto hebr. Elona, kuris iš hebr. vyr. v. Elon — „ąžuolas“',' Elona yra hebrajų kilmės vardas.'),(5463,'Butvydė','',' Butvydė yra lietuvių kilmės vardas.'),(5464,'Ūla',' (4) liet., iš upėvardžio Ūla (Marcinkonys)',' Ūla yra lietuvių kilmės vardas.'),(5465,'Ugnė','Ugnė – lietuviškas vardas. Galūnės vedinys iš lietuviško žodžio ugnis (plg. liet. mitologijos įvaizdžius: amžinoji ugnis, šventoji ugnis)',' Ugnė yra lietuvių kilmės vardas.'),(5466,'Švitrė',' (2) liet., trumpinys iš Švitrigailė, taip pat galūnės vedinys iš vyr. v. Švitrys',' Švitrė yra  kilmės vardas.'),(5467,'Švitrigailė',' (1) liet., trump. Švitrė, iš vyr. v. Švitrigaila',' Švitrigailė yra lietuvių kilmės vardas.');
